ingredients_array.push( [ 'CostanzoRecipes_Sides_VeganStuffedMushrooms', '<ul><li onclick="handleItemClick()">5 portobello mushrooms (see notes)</li><li onclick="handleItemClick()">1 tbsp oil</li><li onclick="handleItemClick()">1 small/medium (110 g) onion diced</li><li onclick="handleItemClick()">1 medium (100 g) pepper</li><li onclick="handleItemClick()">1 tsp onion powder</li><li onclick="handleItemClick()">1 tsp garlic powder</li><li onclick="handleItemClick()">1/2 tsp ground cumin</li><li onclick="handleItemClick()">Salt, ground pepper, and chili powder to taste</li><li onclick="handleItemClick()">2 cloves of garlic</li><li onclick="handleItemClick()">1 cup canned (175 g) chickpeas drained and rinsed</li><li onclick="handleItemClick()">1/3 cup (40 g) walnuts finely chopped</li><li onclick="handleItemClick()">1 heaped tbsp (30 g) tomato paste</li><li onclick="handleItemClick()">1 tbsp tamari or soy sauce</li><li onclick="handleItemClick()">1/2 tbsp balsamic vinegar</li><li onclick="handleItemClick()">4 tbsp dairy-free milk</li><li onclick="handleItemClick()">vegan cheese to taste</li><li onclick="handleItemClick()">Fresh herbs to garnish</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_VeganStuffedMushrooms', '<ol><li onclick="handleItemClick()">Preheat the oven to 360 F (180 C) and line a baking sheet with parchment paper.</li><li onclick="handleItemClick()">Remove the stems of the mushrooms and chop them into pieces. Set aside.</li><li onclick="handleItemClick()">Add the chickpeas to a bowl and mash them with a fork.</li><li onclick="handleItemClick()">Heat oil in a large skillet, add onion, pepper, and all spices. Stir to combine and cook for 3-4 minutes.</li><li onclick="handleItemClick()">Also, stir in garlic, mashed chickpeas, and walnuts.</li><li onclick="handleItemClick()">Next add the tomato paste, tamari, balsamic vinegar, and dairy-free milk. Stir to combine.</li><li onclick="handleItemClick()">Finally, add the chopped mushroom stems and stir. Cook for a few more minutes, then set aside.</li><li onclick="handleItemClick()">Place the portobello mushrooms on the lined baking sheet and fill each mushroom with the filling until there is no filling left.</li><li onclick="handleItemClick()">Bake in the oven for about 10 minutes, then add vegan cheese of choice (I used my vegan cheese sauce) and bake for a further 10 minutes. Garnish with fresh herbs and enjoy!</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_VeganStuffedMushrooms', 'IsVegan<ul><li onclick="handleItemClick()">From <a href="https://elavegan.com/wprm_print/18133" target="_blank">https://elavegan.com/wprm_print/18133</a></li><li onclick="handleItemClick()">date created: [2022-07-04 Mon] </li><li onclick="handleItemClick()"><2022-06-28 Tue> J made these but mistakenly used cannellini beans. They were tasty.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_SweetPotatoAvocadoToasts', '<ul><li onclick="handleItemClick()">2 medium sweet potatoes</li><li onclick="handleItemClick()">1 ripe avocado, halved and seeded</li><li onclick="handleItemClick()">½ cup fresh or frozen corn kernels</li><li onclick="handleItemClick()">½ cup cooked black beans</li><li onclick="handleItemClick()">1 small tomato, finely chopped</li><li onclick="handleItemClick()">½ cup thinly sliced scallions</li><li onclick="handleItemClick()">2 tablespoons chopped fresh cilantro</li><li onclick="handleItemClick()">2 tablespoons lemon juice</li><li onclick="handleItemClick()">1 fresh jalapeño chile, seeded and finely chopped</li><li onclick="handleItemClick()">1 clove garlic, minced</li><li onclick="handleItemClick()">sea salt, to taste</li><li onclick="handleItemClick()">chipotle chile powder or smoked paprika</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_SweetPotatoAvocadoToasts', '<ol><li onclick="handleItemClick()">Preheat oven to 425°F.</li><li onclick="handleItemClick()">Prick the sweet potatoes in a few places with a fork.</li><li onclick="handleItemClick()">Bake 30 to 40 minutes, until a fork inserted in a sweet potatoes reaches the core with some resistance. (Do not cook until tender!) Remove sweet potatoes from oven and cool</li><li onclick="handleItemClick()">Scoop avocado flesh into a bowl and mash it.</li><li onclick="handleItemClick()">Stir in corn and black beans.</li><li onclick="handleItemClick()">Reserve about 1 tablespoon each of the tomato, scallions and cilantro; add the remaining tomato, scallions and cilantro to avocado mixture.</li><li onclick="handleItemClick()">Add lemon juice, jalapeño garlic and salt. Mix well. Taste and adjust seasonings if necessary. </li><li onclick="handleItemClick()">Cut the sweet potatoes into twelve ½-inch-thick rounds.</li><li onclick="handleItemClick()">Toast them in a toaster oven until the edges are brown. (Alternatively, arrange rounds on a parchment-lined baking sheet and bake in a 425°F oven for 10 to 15 minutes or until edges are brown, turning once, halfway through baking.)</li><li onclick="handleItemClick()">Arrange toasted rounds on a platter.</li><li onclick="handleItemClick()">Top each round with a scoop of avocado mixture.</li><li onclick="handleItemClick()">Top with reserved tomato, scallions and cilantro.</li><li onclick="handleItemClick()">If desired, sprinkle lightly with chipotle powder or smoked paprika.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_SweetPotatoAvocadoToasts', '<ul><li onclick="handleItemClick()">From Chuck Schwabe, who made these for Aron Cooke\'s 75<sup>th</sup>birthday party.</li><li onclick="handleItemClick()">date created: [2021-07-19 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_SummerFarroSalad', '<ul><li onclick="handleItemClick()">3/4  cup uncooked farro</li><li onclick="handleItemClick()">1 pint strawberries hulled and quartered</li><li onclick="handleItemClick()">2 medium avocados diced</li><li onclick="handleItemClick()">3 cups loosely packed baby spinach roughly chopped</li><li onclick="handleItemClick()">1/2 cup Vegan crumbled feta cheese</li><li onclick="handleItemClick()">1/2  small red onion finely chopped</li><li onclick="handleItemClick()">1/4 cup chopped toasted walnuts</li></ul><ul><li onclick="handleItemClick()">3 tablespoons extra virgin olive oil** or aquafaba</li><li onclick="handleItemClick()">2 tablespoons balsamic vinegar</li><li onclick="handleItemClick()">1 tablespoons honey</li><li onclick="handleItemClick()">1 teaspoon Dijon mustard</li><li onclick="handleItemClick()">2 teaspoons poppy seeds</li><li onclick="handleItemClick()">1/4 teaspoon kosher salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_SummerFarroSalad', '<ol><li onclick="handleItemClick()">Prepare farro according to package instructions. Place in a serving bowl and let cool while you prepare the other ingredients.</li><li onclick="handleItemClick()">In a small bowl, whisk together all of the ingredients until combined: olive oil or aquafaba, balsamic vinegar, honey, mustard, poppy seeds, and salt. Taste and adjust seasoning as desired.</li><li onclick="handleItemClick()">Pour over the farro, then toss to coat.</li><li onclick="handleItemClick()">Add the remaining ingredients to the bowl with the farro: strawberries, avocados, spinach, feta, red onion, and walnuts, then toss gently to combine. Serve chilled or at room temperature.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_SummerFarroSalad', '<ul><li onclick="handleItemClick()">From Patsy McCutcheon</li><li onclick="handleItemClick()">date created: [2023-06-24 Sat] </li><li onclick="handleItemClick()">[2023-06-29 Thu] Made for Greg and Mary Ann. Left out the avocados but it was still tasty.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_StracciatellaItalianEggDropSoup', '<ul><li onclick="handleItemClick()">4 Eggs</li><li onclick="handleItemClick()">6 cups <s class="conditional-space-after">chicken</s>vegetable broth</li><li onclick="handleItemClick()">⅓ cup fresh grated pecorino Romano</li><li onclick="handleItemClick()">½ cup thinly sliced baby spinach</li><li onclick="handleItemClick()">2 tablespoon Pork King Good Crumbs</li><li onclick="handleItemClick()">2 tablespoon sliced scallions</li><li onclick="handleItemClick()">2 tablespoon olive oil</li><li onclick="handleItemClick()">2 tablespoon diced shallot</li><li onclick="handleItemClick()">1 tablespoon minced garlic</li><li onclick="handleItemClick()">2 tsp Italian seasoning (spiceology)</li><li onclick="handleItemClick()">½ tsp turmeric</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_StracciatellaItalianEggDropSoup', '<ol><li onclick="handleItemClick()">Crack eggs and then add Italian seasoning, Pork King Good Crumbs and Pecorino Romano in a mixing bowl. Whisk ingredients thoroughly and set to the side.</li><li onclick="handleItemClick()">Add olive oil, diced shallots, and minced garlic to a saucepan over medium heat until they have softened.</li><li onclick="handleItemClick()">Add broth to the pan and bring to a simmer just below a boil. Add scallions and thinly sliced spinach and stir for about 20 seconds.</li><li onclick="handleItemClick()">Carefully pour in the egg mixture while whisking. Enjoy.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_StracciatellaItalianEggDropSoup', '<ul><li onclick="handleItemClick()"><a href="https://hardcoreitalians.blog/2019/09/13/straciatella-italian-egg-drop-soup-recipe/" target="_blank">https://hardcoreitalians.blog/2019/09/13/straciatella-italian-egg-drop-soup-recipe/</a></li><li onclick="handleItemClick()">date created: [2020-01-18 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_SpicyVegetableSoup', '<ul><li onclick="handleItemClick()">24 ounces of frozen mixed vegetables</li></ul>3 yellow potatoes, cubed<ul><li onclick="handleItemClick()">8-ounce can of tomato sauce</li><li onclick="handleItemClick()">15-ounce can of fire roasted tomatoes</li><li onclick="handleItemClick()">6 cups vegetable broth</li><li onclick="handleItemClick()">1 tablespoon olive oil</li><li onclick="handleItemClick()">1 yellow onion, diced</li><li onclick="handleItemClick()">1 teaspoon minced garlic</li><li onclick="handleItemClick()">½ teaspoon red chili flakes</li><li onclick="handleItemClick()">1 teaspoon chili powder</li><li onclick="handleItemClick()">2 bay leaves</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">½ teaspoon pepper</li><li onclick="handleItemClick()">grated Parmesan cheese for topping</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_SpicyVegetableSoup', '<ol><li onclick="handleItemClick()">In a large stock pot, heat olive oil over medium heat and add 1 diced yellow onion, cooking until fragrant.</li><li onclick="handleItemClick()">Then, add 1 teaspoon of minced garlic and keep sautéing for about eight minutes total, or until onions grow translucent.</li><li onclick="handleItemClick()">Add 3 cubed potatoes, an 8-ounce can of tomato sauce, a 15-ounce can of fire roasted tomatoes, 6 cups of vegetable broth, ½ teaspoon of red chili flakes, 1 teaspoon of chili powder, 2 bay leaves, 1 teaspoon of salt, and ½ teaspoon of pepper.</li><li onclick="handleItemClick()">Bring to a boil and then lower soup to a simmer.</li><li onclick="handleItemClick()">Let simmer for 15 minutes, stirring occasionally.</li><li onclick="handleItemClick()">Add the frozen mixed vegetables and stir, then simmer for five more minutes.</li><li onclick="handleItemClick()">Remove bay leaves and serve.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_SpicyVegetableSoup', '<ul><li onclick="handleItemClick()">From <a href="https://www.mashed.com/368806/spicy-vegetable-soup-recipe/" target="_blank">https://www.mashed.com/368806/spicy-vegetable-soup-recipe/</a></li><li onclick="handleItemClick()">date created: [2023-03-27 Mon] </li><li onclick="handleItemClick()">[2023-03-27 Mon] Made for us and Chuck. I swapped out the frozen veggies for a pound of peas and a can of cannellini beans. It was nice and spicy.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_RomescoSauce', '<ul><li onclick="handleItemClick()">one 16-ounce jar of roasted red peppers, drained</li><li onclick="handleItemClick()">½ cup raw or roasted almonds (unsalted)</li><li onclick="handleItemClick()">¼ cup oil-packed sun-dried tomatoes, rinsed and drained</li><li onclick="handleItemClick()">2 medium-to-large cloves garlic, peeled and quartered</li><li onclick="handleItemClick()">1 tablespoon sherry vinegar or red wine vinegar</li><li onclick="handleItemClick()">1 teaspoon smoked paprika</li><li onclick="handleItemClick()">½ teaspoon fine sea salt, to taste</li><li onclick="handleItemClick()">¼ teaspoon cayenne pepper</li><li onclick="handleItemClick()">½ cup extra-virgin olive oil</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_RomescoSauce', '<ol><li onclick="handleItemClick()">In a blender (preferably) or food processor, combine everything but the olive oil. Securely fasten the lid and blend, starting on low and increasing the speed as you are able to gain traction.</li><li onclick="handleItemClick()">Once the ingredients are mostly blended, start drizzling in the olive oil while running the blender. Blend until you reach your desired consistency (I like my Romesco sauce pretty creamy, but you might prefer it with a more chunky texture).</li><li onclick="handleItemClick()">Taste, and add additional salt (up to ¼ teaspoon) if it doesn’t quite knock your socks off yet.</li><li onclick="handleItemClick()">Serve immediately, or store in a jar in the refrigerator for 7 to 10 days.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_RomescoSauce', '<ul><li onclick="handleItemClick()">From <a href="https://cookieandkate.com/easy-romesco-sauce-recipe/" target="_blank">https://cookieandkate.com/easy-romesco-sauce-recipe/</a></li><li onclick="handleItemClick()">date created: [2020-10-10 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_RoastedCabbagewithWalnutsandParmesan', '<ul><li onclick="handleItemClick()">1 medium-large (1¾  pounds) or two small heads savoy cabbage</li><li onclick="handleItemClick()">7 tablespoons extra-virgin olive oil, divided</li><li onclick="handleItemClick()">1 teaspoon kosher salt, plus more to taste</li><li onclick="handleItemClick()">Freshly ground black pepper</li><li onclick="handleItemClick()">Scant ½ cup (1.75 ounces) walnut halves and pieces</li><li onclick="handleItemClick()">1 large or 2 smaller garlic cloves</li><li onclick="handleItemClick()">1 large lemon</li><li onclick="handleItemClick()">Red pepper flakes, such as Aleppo (optional)</li><li onclick="handleItemClick()">Grated parmesan, to taste</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_RoastedCabbagewithWalnutsandParmesan', '<ol><li onclick="handleItemClick()">Heat oven to 475ºF.</li><li onclick="handleItemClick()">Remove any damaged outer leaves of cabbage and cut it 8 (for small ones) to 12 (for a large one) wedges.</li><li onclick="handleItemClick()">Coat a large baking sheet with 2 tablespoons olive oil.</li><li onclick="handleItemClick()">Arrange cabbage wedges in one layer, drizzling or brushing them with 2 more tablespoons olive oil and sprinkle with 1 teaspoon kosher salt and freshly ground black pepper to taste.</li><li onclick="handleItemClick()">Roast for 8 to 10 minutes, until charred underneath (don’t panic if you see a few thin black edges; they’re going to taste amazing).</li><li onclick="handleItemClick()">Use a spatula to flip each piece over and roast for 5 more minutes, until the edges of the cabbage are dark brown.</li><li onclick="handleItemClick()">Meanwhile, while cabbage roasts, place nuts on a smaller tray or baking dish and roast them next to the cabbage for 4 to 5 minutes.</li><li onclick="handleItemClick()">Remove and scatter them, still hot, onto a cutting board and coarsely chop them.</li><li onclick="handleItemClick()">Scoop into a bowl and finely grate the zest of half a lemon and all of the garlic over it.</li><li onclick="handleItemClick()">Add remaning 3 tablespoons olive oil to walnuts, a few pinches of salt and red pepper flakes and stir to combine.<span class="tip">    If you’ve got a couple minutes to let it all infuse as it cools, let it rest.</span></li><li onclick="handleItemClick()">When ready, squeeze the juice of half your lemon in and stir to combine. Adjust flavors to taste, adding more lemon if needed; you want this dressing to be robust.</li><li onclick="handleItemClick()">The moment the cabbage comes out of the oven, spoon the walnut dressing over the wedges.</li><li onclick="handleItemClick()">Grate parmesan all over, to taste.</li><li onclick="handleItemClick()">Serve immediately, while piping hot. There will be no leftovers.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_RoastedCabbagewithWalnutsandParmesan', '<ul><li onclick="handleItemClick()">From <a href="https://smittenkitchen.com/2019/11/roasted-cabbage-with-walnuts-and-parmesan/" target="_blank">https://smittenkitchen.com/2019/11/roasted-cabbage-with-walnuts-and-parmesan/</a>by way of Nancy Burnett</li><li onclick="handleItemClick()">date created: [2021-03-13 Sat] </li><li onclick="handleItemClick()">[2021-02-16 Tue] T made it. Yummy!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_RoastedBrusselsSprouts', '<ul><li onclick="handleItemClick()">1½ pounds Brussels sprouts trimmed and halved</li><li onclick="handleItemClick()">4 cloves garlic very roughly chopped (leave the pieces a bit chunky; add more if you live in a house of garlic lovers)</li><li onclick="handleItemClick()">1 ½ tablespoons extra-virgin olive oil</li><li onclick="handleItemClick()">½ teaspoon kosher salt</li><li onclick="handleItemClick()">¼ teaspoon black pepper</li><li onclick="handleItemClick()">2 tablespoons freshly ground or grated Parmesan</li><li onclick="handleItemClick()">Any optional additions: lemon, balsamic vinegar, herbs, red pepper flakes, etc.</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_RoastedBrusselsSprouts', '<ol><li onclick="handleItemClick()">Place a rack in the upper third of your oven and preheat the oven to 400 degrees Place the Brussels sprouts and garlic in the center of a large rimmed baking sheet.</li><li onclick="handleItemClick()">Drizzle with the olive oil and sprinkle with salt, pepper, and any other desired spice additions.</li><li onclick="handleItemClick()">Gently mix until the Brussels sprouts are evenly coated, then spread them into a single layer on the baking sheet.</li><li onclick="handleItemClick()">For even better crisping, flip the Brussels sprouts so that they are all cut sides down.</li><li onclick="handleItemClick()">Bake for 10 minutes, then remove from the oven and stir in the Parmesan cheese.</li><li onclick="handleItemClick()">Continue baking 10 to 20 additional minutes, until the Brussels sprouts are lightly charred and crisp on the outside and tender in the center.<ul><li onclick="handleItemClick()">The outer leaves will very dark too.</li><li onclick="handleItemClick()">Watch carefully towards the end of the baking time, as the cooking time will vary based on the size of your sprouts.</li><li onclick="handleItemClick()">Season with additional salt and/or pepper to taste.</li><li onclick="handleItemClick()">Enjoy immediately.</li></ul></li></ol><span class="tip"><i class="conditional-space-after"></i>: Drizzle the vinegar or lemon juice over the sprouts after removing them from the oven. Return the pan to the oven for 1 to 2 minutes, then serve.</span><span class="tip"><i class="conditional-space-after"></i>: Omit the Parmesan or swap it for nutritional yeast. Sprinkle on the nutritional yeast just before serving.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_RoastedBrusselsSprouts', '<ul><li onclick="handleItemClick()">From <a href="https://www.wellplated.com/roasted-brussels-sprouts-with-garlic/" target="_blank">https://www.wellplated.com/roasted-brussels-sprouts-with-garlic/</a></li><li onclick="handleItemClick()">date created: [2022-02-20 Sun] </li><li onclick="handleItemClick()">[2022-02-20 Sun] Made for Pat, Sharon, Lynn and TC: yum!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_RefriedBeans', '<ul><li onclick="handleItemClick()">3 cups simmered black beans or pinto beans, with liquid (see recipe)</li><li onclick="handleItemClick()">2 tablespoons grapeseed or sunflower oil</li><li onclick="handleItemClick()">2 teaspoons cumin seeds, ground</li><li onclick="handleItemClick()">1 chipotle in adobo, seeded and minced (optional)</li><li onclick="handleItemClick()">Salt to taste</li><li onclick="handleItemClick()">1 teaspoon mild or hot chili powder (more to taste)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_RefriedBeans', '<ol><li onclick="handleItemClick()">Drain off about ½ cup of liquid from beans, retaining it in a separate bowl to use later for moistening beans, should they dry out.</li><li onclick="handleItemClick()">Heat oil over medium-high heat in a large, heavy nonstick frying pan and add ground cumin and chili.</li><li onclick="handleItemClick()">Cook, stirring over medium heat, for about a minute, until the spices begin to sizzle and cook.</li><li onclick="handleItemClick()">Add beans and optional chipotle.</li><li onclick="handleItemClick()">Fry beans, stirring and mashing with the back of a spoon, until they thicken and form a thin crust on the bottom of the pan.</li><li onclick="handleItemClick()">Stir up crust and mix into the beans.</li><li onclick="handleItemClick()">Cook until beans are thick but not dry, about 10 minutes.</li><li onclick="handleItemClick()">Add liquid you saved from the beans if they seem too dry.</li><li onclick="handleItemClick()">Taste refried beans and adjust salt (they probably won’t need any as the broth reduces when you refry them).</li></ol><span class="note">If you use canned beans, do not drain. The frying process will go more quickly.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_RefriedBeans', '<ul><li onclick="handleItemClick()">From <a href="https://cooking.nytimes.com/recipes/1016969-refried-bean-zucchini-and-corn-gratin" target="_blank">https://cooking.nytimes.com/recipes/1016969-refried-bean-zucchini-and-corn-gratin</a></li><li onclick="handleItemClick()">date created: [2022-03-26 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_QuickRefrigeratorPickledCucumbers', '<ul><li onclick="handleItemClick()">5 small cucumbers</li><li onclick="handleItemClick()">1/4 tsp mustard seed, whole</li><li onclick="handleItemClick()">1/4 teaspoon dill, dried</li><li onclick="handleItemClick()">1/2 tsp black peppercorn</li><li onclick="handleItemClick()">2 garlic cloves, whole</li><li onclick="handleItemClick()">1 cup water</li><li onclick="handleItemClick()">1 cup white vinegar (can sub with apple cider vinegar)</li><li onclick="handleItemClick()">2 tbsp sugar</li><li onclick="handleItemClick()">1 tbsp salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_QuickRefrigeratorPickledCucumbers', '<ol><li onclick="handleItemClick()">Slice the cucumbers into uniform coins or spears (your choice!). You’re going to use around 3 to 5 (depending on the specific size) cucumbers in this recipe per 16 oz. jar.</li><li onclick="handleItemClick()">Add the cucumber slices, mustard seed, dill, peppercorn, and garlic into your jar. Don’t worry that the spices settle at the bottom, they will rise up again evenly distribute their flavor when you add the vinegar brine.</li><li onclick="handleItemClick()">Mix the vinegar, water, salt, and sugar in a stainless steel pan and bring to a boil. You’ll need to babysit this.</li><li onclick="handleItemClick()">As soon as it reaches a good boil, pour it over the cucumber mixture in the jar until they are just covered. Don’t let it over boil or some of the vinegar needed for the pickling process will boil out.</li><li onclick="handleItemClick()">Put the top on immediately and put into the refrigerator. Let flavors blend overnight for best results.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_QuickRefrigeratorPickledCucumbers', '<ul><li onclick="handleItemClick()">From <a href="https://southerneatsandgoodies.com/pickled-cucumbers/" target="_blank">https://southerneatsandgoodies.com/pickled-cucumbers/</a></li><li onclick="handleItemClick()">date created: [2023-02-20 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_PotatoCheddarSoupWithQuickPickledJalapenos', '<ul><li onclick="handleItemClick()">2 jalapeños</li><li onclick="handleItemClick()">2 limes, halved</li><li onclick="handleItemClick()">Kosher salt and black pepper</li><li onclick="handleItemClick()">Large pinch of granulated sugar or a drop of honey</li><li onclick="handleItemClick()">3 tablespoons unsalted butter</li><li onclick="handleItemClick()">1 large Spanish or white onion, diced</li><li onclick="handleItemClick()">2 celery stalks, diced</li><li onclick="handleItemClick()">4 garlic cloves, minced</li><li onclick="handleItemClick()">½ teaspoon chili powder, plus more for garnish</li><li onclick="handleItemClick()">2½ pounds Yukon Gold potatoes, peeled and cut into 1-inch cubes</li><li onclick="handleItemClick()">1 quart vegetable broth</li><li onclick="handleItemClick()">2 cups grated Cheddar (8 ounces), plus more for garnish</li><li onclick="handleItemClick()">1 cup half-and-half, or use ½ cup whole milk and ½ cup heavy cream</li><li onclick="handleItemClick()">3 scallions, white and light green parts, thinly sliced</li><li onclick="handleItemClick()">Chopped cilantro, for serving</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_PotatoCheddarSoupWithQuickPickledJalapenos', '<ol><li onclick="handleItemClick()">Thinly slice the jalapeños, discarding the seeds if you like. Put slices in a bowl and squeeze in enough lime juice to cover them. Add a pinch each of salt and sugar. Let sit at room temperature while you make the soup. (The jalapeños can be prepared up to 5 days ahead of time and stored in the refrigerator; they get softer and more pickle-y as they sit.)</li><li onclick="handleItemClick()">In a large pot, melt the butter over medium heat.</li><li onclick="handleItemClick()">Add onion, celery and a large pinch of salt, and sauté until lightly golden and soft, about 10 minutes.</li><li onclick="handleItemClick()">Add garlic and chili powder and sauté until fragrant, 1 minute.</li><li onclick="handleItemClick()">Add potatoes, broth and 2 teaspoons salt, and bring to a simmer. Cook until potatoes are very tender, 30 to 40 minutes.</li><li onclick="handleItemClick()">Using an immersion blender or transferring the soup to a regular blender in batches, purée the soup, adding some water as needed to thin it out. (The soup can be as thick or brothy as you like.)</li><li onclick="handleItemClick()">Return the soup to the pot if you removed it and reduce heat to medium-low.</li><li onclick="handleItemClick()">Add cheese and half-and-half, and cook at a very gentle simmer, stirring, until the cheese melts, 1 to 2 minutes. Taste and season with salt and pepper as needed.</li><li onclick="handleItemClick()">Top each bowl with pickled jalapeños, plus a drizzle of their pickling liquid and a pinch of chili powder, along with scallions, cilantro and more Cheddar.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_PotatoCheddarSoupWithQuickPickledJalapenos', '<ul><li onclick="handleItemClick()">From <a href="https://cooking.nytimes.com/recipes/1021839-potato-cheddar-soup-with-quick-pickled-jalapenos" target="_blank">https://cooking.nytimes.com/recipes/1021839-potato-cheddar-soup-with-quick-pickled-jalapenos</a></li><li onclick="handleItemClick()">date created: [2022-02-01 Tue] </li><li onclick="handleItemClick()">[2022-02-01 Tue] Hearty, flavorful soup.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_PickledOnions', '<ul><li onclick="handleItemClick()">½ cups apple cider vinegar</li><li onclick="handleItemClick()">1 tablespoon sugar</li><li onclick="handleItemClick()">1 ½ teaspoons kosher salt</li><li onclick="handleItemClick()">1 red onion, thinly sliced</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_PickledOnions', '<ol><li onclick="handleItemClick()">Whisk first 3 ingredients and 1 cup water in a small bowl until sugar and salt dissolve.</li><li onclick="handleItemClick()">Place onion in a jar; pour vinegar mixture over. Let sit at room temperature for 1 hour.</li><li onclick="handleItemClick()">Cover and chill.</li><li onclick="handleItemClick()">Drain onions before using.</li></ol>' ] );
