ingredients_array.push( [ 'CostanzoRecipes_Sides_PersianCarrots', '<ul><li onclick="handleItemClick()">5 medium carrots, sliced diagonally into ¼ inch thick ovals</li><li onclick="handleItemClick()">1 medium onion, cut into ¼ inch thick half rings</li><li onclick="handleItemClick()">4 Tbsp. unsalted butter</li><li onclick="handleItemClick()">¼ cup raisins</li><li onclick="handleItemClick()">¼ cup pitted dates, cut into ¼ inch thick slivers</li><li onclick="handleItemClick()">½ tsp. salt</li><li onclick="handleItemClick()">¼ tsp. sugar</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_PersianCarrots', '<ol><li onclick="handleItemClick()">Melt butter in a medium skillet over medium heat.</li><li onclick="handleItemClick()">Add carrots, onion, raisins, & dates.</li><li onclick="handleItemClick()">Stir & fry gently for 5 minutes.</li><li onclick="handleItemClick()">Add the salt & sugar. Stir & fry for another 4 to 5 minutes, until carrots are just tender & onion is soft.</li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_PersianCarrots', '<ul><li onclick="handleItemClick()">salt and pepper; to taste</li><li onclick="handleItemClick()">1 Onion, sliced</li><li onclick="handleItemClick()">4 tb Sultanas or currants</li><li onclick="handleItemClick()">3 large or 4 medium carrots</li><li onclick="handleItemClick()">100 ml Water</li><li onclick="handleItemClick()">8 fresh dates</li><li onclick="handleItemClick()">2 tbs olive oil</li></ul>Original recipe makes 4 Servings' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_PersianCarrots', '<ol><li onclick="handleItemClick()">This side dish with a difference goes very well with plainly grilled or roasted chicken or braised lamb.</li><li onclick="handleItemClick()">Wash 3 large or 4 medium carrots and slice into rounds.</li><li onclick="handleItemClick()">Peel one onion and slice. </li><li onclick="handleItemClick()">Stone 8 fresh dates (or substitute dried) and cut into slices lengthwise.</li><li onclick="handleItemClick()">Have ready 4 tablespoons of currants or sultanas.</li><li onclick="handleItemClick()">Heat 2 tablespoons olive oil in a wide saucepan. Add all the prepared ingredients and stir-fry for a minute or two, then add 100 mL water, cover and bring to a fast boil. Add salt to taste and put back the lid at an angle so that steam can escape. Cook for about 10 minutes, stirring occasionally, until the carrots are tender and the water has evaporated. If water remains, remove the lid and raise the heat to dry it off.</li><li onclick="handleItemClick()">Serve.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_PersianCarrots', '<ul><li onclick="handleItemClick()">Posted by Stephen Ceideburg From an article by Meryl Constance in The</li><li onclick="handleItemClick()">Sydney Morning Herald, 6/8/93.</li><li onclick="handleItemClick()">Courtesy Mark Herron.</li><li onclick="handleItemClick()">first recipe <a href="https://www.driftlessorganics.com/carrots-with-raisins-dates/" target="_blank">https://www.driftlessorganics.com/carrots-with-raisins-dates/</a></li><li onclick="handleItemClick()">second <a href="http://www.bigoven.com/recipe/persian-carrots/4291" target="_blank">http://www.bigoven.com/recipe/persian-carrots/4291</a></li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_PeanutDippingSauce', '<ul><li onclick="handleItemClick()">¾ cup creamy peanut butter</li><li onclick="handleItemClick()">¼ cup rice vinegar</li><li onclick="handleItemClick()">⅓ cup reduced sodium tamari or reduced-sodium soy sauce</li><li onclick="handleItemClick()">3 tablespoons honey</li><li onclick="handleItemClick()">1 ½ teaspoons grated fresh ginger or ½ teaspoon ground ginger</li><li onclick="handleItemClick()">1 to 2 medium cloves garlic, pressed or minced, to taste</li><li onclick="handleItemClick()">¼ teaspoon red pepper flakes, plus more for sprinkling</li><li onclick="handleItemClick()">2 to 4 tablespoons water or coconut milk, or as necessary to reach your desired consistency</li><li onclick="handleItemClick()">Optional garnishes: sprinkling of chopped roasted peanuts and additional red pepper flakes</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_PeanutDippingSauce', '<ol><li onclick="handleItemClick()">In a 2-cup liquid measuring cup or medium-sized mixing bowl, whisk together the ingredients until well blended. If your peanut butter is particularly thick, you may need to use the full 4 tablespoons of water to thin out the mixture (or more, if necessary).</li><li onclick="handleItemClick()">Feel free to adjust to taste here—for example, sometimes I want my sauce more savory and add another clove of garlic, or a little sweeter, so I add extra honey.</li><li onclick="handleItemClick()">If you’re serving the sauce as a party dip, transfer it to a serving bowl and sprinkle with chopped peanuts and red pepper flakes for some visual interest!</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_PeanutDippingSauce', '<ul><li onclick="handleItemClick()">From <a href="https://cookieandkate.com/peanut-dipping-sauce/#tasty-recipes-23875-jump-target" target="_blank">https://cookieandkate.com/peanut-dipping-sauce/#tasty-recipes-23875-jump-target</a></li><li onclick="handleItemClick()">date created: [2023-02-20 Mon] </li><li onclick="handleItemClick()">[2023-02-18 Sat] Made for T, Greg and MaryAnn as a dipping sauce for baked tofu. Yum!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_PatatasBravas', '<ul><li onclick="handleItemClick()">1 clove garlic, minced, or more to taste</li><li onclick="handleItemClick()">½ teaspoon smoked paprika</li><li onclick="handleItemClick()">1 pinch salt</li><li onclick="handleItemClick()">1 cup mayonnaise</li><li onclick="handleItemClick()">1 tablespoon sherry vinegar, or more to taste</li><li onclick="handleItemClick()">1 teaspoon tomato paste</li><li onclick="handleItemClick()">¼ teaspoon ground chipotle peppers</li><li onclick="handleItemClick()">1 pinch cayenne pepper, or more to taste</li></ul><ul><li onclick="handleItemClick()">½ tablespoon salt (was 1T)</li><li onclick="handleItemClick()">½ teaspoon ground black pepper</li><li onclick="handleItemClick()">½ teaspoon paprika</li><li onclick="handleItemClick()">½ teaspoon ground chipotle peppers</li></ul><ul><li onclick="handleItemClick()">2 quarts cold water</li><li onclick="handleItemClick()">1 tablespoon salt</li><li onclick="handleItemClick()">1 teaspoon smoked paprika</li><li onclick="handleItemClick()">1 teaspoon ground cumin</li><li onclick="handleItemClick()">2 bay leaves</li><li onclick="handleItemClick()">2 pounds russet potatoes, peeled and cut into 1-inch cubes</li><li onclick="handleItemClick()">2 cups vegetable oil for frying</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_PatatasBravas', '<ol><li onclick="handleItemClick()">Combine garlic, ½ teaspoon smoked paprika, and a pinch of salt in a mortar and pestle or food processor; process until smooth. Mix in mayonnaise, sherry vinegar, tomato paste, ¼ teaspoon chipotle chile powder, and cayenne pepper until combined. Cover and refrigerate dipping sauce.</li><li onclick="handleItemClick()">Mix 1 tablespoon salt, black pepper, ½ teaspoon smoked paprika, and ½ teaspoon chipotle chile powder together in a small bowl. Set spice blend aside.</li><li onclick="handleItemClick()">Pour water into a large saucepan and stir 1 tablespoon salt, 1 teaspoon smoked paprika, cumin, and bay leaves into water. Bring to a boil, reduce heat to low, and cover; simmer for 10 minutes.</li><li onclick="handleItemClick()">Stir potatoes into water-paprika mixture, bring to a boil, and simmer until potatoes are tender but not fully cooked, 4 to 5 minutes. The tip of a paring knife should easily insert into the center of a potato cube. Drain potatoes and transfer to a wire rack to cool completely, about 45 minutes.</li><li onclick="handleItemClick()">Heat vegetable oil in a large cast iron skillet or Dutch oven to 350 degrees F (175 degrees C). Add cooled potato cubes and cook, stirring frequently, until golden brown, 5 to 6 minutes. Transfer potatoes to a baking sheet lined with paper towels to cool slightly. Toss in a bowl with spice blend and serve with dipping sauce.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_PatatasBravas', '<a href="https://www.allrecipes.com/recipe/230569/chef-johns-patatas-bravas/print/?recipeType=Recipe&servings=4&isMetric=false" target="_blank">https://www.allrecipes.com/recipe/230569/chef-johns-patatas-bravas/print/?recipeType=Recipe&servings=4&isMetric=false</a>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_OvenRoastedBrusselsSproutsWithBalsamicVinegar', '<ul><li onclick="handleItemClick()">2 to 3 cups Brussels sprouts</li><li onclick="handleItemClick()">3 tablespoons balsamic vinegar</li><li onclick="handleItemClick()">Dash of coarse salt (sea salt or kosher salt)</li><li onclick="handleItemClick()">Freshly ground black pepper, to taste</li><li onclick="handleItemClick()">3 tablespoons olive oil</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_OvenRoastedBrusselsSproutsWithBalsamicVinegar', '<ol><li onclick="handleItemClick()">Gather the ingredients.</li><li onclick="handleItemClick()">Heat the oven to 375 F.</li><li onclick="handleItemClick()">Give the Brussels sprouts a rinse in cold water and dry on a paper towel.</li><li onclick="handleItemClick()">Trim off the ends of the sprouts if they are large and firm. If they are smaller and more tender, just cut off the brown end. Pull off any loose outer leaves. Slice the sprouts in half lengthwise.</li><li onclick="handleItemClick()">Place the Brussels sprouts in a single layer on a foil-lined baking sheet.</li><li onclick="handleItemClick()">In a small bowl, whisk together the vinegar, salt, and pepper.</li><li onclick="handleItemClick()">While whisking, slowly drizzle in the olive oil. Whisk until combined.</li><li onclick="handleItemClick()">Drizzle the oil-and-vinegar dressing over the sprouts, reserving a little for serving, and gently toss to coat.</li><li onclick="handleItemClick()">Roast in the oven for 25 minutes, turning once. The sprouts are done when they are browned and caramelized.</li><li onclick="handleItemClick()">Serve the Brussels sprouts with an extra drizzle of the dressing if you wish, but they are also delicious just as they are from the oven.</li><li onclick="handleItemClick()">Enjoy.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_OvenRoastedBrusselsSproutsWithBalsamicVinegar', '<ul><li onclick="handleItemClick()"><a href="https://www.thespruceeats.com/brussels-sprouts-with-balsamic-vinegar-3377791" target="_blank">https://www.thespruceeats.com/brussels-sprouts-with-balsamic-vinegar-3377791</a></li><li onclick="handleItemClick()">date created: [2020-01-18 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_OvenFriedPatatasBravas', 'YIELD: 4 appetizer servingsTIME: 30 minutes<ul><li onclick="handleItemClick()">2 pounds yellow-fleshed or russet potatoes, peeled and cut in 1 1/2-inch chunks</li><li onclick="handleItemClick()">Kosher salt</li><li onclick="handleItemClick()">½ cup extra-virgin olive oil</li><li onclick="handleItemClick()">1 head garlic, separated into cloves but not peeled</li></ul><ul><li onclick="handleItemClick()">2 tablespoons extra-virgin olive oil</li><li onclick="handleItemClick()">2 garlic cloves, minced</li><li onclick="handleItemClick()">2 tablespoons all-purpose flour</li><li onclick="handleItemClick()">1 tablespoon tomato paste</li><li onclick="handleItemClick()">1 tablespoon pimentón dulce, or use sweet paprika</li><li onclick="handleItemClick()">1 teaspoon pimentón picante, 1/2 teaspoon chipotle chile powder or 1/4 teaspoon cayenne</li><li onclick="handleItemClick()">1 cup chicken broth or water</li><li onclick="handleItemClick()">1 tablespoon sherry vinegar Kosher salt</li></ul><ul><li onclick="handleItemClick()">2 egg yolks</li><li onclick="handleItemClick()">4 garlic cloves, pounded, finely minced or grated</li><li onclick="handleItemClick()">1½ cups extra-virgin olive oil</li><li onclick="handleItemClick()">Kosher salt and black pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_OvenFriedPatatasBravas', '<ol><li onclick="handleItemClick()">Heat oven to 450 degrees. Put potato chunks in a large bowl, season generously with salt and toss to coat. Leave for a few minutes to let potatoes absorb salt. Add olive oil and unpeeled garlic cloves and toss to coat well. (Don’t skimp on the oil; it can be strained and saved after cooking for future use.)</li><li onclick="handleItemClick()">Transfer potatoes (and garlic cloves) and oil to a large cast-iron skillet or heavy roasting pan. Make sure to have potatoes in a single layer without crowding. (If necessary, use two pans.) There should be a good ½-inch oil in the bottom of the pan. Add more if required.</li><li onclick="handleItemClick()">Place pan in oven and roast for 15 to 20 minutes, until potato chunks are well browned on the bottom. With a metal spatula, carefully turn chunks over. Reduce heat to 400 degrees, and continue roasting until potatoes are well browned and crisp, about another 15 to 20 minutes.</li><li onclick="handleItemClick()">While potatoes are roasting, make the two sauces:<ol><li onclick="handleItemClick()">For the <b class="conditional-space-after">salsa brava</b>, put 2 tablespoons olive oil in a small saucepan over medium heat. Add garlic and let sizzle without browning, then stir in flour and let mixture sizzle. Stir in tomato paste, pimentón dulce and pimentón picante, then add broth gradually, stirring well as the sauce thickens. Bring to a gentle simmer, add vinegar and cook for 5 minutes until the sauce has a gravylike consistency, but isn\'t too thick. Thin with a little more broth or water, if necessary. Season with salt to taste.</li><li onclick="handleItemClick()">For the <b class="conditional-space-after">allioli</b>, put egg yolks and garlic in a mortar or small bowl and whisk together. (Alternatively, use a mini food processor or stick blender, see note.) Add oil a few drops at a time, whisking vigorously with each addition. As the sauce thickens, add olive oil a teaspoon at a time. If the aioli gets too thick, whisk in 1 tablespoon water, then continue to whisk in remaining oil. The finished sauce should have the consistency of softly whipped cream. Season to taste with salt and pepper.</li></ol></li><li onclick="handleItemClick()">When potatoes are ready, use spatula to transfer to a pan lined with paper towels to blot, then to a warm serving dish. Sprinkle lightly with salt. Serve warm with the two sauces.</li></ol><span class="tip">To make in a blender or food processor, use 1 whole egg and 1 egg yolk instead of only yolks. Drizzle oil in a thin stream with motor running until the sauce thickens, which takes only a minute or so. Transfer to a small bowl, then thin with a little water and season with salt and pepper.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_OvenFriedPatatasBravas', '<ul><li onclick="handleItemClick()">From <a href="https://cooking.nytimes.com/recipes/1021018-oven-fried-patatas-bravas-crispy-potatoes-with-two-sauces" target="_blank">https://cooking.nytimes.com/recipes/1021018-oven-fried-patatas-bravas-crispy-potatoes-with-two-sauces</a>, by David Tanis</li><li onclick="handleItemClick()">date created: [2020-07-25 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_OrangePistachioQuinoaSalad', '<ul><li onclick="handleItemClick()">¼ cup roasted pistachio nuts</li><li onclick="handleItemClick()">1 cup uncooked quinoa</li><li onclick="handleItemClick()">1½ cups water</li><li onclick="handleItemClick()">1 teaspoon ground cumin</li><li onclick="handleItemClick()">½ teaspoon ground coriander</li><li onclick="handleItemClick()">1 teaspoon sea salt</li><li onclick="handleItemClick()">⅛ teaspoon ground pepper</li><li onclick="handleItemClick()">½ cup fresh mint, chopped</li><li onclick="handleItemClick()">2 scallions, finely chopped</li><li onclick="handleItemClick()">2 tablespoons lemon juice</li><li onclick="handleItemClick()">2 tablespoons orange juice</li><li onclick="handleItemClick()">1 tablespoon orange zest</li><li onclick="handleItemClick()">2 tablespoons extra virgin olive oil</li><li onclick="handleItemClick()">½ cup raisins (dark or light)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_OrangePistachioQuinoaSalad', '<ol><li onclick="handleItemClick()">Place water and quinoa in a pan and bring to a boil, cover with a lid and lower heat to a simmer for 15 minutes or until all liquid is absorbed. (You can follow the recipe on the package.)</li></ol><ol><li onclick="handleItemClick()">Combine the lemon juice, orange juice, zest and olive oil.</li><li onclick="handleItemClick()">Add the dressing about ½ hour before service and the pistachio nuts just before serving.</li></ol><span class="note">If the dressing is added too soon, the quinoa absorbs it and becomes dry.</span><span class="tip">If you have any leftovers you can add a little orange just and olive oil to moisten it.</span><span class="tip">Remove the pulp from the orange squeezed for the juice and add that to the salad. Or you can add 1 can of Mandarin orange sections.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_OrangePistachioQuinoaSalad', '<ul><li onclick="handleItemClick()">From Esther Turcotte (who served this at the May 2021 Meadows-ettes gathering. It was yum!)</li><li onclick="handleItemClick()">date created: [2021-06-07 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_MexicanRice', '<ul><li onclick="handleItemClick()">1½ cups long grain rice</li><li onclick="handleItemClick()">3⅛ cup low sodium chicken broth (use ¼ to ⅓ cup less liquid for drier rice)</li><li onclick="handleItemClick()">4.5 oz. can tomato paste</li><li onclick="handleItemClick()">3 Tbsp. butter</li><li onclick="handleItemClick()">½ cup onion, finely diced</li><li onclick="handleItemClick()">4 oz. can diced green chilies</li><li onclick="handleItemClick()">Fresh black pepper</li><li onclick="handleItemClick()">Pinch of red pepper flakes</li><li onclick="handleItemClick()">Cilantro for garnish</li><li onclick="handleItemClick()">Salt as needed</li></ul>' ] );
