ingredients_array.push( [ 'CostanzoRecipes_Sides_LemonCurd', 'Yield: 2 cups<br>Prep time: 15 minutes<br>Cook time: 6 minutes<br>Total time: 21 minutes<br>This easy Lemon Curd recipe is a velvety soft, utterly delicious 4 ingredient lemony spread that is exceptionally easy to make at home, on the stovetop, in 10 minutes. A perfect blending of sweet and tangy goodness. It tastes like springtime in every bite.<ul><li onclick="handleItemClick()">⅓ cup fresh lemon juice (about 2 large lemons)</li><li onclick="handleItemClick()">1 tablespoon grated lemon zest</li><li onclick="handleItemClick()">⅔ cup granulated sugar (see note)</li><li onclick="handleItemClick()">4 large eggs</li><li onclick="handleItemClick()">Pinch of salt</li><li onclick="handleItemClick()">6 tablespoons unsalted butter, cubed</li></ul><span class="note">If you prefer your lemon curd a bit less tart and a little sweeter -- increase the sugar to 1 cup and the butter to 8 tablespoons.</span>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_LemonCurd', '<ol><li onclick="handleItemClick()">Fill a saucepan with 1 to 2 inches of water. Place on high heat and once the water comes to a boil, reduce to low heat and keep the water simmering.</li><li onclick="handleItemClick()">Add eggs, granulated sugar, lemon zest, lemon juice, and salt into a heavy glass bowl that fits on top of the saucepan. Whisk until completely blended and set on the simmering water in the saucepan. Be sure that the water does not touch the bottom of the bowl.</li><li onclick="handleItemClick()">Whisk constantly as the curd cooks for about 10 minutes, or until the mixture thickens. It will resemble a thick sauce, like Hollandaise. Lemon curd thickens at about 170 degrees on an instant-read thermometer, which takes about 10 to 11 minutes. Once it begins to thicken, it does so quickly.</li><li onclick="handleItemClick()">Remove the bowl from the heat and toss in the pieced butter and whisk into the curd, it will melt as it is whisked.</li><li onclick="handleItemClick()">Pour the lemon curd into a jar or bowl and place plastic wrap onto the curd to prevent skin from forming as it cools. The curd will continue to thicken as it cools. Once cool, the plastic wrap can be removed. Refrigerate.</li></ol><span class="note"><b class="conditional-space-after">REFRIGERATING LEMON CURD</b><br>The lemon curd can be refrigerated for up to 10 days and makes approximately 2 cups.<br></span><span class="note"><b class="conditional-space-after">FREEZING LEMON CURD</b><br>For longer storage, you can freeze for up to 3 to 6 months. Thaw in the refrigerator overnight.</span><span class="note"><b class="conditional-space-after">Yield</b><br>Makes about two Mason jelly jars worth.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_LemonCurd', '<ul><li onclick="handleItemClick()">From <a href="https://www.31daily.com/easy-lemon-curd-recipe/" target="_blank">https://www.31daily.com/easy-lemon-curd-recipe/</a></li><li onclick="handleItemClick()">date created: [2022-03-25 Fri] </li><li onclick="handleItemClick()">I like the lower butter and sugar version: it\'s assertively yet pleasingly tart.</li></ul>' ] );
