ingredients_array.push( [ 'CostanzoRecipes_Sides_IndianStyleRiceSalad', 'Time: 30 to 60 minutes, depending on the type of rice<ul><li onclick="handleItemClick()">1½ to 2 cups brown or white basmati rice</li><li onclick="handleItemClick()">Salt and freshly ground black pepper</li><li onclick="handleItemClick()">¼ cup chopped scallion</li><li onclick="handleItemClick()">¾ cup cubed cooked potato</li><li onclick="handleItemClick()">¾ cup cooked cauliflower florets</li><li onclick="handleItemClick()">¾ cup cooked green peas</li><li onclick="handleItemClick()">½ cup coconut milk, or more as needed</li><li onclick="handleItemClick()">3 tablespoons rice wine vinegar, or more to taste</li><li onclick="handleItemClick()">1 tablespoon curry powder, or to taste</li><li onclick="handleItemClick()">1 jalapeno or other hot fresh chili, stemmed, seeded and minced, or to taste, optional</li><li onclick="handleItemClick()">½ cup chopped fresh cilantro.</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_IndianStyleRiceSalad', '<ol><li onclick="handleItemClick()">Cook rice in abundant salted water, as you would pasta, until it\'s just done; white rice will take 10 to 15 minutes, brown 30 or a little longer.</li><li onclick="handleItemClick()">Drain, rinse in cold water, drain again, then combine with vegetables in a large bowl.</li><li onclick="handleItemClick()">Combine black pepper, coconut milk, rice wine vinegar and curry powder in a blender and turn machine on; a creamy emulsion will form within 30 seconds. Taste and add more vinegar a teaspoon or two at a time until balance tastes right to you, then add more curry powder, salt, or pepper, if needed.</li><li onclick="handleItemClick()">Drizzle vinaigrette over rice and vegetables.</li><li onclick="handleItemClick()">Use 2 big forks to combine, fluffing rice and tossing gently to separate grains.</li><li onclick="handleItemClick()">Stir in chili, if using, and cilantro, taste, and adjust seasoning or moisten with a little more dressing.</li><li onclick="handleItemClick()">Serve at room temperature, or refrigerate for up to a day, bringing salad back to room temperature before serving.</li></ol>' ] );
