ingredients_array.push( [ 'CostanzoRecipes_Sides_HoneyGarlicCauliflower', '<ul><li onclick="handleItemClick()">1 c. all-purpose flour</li><li onclick="handleItemClick()">2 c. panko breadcrumbs</li><li onclick="handleItemClick()">3 large eggs, beaten</li><li onclick="handleItemClick()">1 head cauliflower, chopped into bite-size florets</li><li onclick="handleItemClick()">⅓ c. honey</li><li onclick="handleItemClick()">⅓ c. soy sauce</li><li onclick="handleItemClick()">2 garlic cloves, minced</li><li onclick="handleItemClick()">Juice of 1 lime</li><li onclick="handleItemClick()">1 tbsp. sriracha</li><li onclick="handleItemClick()">¼ c. water</li><li onclick="handleItemClick()">2 tsp. corn starch</li><li onclick="handleItemClick()">¼ c. Sliced scallions</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_HoneyGarlicCauliflower', '<ol><li onclick="handleItemClick()">Preheat oven to 400° and line a large baking sheet with foil.</li><li onclick="handleItemClick()">In a large bowl, combine flour and cauliflower, toss until fully coated.</li><li onclick="handleItemClick()">Set up a dredging station: In one bowl, add panko breadcrumbs and in another bowl whisk eggs and add 2 tablespoons water.</li><li onclick="handleItemClick()">Dip cauliflower in beaten eggs, then panko until fully coated.</li><li onclick="handleItemClick()">Transfer to a prepared baking sheet and season generously with salt and pepper.</li><li onclick="handleItemClick()">Bake until golden and crispy, 20 to 25 minutes.</li><li onclick="handleItemClick()">Meanwhile, make sauce:<ul><li onclick="handleItemClick()">In a small bowl, whisk together cornstarch and water, until the cornstarch dissolves completely. Set aside.</li><li onclick="handleItemClick()">Combine soy sauce, honey, garlic, lime juice and Sriracha in a small saucepan over medium heat.</li></ul></li><li onclick="handleItemClick()">When the mixture reaches a boil, reduce heat and add the cornstarch mixture.</li><li onclick="handleItemClick()">Bring to simmer again and cook until sauce thickens, about 2 minutes.</li><li onclick="handleItemClick()">Toss cooked cauliflower in sauce until evenly coated.</li><li onclick="handleItemClick()">Return the cauliflower to baking sheet and broil for 2 minutes.</li><li onclick="handleItemClick()">Garnish with scallions and serve immediately.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_HoneyGarlicCauliflower', '<ul><li onclick="handleItemClick()">From <a href="https://www.delish.com/cooking/recipe-ideas/recipes/a47636/honey-garlic-cauliflower/" target="_blank">https://www.delish.com/cooking/recipe-ideas/recipes/a47636/honey-garlic-cauliflower/</a>(via a tip from the HLT newsletter)</li><li onclick="handleItemClick()">date created: [2021-06-23 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_HollandaiseSauce', '<ul><li onclick="handleItemClick()">4 egg yolks</li><li onclick="handleItemClick()">1 tablespoon freshly squeezed lemon juice</li><li onclick="handleItemClick()">½ cup unsalted butter, melted (1 stick)</li><li onclick="handleItemClick()">Pinch cayenne</li><li onclick="handleItemClick()">Pinch salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_HollandaiseSauce', '<ol><li onclick="handleItemClick()">Vigorously whisk the egg yolks and lemon juice together in a stainless steel bowl and until the mixture is thickened and doubled in volume.</li><li onclick="handleItemClick()">Place the bowl over a saucepan containing barely simmering water (or use a double boiler,) the water should not touch the bottom of the bowl.</li><li onclick="handleItemClick()">Continue to whisk rapidly. Be careful not to let the eggs get too hot or they will scramble.</li><li onclick="handleItemClick()">Slowly drizzle in the melted butter and continue to whisk until the sauce is thickened and doubled in volume.</li><li onclick="handleItemClick()">Remove from heat, whisk in cayenne and salt.</li><li onclick="handleItemClick()">Cover and place in a warm spot until ready to use for the eggs benedict. If the sauce gets too thick, whisk in a few drops of warm water before serving.</li></ol>' ] );
