credits_array.push( [ 'CostanzoRecipes_Sides_HollandaiseSauce', '<ul><li onclick="handleItemClick()">date created: [2021-04-04 Sun] </li><li onclick="handleItemClick()"><a href="https://www-foodnetwork-com.cdn.ampproject.org/v/s/www.foodnetwork.com/recipes/tyler-florence/hollandaise-sauce-recipe-1910043.amp?amp_js_v=a6" target="_blank">https://www-foodnetwork-com.cdn.ampproject.org/v/s/www.foodnetwork.com/recipes/tyler-florence/hollandaise-sauce-recipe-1910043.amp?amp_js_v=a6</a></li><li onclick="handleItemClick()">[2021-04-04 Sun] Made for Easter brunch Veggie Benes. Everythhing about it was good: texture, taste, appearance.... until the final step. I had had a nice, velvety smooth creamy texture and then put the pot in the warming oven for too long: the sauce curdled a bit.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_HollandaiseSauce', '<ul><li onclick="handleItemClick()">2 egg yolks</li><li onclick="handleItemClick()">3 Tbls lemon juice</li><li onclick="handleItemClick()">½ cup butter</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_HollandaiseSauce', '<ol><li onclick="handleItemClick()">Stir 2 egg yolks, slightly beaten, and 3 tablespoons lemon juice vigorously in 1-quart saucepan with wooden spoon.</li><li onclick="handleItemClick()">Add ¼ cup butter. Heat over very low heat, stirring constantly, until butter is melted.</li><li onclick="handleItemClick()">Add ¼ cup butter, stirring vigorously until butter is melted and sauce thickens.</li><li onclick="handleItemClick()">(Be sure butter melts slowly; this give eggs time to cook and thicken sauce without curdling.) Serve hot or at room temperature. </li></ol>' ] );
