ingredients_array.push( [ 'CostanzoRecipes_Sides_FrozenFoodProcessorPesto', '<ul><li onclick="handleItemClick()">2 cups firmly packed basil leaves</li><li onclick="handleItemClick()">⅓ cup olive oil</li><li onclick="handleItemClick()">2 tablespoons pine nuts</li><li onclick="handleItemClick()">2 cloves peeled garlic</li><li onclick="handleItemClick()">⅔ cup parmesan cheese</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_FrozenFoodProcessorPesto', '<ol><li onclick="handleItemClick()">Blend all ingredients in a food processor until smoot, stopping to scrape sides from time to time.</li><li onclick="handleItemClick()">Ladle mixture into ice cube trays.</li><li onclick="handleItemClick()">Top off with a little olive oil.</li><li onclick="handleItemClick()">Cover with plastic wrap and freeze.</li><li onclick="handleItemClick()">When solid, empty trays into plastic bags and store in freezer.</li><li onclick="handleItemClick()">When ready to prepare pasta, gently thaw the desired amount of pesto (4 cubes per ½ pound of pasta).</li><li onclick="handleItemClick()">When at rom temperature, add 1 tablespoons parmesan cheese to each cube.</li><li onclick="handleItemClick()">Place in serving dish.</li><li onclick="handleItemClick()">Boil water for pasta.</li><li onclick="handleItemClick()">Add a couple of teaspoons of the pasta’s boiling water and stir until smooth.</li><li onclick="handleItemClick()">Toss pasta in the sauce and serve immediately.<span class="note">    Yield: 12 tablespoons (cubes) or enough for 1- 1½ pounds of pasta.</span><span class="warning">    Never, never, never heat or reheat pesto sauce. It will become bitter, so no leftovers!!!</span></li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_FrozenFoodProcessorPesto', '<ul><li onclick="handleItemClick()">From New York Times</li><li onclick="handleItemClick()">date created: [2021-07-08 Thu] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_FriedRice', '<ul><li onclick="handleItemClick()">3 tablespoons butter, divided</li><li onclick="handleItemClick()">2 eggs, whisked</li><li onclick="handleItemClick()">2 medium carrots, peeled and diced</li><li onclick="handleItemClick()">1 small white onion, diced</li><li onclick="handleItemClick()">½ cup frozen peas</li><li onclick="handleItemClick()">3 cloves garlic, minced</li><li onclick="handleItemClick()">salt and black pepper</li><li onclick="handleItemClick()">4 cups cooked and chilled rice (I prefer short-grain white rice)</li><li onclick="handleItemClick()">3 green onions, thinly sliced</li><li onclick="handleItemClick()">3–4 tablespoons soy sauce, or more to taste</li><li onclick="handleItemClick()">2 teaspoons oyster sauce (optional)</li><li onclick="handleItemClick()">½ teaspoon toasted sesame oil</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_FriedRice', '<ol><li onclick="handleItemClick()">Heat ½ tablespoon of butter in a large sauté pan over medium-high heat until melted.</li><li onclick="handleItemClick()">Add egg, and cook until scrambled, stirring occasionally.</li><li onclick="handleItemClick()">Remove egg, and transfer to a separate plate.</li><li onclick="handleItemClick()">Add an additional 1 tablespoon butter to the pan and heat until melted.</li><li onclick="handleItemClick()">Add carrots, onion, peas and garlic, and season with a generous pinch of salt and pepper.</li><li onclick="handleItemClick()">Sauté for about 5 minutes or until the onion and carrots are soft.</li><li onclick="handleItemClick()">Increase heat to high, add in the remaining 1½ tablespoons of butter, and stir until melted.</li><li onclick="handleItemClick()">Immediately add the rice, green onions, soy sauce and oyster sauce (if using), and stir until combined.</li><li onclick="handleItemClick()">Continue sautéing for an additional 3 minutes to fry the rice, stirring occasionally.<span class="tip">    I like to let the rice rest for a bit between stirs so that it can crisp up on the bottom.</span></li><li onclick="handleItemClick()">Add in the eggs and stir to combine.</li><li onclick="handleItemClick()">Remove from heat, and stir in the sesame oil until combined.</li><li onclick="handleItemClick()">Taste and season with extra soy sauce, if needed.</li><li onclick="handleItemClick()">Serve immediately, or refrigerate in a sealed container for up to 3 days.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_FriedRice', '<ul><li onclick="handleItemClick()">From <a href="https://www.gimmesomeoven.com/fried-rice-recipe/" target="_blank">https://www.gimmesomeoven.com/fried-rice-recipe/</a></li><li onclick="handleItemClick()">date created: [2021-06-28 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_EscaroleBeanSoup', '<ul><li onclick="handleItemClick()">2 teaspoons vegetable oil</li><li onclick="handleItemClick()">¾ cup chopped onions</li><li onclick="handleItemClick()">1 clove garlic, minced</li><li onclick="handleItemClick()">One 14½ ounce can whole peeled tomatoes, undrained</li><li onclick="handleItemClick()">4 cups vegetable broth</li><li onclick="handleItemClick()">4 cups lightly packed, bite-sized pieces, escarole (or other green)</li><li onclick="handleItemClick()">1 cup cooked cannellini beans (cooked from dry or canned, drained) or use chickpeas or kidney beans</li><li onclick="handleItemClick()">¼ cup bowtie pasta (or other small pasta such as orzo)</li><li onclick="handleItemClick()">1 teaspoon sugar</li><li onclick="handleItemClick()">½ teaspoon oregano</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_EscaroleBeanSoup', '<ol><li onclick="handleItemClick()">In a 3-quart saucepan, heat the oil over medium-high heat.</li><li onclick="handleItemClick()">Add the onions and garlic; cook, stirring until softened, about 2 minutes.</li><li onclick="handleItemClick()">Add the tomatoes with liquid and break with up with the back of a spoon.</li><li onclick="handleItemClick()">Add the broth and bring to a boil.</li><li onclick="handleItemClick()">Add the remaining ingredients; return to a boil.</li><li onclick="handleItemClick()">Reduce heat and simmer, uncovered, 10 minutes or until pasta is tender.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_EscaroleBeanSoup', '<ul><li onclick="handleItemClick()">From 1,000 Vegetarian Recipes by Carol Gelles, page 127.</li><li onclick="handleItemClick()">date created: [2021-09-24 Fri] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_CrispySaltandVinegarPotatoes', '<ul><li onclick="handleItemClick()">2 pounds baby Yukon Gold potatoes, halved, quartered if large</li><li onclick="handleItemClick()">1 cup plus 2 Tbsp. distilled white vinegar</li><li onclick="handleItemClick()">1 tablespoon kosher salt, plus more</li><li onclick="handleItemClick()">2 tablespoons unsalted butter</li><li onclick="handleItemClick()">Freshly ground black pepper</li><li onclick="handleItemClick()">2 tablespoons chopped fresh chives</li><li onclick="handleItemClick()">Flaky sea salt (such as Maldon)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_CrispySaltandVinegarPotatoes', '<ol><li onclick="handleItemClick()">Combine potatoes, 1 cup vinegar, and 1 Tbsp. kosher salt in a medium saucepan; add water to cover by 1”.</li><li onclick="handleItemClick()">Bring to a boil, reduce heat, and simmer until potatoes are tender, 20–25 minutes; drain and pat dry.</li><li onclick="handleItemClick()">Heat butter in a large skillet over medium-high heat.</li><li onclick="handleItemClick()">Add potatoes; season with kosher salt and pepper.</li><li onclick="handleItemClick()">Cook, tossing occasionally, until golden brown and crisp, 8–10 minutes.</li><li onclick="handleItemClick()">Drizzle with remaining 2 Tbsp. vinegar.</li><li onclick="handleItemClick()">Serve topped with chives and sea salt.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_CrispySaltandVinegarPotatoes', '<ul><li onclick="handleItemClick()">From <a href="https://www.bonappetit.com/recipe/crispy-salt-and-vinegar-potatoes" target="_blank">https://www.bonappetit.com/recipe/crispy-salt-and-vinegar-potatoes</a></li><li onclick="handleItemClick()">date created: [2014-05-30 Fri] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_ColdSesameNoodles', 'YIELD: 4 servingsTIME: 10 minutesNoodles dressed with sesame are popular in many parts of China, but this particular style, made with peanut butter and served cold, became a Chinese-American staple in the United States in the 1970s. The family of Shorty Tang — an ambitious restaurateur who emigrated from Sichuan to Taipei to New York — firmly believes that he invented the dish and still serve it at Hwa Yuan, the restaurant he opened in 1967 in Manhattan’s Chinatown. They have never divulged the exact recipe; this is our own lush but refreshing version.<ul><li onclick="handleItemClick()">1 pound noodles, frozen or (preferably) fresh</li><li onclick="handleItemClick()">2 tablespoons sesame oil, plus a splash</li><li onclick="handleItemClick()">3½ tablespoons soy sauce</li><li onclick="handleItemClick()">2 tablespoons Chinese rice vinegar</li><li onclick="handleItemClick()">2 tablespoons Chinese sesame paste</li><li onclick="handleItemClick()">1 tablespoon smooth peanut butter</li><li onclick="handleItemClick()">1 tablespoon granulated sugar</li><li onclick="handleItemClick()">1 tablespoon finely grated ginger</li><li onclick="handleItemClick()">2 teaspoons minced garlic</li><li onclick="handleItemClick()">2 teaspoons chile-garlic paste, chile crisp or chile oil, or to taste</li><li onclick="handleItemClick()">Half a cucumber, peeled, seeded and cut into 1/8-inch by 1/8-inch by 2-inch sticks</li><li onclick="handleItemClick()">¼ cup chopped roasted peanuts</li></ul><span class="tip">The Chinese sesame paste called for here is made of toasted sesame seeds; it is not the same as tahini, the Middle Eastern paste made of plain, untoasted sesame. But you could use tahini in a pinch. You need only add a little toasted sesame oil to compensate for flavor, and perhaps some peanut butter to keep the sauce emulsified.</span>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_ColdSesameNoodles', '<ol><li onclick="handleItemClick()">Bring a large pot of water to a boil.</li><li onclick="handleItemClick()">Add noodles and cook until barely tender, about 5 minutes. They should retain a hint of chewiness.</li><li onclick="handleItemClick()">Drain, rinse with cold water, drain again and toss with a splash of sesame oil.</li><li onclick="handleItemClick()">In a medium bowl, whisk together the remaining 2 tablespoons sesame oil, the soy sauce, rice vinegar, sesame paste, peanut butter, sugar, ginger, garlic and chili-garlic paste.</li><li onclick="handleItemClick()">Pour the sauce over the noodles and toss.</li><li onclick="handleItemClick()">Transfer to a serving bowl, and garnish with cucumber and peanuts.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_ColdSesameNoodles', '<ul><li onclick="handleItemClick()">From <a href="https://cooking.nytimes.com/recipes/9558-takeout-style-sesame-noodles" target="_blank">https://cooking.nytimes.com/recipes/9558-takeout-style-sesame-noodles</a></li><li onclick="handleItemClick()">date created: [2020-07-22 Wed] </li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_ChipotleRanchDressing', '<ul><li onclick="handleItemClick()">1 cup mayonnaise</li><li onclick="handleItemClick()">1 cup sour cream</li><li onclick="handleItemClick()">1 cup buttermilk</li><li onclick="handleItemClick()">1½ teaspoons granulated garlic</li><li onclick="handleItemClick()">1 teaspoon garlic powder</li><li onclick="handleItemClick()">1½ teaspoons onion powder</li><li onclick="handleItemClick()">¼ cup dried parsley ( I used fresh)</li><li onclick="handleItemClick()">1½ teaspoons dried chipotle powder</li><li onclick="handleItemClick()">1½ teaspoons lime juice</li><li onclick="handleItemClick()">1½ teaspoons salt</li></ul><ul><li onclick="handleItemClick()">½ cup mayo (or use sour cream, vegan mayo “Veganaise” – or make with silken tofu, see notes below)</li><li onclick="handleItemClick()">1 tablespoon water (for a thinner sauce)</li><li onclick="handleItemClick()">1 - 2 teaspoons lime juice (to taste)</li><li onclick="handleItemClick()">⅛ teaspoon salt, more to taste</li><li onclick="handleItemClick()">½ teaspoon chili powder</li><li onclick="handleItemClick()">1 teaspoon smoked paprika</li><li onclick="handleItemClick()">⅛ - ¼ teaspoon chipotle powder – you can also use one canned chipotle pepper (blending it with the mayo in a blender) or just stir in a teaspoon or two of the spicy smoky adobo sauce from the can. Start conservatively, adding more to taste.</li></ul><ol><li onclick="handleItemClick()">Mix in mixer or food processor on low speed until well mixed. Or whisk.</li><li onclick="handleItemClick()">Refrigerate.</li></ol>' ] );
