ingredients_array.push( [ 'CostanzoRecipes_Sides_ChiliSauce', '<ul><li onclick="handleItemClick()">1 (8-ounce) can tomato sauce</li><li onclick="handleItemClick()">¼ cup packed light or dark brown sugar</li><li onclick="handleItemClick()">3 tablespoons apple cider vinegar</li><li onclick="handleItemClick()">2 tablespoons tomato paste</li><li onclick="handleItemClick()">1 teaspoon Worcestershire sauce</li><li onclick="handleItemClick()">1 teaspoon smoked paprika</li><li onclick="handleItemClick()">½ teaspoon garlic powder</li><li onclick="handleItemClick()">½ teaspoon kosher salt</li><li onclick="handleItemClick()">¼ teaspoon freshly ground black pepper</li><li onclick="handleItemClick()">¼ teaspoon ground allspice</li><li onclick="handleItemClick()">⅛ teaspoon ground cinnamon</li><li onclick="handleItemClick()">⅛ teaspoon ground cloves</li><li onclick="handleItemClick()">⅛ teaspoon cayenne pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_ChiliSauce', '<ol><li onclick="handleItemClick()">Place:<ul><li onclick="handleItemClick()">1 (8-ounce) can tomato sauce</li><li onclick="handleItemClick()">¼ cup packed brown sugar</li><li onclick="handleItemClick()">3 tablespoons apple cider vinegar</li><li onclick="handleItemClick()">2 tablespoons tomato paste</li><li onclick="handleItemClick()">1 teaspoon Worcestershire sauce</li><li onclick="handleItemClick()">1 teaspoon smoked paprika</li><li onclick="handleItemClick()">½ teaspoon garlic powder</li><li onclick="handleItemClick()">½ teaspoon kosher salt</li><li onclick="handleItemClick()">¼ teaspoon black pepper</li><li onclick="handleItemClick()">¼ teaspoon ground allspice</li><li onclick="handleItemClick()">⅛ teaspoon ground cinnamon</li><li onclick="handleItemClick()">⅛ teaspoon ground cloves</li><li onclick="handleItemClick()">and ⅛ teaspoon cayenne pepper in a small saucepan and stir to combine.</li></ul></li><li onclick="handleItemClick()">Bring to a gentle boil over medium-high heat. Reduce the heat to low and simmer for 10 minutes</li><li onclick="handleItemClick()">stirring occasionally. The sauce will turn a deeper, richer shade of red.</li><li onclick="handleItemClick()">Remove from the heat and let cool completely.</li><li onclick="handleItemClick()">Transfer to an airtight container and refrigerate for up to 1 week.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_ChiliSauce', '<ul><li onclick="handleItemClick()">From <a href="https://www.thekitchn.com/chili-sauce-recipe-23224897" target="_blank">https://www.thekitchn.com/chili-sauce-recipe-23224897</a></li><li onclick="handleItemClick()">date created: [2021-09-17 Fri] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_CheeseSticks', '<ul><li onclick="handleItemClick()">1 sheet frozen puff pastry, thawed just enough to unfold</li><li onclick="handleItemClick()">2 teaspoons olive oil (preferably drained from a tin of anchovies)</li><li onclick="handleItemClick()">1 pinch cayenne pepper, or to taste</li><li onclick="handleItemClick()">salt and freshly ground black pepper to taste</li><li onclick="handleItemClick()">¼ cup shredded sharp white Cheddar cheese</li><li onclick="handleItemClick()">5 tablespoons freshly shredded Parmigiano-Reggiano cheese, divided</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_CheeseSticks', '<ol><li onclick="handleItemClick()">Preheat the oven to 400°F (200°C).</li><li onclick="handleItemClick()">Line a baking sheet with parchment paper or a silicone baking mat.</li><li onclick="handleItemClick()">Unfold puff pastry into a flat sheet and brush olive oil over top.</li><li onclick="handleItemClick()">Season with salt, pepper, and cayenne pepper.</li><li onclick="handleItemClick()">Sprinkle Cheddar and ¼ cup Parmigiano-Reggiano all over dough to cover.</li><li onclick="handleItemClick()">Cover with a piece of plastic wrap (or silpat).</li><li onclick="handleItemClick()">Press on the plastic wrap (or silpat) with your fingers to push cheese and seasonings firmly into the dough, or place a sheet pan over top and press down.</li><li onclick="handleItemClick()">Remove and discard plastic wrap.</li><li onclick="handleItemClick()">Cut dough along the seams into thirds with a pizza cutter or sharp knife, then cut each third lengthwise into thirds again for a total of nine strips.</li><li onclick="handleItemClick()">Pick up one strip and place it seasoned-side down onto the work surface.</li><li onclick="handleItemClick()">Twist it from both ends eight to nine times to make a rolled tube of dough with the seasoning facing out.</li><li onclick="handleItemClick()">Place onto the prepared baking sheet and repeat with remaining strips.</li><li onclick="handleItemClick()">Sprinkle remaining 1 tablespoon Parmigiano-Reggiano cheese over cheese sticks.</li><li onclick="handleItemClick()">Roll sticks lightly to even up their shapes; pick up and press any dropped cheese onto the surfaces.</li><li onclick="handleItemClick()">Bake in the preheated oven for about 10 minutes, then flip and bake until sticks are browned and crisp and hold their shape without drooping when lifted, 10 to 20 more minutes.</li><li onclick="handleItemClick()">Cool on a wire rack before serving.</li></ol><span class="note">You can use all kinds of dried herbs and spices, curry powders, smoked paprika, and things like that. This is my basic formula, but you can adapt it to suit your tastes.</span><span class="note">The wider the strips, the more bread-like the cheese sticks will be. The tighter you twist them, the more dense and crisp they will be. A loose twist will result in a softer, breadier stick.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_CheeseSticks', '<ul><li onclick="handleItemClick()">From <a href="https://www.allrecipes.com/recipe/234683/how-to-make-cheese-sticks/" target="_blank">https://www.allrecipes.com/recipe/234683/how-to-make-cheese-sticks/</a></li><li onclick="handleItemClick()">date created: [2023-07-29 Sat] </li><li onclick="handleItemClick()">[2023-07-28 Fri] Made for T and Louise and Todd. The pastry stuck a bit on the cutting board, but otherwise these were pretty simple and got raves!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_CheeseGrits', '<ul><li onclick="handleItemClick()">½ c. white grits</li><li onclick="handleItemClick()">¾ tsp. salt</li><li onclick="handleItemClick()">2½ c. boiling water</li><li onclick="handleItemClick()">¼ lb. cheddar cheese, grated</li><li onclick="handleItemClick()">1 egg, well beaten</li><li onclick="handleItemClick()">Pinch of cayenne pepper</li><li onclick="handleItemClick()">Paprika</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_CheeseGrits', '<ol><li onclick="handleItemClick()">Gradually stir grits and salt into the boiling water. Cover and cook for about 10 minutes, until grits are done, stirring often. </li><li onclick="handleItemClick()">Add all but ⅓ cup of the grated cheese and the egg. Season with cayenne and stir until mixture is smooth. Cover and cook a little longer until cheese is melted. Pour into a well greased casserole and top with remaining cheese and dust with paprika. Bake in a 325 degree oven for 25 minutes.</li><li onclick="handleItemClick()">Serves 2.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_CheeseGrits', '<ul><li onclick="handleItemClick()">date created: [2008-05-17 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_CauliflowerPotatoFennelandChilliCheeseCroquettes', '<ul><li onclick="handleItemClick()">2 baking potatoes</li><li onclick="handleItemClick()">175g of cauliflower florets</li><li onclick="handleItemClick()">100g of mature cheddar, cut into cubes</li><li onclick="handleItemClick()">2 tsp fennel seeds</li><li onclick="handleItemClick()">1 tsp cumin seeds</li><li onclick="handleItemClick()">2 tsp chilli flakes</li><li onclick="handleItemClick()">salt, to taste</li><li onclick="handleItemClick()">2 pinches of black pepper</li><li onclick="handleItemClick()">2 eggs, beaten</li><li onclick="handleItemClick()">50g of plain flour, you may need extra</li><li onclick="handleItemClick()">Panko breadcrumbs</li><li onclick="handleItemClick()">vegetable oil, for frying</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_CauliflowerPotatoFennelandChilliCheeseCroquettes', '<ol><li onclick="handleItemClick()">Preheat an oven to 375°F/190°C/gas mark 5.</li><li onclick="handleItemClick()">Place the potatoes on a baking tray, prick a few times with a fork then place in the oven for about 1 hour, or until fluffy and cooked through.</li><li onclick="handleItemClick()">When the potatoes are cool enough to handle, scoop out the insides and place in a large bowl.</li><li onclick="handleItemClick()">Place the cauliflower in a steamer basket set over water and steam for 7–10 minutes or until tender, then leave to cool. Mash the cauliflower lightly with a fork and add it to the potato mixture.</li><li onclick="handleItemClick()">Sprinkle in the fennel seeds, cumin seeds, chilli, salt and black pepper and mix well. Add the cubes of cheese and gently toss the mixture until evenly combined.</li><li onclick="handleItemClick()">Make even sized ‘sausages’ with the croquette mixture, then roll and coat them in plain flour, then the egg and finally coat the panko breadcrumbs. (I made about 14 croquettes from this quantity of ingredients.)</li><li onclick="handleItemClick()">Place the croquettes in the fridge to chill and set for 30–60 minutes.</li><li onclick="handleItemClick()">When you are ready to fry them, heat the oil in deep-fryer or large heavy-based saucepan.</li><li onclick="handleItemClick()">Deep fry the croquettes for 2–3 minutes or until golden, then transfer onto kitchen paper with a slotted spoon. Serve immediately.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_CauliflowerPotatoFennelandChilliCheeseCroquettes', '<ul><li onclick="handleItemClick()">From <a href="https://www.greatbritishchefs.com/recipes/cauliflower-cheese-croquettes-recipe" target="_blank">https://www.greatbritishchefs.com/recipes/cauliflower-cheese-croquettes-recipe</a></li><li onclick="handleItemClick()">date created: [2020-01-20 Mon] </li><li onclick="handleItemClick()">[2021-01-09 Sat] Made for T. I got 8 croquettes out of the recipe. They were light, not greasy and quite tasty. A hit!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_BuffaloCauliflower', '<ul><li onclick="handleItemClick()">½ head cauliflower, chopped into bite size pieces</li><li onclick="handleItemClick()">1 cup garbanzo bean (or wheat) flour</li><li onclick="handleItemClick()">1 cup water</li><li onclick="handleItemClick()">1 tsp. garlic powder (or minced fresh garlic)</li><li onclick="handleItemClick()">½ tsp. salt</li><li onclick="handleItemClick()">1 tsp. melted butter or ghee</li><li onclick="handleItemClick()">⅔ cup hot sauce</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_BuffaloCauliflower', '<ol><li onclick="handleItemClick()">Preheat oven to 450F.</li><li onclick="handleItemClick()">In a medium size bowl, combine flour, water, garlic powder and salt. Whisk together until smooth.</li><li onclick="handleItemClick()">Toss cauliflower into batter making sure to coat each piece completely, then place battered   cauliflower on a lightly greased, non-stick baking sheet. </li><li onclick="handleItemClick()">Bake for 15 minutes, tossing half way through.</li><li onclick="handleItemClick()">In the meantime, combine melted butter and hot sauce in a large bowl, stirring.</li><li onclick="handleItemClick()">When cauliflower is done, remove it from the oven and gently toss it in the hot sauce mixture.</li><li onclick="handleItemClick()">Place cauliflower back on the baking sheet and cook for an additional 25 minutes or until it   becomes crispy. Allow cauliflower to cool for 15 minutes before serving. </li><li onclick="handleItemClick()">Serve with your favorite creamy dressing.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Sides_BuffaloCauliflower', '' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_BuffaloCauliflower', '<a href="http://www.mindbodygreen.com/0-13441/crispy-cauliflower-buffalo-wings-gluten-free.html" target="_blank">http://www.mindbodygreen.com/0-13441/crispy-cauliflower-buffalo-wings-gluten-free.html</a>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_BuffaloBites', '<ul><li onclick="handleItemClick()">1 16-ounce container firm tofu (I used Organic firm from Trader Joe’s – the one in the pink package)</li><li onclick="handleItemClick()">3/4 cup Frank’s Red Hot Buffalo Sauce, divided (½ + ¼ cup)</li><li onclick="handleItemClick()">1/4 cup water</li><li onclick="handleItemClick()">1 tablespoon + 1 teaspoon (vegan) butter, divided</li><li onclick="handleItemClick()">2 tablespoons cornstarch</li></ul><ul><li onclick="handleItemClick()">6 ounces unsweetened Greek-style non-dairy yogurt</li><li onclick="handleItemClick()">1 teaspoon seasoning blend like Ranch seasonings (I used Trader Joe’s 21 seasoning salute)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_BuffaloBites', '<ol><li onclick="handleItemClick()">Remove tofu from package and drain excess liquid.</li><li onclick="handleItemClick()">If pressing, place tofu block between two plates and place 2-3 cans on top. Place in refrigerator for 3-4 hours and drain additional water. You can skip this step if short on time.</li><li onclick="handleItemClick()">Cube tofu into 1 inch cubes and place in a Tupperware container or baking dish large enough that cubes are close but not stacked.</li><li onclick="handleItemClick()">Prepare marinade by combining 1 tablespoon melted non-dairy butter with ½ cup hot sauce + ¼ cup water. Mix. Pour over tofu. Cover tofu.</li><li onclick="handleItemClick()">Place tofu in the refrigerator for 1-8 hours (or overnight).</li><li onclick="handleItemClick()">Preheat oven to 400 degrees Fahrenheit.</li><li onclick="handleItemClick()">Remove tofu from refrigerator and transfer to a bowl. Add cornstarch and gently toss until all tofu is lightly coated.</li><li onclick="handleItemClick()">Line a baking sheet with a Sil-pat or parchment paper. Transfer tofu to baking sheet, spaced evenly.</li><li onclick="handleItemClick()">Bake tofu for 30-45 minutes, until crispy on the outside, flipping halfway through.</li><li onclick="handleItemClick()">Meanwhile, combine remaining ¼ cup hot sauce + 1 teaspoon melted non-dairy butter. Use to drench tofu immediately after removing from the oven.</li><li onclick="handleItemClick()">Serve immediately.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_BuffaloBites', '<ul><li onclick="handleItemClick()">From <a href="https://kbaked.com/2018/01/04/baked-buffalo-tofu-bites/" target="_blank">https://kbaked.com/2018/01/04/baked-buffalo-tofu-bites/</a></li><li onclick="handleItemClick()">date created: [2020-12-28 Mon] </li></ul>' ] );
yields_array.push( [ 'CostanzoRecipes_Sides_BroccoliwithGarlicSauce', 'Serves: 4' ] );
ingredients_array.push( [ 'CostanzoRecipes_Sides_BroccoliwithGarlicSauce', '<ul><li onclick="handleItemClick()">1 pound broccoli, cut into florets</li><li onclick="handleItemClick()">1 teaspoon dark soy sauce</li><li onclick="handleItemClick()">2 tablespoons soy sauce</li><li onclick="handleItemClick()">1½ teaspoons rice wine vinegar</li><li onclick="handleItemClick()">2 teaspoons sugar</li><li onclick="handleItemClick()">¾ cup hot chicken or vegetable stock (to keep the dish vegetarian)</li><li onclick="handleItemClick()">½ teaspoon sesame oil</li><li onclick="handleItemClick()">A pinch of fresh ground white pepper</li><li onclick="handleItemClick()">2 tablespoons vegetable oil</li><li onclick="handleItemClick()">4 cloves of minced garlic (about a tablespoon)</li><li onclick="handleItemClick()">1 tablespoon Shaoxing wine</li><li onclick="handleItemClick()">Cornstarch slurry (1½ tablespoons cornstarch mixed with 1½ tablespoons water)</li><li onclick="handleItemClick()">1 teaspoon homemade chili oil (optional)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_BroccoliwithGarlicSauce', '<ol><li onclick="handleItemClick()">Wash the broccoli thoroughly and set aside. Mix the soy sauces, rice wine vinegar, sugar, stock, sesame oil, and ground white pepper, and set aside.</li><li onclick="handleItemClick()">Heat the wok over high heat. Add the vegetable oil, garlic, and broccoli and quickly stir-fry so the garlic doesn\'t burn.</li><li onclick="handleItemClick()">Stir fry for 15 seconds, and add the Shaoxing rice wine around the perimeter of the wok. Give everything a quick stir and add in the sauce mixture. Let the sauce come to a boil, and mix the cornstarch and water together to make a slurry.</li><li onclick="handleItemClick()">Add the cornstarch slurry slowly while stirring the broccoli and sauce constantly. Let the sauce cook and thicken until it coats the back of a spoon. If you like a thick sauce, add more cornstarch and water. If you like your sauce thinner, add less cornstarch and water. If you\'d like, stir in the chili oil at this point. Serve!</li></ol>' ] );
