ingredients_array.push( [ 'CostanzoRecipes_Sides_BroccoliSaladWithGarlicandSesame', 'YIELD: 6 to 8 servingsTIME: 10 minutes, plus marinatingThis salad is made from uncooked broccoli tossed with an assertive garlic, sesame, chile and cumin-seed vinaigrette slicked with good extra-virgin olive oil and red wine vinegar. The acid “cooks” the florets a little as ceviche does fish. After an hour, the broccoli softens as if blanched, turning bright emerald, and soaking up all the intense flavors of the dressing. You’ll be making this one again.<ul><li onclick="handleItemClick()">1½ teaspoons red wine vinegar</li><li onclick="handleItemClick()">1 teaspoon kosher salt, more to taste</li><li onclick="handleItemClick()">2 heads broccoli, 1 pound each, cut into bite-size florets</li><li onclick="handleItemClick()">¾ cup extra virgin olive oil</li><li onclick="handleItemClick()">4 fat garlic cloves, minced</li><li onclick="handleItemClick()">2 teaspoons cumin seeds</li><li onclick="handleItemClick()">2 teaspoons roasted (Asian) sesame oil</li><li onclick="handleItemClick()">Large pinch crushed red pepper flakes</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_BroccoliSaladWithGarlicandSesame', '<ol><li onclick="handleItemClick()">In a large bowl, stir together the vinegar and salt.</li><li onclick="handleItemClick()">Add broccoli and toss to combine.</li><li onclick="handleItemClick()">In a large skillet, heat olive oil until hot, but not smoking.</li><li onclick="handleItemClick()">Add garlic and cumin and cook until fragrant, about 1 minute.</li><li onclick="handleItemClick()">Stir in sesame oil and pepper flakes.</li><li onclick="handleItemClick()">Pour mixture over broccoli and toss well.</li><li onclick="handleItemClick()">Let sit for at least 1 hour at room temperature, and up to 48 (chill it if you want to keep it for more than 2 hours).</li><li onclick="handleItemClick()">Adjust seasonings (it may need more salt) and serve.</li></ol>' ] );
