ingredients_array.push( [ 'CostanzoRecipes_Sides_AsparagusRollswithHerbButterSauce', '<ul><li onclick="handleItemClick()">4 sheets of filo pastry</li><li onclick="handleItemClick()">¼ cup butter, melted</li><li onclick="handleItemClick()">16 young asparagus spears, trimmed</li></ul><ul><li onclick="handleItemClick()">2 shallots, finely chopped</li><li onclick="handleItemClick()">1 bay leaf</li><li onclick="handleItemClick()">⅔ cup dry white whine</li><li onclick="handleItemClick()">6 oz butter, softened</li><li onclick="handleItemClick()">1 tbsp chopped fresh herbs</li><li onclick="handleItemClick()">salt and freshly ground black pepper</li><li onclick="handleItemClick()">chopped chives, to garnish</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Sides_AsparagusRollswithHerbButterSauce', '<ol><li onclick="handleItemClick()">Preheat the oven to 400 degrees F. Cut the filo sheets in half. Brush a half sheet with melted butter. Fold one corner of the sheet down to the bottom edge to give a wedge shape.</li><li onclick="handleItemClick()">Lay 4 asparagus spears on top at the longest edge and roll up toward the shortest edge. Using the remaining filo and asparagus spears, make three more rolls in the same way.</li><li onclick="handleItemClick()">Lay the rolls on a greased baking sheet. Brush with the remaining melted butter. Bake in the oven for 8 minutes, until golden.</li><li onclick="handleItemClick()">Meanwhile, put the shallots, bay leaf and wine into a pan. Cover and cook over a high heat until the wine is reduced to 2-4 tbsp.</li><li onclick="handleItemClick()">Strain the wine mixture into a bowl. Whisk in the butter, a little at a time until the sauce is smooth and glossy.</li><li onclick="handleItemClick()">Stir in the herbs and add salt and pepper to taste. Return to the pan and keep the sauce warm. Serve the rolls on individual plates with a salad garnish if desired. Serve the sauce separately, sprinkled with a few chopped chives.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Sides_AsparagusRollswithHerbButterSauce', '<ul><li onclick="handleItemClick()">From <a href="https://www.amazon.com/Fast-Vegetarian-Matthew-Drennan-2001-07-31/dp/B01K93C14U/ref=sr_1_1?dchild=1&keywords=Fast+Vegetarian+Food+drennan&qid=1595522860&sr=8-1" target="_blank">https://www.amazon.com/Fast-Vegetarian-Matthew-Drennan-2001-07-31/dp/B01K93C14U/ref=sr_1_1?dchild=1&keywords=Fast+Vegetarian+Food+drennan&qid=1595522860&sr=8-1</a>, page 58</li><li onclick="handleItemClick()">date created: [2020-07-23 Thu] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_ZucchiniandPepperEnchiladas', '<ul><li onclick="handleItemClick()">2 tablespoons olive oil</li><li onclick="handleItemClick()">2 medium sized cloves of garlic, crushed</li><li onclick="handleItemClick()">1 cup minced onion</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">1 cup minced green bell peppers</li><li onclick="handleItemClick()">2½ cups diced zucchini (about 2 smallish zukes)</li><li onclick="handleItemClick()">½ teaspoon <i class="conditional-space-after"></i>: basil, cayenne, cumin, oregano and black pepper, to taste</li></ul><ul><li onclick="handleItemClick()">1 cup chopped onion</li><li onclick="handleItemClick()">2 cloves crushed garlic</li><li onclick="handleItemClick()">3 cups chopped tomatoes</li><li onclick="handleItemClick()">1 cup water</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">1 teaspoon cumin</li><li onclick="handleItemClick()">¼ teaspoon ground corriander</li><li onclick="handleItemClick()">2 teaspoon dry red wine</li><li onclick="handleItemClick()">¼ - ½ teaspoon cayenne</li><li onclick="handleItemClick()">¼ teaspoon black pepper</li><li onclick="handleItemClick()">½ teaspoon chili powder</li><li onclick="handleItemClick()">2 tablespoons tomato paste</li><li onclick="handleItemClick()">2 tablespoons olive oil</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_ZucchiniandPepperEnchiladas', '<ol><li onclick="handleItemClick()">In a large heavy skillet, sauté the garlic and onion in olive oil, with salt.</li><li onclick="handleItemClick()">When the onions are soft (after about 5 minutes), add the pepper, zucchini and herbs.</li><li onclick="handleItemClick()">Stir and continue to cook over medium heat another 5-8 minutes, or until the zucchini is just barely tender.</li><li onclick="handleItemClick()">Remove from heat and stir in the cheese.</li><li onclick="handleItemClick()">Allow to cool at least to room temperature before filling enchiladas.</li></ol><ol><li onclick="handleItemClick()">Sauté onions and garlic in olive oil with ½ teaspoon salt until onion is clear.</li><li onclick="handleItemClick()">Add spices.</li><li onclick="handleItemClick()">Transfer to saucepan and add tomatoes, water, tomato paste and wine.</li><li onclick="handleItemClick()">Add remaining salt.</li><li onclick="handleItemClick()">Cover and simmer ½ hour or longer (several hours is best).<span class="warning">   Hot spices tend to get hotter as they cook. It is recommended that you add the cayenne a little at a time so the degree of hotness is to your tolerance.</span><span class="note">   This sauce can be left in chunky form. Or you can purée all or part of it.</span></li></ol>' ] );
