ingredients_array.push( [ 'CostanzoRecipes_Entrees_VegetableRiggies', 'Prep time: 20 minCook time: 45 min<br>Ready in: 1 hour 5 min<br>Yields: Serves 6 to 10<ul><li onclick="handleItemClick()">12 medium-sized mushrooms, sliced</li><li onclick="handleItemClick()">regular sized bag green onions, chopped</li><li onclick="handleItemClick()">½ clove garlic, minced or pressed</li><li onclick="handleItemClick()">¾ stick butter, melted in pan</li><li onclick="handleItemClick()">1 to 2 lbs various peppers of your choice, cut however your heart desires</li><li onclick="handleItemClick()">1 to 2 lbs High-quality rigatoni pasta</li><li onclick="handleItemClick()">2 large cans crushed tomatoes</li><li onclick="handleItemClick()">½ to 1 white onion, preferably in rings</li><li onclick="handleItemClick()">a handful Italian seasonings, pepper and salt, tossed in</li><li onclick="handleItemClick()">1 quart heavy cream</li><li onclick="handleItemClick()">1 tablespoon extra virgin olive oil</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_VegetableRiggies', '<ol><li onclick="handleItemClick()">Chop up all your veggies, place the mushrooms and scallions in one bowl, and have all your peppers in another bowl.</li><li onclick="handleItemClick()">Put the crushed tomatoes in a medium sauce pan. Put on a low heat, adding white onion and all the seasonings. Base amounts on your liking. Periodically stir.</li><li onclick="handleItemClick()">Heat butter and garlic in a large high sided frying pan on a medium heat. Once garlic smell comes off the pan, immediately add mushrooms and scallions. Saute until lightly browned, roughly 10 minutes. Get your pasta water started on the heat. Add olive oil to water.</li><li onclick="handleItemClick()">Add peppers. Keep heat close to high. Let cook for about 10 more minutes. Your pasta is done.</li><li onclick="handleItemClick()">Add heavy cream in with peppers. Let cook on medium heat for about 15 minutes.</li><li onclick="handleItemClick()">Combine everything... <i class="conditional-space-after"></i></li></ol>' ] );
