ingredients_array.push( [ 'CostanzoRecipes_Entrees_VegetablePotPie', 'Prep Time: 1 hr Total Time: 1 hr 45 minsServings: 6-8<ul><li onclick="handleItemClick()">1 cup potato, diced</li><li onclick="handleItemClick()">1 cup onion, diced</li><li onclick="handleItemClick()">1 cup celery, diced</li><li onclick="handleItemClick()">1 cup carrots, diced</li><li onclick="handleItemClick()">⅓ cup melted butter</li><li onclick="handleItemClick()">½ cup all-purpose flour</li><li onclick="handleItemClick()">2 cups vegetable broth</li><li onclick="handleItemClick()">1 cup half-and-half</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">¼ teaspoon pepper</li><li onclick="handleItemClick()">½ teaspoon of rosemary (optional)</li><li onclick="handleItemClick()">½ teaspoon of thyme (optional)</li><li onclick="handleItemClick()">1 cup peas</li><li onclick="handleItemClick()">1 cup TVP or other mock meat (optional)</li><li onclick="handleItemClick()">1 pie crust (either store bought or your own recipe)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_VegetablePotPie', '<ol><li onclick="handleItemClick()">Preheat oven to 400 degrees F.</li><li onclick="handleItemClick()">Saute onion, celery, carrots and potatoes in butter for 10 minutes.</li><li onclick="handleItemClick()">Add flour to sauteed mixture, stirring well, cook one minute stirring constantly.</li><li onclick="handleItemClick()">Combine broth and half and half; gradually stir into vegetable mixture.</li><li onclick="handleItemClick()">Cook over medium heat stirring constantly until thickened and bubbly.</li><li onclick="handleItemClick()">Stir in salt and pepper; add peas and TVP or other mock meat (if using) and stir well.</li><li onclick="handleItemClick()">Pour into shallow 2 quart casserole dish and top with pie shell.</li><li onclick="handleItemClick()">Cut slits to allow steam to escape.</li><li onclick="handleItemClick()">Bake for 40-50 minutes or until pastry is golden brown and filling is bubbly and cooked through.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_VegetablePotPie', '<ul><li onclick="handleItemClick()">Recommended by Louise.</li><li onclick="handleItemClick()">By Vincy Bramblett on August 07, 2001 97.40%;  708 Reviews<ul><li onclick="handleItemClick()"><a href="https://www.epicurious.com/recipes/member/views/delicious-chicken-pot-pie-52349241" target="_blank">https://www.epicurious.com/recipes/member/views/delicious-chicken-pot-pie-52349241</a></li><li onclick="handleItemClick()"><a href="http://www.geniuskitchen.com/recipe/delicious-chicken-pot-pie-10744" target="_blank">http://www.geniuskitchen.com/recipe/delicious-chicken-pot-pie-10744</a></li></ul></li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_VegetableEnchiladas', '<ul><li onclick="handleItemClick()">3 tbsp. vegetable oil</li><li onclick="handleItemClick()">1 onion, minced</li><li onclick="handleItemClick()">1 clove garlic, minced or pressed</li><li onclick="handleItemClick()">1 green pepper, chopped fine</li><li onclick="handleItemClick()">3 stalks celery, chopped fine</li><li onclick="handleItemClick()">1 c. chopped parsley</li><li onclick="handleItemClick()">1 c. coarsely grated zucchini</li><li onclick="handleItemClick()">2 c. green beans, chopped sm.</li><li onclick="handleItemClick()">1 tsp. salt</li><li onclick="handleItemClick()">Dash each of chili, cumin powder, corn flour</li><li onclick="handleItemClick()">2 c. grated cheddar or Jack cheese</li><li onclick="handleItemClick()">3½ c. Red Sauce</li><li onclick="handleItemClick()">12 corn or whole wheat flour tortillas</li><li onclick="handleItemClick()">½ c. chopped black olives</li></ul><ul><li onclick="handleItemClick()">½ large onion, chopped</li><li onclick="handleItemClick()">2 tbsp. oil</li><li onclick="handleItemClick()">1 bay leaf</li><li onclick="handleItemClick()">1 tsp. cumin</li><li onclick="handleItemClick()">3 c. tomatoes</li><li onclick="handleItemClick()">1 tsp. salt</li><li onclick="handleItemClick()">1 clove garlic, minced</li><li onclick="handleItemClick()">2 tbsp. chopped green pepper</li><li onclick="handleItemClick()">1 tsp. oregano</li><li onclick="handleItemClick()">½ tsp. chili powder</li><li onclick="handleItemClick()">1 (6 oz.) can tomato paste</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_VegetableEnchiladas', '<ol><li onclick="handleItemClick()">Saute onion, garlic, pepper and celery in oil. Add parsley, zucchini and green beans with salt, cumin, and chili powder and cook, covered, until tender.</li><li onclick="handleItemClick()">If vegetables are very wet, thicken with corn flour. Add 1 cup of the cheese and ¾ cup of the red sauce. Preheat oven to 350 degrees.</li><li onclick="handleItemClick()">Fill each tortilla with ⅓ cup of vegetable mixture. Roll them up and place in a baking dish, seam-side down, close together and cover with remaining sauce. Top with remaining cheese and olives and heat until sauce bubbles.</li></ol><ol><li onclick="handleItemClick()">Saute onion and garlic in oil.</li><li onclick="handleItemClick()">Add pepper, bay leaf, oregano, cumin, chili powder, tomatoes, tomato paste and salt.</li><li onclick="handleItemClick()">Simmer for half and hour and remove bay leaf.</li></ol>' ] );
