ingredients_array.push( [ 'CostanzoRecipes_Entrees_UltimateVeggieBurgerRecipe', 'These make great do-ahead meals, and you can store shaped, ready-to-cook patties in the refrigerator for a week\'s worth of work lunches. Sprouted garbanzos are becoming more readily available, but if you can\'t find them, canned or cooked garbanzos (chickpeas) will work great. Sprouting boosts their already fantastic nutritional value even more...<ul><li onclick="handleItemClick()">2½ cups sprouted garbanzo beans (chickpeas) OR canned garbanzos, drained and rinsed</li><li onclick="handleItemClick()">4 large eggs</li><li onclick="handleItemClick()">½ teaspoon fine-grain sea salt</li><li onclick="handleItemClick()">⅓ cup chopped fresh cilantro</li><li onclick="handleItemClick()">1 onion, chopped</li><li onclick="handleItemClick()">Grated zest of one large lemon</li><li onclick="handleItemClick()">1 cup micro sprouts, chopped (try brocolli, onion, or alfalfa sprouts - optional)</li><li onclick="handleItemClick()">1 cup toasted (whole-grain) bread crumbs</li><li onclick="handleItemClick()">1 tablespoon extra-virgin olive oil (or clarified butter)</li></ul>Method:<ol><li onclick="handleItemClick()">If you are using sprouted garbanzos, steam them until just tender, about 10 minutes. Most of you will be using canned beans, so jump right in and combine the garbanzos, eggs, and salt in a food processor. Puree until the mixture is the consistency of a very thick, slightly chunky hummus. Pour into a mixing bowl and stir in the cilantro, onion, zest, and sprouts. Add the breadcrumbs, stir, and let sit for a couple of minutes so the crumbs can absorb some of the moisture. At this point, you should have a moist mixture that you can easily form into twelve 1½-inch-thick patties. I err on the moist side here, because it makes for a nicely textured burger. You can always add more bread crumbs a bit at a time to firm up the dough if need be. Conversely, a bit of water or more egg can be used to moisten the batter.</li><li onclick="handleItemClick()">Heat the oil in a heavy skillet over medium low, add 4 patties, cover, and cook for 7 to 10 minutes, until the bottoms begin to brown. Turn up the heat if there is no browning after 10 minutes. Flip the patties and cook the second side for 7 minutes, or until golden. Remove from the skillet and cool on a wire rack while you cook the remaining patties. Carefully cut each patty in half, insert your favorite fillings, and enjoy immediately.</li><li onclick="handleItemClick()">Makes 12 mini burgers.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_UltimateVeggieBurgerRecipe', '<ul><li onclick="handleItemClick()">101 Cookbooks <a href="http://www.101cookbooks.com/" target="_blank">http://www.101cookbooks.com/</a></li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_Tofubanhmisandwich', '<ul><li onclick="handleItemClick()">¼ cup tamari</li><li onclick="handleItemClick()">2 tbsp lime juice</li><li onclick="handleItemClick()">2 Tbsp (coconut) sugar</li><li onclick="handleItemClick()">2 tsp sesame oil</li><li onclick="handleItemClick()">1 garlic clove, chopped</li><li onclick="handleItemClick()">1 1-inch cube ginger, chopped</li><li onclick="handleItemClick()">1 lemongrass stalk, roughly chopped </li><li onclick="handleItemClick()">½ tsp crushed red chili flakes</li></ul><ul><li onclick="handleItemClick()">½ cup white vinegar</li><li onclick="handleItemClick()">½ cup water</li><li onclick="handleItemClick()">3 tbsp sugar</li><li onclick="handleItemClick()">1 tsp salt</li><li onclick="handleItemClick()">½ cup carrots, cut into sticks or peeled</li><li onclick="handleItemClick()">½ cup daikon, cut into sticks or peeled</li></ul><ul><li onclick="handleItemClick()">1 baguette</li><li onclick="handleItemClick()">¼ cucumber, sliced</li><li onclick="handleItemClick()">green onions</li><li onclick="handleItemClick()">(vegan) mayonnaise </li><li onclick="handleItemClick()">hoisin sauce</li><li onclick="handleItemClick()">cilantro (optional)</li><li onclick="handleItemClick()">sriracha (optional)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_Tofubanhmisandwich', '<ol><li onclick="handleItemClick()"><i class="conditional-space-after"></i>: Mix the marinade together and place the tofu in the marinade. Let sit overnight or at least 1 hour before baking. Bake tofu at 420° for 20-25 minutes until golden brown.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>: Mix the vinegar, water, sugar and salt together in a bowl. Cut the carrots and daikons into thin sticks and place in the pickling mixture overnight or for at least an hour.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>: Cut a piece of the baguette and spread some vegan mayonnaise and hoisin sauce onto the bread. Fill with the marinated tofu, pickled veggies, sliced cucumber, green onions and cilantro. Optionally add some sriracha for spice!</li><li onclick="handleItemClick()">If you like your bread warm, gently heat the banh mi in a panini press for 1-2 minutes.<span class="tip">   Try serving in <a href="https://john-costanzo.github.io/recipes-rb.html#CostanzoRecipes_Bread_VeganBurgerBuns" target="_blank">https://john-costanzo.github.io/recipes-rb.html#CostanzoRecipes_Bread_VeganBurgerBuns</a>.</span></li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_Tofubanhmisandwich', 'Favorite<ul><li onclick="handleItemClick()">From <a href="https://choosingchia.com/tofu-banh-mi-sandwich/" target="_blank">https://choosingchia.com/tofu-banh-mi-sandwich/</a></li><li onclick="handleItemClick()">date created: [2022-01-20 Thu] </li><li onclick="handleItemClick()">[2022-01-20 Thu] Made for T and me. I marinated the tofu and veggies for about 3 hours. I also cooked the tofu on convection for 25 minutes. I left the sandwiches in the panini maker for about 10 minutes and they got warm throughout. We both enjoyed these!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_ThaiRedCurrySummerSquash', 'by mlsawatzky of Sandbrook Meadow Farm<ul><li onclick="handleItemClick()">3 medium summer squash cubed</li><li onclick="handleItemClick()">1 sweet onion, sliced</li><li onclick="handleItemClick()">2 cloves of garlic sliced</li><li onclick="handleItemClick()">2 TBLSP olive oil</li><li onclick="handleItemClick()">1 - 2 TBLSP red curry paste (MASRE brand good)</li><li onclick="handleItemClick()">1 - 2 cans coconut milk (lite is good)</li><li onclick="handleItemClick()">1¼ TBLSP fish sauce</li><li onclick="handleItemClick()">1 TBLSP brown sugar</li><li onclick="handleItemClick()">Salt</li><li onclick="handleItemClick()">Sweet (Thai) Basil</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_ThaiRedCurrySummerSquash', '<ol><li onclick="handleItemClick()">Saute curry paste in olive oil 1-2 minutes to bring out flavor.  Add 1 cup coconut milk  & simmer 4 minutes.  Add onion, garlic and squash.  Cook until beginning to get tender.  Add 1½ cup coconut milk or water and fish sauce & sugar.  Add salt to taste & remove from heat and add sweet basil</li><li onclick="handleItemClick()">May use other vegetables as well</li><li onclick="handleItemClick()">From Mary Laura @ Sandbrook 11-July-2012</li></ol>' ] );
