ingredients_array.push( [ 'CostanzoRecipes_Entrees_SwissMushroomandSpinachFrittata', '<ul><li onclick="handleItemClick()">1-2 tablespoons extra virgin olive oil</li><li onclick="handleItemClick()">8 ounces button mushrooms, sliced (other mushrooms such as crimini may be substituted)</li><li onclick="handleItemClick()">1 garlic clove, minced</li><li onclick="handleItemClick()">5 cups baby spinach</li><li onclick="handleItemClick()">10 large eggs, separated</li><li onclick="handleItemClick()">1 cup half-and-half or whole milk</li><li onclick="handleItemClick()">1½ cup + ¼ cup shredded Emmi USA Kaltbach Emmentaler AOP cheese, divided</li><li onclick="handleItemClick()">1 teaspoon kosher salt</li><li onclick="handleItemClick()">½ teaspoon ground black pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_SwissMushroomandSpinachFrittata', '<ol><li onclick="handleItemClick()">Place an oven rack on the center or upper-middle shelf, then preheat oven to 400 degrees F.</li><li onclick="handleItemClick()">Heat the olive oil in a 12-inch oven-safe nonstick or cast iron skillet over medium-high heat. Use just enough oil to coat bottom of the pan; you might not need the entire amount. Add the mushrooms and cook until soft and fragrant, 3-4 minutes. Adjust the heat to medium-low and add the garlic, stirring for an additional 30-60 seconds. Add the spinach in batches, stirring as it wilts. Once all of the spinach has been wilted, remove the pan from the heat.</li><li onclick="handleItemClick()">In a large bowl, beat the egg whites to a stiff peak using an electric hand mixer or stand mixer with the whisk attachment. In a separate large bowl, whisk together the yolks, then add the half-and-half, 1½ cups cheese, salt and pepper.</li><li onclick="handleItemClick()">Gently fold the whites into the yolks using a spatula. Once evenly combined, pour the egg mixture over the vegetables. Sprinkle the remaining cheese evenly over the top.</li><li onclick="handleItemClick()">Bake for 10-13 minutes, or until the eggs have fluffed up and set with a golden top. Cut the frittata into wedges and serve.</li><li onclick="handleItemClick()">The frittata is best served fresh, but leftovers can be refrigerated in an airtight container for up to 5 days. Microwave to reheat for a quick breakfast, lunch, or dinner.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_SwissMushroomandSpinachFrittata', '<ul><li onclick="handleItemClick()">From <a href="https://www.savorysimple.net/swiss-mushroom-spinach-frittata-recipe/#wprm-recipe-container-25417" target="_blank">https://www.savorysimple.net/swiss-mushroom-spinach-frittata-recipe/#wprm-recipe-container-25417</a></li><li onclick="handleItemClick()">date created: [2020-05-31 Sun] </li><li onclick="handleItemClick()">[2020-05-31 Sun] I made a half recipe, but also threw in a half an onion, nearly caramelized. TC and I liked it!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_SweetPotatoandBlackBeanChili', '<ul><li onclick="handleItemClick()">1 tablespoon plus 2 teaspoons extra-virgin olive oil</li><li onclick="handleItemClick()">1 medium-large sweet potato, peeled and diced</li><li onclick="handleItemClick()">1 large onion, diced</li><li onclick="handleItemClick()">4 cloves garlic, minced</li><li onclick="handleItemClick()">2 tablespoons chili powder</li><li onclick="handleItemClick()">4 teaspoons ground cumin</li><li onclick="handleItemClick()">1/2 teaspoon ground chipotle chile (see Note)</li><li onclick="handleItemClick()">¼ teaspoon salt</li><li onclick="handleItemClick()">2 ½ cups water</li><li onclick="handleItemClick()">2 15-ounce cans black beans, rinsed</li><li onclick="handleItemClick()">1 14-ounce can diced tomatoes</li><li onclick="handleItemClick()">4 teaspoons lime juice</li><li onclick="handleItemClick()">½ cup chopped fresh cilantro</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_SweetPotatoandBlackBeanChili', '<ol><li onclick="handleItemClick()">Heat oil in a Dutch oven over medium-high heat.</li><li onclick="handleItemClick()">Add sweet potato and onion and cook, stirring often, until the onion is beginning to soften, about 4 minutes.</li><li onclick="handleItemClick()">Add garlic, chili powder, cumin, chipotle and salt and cook, stirring constantly, for 30 seconds.</li><li onclick="handleItemClick()">Add water and bring to a simmer.</li><li onclick="handleItemClick()">Cover, reduce heat to maintain a gentle simmer and cook until the sweet potato is tender, 10 to 12 minutes.</li><li onclick="handleItemClick()">Add beans, tomatoes and lime juice; increase heat to high and return to a simmer, stirring often.</li><li onclick="handleItemClick()">Reduce heat and simmer until slightly reduced, about 5 minutes.</li><li onclick="handleItemClick()">Remove from heat and stir in cilantro.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_SweetPotatoandBlackBeanChili', '<ul><li onclick="handleItemClick()">From <a href="https://www.eatingwell.com/recipe/250222/sweet-potato-black-bean-chili/" target="_blank">https://www.eatingwell.com/recipe/250222/sweet-potato-black-bean-chili/</a></li><li onclick="handleItemClick()">date created: [2021-09-27 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_SweetPotatoHash', '<ul><li onclick="handleItemClick()">2 medium sweet potatoes, peeled and cut into ½ inch cubes</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">1 tablespoon butter</li><li onclick="handleItemClick()">2 cups button mushrooms, sliced</li><li onclick="handleItemClick()">1 tablespoon grapeseed oil</li><li onclick="handleItemClick()">½ red onion, diced</li><li onclick="handleItemClick()">Optional: 1 Fresno chili or jalapeno, diced (remove seeds for a more mild heat)</li><li onclick="handleItemClick()">2 to 3 cloves garlic, minced</li><li onclick="handleItemClick()">1 red bell pepper, chopped</li><li onclick="handleItemClick()">Salt and pepper to taste</li><li onclick="handleItemClick()">2 tablespoons fresh cilantro, minced</li><li onclick="handleItemClick()">1 tablespoon grapeseed oil</li><li onclick="handleItemClick()">4 to 8 eggs</li><li onclick="handleItemClick()">Optional: ketchup and/ or Sriracha sauce for serving</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_SweetPotatoHash', '<ol><li onclick="handleItemClick()">To par-boil the sweet potatoes place them in a medium-sized pot and cover with water, add the ½ teaspoon of salt, stir. Bring to a boil, uncovered, and boil for 2 to 3 minutes. The potatoes should be slightly tender, but not completely cooked. A fork should go about ⅓ of the way into the potato. Once they are par-boiled immediately drain them in to a colander and rinse them in cold water to stop the cooking process. Set aside.</li><li onclick="handleItemClick()">While the sweet potatoes are coming to a boil sauté the mushrooms. Heat a large, heavy-bottomed skillet over medium-high heat. Melt the butter. Add the mushrooms and sauté them for about 10 minutes, stirring occasionally. They should be browned and tender. Remove the mushrooms into a dish and set aside.</li><li onclick="handleItemClick()">Heat the grapeseed oil in the heated skillet, add the onion and the Fresno chili or jalapeno (optional). Sauté until tender, about 3 minutes. Add the garlic and sauté for 1 minute more.</li><li onclick="handleItemClick()">Add the red bell pepper and the par-boiled sweet potatoes. Season with a healthy pinch of salt and pepper. Sauté for about 10 to 15 minutes, stirring occasionally. You will know the potatoes are done when they are fork-tender and slightly caramelized. Add the mushrooms back into the hot pan and allow to heat for 2 minutes.</li><li onclick="handleItemClick()">Remove the pan from the heat and stir in the cilantro. Taste-test and add more salt and pepper as needed. Transfer the sweet potato mixture onto a serving platter or individual plates.</li><li onclick="handleItemClick()">Return to the skillet, heat over medium-high heat. Add a tablespoon of grapeseed oil. Crack as many eggs as you plan to use into the skillet. Cover and cook for about 3 to 5 minutes, or until the egg white has set and the yolk is still runny. NOTE: you can cook your eggs any way you prefer, but I recommend eggs that have runny yolks for this recipe so that the potatoes can soak everything up.</li><li onclick="handleItemClick()">Serve the eggs over the potato hash mixture with a side of ketchup and Sriracha sauce (optional).</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_SweetPotatoHash', 'If you want to make this breakfast go even faster on the morning of then you can make the sweet potato mixture the night before, store it in the refrigerator in an airtight container and heat it up while you cook up your eggs. The sweet potato mixture reheats nicely.<ul><li onclick="handleItemClick()"><a href="https://robustrecipes.com/sweet-potato-hash-with-mushrooms/" target="_blank">https://robustrecipes.com/sweet-potato-hash-with-mushrooms/</a></li><li onclick="handleItemClick()">date created: [2019-10-29 Tue] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_SweetPotatoBlackBeanBurgers', '<ul><li onclick="handleItemClick()">1 medium sweet potato</li><li onclick="handleItemClick()">1 15-ounce can black beans, drained and rinsed</li><li onclick="handleItemClick()">¼ cup chopped onion</li><li onclick="handleItemClick()">½ cup rolled oats</li><li onclick="handleItemClick()">1 teaspoon ground cumin</li><li onclick="handleItemClick()">1 teaspoon paprika</li><li onclick="handleItemClick()">½ teaspoon onion powder</li><li onclick="handleItemClick()">½ teaspoon garlic powder</li></ul><ul><li onclick="handleItemClick()">½ cup vegan mayo</li><li onclick="handleItemClick()">1 tablespoon sriracha hot sauce</li><li onclick="handleItemClick()">pinch garlic powder</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_SweetPotatoBlackBeanBurgers', '<ol><li onclick="handleItemClick()">Preheat oven to 400°.</li><li onclick="handleItemClick()">Cut potato in half lengthwise and place on pan.</li><li onclick="handleItemClick()">Bake for 30 minutes until fork tender; remove from oven.</li><li onclick="handleItemClick()">Lower oven to 375°.</li><li onclick="handleItemClick()">When potato is cool enough to handle, peel off skin.</li><li onclick="handleItemClick()">Add flesh to large bowl and mash.</li><li onclick="handleItemClick()">Add black beans and mash lightly into potato, leaving some beans whole.</li><li onclick="handleItemClick()">Stir in onion, oats, cumin, paprika, onion powder and garlic powder.</li><li onclick="handleItemClick()">Form burgers.</li><li onclick="handleItemClick()">Lightly oil a pan.</li><li onclick="handleItemClick()">Fry 15 minutes on each side.</li><li onclick="handleItemClick()">Sever on rolls or over salad.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_SweetPotatoBlackBeanBurgers', '<ul><li onclick="handleItemClick()">From Hope Schissel</li><li onclick="handleItemClick()">date created: [2021-12-10 Fri] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_SunDriedTomatoandKalePasta', '<ul><li onclick="handleItemClick()">½ cup olive oil</li><li onclick="handleItemClick()">1 bunch tuscan kale ribs removed and roughly chopped</li><li onclick="handleItemClick()">8 cloves garlic finely minced</li><li onclick="handleItemClick()">1 teaspoon red pepper flakes</li><li onclick="handleItemClick()">1 lemon zested and juiced</li><li onclick="handleItemClick()">½ cup sun dried tomatoes the kind in oil, roughly chopped</li><li onclick="handleItemClick()">¾ cup white wine</li><li onclick="handleItemClick()">10 ounces spaghetti</li><li onclick="handleItemClick()">¾ cup shredded mozzarella</li><li onclick="handleItemClick()">kosher salt and freshly cracked black pepper to taste</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_SunDriedTomatoandKalePasta', '<ol><li onclick="handleItemClick()">Heat the olive oil over medium heat in a skillet. Once hot, add the kale, red pepper flakes and season with salt and pepper and cook until wilted.</li><li onclick="handleItemClick()">Add the garlic and sauté for 30 seconds until fragrant.</li><li onclick="handleItemClick()">Add the sun dried tomatoes, lemon zest and stir to combine.</li><li onclick="handleItemClick()">Add the white wine and cook until alcohol cooks off.</li><li onclick="handleItemClick()">Remove from the heat and stir in the lemon juice. Stir to combine, taste and adjust seasoning as needed.</li><li onclick="handleItemClick()">Cook the pasta according to the package directions. Reserve ½ cup of the pasta water.</li><li onclick="handleItemClick()">Drain and toss with sauce, reserved water, cheese and season with salt and pepper as needed.</li><li onclick="handleItemClick()">Serve immediately.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_SunDriedTomatoandKalePasta', '<ul><li onclick="handleItemClick()">From <a href="https://whatsgabycooking.com/sun-dried-tomato-and-kale-pasta/" target="_blank">https://whatsgabycooking.com/sun-dried-tomato-and-kale-pasta/</a></li><li onclick="handleItemClick()">date created: [2021-12-06 Mon] </li><li onclick="handleItemClick()">[2021-12-04 Sat] Tasty!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_SpicySpinachandCheeseCurry', '<ul><li onclick="handleItemClick()">8 cups milk</li><li onclick="handleItemClick()">¼ cup fresh lemon juice or cider vinegar</li><li onclick="handleItemClick()">6 tbsp. ghee or vegetable oil</li></ul><ul><li onclick="handleItemClick()">1" piece ginger, peeled and chopped</li><li onclick="handleItemClick()">3-4 cloves garlic; peeled and chopped</li><li onclick="handleItemClick()">1 serrano chile, stemmed and chopped</li><li onclick="handleItemClick()">4 bunches spinach, washed, trimmed and finely chopped (about 6 cups)</li><li onclick="handleItemClick()">salt</li><li onclick="handleItemClick()">½ tsp. garam masala</li><li onclick="handleItemClick()">1-2 pinches cayenne</li><li onclick="handleItemClick()">6 tbsp. heavy cream</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_SpicySpinachandCheeseCurry', '<ol><li onclick="handleItemClick()">Line a colander with 4 layers of cheesecloth, draping it over the sides and set a colander aside in the thie sink.</li><li onclick="handleItemClick()">Put the milk into a large saucepan and bring just to a boil over medium-high heat, stirring often with a wooden spoon to prevent it from scorching, about 15 minutes.</li><li onclick="handleItemClick()">Reduce heat to medium-low, add lemon juice and very slowly and gently stir until large curds form, about 30 seconds.</li><li onclick="handleItemClick()">Carefully pour milk mixture into colander and gently rinse off under cold running water and any foam and residual lemon juice from curds.</li><li onclick="handleItemClick()">Gather corners of cheesecloth together and gently squeeze out liquid.</li><li onclick="handleItemClick()">Tip opposite corners of cheesecloth together to make a sack and hang it from a large kitchen spoon suspended over a deep bowl.</li><li onclick="handleItemClick()">Set drained from cheese, about 1½ hours.</li><li onclick="handleItemClick()">Transfer sack to a large plate, untie cheesecloth and loosely drape corners over cheese.</li><li onclick="handleItemClick()">Place a large heavy pot on top of cheese, then set aside for 30 minutes to compress cheese.</li><li onclick="handleItemClick()">Remove pot and unwrap cheese.</li><li onclick="handleItemClick()">Cut cheese into ½" x 1" pieces.</li><li onclick="handleItemClick()">Heat ghee in a large nonstick skillet over medium heat.</li><li onclick="handleItemClick()">Add cheese and fry until golden all over, 4-6 minutes.</li><li onclick="handleItemClick()">Transfer cheese with a slotted spatula to a plate and set aside</li></ol><ol><li onclick="handleItemClick()">Put ginger, garlic, chiles and ¼ cup water into a blender and purée to a smooth paste.</li><li onclick="handleItemClick()">Return skillet with ghee to stove and heat over medium-high heat.</li><li onclick="handleItemClick()">Add ginger-garlic paste and cook, stirring with a wooden spoon, for 30 seconds.</li><li onclick="handleItemClick()">Add spinach, season to taste with salt and cook, stirring often, until spinach wilts, about 1 minute.</li><li onclick="handleItemClick()">Reduce heat to medium-low, cover an cook, stirring often, until spinach is very soft, 10-15 minutes.</li><li onclick="handleItemClick()">Stir in garam masala, cayenne to taste and cream.</li><li onclick="handleItemClick()">Add fried cheese to skillet, cover and continue cooking until liquid thickens and spinach is silks soft, about 15 minutes more.</li><li onclick="handleItemClick()">Serve with warm Indian flat bread, if desired.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_SpicySpinachandCheeseCurry', '<ul><li onclick="handleItemClick()">From <i class="conditional-space-after"></i>No. 59, page 36</li><li onclick="handleItemClick()">Date created: [2021-03-15 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_SpicyBlackBeanCakes', '<ul><li onclick="handleItemClick()">* ½ cup reduced fat sour cream</li><li onclick="handleItemClick()">* 2 teaspoons fresh lime juice</li><li onclick="handleItemClick()">* 1 small fresh jalapeno pepper, minced</li><li onclick="handleItemClick()">* salt to taste</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_SpicyBlackBeanCakes', '<ul><li onclick="handleItemClick()">Combine all ingredients.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_SpicyBlackBeanCakes', '<ul><li onclick="handleItemClick()">¼ cup quinoa, dry</li><li onclick="handleItemClick()">2 (14.5 ounce) cans black beans, drained and rinsed</li><li onclick="handleItemClick()">2 tbsp olive oil</li><li onclick="handleItemClick()">6 cloves garlic, pressed</li><li onclick="handleItemClick()">2 fresh jalapeno peppers, finely diced and/or</li><li onclick="handleItemClick()">1 chipotle jalapeno peppers, in adobo sauce</li><li onclick="handleItemClick()">1 tablespoon ground cumin</li><li onclick="handleItemClick()">1 tablespoon chili pepper</li><li onclick="handleItemClick()">salt and black pepper to taste</li><li onclick="handleItemClick()">1 egg, lightly beaten</li><li onclick="handleItemClick()">½ cup plain dried bread crumbs (optional)</li><li onclick="handleItemClick()">½ cup corn kernels (optional)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_SpicyBlackBeanCakes', '<ol><li onclick="handleItemClick()">To prepare lime sour cream, mix the sour cream, lime juice, 1 small minced jalapeno, and salt together in a small bowl. Cover, and refrigerate.</li><li onclick="handleItemClick()">Preheat oven to 375 degrees.</li><li onclick="handleItemClick()">Cook the quinoa per instructions on package.  (Toast quinoa first, rinse then simmer ¼ cup quinoa in ½ cup boiling water.) This will take about 10-15 minutes.</li><li onclick="handleItemClick()">Puree black beans with olive oil, garlic, peppers and spices in a food processor.</li><li onclick="handleItemClick()">Whisk egg in a medium-sized bowl.</li><li onclick="handleItemClick()">Add black bean puree, cooked quinoa and bread crumbs (if using) to egg bowl and mix until fully combined into a batter.</li><li onclick="handleItemClick()">Place 6 cupcake papers on a baking sheet.  Divide black bean cake batter among the 6 cups, and bake for about 15 to 20 minutes.</li><li onclick="handleItemClick()">Allow black bean cakes to cool for a few minutes.  Remove from papers.  Serve over a bed of spinach with fresh salsa and grated cheese. Or over polenta or mashed potatoes.</li><li onclick="handleItemClick()">Serve with lime sour cream.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_SpicyBlackBeanCakes', '<ul><li onclick="handleItemClick()">January 2011; inspired by </li><li onclick="handleItemClick()"><a href="http://www.myplateisfullblog.com/2010/03/26/quinoa-black-bean-cakes/" target="_blank">http://www.myplateisfullblog.com/2010/03/26/quinoa-black-bean-cakes/</a>and <a href="http://allrecipes.com//Recipe/spicy-black-bean-cakes/Detail.aspx" target="_blank">http://allrecipes.com//Recipe/spicy-black-bean-cakes/Detail.aspx</a></li><li onclick="handleItemClick()">date created: [2011-01-30 Sun] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_SouthwesternQuicheWithPotatoCrust', '<ul><li onclick="handleItemClick()">6 large eggs</li><li onclick="handleItemClick()">1 tsp. salt</li><li onclick="handleItemClick()">1.5 cups frozen shredded hash brown potatoes, thawed</li><li onclick="handleItemClick()">½ medium red bell pepper, diced</li><li onclick="handleItemClick()">½ cup fresh or frozen corn kernels, thawed if frozen</li><li onclick="handleItemClick()">2 green onions (white and green parts), thinly sliced</li><li onclick="handleItemClick()">2 tbsp. chopped fresh cilantro</li><li onclick="handleItemClick()">¾ cup shredded or crumbled Cheddar cheese</li><li onclick="handleItemClick()">½ cup low-fat milk</li><li onclick="handleItemClick()">2 chipotle chiles in adobo sauce, w/ 2 tsp. sauce reserved</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_SouthwesternQuicheWithPotatoCrust', '<ol><li onclick="handleItemClick()">Preheat oven to 375 degrees F. Coat the pie dish with cooking spray. Whisk together 1 egg and ¼ tsp. salt in a medium bowl. Stir in shredded hash browns. Press the potato mixture into the bottom and sides of the pie dish to form crust. Bake for 15 minutes, or until lightly browned.</li><li onclick="handleItemClick()">Sprinkle the bell pepper, corn, green onions, cilantro, and cheese over the potato crust.</li><li onclick="handleItemClick()">In a blender, mix together the remaining eggs, milk, ¾ tsp. salt, chiles and adobo sauce. Pour mixture over vegetables in pie dish. Bake 20 to 25 minutes, or until knife inserted in center comes out clean. Let stand 5 minutes before serving.</li><li onclick="handleItemClick()">Serves 6.</li><li onclick="handleItemClick()">I served the quiche topped with avocado slices and good store-bought salsa (I had Mrs. Renfro\'s Black Bean Salsa on hand). It was quite tasty, and everyone wanted seconds. I\'ll make this again, but I think next time I\'ll serve it with some black beans or a salad on the side, to add some fiber, and maybe add a third chipotle pepper (love the smokey flavor they add). Adapted from January 2007 Vegetarian Times recipe.</li></ol>' ] );
