ingredients_array.push( [ 'CostanzoRecipes_Entrees_SourdoughPasta', '<ul><li onclick="handleItemClick()">½ cup (138 g) sourdough starter, discard or fed</li><li onclick="handleItemClick()">1½ cups (180 g) all-purpose flour</li><li onclick="handleItemClick()">2 large eggs</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_SourdoughPasta', '<ol><li onclick="handleItemClick()">Pour all the ingredients into the bowl of a stand mixer with a dough hook attachment and mix on low until it forms a ball.</li><li onclick="handleItemClick()">Cover the dough in plastic and rest the dough for 30 minutes (up to overnight).</li><li onclick="handleItemClick()">When ready to make the pasta, set the dough onto a floured surface and roll out with a rolling pin to get it as thin as possible (15-20 minutes).</li><li onclick="handleItemClick()">Slice noodles to your desired thickness.</li><li onclick="handleItemClick()">Drop noodles into boiling water for 3-5 minutes.</li><li onclick="handleItemClick()">Drain and serve.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_SourdoughPasta', '<ul><li onclick="handleItemClick()">From <a href="https://iamhomesteader.com/sourdough-pasta/#wprm-recipe-container-65130" target="_blank">https://iamhomesteader.com/sourdough-pasta/#wprm-recipe-container-65130</a></li><li onclick="handleItemClick()">date created: [2022-12-31 Sat] </li><li onclick="handleItemClick()">[2022-12-31 Sat] I was worried that the dough was very sticky, but it was well-behaved in the pasta machine. The noodles were soft and tasty, reminiscent of egg noodles.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_SmokyGreensandBeans', 'Prep Time: 30 minTotal Time: 30 min<ul><li onclick="handleItemClick()">2 tablespoons olive oil</li><li onclick="handleItemClick()">1 large onion, chopped</li><li onclick="handleItemClick()">2 garlic cloves, chopped</li><li onclick="handleItemClick()">1 14½-ounce can diced tomatoes in juice</li><li onclick="handleItemClick()">1½ teaspoons smoked paprika</li><li onclick="handleItemClick()">1 14½-ounce can vegetable broth</li><li onclick="handleItemClick()">8 cups coarsely chopped assorted greens (such as kale, mustard greens, and collard greens about 8 ounces)</li><li onclick="handleItemClick()">1 15-ounce can cannellini (white kidney beans), drained</li><li onclick="handleItemClick()">Grated Manchego or Parmesan cheese (optional)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_SmokyGreensandBeans', '<ol><li onclick="handleItemClick()">Heat oil in heavy large pot over medium-high heat.</li><li onclick="handleItemClick()">Add onion and sauté until soft and beginning to brown, about 6 minutes.</li><li onclick="handleItemClick()">Add garlic; stir 1 minute.</li><li onclick="handleItemClick()">Add tomatoes with juice and paprika; stir 1 minute.</li><li onclick="handleItemClick()">Add broth and greens; bring to boil, stirring often.</li><li onclick="handleItemClick()">Reduce heat to medium-low, cover, and simmer until greens are wilted and tender, stirring occasionally, about 15 minutes.</li><li onclick="handleItemClick()">Stir in beans and simmer 1 minute to heat through.</li><li onclick="handleItemClick()">Divide among bowls; sprinkle with cheese, if desired.</li></ol>' ] );
