ingredients_array.push( [ 'CostanzoRecipes_Entrees_RoastedEggplantCrispGarlicandBasilPasta', '<ul><li onclick="handleItemClick()">8 medium baby japanese eggplant (or 1 Globe eggplant) ends trimmed</li><li onclick="handleItemClick()">6 tablespoons olive oil divided plus more for garnish</li><li onclick="handleItemClick()">4 sprigs fresh thyme (or oregano) leaves stripped</li><li onclick="handleItemClick()">kosher salt and freshly ground black pepper</li><li onclick="handleItemClick()">6 medium garlic cloves thinly sliced</li><li onclick="handleItemClick()">1 (14-ounce) can tomato puree</li><li onclick="handleItemClick()">1 tablespoon balsamic or sherry vinegar</li><li onclick="handleItemClick()">1 teaspoon unrefined cane sugar (optional)</li><li onclick="handleItemClick()">12 ounces spaghetti</li><li onclick="handleItemClick()">3 ounces feta or goat cheese crumbled</li><li onclick="handleItemClick()">1 handful fresh basil leaves thinly sliced</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_RoastedEggplantCrispGarlicandBasilPasta', '<ol><li onclick="handleItemClick()">Heat oven to 450 degreesF and arrange a rack in the middle. Slice baby eggplant lengthwse or cut larger eggplant into 1-inch cubes then combine with half of the olive oil and the thyme or oregano. Season with salt and freshly ground black pepper and toss to combine. Spread on a silicone baking mat or foil-lined baking sheet in one even layer and roast, stirring a few times, until soft and golden brown, about 20 to 30 minutes.</li><li onclick="handleItemClick()">Meanwhile,  bring a large pot of heavily salted water to a boil over high heat.</li><li onclick="handleItemClick()">In a large frying pan, heat the remaining oil over medium-high heat. When it shimmers, add garlic and cook until garlic is crisp, golden brown, and fragrant. Remove garlic to a paper towel-lined plate and set aside.</li><li onclick="handleItemClick()">Return pan with olive oil to the stove over medium heat and add the tomatoes and vinegar, sugar, season with salt, reduce heat to medium-low, and simmer, stirring occasionally, until slightly thickened, about 10 minutes</li><li onclick="handleItemClick()">Meanwhile, when the water boils, cook pasta according to package directions. Reserve 1 cup of pasta water and drain pasta. Set aside.</li><li onclick="handleItemClick()">Add eggplant to pasta sauce and simmer until heated through. Taste, and, add more vinegar if the sauce is sweet, or, as needed, add sugar to make the sauce sweeter.</li><li onclick="handleItemClick()">Add reserved pasta to pasta sauce and stir to coat. Add ¼ cup of the reserved pasta water and stir until each piece of pasta is just coated with the sauce. Add additional pasta water as needed to help the sauce coat the pasta. Remove from heat, top with cheese, basil, and crisp garlic and season with additional salt and pepper, as desired. Finish pasta with a drizzle of additional olive oil and serve.</li></ol>' ] );
