methods_array.push( [ 'CostanzoRecipes_Entrees_PizzaNewYorkstylev20', '<ul><li onclick="handleItemClick()">Mix ingredients.</li><li onclick="handleItemClick()">Adding flour as necessary</li><li onclick="handleItemClick()">Knead until window pane thin, perhaps for 10 minutes.</li><li onclick="handleItemClick()">Refrigerate for at least 24 hours.</li><li onclick="handleItemClick()"></li></ul>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_PizzaNewYorkstylev20', '<ul><li onclick="handleItemClick()">From <a href="https://www.youtube.com/watch?v=SDpCzJw2xm4" target="_blank">https://www.youtube.com/watch?v=SDpCzJw2xm4</a></li><li onclick="handleItemClick()">date created: [2020-06-27 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_PizzaCheesyPan', '<ul><li onclick="handleItemClick()">240 grams (1¾ cups plus 2 tablespoons) all-purpose flour<ul><li onclick="handleItemClick()">or swap in ½ cup (80 grams) corn meal to 160 grams flour</li></ul></li><li onclick="handleItemClick()">180 milliliters (¾ cup) lukewarm water</li><li onclick="handleItemClick()">1 tablespoon olive oil</li><li onclick="handleItemClick()">¾ teaspoon kosher salt</li><li onclick="handleItemClick()">½ teaspoon instant or active dry yeast</li></ul><ul><li onclick="handleItemClick()">1½ tablespoons olive oil</li><li onclick="handleItemClick()">6 ounces mozzarella, grated (about 1¼ loosely packed cups)</li><li onclick="handleItemClick()">120 grams (½ cup) tomato sauce or pizza sauce</li><li onclick="handleItemClick()">Freshly grated hard cheese, such as Parmesan or pecorino, for garnish (optional)</li><li onclick="handleItemClick()">Fresh herbs, such as basil, marjoram or oregano, for garnish (optional)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_PizzaCheesyPan', '<ol><li onclick="handleItemClick()">Prepare the dough: Measure the flour, water, olive oil, salt and yeast into a large mixing bowl. Mix together with your hand or a dough scraper until it forms a shaggy, sticky ball with no dry patches. Cover the bowl using a damp towel or plastic wrap, and let the dough rest for 5 minutes.</li><li onclick="handleItemClick()">Wet your hand, and reach down between the side of the bowl and the dough, as though you were going to lift the dough out, but instead of lifting, stretch the bottom of the dough up, and fold it over the top. Repeat three more times, turning the bowl 90 degrees each time. Cover the bowl again for 5 minutes, then repeat the folding-and-resting process three more times. After the fourth time, cover the bowl, and let the dough rest, undisturbed, for 40 minutes, then transfer the bowl to the fridge for at least 12 hours or up to 72 hours.</li><li onclick="handleItemClick()">About 3 hours before you want to eat the pizza, get ready for assembly: Pour the olive oil into a well-seasoned 9- or 10-inch cast-iron skillet, and use your fingers to coat the inside of the pan, including the sides. Transfer the dough to the pan, and turn it once to coat both sides with the oil. After coating the dough in oil, press the dough to the edges of the pan, dimpling it with your fingertips. If the dough shrinks back, cover it and let it rest for about 15 minutes, then repeat the pressing and dimpling. At this point, you should be able to smush the dough out and into the edges of the pan, but if not, give it one more 15-minute rest before trying again. Cover the dough, and let it rise for 2 hours at room temperature. It will look soft and jiggle when you gently shake the pan.</li><li onclick="handleItemClick()">Place one rack at the bottom of the oven and one toward the top (about 4 to 5 inches from the top heating element), then heat the oven to 450°. When you’re ready to bake the pizza, sprinkle a scant 1 cup mozzarella evenly over the crust. Cover the entire dough so none is showing, then dollop small spoonfuls of the sauce over the cheese. Sprinkle the remaining mozzarella on top, and bake on the bottom rack of the oven for 18 to 20 minutes, until the cheese is bubbling and the bottom and edges of the crust are a rich golden brown. (Use a spatula to check the bottom.) If the bottom is brown but the top still seems pale, transfer the pizza to the top rack, and bake for 2 to 4 minutes longer. On the other hand, if the top seems fine but the bottom’s not browned to your liking, leave the pizza on the bottom rack for another 2 to 4 minutes.</li><li onclick="handleItemClick()">Remove the pizza from the oven, and place the pan on a heatproof surface. Carefully run a table knife or spatula between the edge of the pizza and side of the pan to prevent the cheese from sticking as it cools. Let the pizza cool very briefly; as soon as you feel comfortable doing so, carefully transfer it from the pan to a cooling rack or cutting surface. If garnishing with hard cheese and herbs, add those now. Serve the pizza anywhere from medium-hot to warm, and use kitchen shears or a large pair of scissors to cut it into wedges.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_PizzaCheesyPan', '<ul><li onclick="handleItemClick()">From <a href="https://cooking.nytimes.com/recipes/1021193-cheesy-pan-pizza" target="_blank">https://cooking.nytimes.com/recipes/1021193-cheesy-pan-pizza</a></li><li onclick="handleItemClick()">date created: [2020-06-27 Sat] </li><li onclick="handleItemClick()">Instead of using a wet hand, I used a dough scraper.</li><li onclick="handleItemClick()">[2020-06-27 Sat] Made for T, Ken, Amy. "A light crust that is greasy and crispy and buttery goodness" - TC</li><li onclick="handleItemClick()">[2020-12-02 Wed] Made for T, Larry and Jan. It was good once again, but I didn\'t bake it for as long as I should have and T thought it could have been a bit crispier.</li><li onclick="handleItemClick()">[2022-02-21 Mon] Made for Pat, Sharon, Greg, MaryAnn and T. Doubled recipe and used large Chicago-style pan.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_PizzaCrustSourdoughKingArthur', '<ul><li onclick="handleItemClick()">1 cup (241g) sourdough starter, unfed/discard</li><li onclick="handleItemClick()">½ cup (113g) warm water</li><li onclick="handleItemClick()">2½ cups (298g) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">½ teaspoon instant or active dry yeast</li><li onclick="handleItemClick()">4 teaspoons Pizza Dough Flavor, optional but delicious</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_PizzaCrustSourdoughKingArthur', '<ol><li onclick="handleItemClick()">Stir any liquid on top of your refrigerated starter back into it before measuring 1 cup (241g) into a large mixing bowl. <i class="conditional-space-after"></i></li><li onclick="handleItemClick()">Add the warm water, flour, salt, yeast, and Pizza Dough Flavor (if using). Mix to combine, then knead for about 7 minutes in a mixer with the dough hook, until the dough wraps itself around the hook and cleans the side of the bowl.</li><li onclick="handleItemClick()">Place the dough in a greased container, cover and let rise until almost doubled in bulk. Depending on the vitality of your starter, this will take between 2 and 4 hours. For a faster rise, place the dough in a warm spot, or double the yeast.</li><li onclick="handleItemClick()">For two thin-crust pizzas, divide the dough in half, and shape each into a flattened disk. Drizzle two 12" round pizza pans with olive oil, and brush to coat the bottom. Place the dough in the pans, cover, and let rest for 15 minutes. After this rest, gently press the dough toward the edges of the pans. If it starts to shrink back, cover and let rest for 15 minutes before continuing.</li><li onclick="handleItemClick()">For a thicker, large pizza, oil a 14" round pizza pan (an 18" x 13" halfsheet pan will also work). Place the dough in the selected pan and press it out to the edges, again giving it a 15-minute rest before continuing if it starts to snap back.</li><li onclick="handleItemClick()">Cover the pan(s) and let the dough rise until it\'s as thick as you like.</li><li onclick="handleItemClick()">Towards the end of the rise time, preheat your oven to 450°F.</li><li onclick="handleItemClick()">Sauce and top as you like, but don\'t add cheese yet. Bake thin-crust pizzas for 5 minutes before removing from the oven and adding cheese. For thick-crust pizza, bake for 10 minutes before removing from the oven and adding cheese. Return to the oven and bake for 5 to 7 more minutes, until the cheese is melted.</li><li onclick="handleItemClick()">Store leftover pizza covered in the refrigerator for up to 5 days.</li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_PizzaCrustSourdoughKingArthur', '<ul><li onclick="handleItemClick()">1 can (28 ounces) Italian plum tomatoes - buy the best you can find</li><li onclick="handleItemClick()">2 Tbl. tomato paste</li><li onclick="handleItemClick()">1 or 2 garlic cloves, minced or pressed</li><li onclick="handleItemClick()">1 tsp. dried oregano</li><li onclick="handleItemClick()">Salt and freshly ground black pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_PizzaCrustSourdoughKingArthur', '<ol><li onclick="handleItemClick()">Crush the tomatoes with your hands or a fork and place in a heavy saucepan over medium heat. Stir in the tomato paste, garlic, oregano and salt and pepper to taste. Bring the mixture just to a boil, then reduce the heat to low and simmer the sauce, stirring occasionally, until thick and flavorful, 30 minutes to 1 hour. Remove from the heat. (This may be stored in the refrigerator for up to 1 week or frozen up to 4 months)</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Entrees_PizzaCrustSourdoughKingArthur', 'One 14" round, or large rectangular thick-crust pizza; or two 12" round thin-crust pizzas.' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_PizzaCrustSourdoughKingArthur', '<ul><li onclick="handleItemClick()">created [2019-12-12 Thu] </li><li onclick="handleItemClick()"><a href="https://www.kingarthurflour.com/recipes/sourdough-pizza-crust-recipe" target="_blank">https://www.kingarthurflour.com/recipes/sourdough-pizza-crust-recipe</a></li><li onclick="handleItemClick()">[2019-12-15 Sun] Made one pie from this. The dough handled really well and had a nice flavor. But it should have been thinner. Also, the cheese (fresh mozerella) didn\'t brown. Try parbaking the crust for a shorter time. </li><li onclick="handleItemClick()">[2020-02-09 Sun] Made one mushroom pie. Preheated oven with the pizza stone to 550 degrees for an hour and left it there. Fully assembled pie and baked for ~8(?) minutes. Nice browning; not crispy but good. T said it was probably the best I ever did.</li><li onclick="handleItemClick()">[2020-03-11 Wed] Made one mushroom pie. Preheated oven with the pizza stone to 550 degrees for > an hour and left it there. Fully assembled pie and baked for 3 minutes, then rotated the pie and baked for another 3 minutes. Then I turned broil on for a couple of minutes. Nice browning and crispy. T said it was probably the <i class="conditional-space-after"></i>best I ever did (I thought it was the best).</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_PizzaCrustSourdoughAlexandra', '<ul><li onclick="handleItemClick()">100g sourdough starter, active and bubbly</li><li onclick="handleItemClick()">375g water</li><li onclick="handleItemClick()">10g salt</li><li onclick="handleItemClick()">500g all-purpose or bread flour</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_PizzaCrustSourdoughAlexandra', '<ol><li onclick="handleItemClick()">Combine 15g of starter with 15g of flour and 15g of water in a bowl. Stir, cover and set aside at room temperature for ~12 hours.</li><li onclick="handleItemClick()">Add to the 45g from step 45g of flour and 45g of water. Stir, cover and set aside at room temperature for ~12 hours.</li><li onclick="handleItemClick()">Combine 375g water, 100g sourdough starter and 10g salt in a large bowl. Stir with a spatula to combine — it doesn’t have to be uniformly mixed. Add the 500g flour. Mix again until the flour is completely incorporated. Transfer to a straight-sided vessel (if you have one.) Cover vessel with tea towel or cloth bowl cover and let stand 30 minutes.</li><li onclick="handleItemClick()">After 30 minutes have passed, reach into the vessel and pull the dough up and into the center.<ul><li onclick="handleItemClick()">Turn the vessel quarter turns and continue this pulling 8 to 10 times.</li><li onclick="handleItemClick()">Let the dough rest for another 30 minutes; then repeat the stretching and folding.</li><li onclick="handleItemClick()">If possible, repeat this cycle twice more for a total of 4 stretch and folds.</li><li onclick="handleItemClick()">By the 4th cycle, you will notice a huge difference in the texture of the dough: it will be smoother, stronger, and more elastic.</li></ul></li><li onclick="handleItemClick()">Cover vessel with a tea towel or bowl cover and set aside to rise at room temperature (70°F/21°C) for 4 to 18 hours (the time will vary depending on the time of year, the strength of your starter, and the temperature of your kitchen) or until the dough has roughly doubled in volume.<span class="note">   The  Tupperware "What-a-bowl" weighs 359 grams.</span></li><li onclick="handleItemClick()">Turn the dough out onto a work surface and shape into a rough ball, using as much flour as needed — the dough will be sticky. Using a bench scraper, divide the dough into 2 equal portions. Sprinkle portions with flour. With floured hands, roll each portion into a ball, using the pinkie-edges of your hands to pinch the dough underneath each ball. Transfer each round of dough to a plastic quart container, cover, and store in fridge for at least 6 hours or up to 3 days or transfer to the freezer.</li><li onclick="handleItemClick()">Pull out a round (or more) of dough from the fridge one hour before you plan on baking. Dust dough with flour and place on a floured work surface. Let sit untouched for about an hour (a little longer or shorter is fine).</li><li onclick="handleItemClick()">Place a Baking Steel or pizza stone in the top third of your oven. Set oven to 550ºF. Heat oven for at least 45 minutes but ideally 1 hour prior to baking.</li><li onclick="handleItemClick()">Gently shape dough into a roughly 10-inch round handling it as minimally as possible. Lay a sheet of parchment paper on top of a pizza peel. Transfer the dough round to the parchment-lined peel.</li><li onclick="handleItemClick()">To make a classic Margherita-style pizza: Spread 4 tablespoons of tomato sauce over the surface of the dough. Top with mozzarella to taste. Sprinkle with parmesan to taste. Drizzle with olive oil. Sprinkle lightly with sea salt.</li><li onclick="handleItemClick()">Shimmy the pizza, parchment paper and all into the oven. Bake pizza until top is blistered, about 5-6 minutes.</li><li onclick="handleItemClick()">Transfer to cutting board.</li><li onclick="handleItemClick()">Sprinkle with basil, if you have it.</li><li onclick="handleItemClick()">Cut and serve. Discard parchment paper.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_PizzaCrustSourdoughAlexandra', 'Favorite<ul><li onclick="handleItemClick()">From <a href="https://alexandracooks.com/2020/05/01/simple-sourdough-pizza-a-step-by-step-guide/" target="_blank">https://alexandracooks.com/2020/05/01/simple-sourdough-pizza-a-step-by-step-guide/</a></li><li onclick="handleItemClick()">date created: [2021-03-13 Sat] </li><li onclick="handleItemClick()">75% hydration crust</li><li onclick="handleItemClick()">[2021-02-27 Sat] Made several times. Step 4 is very forgiving. I used a dough scraper to stretch the dough, several times throughout the day and irregular intervals. Cook time on an oven that would only go to 500° using a pizza stone is 10-12 minutes.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_PineappleSweetandSourTofu', '<ul><li onclick="handleItemClick()">½ cup vegetable broth</li><li onclick="handleItemClick()">¼ cup apple cider vinegar</li><li onclick="handleItemClick()">¼ cup agave or maple syrup</li><li onclick="handleItemClick()">1 cup diced fresh pineapple</li><li onclick="handleItemClick()">1 cup diced red bell pepper</li><li onclick="handleItemClick()">1 tablespoons soy sauce or tamari</li><li onclick="handleItemClick()">1 teaspoon Frank\'s, Sambal oelek or sriracha, optional</li><li onclick="handleItemClick()">3 garlic cloves, minced</li><li onclick="handleItemClick()">2 tablespoons cold water</li><li onclick="handleItemClick()">1 tablespoon cornstarch</li><li onclick="handleItemClick()">1 tablespoon vegetable oil</li><li onclick="handleItemClick()">1 pound extra firm tofu, drained, pressed at least 15 minutes and cut into ½ inch cubes</li><li onclick="handleItemClick()">¼ cup roasted cashews, coarsely chopped</li><li onclick="handleItemClick()">2 scallions, chopped</li><li onclick="handleItemClick()">Cooked rice, for serving</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_PineappleSweetandSourTofu', '<ol><li onclick="handleItemClick()">Stir the vegetable broth, cider vinegar, agave or maple syrup, pineapple, bell pepper, soy sauce or tamari, chili paste or sriracha and garlic together in small saucepan and place over medium heat. </li><li onclick="handleItemClick()">Bring the mixture to a simmer. Lower the heat and simmer for 15 minutes, stirring occasionally.</li><li onclick="handleItemClick()">While sauce simmers, whisk the cold water and cornstarch together in small bowl. Set it aside.</li><li onclick="handleItemClick()">About halfway through sauce\'s cooking time, prepare the tofu. Coat large a skillet with oil and place it over medium-high heat. </li><li onclick="handleItemClick()">Arrange the tofu cubes in a single layer in the skillet. Cook for about 10 minutes, flipping 2-3 times during cooking to ensure browning on multiple sides.</li><li onclick="handleItemClick()">Once the simmer time for the sauce is up, stir in the cornstarch mixture. Allow it to simmer for another minute or two, until it thickens up.</li><li onclick="handleItemClick()">Pour the sauce and pineapple mixture over the tofu. Stir to coat the tofu and remove the skillet from heat.</li><li onclick="handleItemClick()">Serve with rice and top with cashews and scallions.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_PineappleSweetandSourTofu', '<ul><li onclick="handleItemClick()">From <a href="https://www.connoisseurusveg.com/pineapple-sweet-sour-tofu/" target="_blank">https://www.connoisseurusveg.com/pineapple-sweet-sour-tofu/</a></li><li onclick="handleItemClick()">date created: [2020-11-18 Wed] </li><li onclick="handleItemClick()">[2020-11-18 Wed] Yummy!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_PastaQuillswithCheesyAubergineEggplantSauce', 'Serves 6<ul><li onclick="handleItemClick()">1¼ lb. eggplant, cut into ½ in cubes</li><li onclick="handleItemClick()">salt & pepper</li><li onclick="handleItemClick()">3 tbsp. olive oil</li><li onclick="handleItemClick()">½ oz. butter or margarine</li><li onclick="handleItemClick()">1 garlic clove, chopped</li><li onclick="handleItemClick()">16 fl. oz canned chopped tomatoes</li><li onclick="handleItemClick()">12 oz. pasta quills (penne)</li><li onclick="handleItemClick()">4 oz. firm goat cheese, cubed</li><li onclick="handleItemClick()">3 tbsp. shredded fresh basil or 1 tsp. dried basil</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_PastaQuillswithCheesyAubergineEggplantSauce', '<ol><li onclick="handleItemClick()">Put the eggplant cubes in a large colander and sprinkle them lightly with salt. Let drain at least 30 minutes.</li><li onclick="handleItemClick()">Rinse the eggplant under cold water and drain well. Dry on kitchen paper.</li><li onclick="handleItemClick()">Heat the oil and butter in a large saucepan. Add the eggplant and fry until just golden on all sides, stirring frequently.</li><li onclick="handleItemClick()">Stir in the garlic and tomatoes. Simmer until thickened, about 15 minutes. Season with salt & pepper.</li><li onclick="handleItemClick()">Cook the penne in a large pan of boiling salted water until just tender (check packet instructions for timing). Drain well and transfer to a warmed serving bowl.</li><li onclick="handleItemClick()">Add the eggplant sauce, goat cheese and basil to the pasta and toss well together. Serve immediately.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_PastaQuillswithCheesyAubergineEggplantSauce', '<ul><li onclick="handleItemClick()">Marsha Montgomery 10 June 2003</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_PastaMilanese', '<ul><li onclick="handleItemClick()">¼ cup extra-virgin olive oil</li><li onclick="handleItemClick()">4 anchovy fillets, minced, <i class="conditional-space-after"></i></li><li onclick="handleItemClick()">1 yellow onion, finely diced</li><li onclick="handleItemClick()">1 bulb fennel, finely diced</li><li onclick="handleItemClick()">6 cloves garlic, minced</li><li onclick="handleItemClick()">1 teaspoon toasted ground fennel seed</li><li onclick="handleItemClick()">1 teaspoon red pepper flakes</li><li onclick="handleItemClick()">1 teaspoon freshly ground black pepper</li><li onclick="handleItemClick()">¼ cup white wine</li><li onclick="handleItemClick()">1 (28-ounce) can whole peeled San Marzano tomatoes</li><li onclick="handleItemClick()">1 pound bucatini or spaghetti</li><li onclick="handleItemClick()">1 cup toasted breadcrumbs</li><li onclick="handleItemClick()">Sea salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_PastaMilanese', '<ol><li onclick="handleItemClick()">Heat olive oil in a large skillet over medium heat. Add anchovies and cook until lightly browned, 1 minute.</li><li onclick="handleItemClick()">Add onions, fennel and garlic, and sweat until lightly golden, about 10 minutes.</li><li onclick="handleItemClick()">Add fennel seed, black pepper, red pepper flakes and a few pinches of salt. Cook until fragrant, 1 minute.</li><li onclick="handleItemClick()">Deglaze pan with white wine, scraping up any browned bits from the bottom, and cook until liquid reduces by one third, 3-5 minutes.</li><li onclick="handleItemClick()">Either crush tomatoes by hand or pass through a food mill, and add to pot. Simmer sauce, stirring often, until thickened, 45 minutes. Taste and add salt as needed.</li><li onclick="handleItemClick()">As sauce finishes cooking, boil pasta according to package instructions until al dente. Drain pasta and toss with sauce. Finish pasta with a sprinkle of toasted Italian breadcrumbs and serve.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_PastaMilanese', '<ul><li onclick="handleItemClick()">From <a href="https://www.wsj.com/articles/pasta-milanese-11615472510?mod=searchresults_pos1&page=1" target="_blank">https://www.wsj.com/articles/pasta-milanese-11615472510?mod=searchresults_pos1&page=1</a></li><li onclick="handleItemClick()">date created: [2021-03-19 Fri] </li><li onclick="handleItemClick()">[2021-03-18 Thu] Made for T; we\'d definitely get this in a restaurant.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_PastaAllaNorma', '<ul><li onclick="handleItemClick()">1½ pounds eggplant</li><li onclick="handleItemClick()">Olive oil as needed (at least ½ cup)</li><li onclick="handleItemClick()">Salt and pepper</li><li onclick="handleItemClick()">1 tablespoon chopped garlic</li><li onclick="handleItemClick()">3 or 4 dried chiles</li><li onclick="handleItemClick()">1½ pounds tomatoes, chopped (canned are fine; about 1 can)</li><li onclick="handleItemClick()">1 teaspoon good dried oregano, or 1 tablespoon fresh</li><li onclick="handleItemClick()">1 pound long pasta</li><li onclick="handleItemClick()">½ cup chopped parsley or basil</li><li onclick="handleItemClick()">½ cup grated ricotta salata (or in a pinch, pecorino Romano)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_PastaAllaNorma', '<ol><li onclick="handleItemClick()">Slice the eggplant about ½ inch thick.</li><li onclick="handleItemClick()">Cook in abundant olive oil, without crowding, sprinkling with salt and adding more oil as needed.<span class="note">   You will undoubtedly have to cook in batches; take your time and cook until the eggplant is nicely browned and soft.</span></li><li onclick="handleItemClick()">Remove to a plate; do not drain on paper towels.</li><li onclick="handleItemClick()">Meanwhile, put a large pot of water to boil and salt it.</li><li onclick="handleItemClick()">At the end of the cooking the eggplant, the pan will ideally have a couple of tablespoons of oil left. If there’s more or less, drain some off or add a bit.</li><li onclick="handleItemClick()">Turn the heat to medium, add the garlic and chiles, and cook until the garlic colors a little bit.</li><li onclick="handleItemClick()">Add the tomatoes and oregano, along with some salt and pepper; cook until saucy but not too dry, stirring occasionally.</li><li onclick="handleItemClick()">Cook the pasta until tender but not mushy.</li><li onclick="handleItemClick()">While it’s cooking, cut the eggplant into strips and reheat for a minute in the tomato sauce.</li><li onclick="handleItemClick()">Drain the pasta and toss it with the tomato sauce and the eggplant.</li><li onclick="handleItemClick()">Taste and adjust the seasoning, then top with the parsley or basil and grated cheese and serve.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_PastaAllaNorma', '<ul><li onclick="handleItemClick()">From a Mark Bittman <i class="conditional-space-after"></i>recipe: <a href="https://cooking.nytimes.com/recipes/1014832-pasta-alla-norma" target="_blank">https://cooking.nytimes.com/recipes/1014832-pasta-alla-norma</a></li><li onclick="handleItemClick()">date created: <2023-07-17 Mon> </li><li onclick="handleItemClick()"><2023-07-17 Mon> Made for T who said it tasted like "restaurant food" (... in a good way!)</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_NoodleKugel', '<ul><li onclick="handleItemClick()">3 Eggs</li><li onclick="handleItemClick()">1 Tbsp of Cinnamon</li><li onclick="handleItemClick()">1 Tbsp Vanilla Extract</li><li onclick="handleItemClick()">2 - 2.5 Cups of Sugar (all depends on how sweet you like it)</li><li onclick="handleItemClick()">1 lb Bag of Broad Noodles</li><li onclick="handleItemClick()">1.5 lbs Container of Cottage Cheese</li><li onclick="handleItemClick()">1 lb Container of Sour Cream</li><li onclick="handleItemClick()">2 Sticks of Unsalted Butter</li><li onclick="handleItemClick()">1 Aluminum Lasagna Pan</li><li onclick="handleItemClick()">1 Small Box of Corn Flakes</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_NoodleKugel', '<ol><li onclick="handleItemClick()">Beat 3 eggs. </li><li onclick="handleItemClick()">Melt 1 Stick of Butter.</li><li onclick="handleItemClick()">Boil Noodles.  Drain.  </li><li onclick="handleItemClick()">Put noodles, Cottage Cheese, Sour Cream, Sugar, Eggs, Cinnamon, Vanilla Extract and melted butter into a large bowl and mix.  Once mixed pour contents into the Aluminum Lasagna pan.</li><li onclick="handleItemClick()">Take Corn Flakes and put them in a zip lock bag.  Crush.</li><li onclick="handleItemClick()">Once crushed, sprinkle Corn Flake Crumbs over the top of the entire Kugel.  Take the remaining stick of butter and cut into thin pieces and dot the top of the kugel</li><li onclick="handleItemClick()">Bake in over for 90 minutes at about 400.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_NoodleKugel', '<ul><li onclick="handleItemClick()">Sandy Tootleman, 2-April-2012 (Spring Fling 2012)</li><li onclick="handleItemClick()">date created: [2012-04-02 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_MushroomPate', '<ul><li onclick="handleItemClick()">½ large onion, chopped</li><li onclick="handleItemClick()">2 scallions, chopped</li><li onclick="handleItemClick()">4 cloves garlic, minced</li><li onclick="handleItemClick()">1½ cup of mushrooms, minced</li><li onclick="handleItemClick()">2 tablespoons of sherry</li><li onclick="handleItemClick()">1 tablespoon of olive oil</li><li onclick="handleItemClick()">2 stalks celery, minced</li><li onclick="handleItemClick()">½ cup of walnuts</li><li onclick="handleItemClick()">½ cup of bread crumbs, whole grain</li><li onclick="handleItemClick()">1 pinch of rosemary</li><li onclick="handleItemClick()">½ teaspoon of thyme</li><li onclick="handleItemClick()">1 tablespoon of tamari sauce</li><li onclick="handleItemClick()">½ teaspoon of basil, fresh, of course</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_MushroomPate', '<ol><li onclick="handleItemClick()">Heat oil in skillet and add onion. Saute, stirring, until limp but not browned. Add mushrooms, garlic and sherry. Saute one - two minutes until mushrooms begin to juice. Stir in rosemary, thyme, tamari, salt and basil. </li><li onclick="handleItemClick()">Put remaining ingredients into food processor and combine until minced. Add mushroom mixture and blend. Put mixture into bowl and refrigerate two hours. </li><li onclick="handleItemClick()">Spread on bread and crackers or hollow out a loaf of French bread and stuff.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_MushroomPate', '<ul><li onclick="handleItemClick()"><a href="http://www.basic-recipes.com/r/p/mushroom3.htm" target="_blank">http://www.basic-recipes.com/r/p/mushroom3.htm</a>28Dec08</li><li onclick="handleItemClick()">date created: [2008-12-18 Thu] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_MexicanLasagna', '<ul><li onclick="handleItemClick()">1 pound canned pinto, pink and/or black beans, drained and rinsed</li><li onclick="handleItemClick()">14 ounce can diced or stewed tomatoes</li><li onclick="handleItemClick()">4 ounce can chopped mild green chilies</li><li onclick="handleItemClick()">2 cups frozen corn kernels, thawed</li><li onclick="handleItemClick()">2 scallions</li><li onclick="handleItemClick()">½ tsp ground cumin</li><li onclick="handleItemClick()">½ tsp dried oregano</li><li onclick="handleItemClick()">8 corn tortillas</li><li onclick="handleItemClick()">1½ cups grated cheese (Monterrey Jack or cheddar)</li><li onclick="handleItemClick()">reduced-fat sour cream (optional)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_MexicanLasagna', '<ol><li onclick="handleItemClick()">Preheat the oven to 400 degrees.</li><li onclick="handleItemClick()">Combine the first 7 ingredients in a mixing bowl. Mix thoroughly.</li><li onclick="handleItemClick()">Lightly oil a wide, 2-quart casserole dish and layer as follows:<ul><li onclick="handleItemClick()">4 tortillas, overlapping each other</li><li onclick="handleItemClick()">half the bean mixture</li><li onclick="handleItemClick()">half the cheese</li></ul></li><li onclick="handleItemClick()">Repeat layers.</li><li onclick="handleItemClick()">Bake the casserole for 20 to 30 minutes, until cheese is bubbly.</li><li onclick="handleItemClick()">Let stand for a minute or two, then cut into squares to serve.</li><li onclick="handleItemClick()">Top with sour cream, if desired.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_MexicanLasagna', '<ul><li onclick="handleItemClick()">From Debbie Rowett, 26 March 2004</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_LentilsRiceCaramelizedOnions', '<ul><li onclick="handleItemClick()">Olive oil</li><li onclick="handleItemClick()">Salt</li><li onclick="handleItemClick()">2 cloves garlic, thinly sliced</li><li onclick="handleItemClick()">1 teaspoon ground cumin</li><li onclick="handleItemClick()">¼ teaspoon ground allspice</li><li onclick="handleItemClick()">a pinch of cayenne</li><li onclick="handleItemClick()">thyme, oregano and/or rosemary</li><li onclick="handleItemClick()">5 cups broth</li><li onclick="handleItemClick()">1 cup lentils, rinsed</li><li onclick="handleItemClick()">¾ cups rinsed rice</li><li onclick="handleItemClick()">salt and pepper</li><li onclick="handleItemClick()">lemon juice, vinegar or sumac</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_LentilsRiceCaramelizedOnions', '<ol><li onclick="handleItemClick()">Heat a slick of oil in a medium saucepan.</li><li onclick="handleItemClick()">Add sliced onions, shallots or leeks — the more the merrier.<span class="tip">   The browned onions are the best part of this dish, so you really can’t overdo it, but just know that the more onions you add, the longer they will take to caramelize. I used two shallots and two small onions, because that’s what I had, but in a perfect world, I’d use one giant white onion, thinly sliced.</span></li><li onclick="handleItemClick()">Add a pinch of salt, and sauté until the onions turn golden brown, 15 to 25 minutes. <span class="tip">   Watch them carefully, especially toward the end of cooking. If they are cooking too quickly, turn down the heat. If they’re not getting brown, crank it. Some dark brown strands mixed in with the golden ones are OK, but you don’t want them to burn. When they are done, transfer half of them to a plate.</span></li><li onclick="handleItemClick()">And add a couple of thinly sliced garlic cloves to the onions left in the pot. Sauté the garlic until fragrant, about a minute.</li><li onclick="handleItemClick()">Add 1 teaspoon ground cumin, ¼ teaspoon ground allspice, if you have it, and a pinch of cayenne, and sauté for a few seconds to toast the spices and bring out their flavor.</li><li onclick="handleItemClick()">If you have any herbs sprigs — thyme, oregano or rosemary — add them to the pot. Otherwise, add a large pinch of dried herbs.</li><li onclick="handleItemClick()">Now add 5 cups broth or water (or a combination), and bring to a simmer.</li><li onclick="handleItemClick()">Add enough olive oil and salt to the liquid so that it tastes good.</li><li onclick="handleItemClick()">Then add 1 cup rinsed lentils (any kind) and let simmer, partly covered, until they are almost but not quite done, about 25 to 30 minutes for green or brown lentils, and 15 to 20 for red lentils.</li><li onclick="handleItemClick()">Add ¾ cups rinsed rice to the pot and continue to simmer until everything is very tender, another 18 to 25 minutes.</li><li onclick="handleItemClick()">When all is tender and lovely, taste it and add lots of salt, pepper and some kind of acid — lemon juice, vinegar or sumac — for brightness.</li><li onclick="handleItemClick()">Top with the reserved golden onions and serve this in bowls, drizzled with your best olive oil, and garnished with red-pepper flakes, chopped fresh herbs, if you have some, and flaky salt. Without the garnish, it’s a drab-looking dish. But even unadorned, the earthy flavors of the lentils combined with those sweet golden onions will shine bright.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_LentilsRiceCaramelizedOnions', '<ul><li onclick="handleItemClick()">From <a href="https://www.nytimes.com/2020/03/30/dining/pantry-mujadara-coronavirus.html" target="_blank">https://www.nytimes.com/2020/03/30/dining/pantry-mujadara-coronavirus.html</a></li><li onclick="handleItemClick()">date created: [2021-01-04 Mon] </li><li onclick="handleItemClick()">[2021-01-03 Sun] Made for T&J. Tasty!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_LentilsSoup', '<ul><li onclick="handleItemClick()">~2 tablespoons oil</li><li onclick="handleItemClick()">1 medium onion, sliced</li><li onclick="handleItemClick()">1 large carrot, sliced (about ¾ cup)</li><li onclick="handleItemClick()">1 clove garlic, finely chopped</li><li onclick="handleItemClick()">4 cups water</li><li onclick="handleItemClick()">12 ounces dried lentils (about 2 cups)</li><li onclick="handleItemClick()">1 bouillon cube</li><li onclick="handleItemClick()">2 tablespoons snipped parsley</li><li onclick="handleItemClick()">1 tablespoon salt</li><li onclick="handleItemClick()">½ teaspoon peppe</li><li onclick="handleItemClick()">¼ to ½ teaspoon dried thyme leaves</li><li onclick="handleItemClick()">1 bay leaf</li><li onclick="handleItemClick()">1 can (28 ounces) whole tomatoes</li><li onclick="handleItemClick()">1 cup water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_LentilsSoup', '<ol><li onclick="handleItemClick()">Heat a large soup pot over medium heat.</li><li onclick="handleItemClick()">Add oil.</li><li onclick="handleItemClick()">Add onion, carrot, celery and garlic; cook, stirring until celery is tender, about 10 minutes.</li><li onclick="handleItemClick()">Stir in 4 cups water, the lentils, bouillon cube, parsley, salt, pepper, thyme and bay leaf.</li><li onclick="handleItemClick()">Heat to boiling; reduce heat.</li><li onclick="handleItemClick()">Cover and simmer until soup thickens, about 1 hour</li><li onclick="handleItemClick()">Stir in tomatoes with liquid and 1 cup water.</li><li onclick="handleItemClick()">Simmer uncovered 15 minutes.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Entrees_LentilsSoup', 'Six servings, about 1½ cups each' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_LentilsSoup', '<ul><li onclick="handleItemClick()">From Betty Crocker\'s Cookbook, page 125.</li><li onclick="handleItemClick()">date created: [2021-04-20 Tue] </li></ul>Unknown type: ’quote-block’Unknown type: ’quote-block’' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_LentilStewwithSausageandPotatoes', '<ul><li onclick="handleItemClick()">4 tablespoons olive oil</li><li onclick="handleItemClick()">4 large garlic cloves, minced</li><li onclick="handleItemClick()">1 teaspoon curry powder</li><li onclick="handleItemClick()">4 cups low-sodium vegetable broth</li><li onclick="handleItemClick()">1 bay leaf</li><li onclick="handleItemClick()">2 cups brown lentils, picked over and rinsed</li><li onclick="handleItemClick()">10 small red-skinned potatoes, quartered</li><li onclick="handleItemClick()">½ pound sausage, diced</li><li onclick="handleItemClick()">1 small bunch greens (kale, arugula or watercress)</li><li onclick="handleItemClick()">1 tablespoon fresh lemon juice</li><li onclick="handleItemClick()">½ cup crumbled feta cheese</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_LentilStewwithSausageandPotatoes', '<ol><li onclick="handleItemClick()">Heat 2 tablespoon of the oil in a large, heavy saucepan over medium heat.</li><li onclick="handleItemClick()">Add garlic and curry powder and cook, stirring until garlic is fragrant.</li><li onclick="handleItemClick()">Add broth, bay leaf and lentils and bring to a boil.</li><li onclick="handleItemClick()">Lower heat, cover and simmer 15 minutes.</li><li onclick="handleItemClick()">Add potatoes, cover and cook until potatoes and lentils are tender but not mushy, about 10 to 15 minutes longer.</li><li onclick="handleItemClick()">While the lentils are cooking, place sausage in a large nonstick skillet, over medium-high heat.</li><li onclick="handleItemClick()">Brown on both sides, set aside and keep warm.</li><li onclick="handleItemClick()">Remove tough stems from the greens and chop coarsely.</li><li onclick="handleItemClick()">When the stew is cooked, toss with remaining 2 tablespoons oil, lemon juice and greens.</li><li onclick="handleItemClick()">Season with salt and freshly ground pepper.</li><li onclick="handleItemClick()">Top each service with sausage and feta.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_LentilStewwithSausageandPotatoes', '<ul><li onclick="handleItemClick()">From Amy Warren (page 111 of <i class="conditional-space-after"></i>)</li><li onclick="handleItemClick()">Serves 4</li><li onclick="handleItemClick()">date created: [2022-03-08 Tue] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_LemonandParmesanCapellini', '<ul><li onclick="handleItemClick()">8 oz capellini or similar pasta</li><li onclick="handleItemClick()">1 cup half and half or light cream</li><li onclick="handleItemClick()">3 oz parmesan (or similar) cheese</li><li onclick="handleItemClick()">Finely grated zest of 1 lemon</li><li onclick="handleItemClick()">Salt and freshly ground pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_LemonandParmesanCapellini', '<ol><li onclick="handleItemClick()">Cook pasta until just tender. </li><li onclick="handleItemClick()">Pour cream into a small pan and bring to boil.</li><li onclick="handleItemClick()">Stir in cheese and lemon rind.</li><li onclick="handleItemClick()">The sauce should thicken in about 30 seconds.</li><li onclick="handleItemClick()">Drain pasta, return to pan, and toss with sauce.</li><li onclick="handleItemClick()">Top with fresh parsley and grated lemon rind if desired.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_LemonandParmesanCapellini', '<ul><li onclick="handleItemClick()">From:  <a href="https://www.amazon.com/Fast-Vegetarian-Matthew-Drennan-2001-07-31/dp/B01K93C14U/ref=sr_1_1?dchild=1&keywords=Fast+Vegetarian+Food+drennan&qid=1595522860&sr=8-1" target="_blank">https://www.amazon.com/Fast-Vegetarian-Matthew-Drennan-2001-07-31/dp/B01K93C14U/ref=sr_1_1?dchild=1&keywords=Fast+Vegetarian+Food+drennan&qid=1595522860&sr=8-1</a>, by Matthew Drennan</li><li onclick="handleItemClick()">date created: [2020-07-25 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_KedgereewithGreenBeansandMushrooms', '<ul><li onclick="handleItemClick()">¾ cup basmati rice</li><li onclick="handleItemClick()">1¼ cups cold water</li><li onclick="handleItemClick()">3 eggs</li><li onclick="handleItemClick()">6 oz green beans, trimmed</li><li onclick="handleItemClick()">¼ cup butter</li><li onclick="handleItemClick()">1 onion, finely chopped</li><li onclick="handleItemClick()">8 oz crimini mushrooms, quartered</li><li onclick="handleItemClick()">2 tbsp light cream or half-and-half</li><li onclick="handleItemClick()">1 tbsp chopped fresh parsley</li><li onclick="handleItemClick()">salt and freshly ground black pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_KedgereewithGreenBeansandMushrooms', '<ol><li onclick="handleItemClick()">Wash the rice several times under cold running water. Drain thoroughly. Bring a pan of water to a boil. Add the rice and cook for 10-12 minutes until tender. Drain thoroughly..</li><li onclick="handleItemClick()">Half fill a second pan with water. Add the eggs and bring to a boil. Lower the heat and simmer for 8 minutes. Drain the eggs and cool them under cold water. Remove the shells.</li><li onclick="handleItemClick()">Bring another pan of water to a boil and cook the green beans for 5 minutes. Drain and refresh under cold running water. Then drain again.</li><li onclick="handleItemClick()">Melt the butter in a large frying pan. Add the onions and mushrooms. Cook for 2-3 minutes over a moderate heat.</li><li onclick="handleItemClick()">Add the green beans and rice to the onion mixture. Stir lightly to mix. Cook for 2 minutes. Cut the hard-boiled eggs in wedges and add  them tto the pan.</li><li onclick="handleItemClick()">Stir in the cream and parsley, taking care noot to break up the eggs. Reheat the kedgeree but do not allow it to boil. Serve at once.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_KedgereewithGreenBeansandMushrooms', '<ul><li onclick="handleItemClick()">From <a href="https://www.amazon.com/Fast-Vegetarian-Matthew-Drennan-2001-07-31/dp/B01K93C14U/ref=sr_1_1?dchild=1&keywords=Fast+Vegetarian+Food+drennan&qid=1595522860&sr=8-1" target="_blank">https://www.amazon.com/Fast-Vegetarian-Matthew-Drennan-2001-07-31/dp/B01K93C14U/ref=sr_1_1?dchild=1&keywords=Fast+Vegetarian+Food+drennan&qid=1595522860&sr=8-1</a>, by Matthew Drennan, page 92</li><li onclick="handleItemClick()">date created: [2020-07-23 Thu] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_HoppinJohn', '<ul><li onclick="handleItemClick()">2 tablespoons extra-virgin olive oil</li><li onclick="handleItemClick()">1 large green bell pepper diced</li><li onclick="handleItemClick()">1 large red bell pepper diced</li><li onclick="handleItemClick()">3 stalks celery</li><li onclick="handleItemClick()">4 medium carrots peeled and diced (about 10 ounces)</li><li onclick="handleItemClick()">3 large cloves garlic minced (about 1 tablespoon)</li><li onclick="handleItemClick()">2 teaspoons smoked paprika</li><li onclick="handleItemClick()">1½  teaspoons chili powder</li><li onclick="handleItemClick()">1¼  teaspoons kosher salt</li><li onclick="handleItemClick()">½ teaspoon cayenne pepper plus additional to taste</li><li onclick="handleItemClick()">1 small bunch kale trimmed and chopped (about 8 ounces)</li><li onclick="handleItemClick()">2 cans (15-ounces) black-eyed peas about 3½  cups, drained and rinsed</li><li onclick="handleItemClick()">1 can (14-ounces) fire-roasted diced tomatoes</li><li onclick="handleItemClick()">Prepared brown rice for serving</li><li onclick="handleItemClick()">Chopped green onions optional for serving</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_HoppinJohn', '<ol><li onclick="handleItemClick()">Heat the oil in a large, deep skillet or Dutch oven over medium heat.</li><li onclick="handleItemClick()">Add the red and green bell peppers, celery, carrots, and garlic and cook, stirring occasionally, until beginning to brown, about 8 minutes.</li><li onclick="handleItemClick()">Stir in the smoked paprika, chili powder, salt, and cayenne. Cook, stirring, for 30 seconds.</li><li onclick="handleItemClick()">Working in small handfuls, stir in the kale, stirring after each addition to let it wilt slightly before adding another handful. Cook and stir until you can fit all of the kale in the pot.</li><li onclick="handleItemClick()">Add the black-eyed peas and tomatoes with their juices. Stir and continue to cook until heated through, about 2 additional minutes.</li><li onclick="handleItemClick()">Taste and add additional salt or spices as desired.</li><li onclick="handleItemClick()">Serve hot with rice and a sprinkle of green onion.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_HoppinJohn', '<ul><li onclick="handleItemClick()">From MaryAnn</li><li onclick="handleItemClick()">date created: [2021-01-02 Sat] </li><li onclick="handleItemClick()">[2021-01-01 Fri] MaryAnn made some for our New Year\'s Day lunch. Yum!</li><li onclick="handleItemClick()">[2023-01-02 Mon] Made for a bunch of COVID-19 patients: Westfalls, Heimburgs and us(!).</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_GrilledVegetableGratin', '<ul><li onclick="handleItemClick()">2 large eggplants (2 pounds)</li><li onclick="handleItemClick()">2 large bell peppers</li><li onclick="handleItemClick()">olive oil</li><li onclick="handleItemClick()">2 large red onions, peeled and sliced</li><li onclick="handleItemClick()">3 cloves garlic, chopped</li><li onclick="handleItemClick()">2 T olive oil</li><li onclick="handleItemClick()">4 c tomatoes, peeled and chopped</li><li onclick="handleItemClick()">3 T fresh basil, chopped</li><li onclick="handleItemClick()">3 T parsley, chopped</li><li onclick="handleItemClick()">1-2 t fresh oregano, chopped</li><li onclick="handleItemClick()">salt and pepper</li><li onclick="handleItemClick()">½ c dry red wine</li><li onclick="handleItemClick()">1 pound rigatoni</li><li onclick="handleItemClick()">½ pound mozzarella, grated</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_GrilledVegetableGratin', '<ol><li onclick="handleItemClick()">Slice the eggplants lengthwise, into  ½-in slices. Salt each slice on both sides and let sit for 30-45 minutes, until sweating a tan-colored water. Rinse each slice for just a second and pat dry. </li><li onclick="handleItemClick()">Quarter the peppers lengthwise and remove seeds and stems.</li><li onclick="handleItemClick()">Brush eggplants and peppers with olive oil and grill over charcoal: eggplant, until tender, peppers (skin side down), until charred. Put the peppers in paper bag for a few minutes, then remove the skins. Cut eggplant and peppers into wide strips and set aside.</li><li onclick="handleItemClick()">Heat 2 T olive oil, then saute onion and garlic until golden. Add 3 c tomatoes, the herbs, salt and pepper, and the wine. Simmer until thickened, about 30 minutes.</li><li onclick="handleItemClick()">Preheat oven to 350 degrees and oil the gratin dish.</li><li onclick="handleItemClick()">Cook the rigatoni until just al dente. Drain and mix with tomato sauce and grilled vegetables.</li><li onclick="handleItemClick()">Pour into gratin dish, sprinkle with remaining tomatoes and mozzarella cheese.</li><li onclick="handleItemClick()">Bake until very hot and cheese is beginning to color, about 30-40 minutes. If you like a brown, bubbly gratin topping, place under the broiler for a minute.</li><li onclick="handleItemClick()">Serve immediately.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_GrilledVegetableGratin', '<ul><li onclick="handleItemClick()">date created: [2010-09-05 Sun] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_GrilledCornandSweetOnionSalad', '<ul><li onclick="handleItemClick()">12 ears of corn, husks and silk removed</li><li onclick="handleItemClick()">¼ cup aged sherry vinegar</li><li onclick="handleItemClick()">1 tablespoon Dijon mustard</li><li onclick="handleItemClick()">1 garlic clove, minced</li><li onclick="handleItemClick()">½ cup olive oil, plus extra for brushing the corn</li><li onclick="handleItemClick()">2 large red bell peppers, diced</li><li onclick="handleItemClick()">1 large Vidalia onion, thinly sliced (or use a Maui or Walla Walla onion)</li><li onclick="handleItemClick()">4 ripe plum tomatoes, finely chopped</li><li onclick="handleItemClick()">1 jalapeno pepper, finely chopped</li><li onclick="handleItemClick()">¼ cup finely chopped chives</li><li onclick="handleItemClick()">kosher salt and freshly ground pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_GrilledCornandSweetOnionSalad', '<ol><li onclick="handleItemClick()">Preheat a gas or charcoal grill to medium.</li><li onclick="handleItemClick()">In a large pot of boiling water, over high heat, cook the corn 5 minutes until barely tender. Brush with olive oil and grill until slightly charred on all sides, above 2 minutes.</li><li onclick="handleItemClick()">Remove from the grill and with a sharp knife, scrape the kernels into a medium bowl, or stand each ear on a cutting surface and scrape downward to remove the kernels.</li><li onclick="handleItemClick()">Combine the vinegar, mustard and garlic in a large bowl and slowly whisk in the remaining ½ cup olive oil until emulsified.</li><li onclick="handleItemClick()">Add the corn kernels, bell peppers, onion and tomatoes, jalapeno and chives.</li><li onclick="handleItemClick()">Toss to coat with the dressing.</li><li onclick="handleItemClick()">Season with salt and pepper.</li></ol>' ] );
