ingredients_array.push( [ 'CostanzoRecipes_Entrees_GrainBowls', '<ul><li onclick="handleItemClick()">1 cup grains:<ul><li onclick="handleItemClick()">farro</li><li onclick="handleItemClick()">quinoa</li><li onclick="handleItemClick()">couscous</li><li onclick="handleItemClick()">polenta</li><li onclick="handleItemClick()">grits</li><li onclick="handleItemClick()">wheat berries</li><li onclick="handleItemClick()">rice</li><li onclick="handleItemClick()">freekeh</li></ul></li><li onclick="handleItemClick()">1 cup vegetables<ul><li onclick="handleItemClick()">black beans</li><li onclick="handleItemClick()">steamed chard or spinach</li><li onclick="handleItemClick()">roasted beets</li><li onclick="handleItemClick()">sautéed mushrooms</li><li onclick="handleItemClick()">roasted cauliflower or Brussels sprouts</li><li onclick="handleItemClick()">shredded carrots and/or cabbage</li><li onclick="handleItemClick()">broccoli rabe</li><li onclick="handleItemClick()">Kalamata olives</li><li onclick="handleItemClick()">chickpeas</li><li onclick="handleItemClick()">red onions or scallions</li><li onclick="handleItemClick()">edamame</li><li onclick="handleItemClick()">6 beets marinated in 3 tablespoon soy sauce, 1 tablespoon sesame oil, 1 small minced garlic clove, ½ teaspoon grated ginger, 1 teaspoon minced green onion and ⅛ teaspoon kosher salt</li></ul></li><li onclick="handleItemClick()">½ cup protein<ul><li onclick="handleItemClick()">cheese</li><li onclick="handleItemClick()">tofu</li><li onclick="handleItemClick()">tempeh</li><li onclick="handleItemClick()">poached egg</li></ul></li><li onclick="handleItemClick()">¼ cup sauce (one or more of these)<ul><li onclick="handleItemClick()"><a href="https://cookieandkate.com/easy-romesco-sauce-recipe/" target="_blank">https://cookieandkate.com/easy-romesco-sauce-recipe/</a></li><li onclick="handleItemClick()">mix ½ cup of mayonnaise with 1 tablespoon of hot sauce and ½ tablespoon of soy sauce</li><li onclick="handleItemClick()">pesto</li><li onclick="handleItemClick()">harissa</li><li onclick="handleItemClick()">Sriracha</li><li onclick="handleItemClick()">peanut sauce</li><li onclick="handleItemClick()">coconut milk</li><li onclick="handleItemClick()">vinaigrette made of red wine vinegar and honey</li><li onclick="handleItemClick()">hummus</li><li onclick="handleItemClick()">ginger root marinated in vinegar</li></ul></li><li onclick="handleItemClick()">¼ cup "toppers"<ul><li onclick="handleItemClick()">mandolined cucumber</li><li onclick="handleItemClick()">pickled radishes</li><li onclick="handleItemClick()">avocado slices</li><li onclick="handleItemClick()">toasted panko crumbs</li><li onclick="handleItemClick()">toasted nuts (like almonds, cashews and peanuts)</li><li onclick="handleItemClick()">seeds</li><li onclick="handleItemClick()">herbs (e.g., basil, oregano, cilantro)</li></ul></li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_GrainBowls', '<ol><li onclick="handleItemClick()">Cook grains.</li><li onclick="handleItemClick()">Place an assortment of vegetables, proteins, sauces and toppers in serving bowls.</li><li onclick="handleItemClick()">Make individual bowls available and ask your guests to build their own bowl.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_GrainBowls', '<ul><li onclick="handleItemClick()">From Mary Ann Heimburg\'s dinner, supplemented by <a href="https://food52.com/blog/12119-how-to-make-a-grain-bowl-without-a-recipe" target="_blank">https://food52.com/blog/12119-how-to-make-a-grain-bowl-without-a-recipe</a></li><li onclick="handleItemClick()">date created: [2020-10-08 Thu] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_GeneralTsosCauliflower', 'Prep time 15 minsCook time 15 minsTotal time 30 minsServes: 6-8 servings<ul><li onclick="handleItemClick()">1 tablespoon sesame oil</li><li onclick="handleItemClick()">3 cloves garlic, minced</li><li onclick="handleItemClick()">1 knob of ginger, grated</li><li onclick="handleItemClick()">½ cup chicken or vegetable broth</li><li onclick="handleItemClick()">½ cup soy sauce</li><li onclick="handleItemClick()">⅓ cup rice vinegar</li><li onclick="handleItemClick()">¼ cup sugar (more to taste)</li><li onclick="handleItemClick()">2 tablespoons tomato paste</li><li onclick="handleItemClick()">2 tablespoons cornstarch, dissolved in 1-2 tablespoons of cold water</li></ul><ul><li onclick="handleItemClick()">1 cup flour</li><li onclick="handleItemClick()">⅔ cup cornstarch</li><li onclick="handleItemClick()">1½ teaspoons baking powder</li><li onclick="handleItemClick()">2 teaspoons salt</li><li onclick="handleItemClick()">4 eggs</li><li onclick="handleItemClick()">water as needed (about ½ cup)</li></ul><ul><li onclick="handleItemClick()">1 head cauliflower, cut into small florets</li><li onclick="handleItemClick()">a deep layer of oil for frying</li><li onclick="handleItemClick()">scallions and sesame seeds for topping</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_GarlickyKaleSaladwithCrispyChickpeas', '<ul><li onclick="handleItemClick()">1 large bunch of kale</li></ul><ul><li onclick="handleItemClick()">1 (15-ounce) can chickpeas, rinsed, drained and thoroughly dried</li><li onclick="handleItemClick()">1½ tablespoon (avocado) oil</li><li onclick="handleItemClick()">1 healthy pinch of sea salt</li><li onclick="handleItemClick()">2½ to 3 tablespoons tandoori masala spice blend</li></ul><ul><li onclick="handleItemClick()">3 cloves garlic</li><li onclick="handleItemClick()">⅓ cup tahini</li><li onclick="handleItemClick()">2 tablespoons olive oil + more for roasting garlic</li><li onclick="handleItemClick()">¼ cup lemon juice, plus more for massaging kale (about two small lemons)</li><li onclick="handleItemClick()">1 healthy pinch of each salt and pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_GarlickyKaleSaladwithCrispyChickpeas', '<ol><li onclick="handleItemClick()">Preheat oven to 375° F.</li><li onclick="handleItemClick()">Add drained chickpeas to a mixing bowl and toss with oil, salt and tandoori masala.</li><li onclick="handleItemClick()">Pull apart garlic cloves but leave the skin on. (Avoid using any tiny garlic cloves from the center of the head.)</li><li onclick="handleItemClick()">Add garlic cloves and seasoned chickpeas to a baking sheet.</li><li onclick="handleItemClick()">Drizzle garlic with a bit of olive or grapeseed oil.</li><li onclick="handleItemClick()">Bake for 15-20 minutes or until garlic is fragrant and slightly browned.</li><li onclick="handleItemClick()">Carefully remove garlic and set aside.</li><li onclick="handleItemClick()">Continue baking chickpeas for 10-15 minutes more or until slightly crispy and golden brown.</li><li onclick="handleItemClick()">Remove from the oven and set aside (chickpeas will get more crispy as they cool).</li><li onclick="handleItemClick()">Squeeze garlic out of skins (or peel away skins) and add to a blender.</li><li onclick="handleItemClick()">Add all remaining dressing ingredients and blend until smooth.<span class="tip">    If you don\'t have a blender, add the dressing ingredients to a bowl and whisk vigorously to combine, smashing the garlic with the whisk.</span></li><li onclick="handleItemClick()">Taste and adjust seasonings as desired, adding more lemon for brightness, tahini for richness and maple syrup for sweetness.</li><li onclick="handleItemClick()">Set dressing aside.</li><li onclick="handleItemClick()">Add kale to a large mixing bowl.</li><li onclick="handleItemClick()">Before adding the dressing, add 1 tablespoon lemon juice to the kale and massage with hands to soften the texture and lessen the bitterness.</li><li onclick="handleItemClick()">Then add as much dressing as desired (some may be leftover) and mix with a spoon or salad tongs.</li><li onclick="handleItemClick()">Top with chickpeas and serve.<span class="tip">    Best when fresh, although leftover keep in the fridge for up to a few days.</span></li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_GarlickyKaleSaladwithCrispyChickpeas', '<ul><li onclick="handleItemClick()">From edibleasheville.com: Winter 2022</li><li onclick="handleItemClick()">date created: [2022-03-12 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_GarlicWhitePizzaSauce', '<ul><li onclick="handleItemClick()">2 tablespoons olive oil</li><li onclick="handleItemClick()">4 cloves garlic, minced</li><li onclick="handleItemClick()">1/4 teaspoon dried oregano</li><li onclick="handleItemClick()">1/4 teaspoon ground black pepper</li><li onclick="handleItemClick()">1/4 teaspoon salt</li><li onclick="handleItemClick()">2-3 tablespoons flour</li><li onclick="handleItemClick()">1 1/2 cups half & half milk works fine, too</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_GarlicWhitePizzaSauce', '<ol><li onclick="handleItemClick()">In a skillet on medium-high heat, heat oil.</li><li onclick="handleItemClick()">Add the garlic and heat for about 3 minutes, until fragrant.</li><li onclick="handleItemClick()">Add the flour (start with 2 tablespoons), oregano, pepper, and salt; whisk well.</li><li onclick="handleItemClick()">Add the half & half all at once, whisking constantly; cook and stir until bubbly and until thickened (usually about 3 minutes).</li></ol><span class="tip">If you want the sauce a bit thicker, mix your remaining 1 tablespoon of flour with a bit of milk until you have a mashed potato consistency. Pour that mixture into the bubbling sauce and whisk constantly. Cook about 1 minute more. It should thicken the sauce. Repeat until you have it the thickness you want.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_GarlicWhitePizzaSauce', 'Favorite<ul><li onclick="handleItemClick()">From <a href="https://www.nelliebellie.com/wprm_print/42899" target="_blank">https://www.nelliebellie.com/wprm_print/42899</a></li><li onclick="handleItemClick()">date created: [2022-05-23 Mon] </li><li onclick="handleItemClick()">[2022-05-21 Sat] Made for T, G&MA and Peggy and Doug. Very flavorful pizza base. Reminded us of a ricotta sauce.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_EasyCoconutCurrySauce', '<ul><li onclick="handleItemClick()">2 tbsp vegetable oil</li><li onclick="handleItemClick()">4 garlic cloves , minced</li><li onclick="handleItemClick()">2 tsp fresh ginger , finely grated</li><li onclick="handleItemClick()">1/2 onion , finely chopped (brown or yellow)</li><li onclick="handleItemClick()">400g/14oz can coconut milk (full fat)</li><li onclick="handleItemClick()">1 cup/ 250 ml chicken broth</li><li onclick="handleItemClick()">1/2 cup / 125 ml tomato passata (tomato puree) (Note 1)</li><li onclick="handleItemClick()">400 g/14 oz can brown lentils , drained</li><li onclick="handleItemClick()">250 g / 8 oz pumpkin (~3 cups) , cut into 2cm / 4/5" cubes</li><li onclick="handleItemClick()">80 g / 2 cups (packed) baby spinach</li><li onclick="handleItemClick()">1/2 cup cashews , unsalted (roasted or raw) (Note 2)</li><li onclick="handleItemClick()">1/2 tsp each salt + pepper</li></ul><ul><li onclick="handleItemClick()">1 tbsp garam masala (Note 3)</li><li onclick="handleItemClick()">2 tbsp curry powder (mild or spicy, your choice) (Note 4)</li><li onclick="handleItemClick()">2 tsp cumin</li><li onclick="handleItemClick()">1 tsp coriander powder</li><li onclick="handleItemClick()">1 tsp paprika (sweet, or hot for spice!)</li><li onclick="handleItemClick()">1/2 tsp turmeric</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_EasyCoconutCurrySauce', '<ol><li onclick="handleItemClick()">Heat oil in a deep skillet or pot over medium high heat. Add onion, garlic and ginger, cook for 2 minutes until onion is a bit tinged with gold.</li><li onclick="handleItemClick()">Add Spices and stir for 1 minute - don\'t worry if it looks a bit dried out.</li><li onclick="handleItemClick()">Add coconut milk, passata and broth. Stir until incorporated.</li><li onclick="handleItemClick()">Add lentils and pumpkin. Bring to simmer then adjust heat so it\'s simmering energetically.</li><li onclick="handleItemClick()">Simmer for 10 minutes or until pumpkin is tender but not mushy, and sauce has thickened.</li><li onclick="handleItemClick()">Stir through baby spinach until wilted, then cashew nuts.</li><li onclick="handleItemClick()">Add salt and pepper last, adjusting to taste.</li><li onclick="handleItemClick()">Serve over rice, sprinkled with coriander and extra cashews, if using.</li></ol><span class="note"><ol><li onclick="handleItemClick()">Crushed canned tomato can also be used here but doesn\'t yield the same smooth sauce. Use 3/4 cup.</li><li onclick="handleItemClick()">Roughly chopped macadamia or pistachios would be a great sub. Otherwise, leave the cashews out and sprinkle generously with store bought fried shallots or onions (Asian section of supermarket), these are a great alternative for providing texture and added interest into the curry.</li><li onclick="handleItemClick()">Garam Masala is a spice mix that is found in major supermarkets in Australia (Woolies, Coles etc) that is commonly used in Indian cooking. It smells like curry powder and is not spicy, if you buy it from standard supermarkets. If you get it from a speciality store, check the spiciness before using - you may wish to dial it back a bit.</li><li onclick="handleItemClick()">I use Cloves of India (sold at supermarkets, spice section), mild or spicy. Any curry powder will be fine here because it\'s not intended to be a full blown authentic Indian curry.</li><li onclick="handleItemClick()">The Formula: This recipe is all about the curry sauce, so feel free to use it for whatever you want to put in it. It makes about 3 1/2 cups of sauce which is enough for about 4 - 5 packed cups of "stuff".   Examples: 500g/1 lb chicken cut into bite size pieces (~2 1/2 cups) + 2 1/2 cups of chopped veggies of choice. Or 500g / 1 lb prawns / shrimp + 2 cups chopped sweet potato. Or 5 cups of veggies, chopped into bite size pieces. Or 1 can of beans (~2 cups) plus 3 cups of chopped veggies. Etc etc. 🙂   Stir throughs like spinach which wilts down to nothing is a freebie that doesn\'t count in the cups allowance, and similarly with a small amount of nuts.   Proteins (chicken, turkey, beef, lamb, fish and prawns/shrimp especially great) - brown first then remove (still raw inside ok), then proceed with recipe. Add it back in to finish cooking through / reheat. For beef and lamb, be sure to use a nice marbled cut and don\'t overcook, keep it juicy inside. You could also stir through shredded or chopped precooked meat.   Vegetables, add them into the sauce based on the cook time. The sauce needs 10 minutes to reduce / flavours to develop.   Legumes (beans) - whether canned or cooked dried beans, add them in as soon as the sauce is mixed and simmer for the full time so they soak up some flavour.   Dried lentils (2/3 dried = 1 can drained) - use 2/3 cup dried and simmer in 3 cups of lightly salted water for  20 minutes or until tender but still firm (not mushy). Drain and use per recipe.</li></ol></span>' ] );
