ingredients_array.push( [ 'CostanzoRecipes_Entrees_DriedMushroomSoupwithBarley', '<ul><li onclick="handleItemClick()">½ ounce dried mushrooms, such as porcini, shiitake, chanterelle and/or morel -- about ⅔ cup</li><li onclick="handleItemClick()">6 cups boiling water</li><li onclick="handleItemClick()">1 tsp canola or other vegetable oil</li><li onclick="handleItemClick()">2 cups chopped onions</li><li onclick="handleItemClick()">2 cloves garlic, pressed</li><li onclick="handleItemClick()">1 cup finely chopped celery</li><li onclick="handleItemClick()">1 cup carrots, peeled and finely chopped</li><li onclick="handleItemClick()">3 cups sliced fresh mushrooms (about 10 oz.)</li><li onclick="handleItemClick()">¼ cup soy sauce</li><li onclick="handleItemClick()">pinch dried thyme</li><li onclick="handleItemClick()">¼ tsp ground black pepper</li><li onclick="handleItemClick()">½ cup raw pearl barley</li><li onclick="handleItemClick()">¼ cup dry shery or 2 tsp honey</li><li onclick="handleItemClick()">salt and ground black pepper to taste</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_DriedMushroomSoupwithBarley', '<ol><li onclick="handleItemClick()">In a saucepan, cover the dried mushrooms with 6 cups boiling water. Simmer for 15 minutes. Remove from heat and set aside for at least 15 minutes.</li><li onclick="handleItemClick()">Meanwhile, warm the oil in a soup pot on low heat. Add the onions and garlic, cover and cook for 5 minutes, stirring occasionally. Add the celery and carrots and cook for 5 minutes, stirring occasionally. Add the fresh mushrooms, increase the heat to medium and cook, stirring continuously, for about 3 minutes, until the mushrooms begin to release their jucies. Remove from the heat and set aside.</li><li onclick="handleItemClick()">Drain the dried mushrooms, reserving the mushroom stock. Cut off and discard any tough stems, then rinse and chop the mushrooms. Strain the stock through a sieve or-- if dirt or sand is evident-- through a paper coffee filter. Add enough water to the stock to make 7 cups of liquid. </li><li onclick="handleItemClick()">Add the chopped dried mushrooms, mushroom stock, soy sauce, thyme, pepper, barley and optional sherry or honey to the pot of sauteed vegetables. Bring to a boil and then cover; reduce the heat and simmer for 45 minutes.</li><li onclick="handleItemClick()">When ready to serve, add salt and pepper to taste. The soup should be brothy, so if it has cooked down and become thick, add a bit more water.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_DriedMushroomSoupwithBarley', '<ul><li onclick="handleItemClick()">Per 8 oz serving: 94 calories, 3.5 g protein, 1.2 g fat, 19 g carbs, 4.3 g dietary fiber</li><li onclick="handleItemClick()">[As served during Easter weeken at Tracey and John\'s; April 2004; Recipe Source: Moosewood Restaurant Low-Fat Favorites, page 94]</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_Dhall', '<ul><li onclick="handleItemClick()">1½ cups dried lentils</li><li onclick="handleItemClick()">4½ cups vegetable stock (or water)</li><li onclick="handleItemClick()">1 teaspoon turmeric</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">2 tablespoon vegetable oil</li><li onclick="handleItemClick()">2 cups diced onions</li><li onclick="handleItemClick()">1 garlic clove, minced or pressed</li><li onclick="handleItemClick()">½ teaspoon ground cumin</li><li onclick="handleItemClick()">1 teaspoon turmeric</li><li onclick="handleItemClick()">½ teaspoon black pepper, coarsely ground</li><li onclick="handleItemClick()">¼ teaspoon hot chili pepper flakes or 1 small fresh hot chili pepper, minced</li><li onclick="handleItemClick()">1 cup coconut milk</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_Dhall', '<ol><li onclick="handleItemClick()">In a large pot, cook the lentils in the stock or water along with the salt and turmeric.</li><li onclick="handleItemClick()">Drain but reserve the liquid.</li><li onclick="handleItemClick()">Saute the onions, garlic and rest of the spices in the oil until the onions are golden brown, stirring continuously.</li><li onclick="handleItemClick()">Mix the drained lentils with the rest of the spices and reheat gently.</li><li onclick="handleItemClick()">When hot, stir in the coconut milk.</li><li onclick="handleItemClick()">If the dhall is too dry or thick, add some of the reserved liquid.</li><li onclick="handleItemClick()">For a lighter, less sweet version of this dish, substitute 1 cup chopped tomatoes for the coconut milk.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_Dhall', '<ul><li onclick="handleItemClick()">From the <i class="conditional-space-after"></i>cookbook, pg 216.</li><li onclick="handleItemClick()">date created: [2020-08-02 Sun] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_CurriedLentilDish', '<ul><li onclick="handleItemClick()">15 Tbs lentils (assortment of channa dal, toor dal, urad dal, masoor dal and moong dal (mung beans))</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_CurriedLentilDish', '<ol><li onclick="handleItemClick()">1 tsp turmeric</li><li onclick="handleItemClick()">2 tsp grated ginger</li><li onclick="handleItemClick()">5 cloves minced garlic</li><li onclick="handleItemClick()">2 tsp green chilies</li><li onclick="handleItemClick()">½ tsp cayenne</li><li onclick="handleItemClick()">½ cup chopped red onion</li><li onclick="handleItemClick()">⅔ cup chopped tomato</li><li onclick="handleItemClick()">1 tsp cumin seeds</li><li onclick="handleItemClick()">1 Tbs chopped cilantro leaves</li><li onclick="handleItemClick()">½ tsp black pepper</li><li onclick="handleItemClick()">1 Tbs lemon juice</li><li onclick="handleItemClick()">½ tsp nutmeg</li><li onclick="handleItemClick()">Place lentils in a saucepan, covering with 2" of water. Soak for 3-5 hours.</li><li onclick="handleItemClick()">Add turmeric, bring to a boil, then simmer, covered, 1½ hours. Stir periodically so it doesn\'t stick. Then whisk until relatively creamy and smooth. (Less water will result in more stew-like.)</li><li onclick="handleItemClick()">Mix ginger, garlic, chilies, cayenne, onion and tomato. Saute cumin seeds in a little olive oil until brown. Add to tomato mixture for 2 minutes. Add to already whisked dal over moderate heat for 1-2 minutes, stirring.</li><li onclick="handleItemClick()">Add cilantro, cook 1-2 minutes. Add black pepper, remove from heat. Then add lemon juice and nutmeg.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_CurriedLentilDish', '<ul><li onclick="handleItemClick()">(via Kate 9 April 2011)</li><li onclick="handleItemClick()">date created: [2011-04-10 Sun] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_CrispyVeganCauliflowerTacos', 'Tacos<ul><li onclick="handleItemClick()">1 medium cauliflower sliced into long pieces – see note</li><li onclick="handleItemClick()">½ cup full fat coconut milk</li><li onclick="handleItemClick()">Juice and Zest of 1 lime</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">½ cup panko breadcrumbs gluten free if necessary</li><li onclick="handleItemClick()">½ cup cornmeal</li><li onclick="handleItemClick()">½ cup unsweetened shredded coconut</li><li onclick="handleItemClick()">1 ½ teaspoons smoked paprika</li><li onclick="handleItemClick()">1 teaspoon cumin</li><li onclick="handleItemClick()">½ teaspoon garlic powder</li><li onclick="handleItemClick()">¼ teaspoon turmeric</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">¼ teaspoon pepper</li></ul>Sweet and Sour Slaw¾ cup chopped red cabbage<ul><li onclick="handleItemClick()">¾ cup chopped green cabbage</li><li onclick="handleItemClick()">½ cup shredded carrots</li><li onclick="handleItemClick()">Juice of 1 lime</li><li onclick="handleItemClick()">1 tablespoon white vinegar</li><li onclick="handleItemClick()">1-2 teaspoon(s) pure maple syrup</li><li onclick="handleItemClick()">½ teaspoon salt</li></ul>Tangy Vegan Tartar Sauce<ul><li onclick="handleItemClick()">⅓ cup homemade vegan mayonnaise or your favorite store-bought vegan mayo</li><li onclick="handleItemClick()">⅓ cup diced dill pickle</li><li onclick="handleItemClick()">Juice and Zest of 1 lime</li><li onclick="handleItemClick()">1 ½ teaspoons dried dill</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">Dash of sriracha optional</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_CrispyVeganCauliflowerTacos', '<ol><li onclick="handleItemClick()">Preheat oven to 400°F.   For the Slaw:</li><li onclick="handleItemClick()">Make the slaw first so it has time to marinate and soften just a bit. Whisk all the wet ingredients together and pour them over the veggies in a medium bowl. Cover it and put it in the fridge.   For the Baked Cauliflower:</li><li onclick="handleItemClick()">Whisk together the coconut milk, zest and juice of 1 lime and½ teaspoon salt in a wide shallow bowl, set aside.</li><li onclick="handleItemClick()">Whisk together the panko, cornmeal, shredded coconut, smoked paprika, cumin, garlic powder, turmeric, ½ teaspoon salt and the pepper in another wide shallow bowl, set aside.</li><li onclick="handleItemClick()">Line a baking sheet with parchment paper and line up your breading station in this order: cauliflower, wet batter, dry breading, baking sheet.</li><li onclick="handleItemClick()">Take a slice of the cauliflower and place it in the coconut milk batter, flipping it over to make sure all sides are covered. Next, place that piece of cauliflower in the dry breading mix, pressing it down and flipping it over to make sure it’s coated evenly on both sides. The breading should stick easily and not fall off. Transfer your breaded piece of cauliflower to the lined baking sheet. Repeat with all remaining slices of cauliflower. My medium sized cauliflower filled up one baking sheet perfectly!</li><li onclick="handleItemClick()">Bake the breaded cauliflower for 25 to 30 minutes, flipping each piece over after 15 minutes, until both sides are golden brown and crispy.   For the Tartar Sauce:</li><li onclick="handleItemClick()">While the cauliflower is baking, make your tartar sauce. In a small bowl, stir together all ingredients. Place in the fridge until you are ready to use it.   For the Tacos:</li><li onclick="handleItemClick()">To assemble the tacos, place a tortilla on a plate, top with a bit of the slaw, a piece or two of the crispy breaded cauliflower and top with a big dollop of tangy tartar sauce. Garnish with an extra squeeze of lime or dash of sriracha.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_CrispyVeganCauliflowerTacos', '<ul><li onclick="handleItemClick()">From <a href="https://www.veggieinspired.com/crispy-baked-cauliflower-tacos/#recipe" target="_blank">https://www.veggieinspired.com/crispy-baked-cauliflower-tacos/#recipe</a></li><li onclick="handleItemClick()">date created: [2023-03-24 Fri] </li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_CrispySpicedChickpeasWithPeppersandTomatoes', '<ul><li onclick="handleItemClick()">2 (15-ounce) cans chickpeas, rinsed and patted dry</li><li onclick="handleItemClick()">½ cup olive oil</li><li onclick="handleItemClick()">2 teaspoons ground cumin</li><li onclick="handleItemClick()">1 teaspoon ground coriander</li><li onclick="handleItemClick()">½ teaspoon ground turmeric</li><li onclick="handleItemClick()">¼ teaspoon ground cayenne</li><li onclick="handleItemClick()">1 teaspoon fine sea salt, plus more to taste</li><li onclick="handleItemClick()">6 fresh thyme sprigs</li><li onclick="handleItemClick()">2 red, orange or yellow bell peppers (or a combination), stems and seeds removed, sliced lengthwise ¼-inch thick</li><li onclick="handleItemClick()">2 medium tomatoes, diced</li><li onclick="handleItemClick()">1 small red onion, sliced</li><li onclick="handleItemClick()">2 jalapeños, stem and seeds removed, sliced</li><li onclick="handleItemClick()">Juice of 1 lemon</li><li onclick="handleItemClick()">1 garlic clove, finely grated or mashed to a paste</li><li onclick="handleItemClick()">1 cup fresh herbs (any combination of parsley, cilantro, mint or dill)</li><li onclick="handleItemClick()">½ cup pomegranate seeds</li><li onclick="handleItemClick()">Couscous or rice, for serving (optional)</li></ul><ol><li onclick="handleItemClick()">Heat the oven to 450° and arrange racks on the top and bottom thirds of the oven.</li><li onclick="handleItemClick()">In a large bowl, toss chickpeas with 2 tablespoons oil, the cumin, coriander, turmeric, cayenne and ½ teaspoon salt until evenly coated. Spread onto a rimmed sheet pan in a single layer and top with 3 thyme sprigs.</li><li onclick="handleItemClick()">On a second sheet pan, combine bell peppers, tomatoes, onion, jalapeños and remaining thyme sprigs with 2 tablespoons oil and remaining ½ teaspoon salt. Spread vegetables into one layer.</li><li onclick="handleItemClick()">Place chickpea pan on the bottom rack and vegetables on the top rack and roast for 10 minutes. Switch pan positions. Roast chickpeas until crisped but still tender, about 5 minutes, and roast vegetables until golden brown, about 10 minutes. If the vegetables are tender but not browned, place the pan under the broiler for 1 to 2 minutes to caramelize. Discard thyme sprigs.</li><li onclick="handleItemClick()">While the chickpeas and vegetables roast, whisk lemon juice, garlic and remaining ¼ cup oil in a small bowl. Season with salt to taste.</li><li onclick="handleItemClick()">Arrange vegetables on a large platter and drizzle with half the dressing, then top with crispy chickpeas, fresh herbs and pomegranate seeds. Drizzle remaining dressing over everything. Serve with couscous or rice, if you like.</li></ol>' ] );
