methods_array.push( [ 'CostanzoRecipes_Entrees_CornSouffle', '<ol><li onclick="handleItemClick()">Mix together all ingredients except cheese.</li><li onclick="handleItemClick()">Bake at 350 degrees for 35 minutes. Put 1 cup of cheddar cheese on the top after it has been cooking for 15 minutes.</li><li onclick="handleItemClick()">1½2/01 from Mary Ann Heimburg</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ol>' ] );
