ingredients_array.push( [ 'CostanzoRecipes_Entrees_CornMacqueChoux', '<ul><li onclick="handleItemClick()">4 tbl. butter</li><li onclick="handleItemClick()">3 ears of corn, shucked and cut off cob</li><li onclick="handleItemClick()">1 cup chopped onion</li><li onclick="handleItemClick()">½ cup diced celery</li><li onclick="handleItemClick()">½ cup diced bell pepper</li><li onclick="handleItemClick()">1 tbl. minced garlic</li><li onclick="handleItemClick()">1 tbl. minced fresh thyme</li><li onclick="handleItemClick()">1 tbl cajun seasoning blend (recipe below)</li><li onclick="handleItemClick()">1-10 oz. can diced Rotel Tomatoes (drained) – these can be found in most grocery stores either in the Mexican section or with other canned tomatoes.  Rotel is a brand name.</li><li onclick="handleItemClick()">1 lb peeled shrimp, lightly sauteed</li><li onclick="handleItemClick()">2 cups heavy cream</li><li onclick="handleItemClick()">¼ cup parmesan, grated</li><li onclick="handleItemClick()">¼ cup green onions, diced</li><li onclick="handleItemClick()">¼ cup parsley, minced</li></ul><ul><li onclick="handleItemClick()">1½ cups salt</li><li onclick="handleItemClick()">½ cup cayenne pepper</li><li onclick="handleItemClick()">¼ cup paprika</li><li onclick="handleItemClick()">¼ cup granulated onion</li><li onclick="handleItemClick()">¼ cup granulated garlic</li><li onclick="handleItemClick()">2 tbl. freshly ground black pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_CornMacqueChoux', '<ol><li onclick="handleItemClick()">Heat butter in saucepot.  Add corn and cook 10 minutes.</li><li onclick="handleItemClick()">Add onion, celery, bell pepper, garlic, and thyme.  Cook for additional 5 minutes.</li><li onclick="handleItemClick()">Add cajun seasoning and Rotel tomatoes and cook for 10 minutes until water from tomatoes has evaporated.</li><li onclick="handleItemClick()">Stir in shrimp, heavy cream, and parmesan, bring to a boil; lower fire and simmer for 15-20 minutes until cream thickens slightly.</li><li onclick="handleItemClick()">Stir in green onions and parsley.  </li><li onclick="handleItemClick()">Serve or rice, pasta, or polenta.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Entrees_CornMacqueChoux', '6-8 servings' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_CornMacqueChoux', '<ul><li onclick="handleItemClick()">From Nancy Burnett who got it via Patrick Mould of Louisiana School of Cooking in Lafayette, LA.</li><li onclick="handleItemClick()">date created: [2007-09-04 Tue] </li><li onclick="handleItemClick()">[2020-07-17 Fri] I <i class="conditional-space-after"></i>got around to making this and TC really liked it. I left out the shrimp and substituted 1 tablespoon of <a href="https://www.tonychachere.com/" target="_blank">https://www.tonychachere.com/</a>for Pat\'s Cajun Seasoning Blend.</li></ul>' ] );
