methods_array.push( [ 'CostanzoRecipes_Entrees_CornChowder', '<ol><li onclick="handleItemClick()">In a stick-proof soup pot, cook onion in 1 Tblsp butter until soft. Add potatoes and cover with water. Simmer until potatoes are almost soft.</li><li onclick="handleItemClick()">Add frozen corn and cook for 2 minutes. Add creamed corn; let simmer for 5 minutes. Add 1 can milk and butter (optional). Serve when hot.</li></ol>' ] );
