ingredients_array.push( [ 'CostanzoRecipes_Entrees_ChipotleLimeCauliflowerTacos', '<ul><li onclick="handleItemClick()">¼ cup lime juice (from about 2 limes)</li><li onclick="handleItemClick()">1-2 tablespoons chopped chipotles in adobo sauce (see Tips)</li><li onclick="handleItemClick()">1 tablespoon honey</li><li onclick="handleItemClick()">2 cloves garlic</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">1 small head cauliflower (see Tips), cut into bite-size pieces</li><li onclick="handleItemClick()">1 small red onion, halved and thinly sliced</li><li onclick="handleItemClick()">1 (15 ounce) can refried black beans, warmed</li><li onclick="handleItemClick()">8 corn tortillas, warmed</li><li onclick="handleItemClick()">½ cup crumbled queso fresco or feta cheese</li><li onclick="handleItemClick()">Sliced red cabbage, fresh cilantro, guacamole, jalapeño slices and/or lime wedges for serving</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_ChipotleLimeCauliflowerTacos', '<ol><li onclick="handleItemClick()">Preheat oven to 450 degrees F. Line a large rimmed baking sheet with foil.</li><li onclick="handleItemClick()">Combine lime juice, chipotles to taste, honey, garlic and salt in a blender; process until mostly smooth.</li><li onclick="handleItemClick()">Place cauliflower in a large bowl, add the sauce and stir to coat.</li><li onclick="handleItemClick()">Transfer to the prepared baking sheet.</li><li onclick="handleItemClick()">Sprinkle onion on top.</li><li onclick="handleItemClick()">Roast, stirring once, until the cauliflower is tender and browned in spots, 18 to 20 minutes.</li><li onclick="handleItemClick()">Serve the vegetables and beans in tortillas, topped with cheese and garnished with cabbage, cilantro, guacamole, jalapeños and/or lime wedges.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_ChipotleLimeCauliflowerTacos', '<span class="tip">Look for small cans of smoked chipotle peppers in adobo sauce near other Mexican ingredients in well-stocked supermarkets. Once opened, refrigerate for up to 2 weeks or freeze for up to 6 months.</span><span class="tip">To prep cauliflower: Remove any outer leaves. Cut off the stem. Turn head upside down and, holding the knife at a 45-degree angle, slice around the stem to remove the core from center of head. Cut the head into large florets. Then, cut or slice florets to desired sizes.</span><ul><li onclick="handleItemClick()">From <a href="https://www.eatingwell.com/recipe/257781/chipotle-lime-cauliflower-tacos/" target="_blank">https://www.eatingwell.com/recipe/257781/chipotle-lime-cauliflower-tacos/</a></li><li onclick="handleItemClick()">date created: [2021-09-27 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_ChickpeaandTatsoiCoconutCurry', '<ul><li onclick="handleItemClick()">1 cup basmati rice (or rice of choice)</li><li onclick="handleItemClick()">2 Tablespoons coconut oil</li><li onclick="handleItemClick()">1 medium sized onion, diced</li><li onclick="handleItemClick()">3 cloves of garlic, minced</li><li onclick="handleItemClick()">2 teaspoons curry powder</li><li onclick="handleItemClick()">1/4 teaspoon crushed red pepper flakes</li><li onclick="handleItemClick()">salt and pepper freshly ground black pepper</li><li onclick="handleItemClick()">1/2 cup vegetables stock (or water)</li><li onclick="handleItemClick()">1 (15 ounce) can of chickpeas, drained</li><li onclick="handleItemClick()">1 (15 ounce) can full-fat coconut milk</li><li onclick="handleItemClick()">1 Tablespoon fresh lime juice</li><li onclick="handleItemClick()">3 cups roughly chopped tatsoi (and/or bok choy)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_ChickpeaandTatsoiCoconutCurry', '<ol><li onclick="handleItemClick()">Cook the rice according to specific instructions on the package.</li><li onclick="handleItemClick()">Heat the oil in a large dutch oven or soup pot over medium heat.</li><li onclick="handleItemClick()">Add the onion and cook, stirring occasionally until fragrant, about 5 minutes.</li><li onclick="handleItemClick()">Add the garlic, curry powder, red pepper flakes and a healthy pinch of salt and pepper.</li><li onclick="handleItemClick()">Cook for 1 minute longer, stirring often to coat the onion and garlic in the spices.</li><li onclick="handleItemClick()">Add in the vegetable stock, chickpeas and coconut milk.</li><li onclick="handleItemClick()">Bring to a boil.</li><li onclick="handleItemClick()">Reduce the heat and simmer for 10 minutes.</li><li onclick="handleItemClick()">Add the lime juice and tatsoi and keep on low heat until the tatsoi wilts down.</li><li onclick="handleItemClick()">Season to taste with additional salt and pepper.</li><li onclick="handleItemClick()">Serve the soup with a scoop of rice and enjoy.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_ChickpeaandTatsoiCoconutCurry', '<ul><li onclick="handleItemClick()">From <a href="https://blog.freshharvestga.com/chickpea-tatsoi-coconut-curry/" target="_blank">https://blog.freshharvestga.com/chickpea-tatsoi-coconut-curry/</a></li><li onclick="handleItemClick()">date created: [2020-11-01 Sun] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_CheddarSweetCornPie', '<ul><li onclick="handleItemClick()">3 tablespoons unsalted butter, divided (2 tablespoons + 1 tablespoon)</li><li onclick="handleItemClick()">1/2 yellow onion, finely chopped</li><li onclick="handleItemClick()">2 cloves garlic, minced</li><li onclick="handleItemClick()">4 cups fresh or frozen (and thawed) corn kernels</li><li onclick="handleItemClick()">2/3 cup half-and-half</li><li onclick="handleItemClick()">2 cups sharp cheddar cheese, grated, divided (1½ cups + ½ cup)</li><li onclick="handleItemClick()">3/4 cup panko or seasoned breadcrumbs, divided (½ cup + ¼ cup)</li><li onclick="handleItemClick()">3 large eggs</li><li onclick="handleItemClick()">1/2 teaspoon chili powder</li><li onclick="handleItemClick()">1/2 teaspoon paprika</li><li onclick="handleItemClick()">3 1/2 tablespoons fresh chives, plus extra for garnish, finely chopped, optional</li><li onclick="handleItemClick()">kosher salt and freshly ground pepper, to taste</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_CheddarSweetCornPie', '<ol><li onclick="handleItemClick()">Preheat oven to 375º F and lightly grease a pie dish with butter or non-stick spray.</li><li onclick="handleItemClick()">Melt 2 tablespoons butter in a large pan or skillet over medium-high heat and sauté onion until softened and translucent, 6-8 minutes. Season with salt and pepper.</li><li onclick="handleItemClick()">Add garlic and cook for another 1-2 minutes, or until fragrant, then transfer mixture to a large bowl.</li><li onclick="handleItemClick()">Add corn, half-and-half, 1½ cups cheddar cheese, ½ cup breadcrumbs, chives, salt and pepper to the bowl with the onion and mix until combined.</li><li onclick="handleItemClick()">In a separate bowl, beat eggs with chili powder and paprika, then stir mixture into bowl with corn and onion until incorporated. Pour mixture into greased pie dish.</li><li onclick="handleItemClick()">Microwave remaining 1 tablespoon butter until melted. Let cool slightly, then whisk together with remaining ¼ cup panko crumbs, ½ cup cheese and chives. Season with salt and pepper.</li><li onclick="handleItemClick()">Evenly sprinkle panko mixture over corn, then place pie dish in oven and bake for 35 minutes, or until corn is puffed up and edges are starting to brown.</li><li onclick="handleItemClick()">Remove from oven and let cool 5-10 minutes, then top with more chives or paprika. Enjoy!</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_CheddarSweetCornPie', '<ul><li onclick="handleItemClick()">From <a href="https://12tomatoes.com/cheddar-corn-pie/" target="_blank">https://12tomatoes.com/cheddar-corn-pie/</a></li><li onclick="handleItemClick()">date created: [2020-12-05 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_CharlestonGumbo', '<ul><li onclick="handleItemClick()">1 quart okra, chopped</li><li onclick="handleItemClick()">1 pint canned tomatoes</li><li onclick="handleItemClick()">½ small onion, chopped</li><li onclick="handleItemClick()">salt, pepper and Worcestershire sauce, to taste </li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_CharlestonGumbo', '<ol><li onclick="handleItemClick()">Combine tomatoes, okra, onion, salt, pepper and Worcestershire.</li><li onclick="handleItemClick()">Let simmer for two hours.</li></ol><span class="note">The original recipe calls for 2 slices of bacon, so it may need a bit of spicing up.</span>Becky says:Unknown type: ’quote-block’' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_CharlestonGumbo', 'IsVegan<ul><li onclick="handleItemClick()">From Mrs. John T. Jenkins (Hess Lebby) via Becky Westfall from <i class="conditional-space-after"></i>, published in 1950(!).</li><li onclick="handleItemClick()">date created: [2022-07-04 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_CauliflowerCashewPeaandCoconutCurry', '<ul><li onclick="handleItemClick()">1 (1-inch) piece fresh ginger, peeled and chopped</li><li onclick="handleItemClick()">4 garlic cloves, chopped</li><li onclick="handleItemClick()">1 green chile, roughly chopped (seeded if you prefer less heat)</li><li onclick="handleItemClick()">Kosher salt</li><li onclick="handleItemClick()">4 tablespoons canola oil</li><li onclick="handleItemClick()">2 large onions, finely chopped</li><li onclick="handleItemClick()">1 tablespoon tomato paste</li><li onclick="handleItemClick()">1 ½ teaspoons ground coriander</li><li onclick="handleItemClick()">1 ¼ teaspoons ground cumin</li><li onclick="handleItemClick()">½ teaspoon chile powder</li><li onclick="handleItemClick()">1 large head cauliflower (about 1 ¼ pounds), broken into bite-size florets</li><li onclick="handleItemClick()">1 (14-ounce) can unsweetened coconut milk</li><li onclick="handleItemClick()">4 ounces unsalted cashews (about ¾ cup)</li><li onclick="handleItemClick()">½ cup frozen peas</li><li onclick="handleItemClick()">½ teaspoon garam masala</li><li onclick="handleItemClick()">1 small bunch cilantro, leaves chopped, for serving</li><li onclick="handleItemClick()">1 lemon wedge, for serving</li><li onclick="handleItemClick()">Cooked basmati rice, for serving</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_CauliflowerCashewPeaandCoconutCurry', '<ol><li onclick="handleItemClick()">Place the ginger, garlic and green chile in a mortar and pestle with a pinch of salt. Mash until a paste forms and set aside. (Alternately, finely chop the ginger, garlic and green chile together, sprinkle with a pinch of salt, then mash into a coarse paste using the flat portion of your chef’s knife.)</li><li onclick="handleItemClick()">In a large skillet with a lid, heat 3 tablespoons oil over medium.</li><li onclick="handleItemClick()">Cook the onions until golden, about 10 minutes.</li><li onclick="handleItemClick()">Add the ginger paste and cook, stirring, until fragrant, 3 to 4 minutes.</li><li onclick="handleItemClick()">Stir in the tomato paste, coriander, cumin, chile powder and 1¼ teaspoons salt.</li><li onclick="handleItemClick()">Stir in the cauliflower and coconut milk and bring to a simmer.</li><li onclick="handleItemClick()">Reduce the heat to low, cover and cook until the cauliflower is tender, 10 to 12 minutes.</li><li onclick="handleItemClick()">Meanwhile, heat the remaining 1 tablespoon oil in a small skillet over medium.</li><li onclick="handleItemClick()">Fry the cashews, stirring occasionally, 2 minutes. Transfer to a plate to cool.</li><li onclick="handleItemClick()">Add the peas and garam masala to the cauliflower mixture and cook, stirring, 5 minutes.</li><li onclick="handleItemClick()">Season to taste with salt.</li><li onclick="handleItemClick()">Top the curry with the cashews, cilantro and a squeeze of lemon just before serving.</li><li onclick="handleItemClick()">Serve with a big steaming bowl of basmati rice.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_CauliflowerCashewPeaandCoconutCurry', '<ul><li onclick="handleItemClick()">From <a href="https://cooking.nytimes.com/recipes/1019911-cauliflower-cashew-pea-and-coconut-curry" target="_blank">https://cooking.nytimes.com/recipes/1019911-cauliflower-cashew-pea-and-coconut-curry</a></li><li onclick="handleItemClick()">date created: [2021-01-04 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_CajunMeatLoafwithChiliSauce', '<ul><li onclick="handleItemClick()">1 cup long grain brown rice</li><li onclick="handleItemClick()">¼ cup oil</li><li onclick="handleItemClick()">⅔ cup dried lentils</li><li onclick="handleItemClick()">1½ teasp. salt</li><li onclick="handleItemClick()">2 cups diced onion</li><li onclick="handleItemClick()">1 cup celery, chopped</li><li onclick="handleItemClick()">1 cup diced green pepper</li><li onclick="handleItemClick()">4 chopped jalapeno peppers</li><li onclick="handleItemClick()">1 Tblsp garlic, chopped</li><li onclick="handleItemClick()">1 cup pecans, chopped</li><li onclick="handleItemClick()">½ cup sesame seeds</li><li onclick="handleItemClick()">½ teasp black pepper</li><li onclick="handleItemClick()">1 pinch white pepper</li><li onclick="handleItemClick()">2 cups TVP</li><li onclick="handleItemClick()">1½ cups barbecue sauce</li><li onclick="handleItemClick()">9 eggs</li><li onclick="handleItemClick()">1 pound cheddar cheese grated</li><li onclick="handleItemClick()">8 ounces tomato juice</li><li onclick="handleItemClick()">¼ cup soy sauce</li></ul><ul><li onclick="handleItemClick()">1 cup		tomato sauce</li><li onclick="handleItemClick()">½ teasp		liquid smoke</li><li onclick="handleItemClick()">¼ cup		sugar</li><li onclick="handleItemClick()">¼ cup		cider vinegar</li><li onclick="handleItemClick()">¼ cup		tomato paste</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_CajunMeatLoafwithChiliSauce', '<ul><li onclick="handleItemClick()">½ cup long grain brown rice</li><li onclick="handleItemClick()">2 Tbls oil</li><li onclick="handleItemClick()">⅓ cup dried lentils</li><li onclick="handleItemClick()">¾ teasp. salt</li><li onclick="handleItemClick()">1 cup diced onion</li><li onclick="handleItemClick()">½ cup celery, chopped</li><li onclick="handleItemClick()">½ cup diced green pepper</li><li onclick="handleItemClick()">2 chopped jalapeno peppers</li><li onclick="handleItemClick()">½ Tblsp garlic, chopped</li><li onclick="handleItemClick()">½ cup pecans, chopped</li><li onclick="handleItemClick()">¼ cup sesame seeds</li><li onclick="handleItemClick()">¼ teasp black pepper</li><li onclick="handleItemClick()">1 pinch white pepper</li><li onclick="handleItemClick()">1 cup TVP</li><li onclick="handleItemClick()">¾ cups barbecue sauce</li><li onclick="handleItemClick()">4 eggs</li><li onclick="handleItemClick()">½ pound cheddar cheese grated</li><li onclick="handleItemClick()">4 ounces tomato juice</li><li onclick="handleItemClick()">2 Tbls soy sauce</li></ul><ul><li onclick="handleItemClick()">1 cup		tomato sauce</li><li onclick="handleItemClick()">½ teasp		liquid smoke</li><li onclick="handleItemClick()">¼ cup		sugar</li><li onclick="handleItemClick()">¼ cup		cider vinegar</li><li onclick="handleItemClick()">¼ cup		tomato paste</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_CajunMeatLoafwithChiliSauce', '<ol><li onclick="handleItemClick()">Take half the oil, and saute uncooked rice over low heat until golden. Stir often.</li><li onclick="handleItemClick()">Add 3 (1.5 for half) cups water, and cook uncovered until rice is tender.</li><li onclick="handleItemClick()">In another saute pan, place lentils, 4 cups (2 cups for half) water and  ½ teaspoon salt. Cook until tender, about 30 minutes and drain. (Do not overcook; lentils should be chewy.)</li><li onclick="handleItemClick()">In a large saute pan, take the rest of the oil and saute half the onions until brown.</li><li onclick="handleItemClick()">Add the rest of onions, celery and peppers and cook until tender, or about 5 minutes.</li><li onclick="handleItemClick()">Mix in the rest of the ingredients, except eggs, cheese and tomato juice. Let cool, then beat eggs with tomato juice and add to mixture.</li><li onclick="handleItemClick()">Add  ¼ cup (or 2 Tbls for half) soy sauce. Knead. Wait 5 minutes so TVP can soak up moisture. Taste TVP to see if smooth. If crunchy, add water. Add cheese and place in baking dish. (Optionally, cover loaf with paper thin cheese: e.g., mozerella.)</li><li onclick="handleItemClick()">Cover with aluminum foil and bake at 275 degrees for 1 hour or until center is cooked.</li><li onclick="handleItemClick()">The meat loaf may be served with ketchup, or with the spicy chili sauce, below.</li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_CajunMeatLoafwithChiliSauce', '<ul><li onclick="handleItemClick()">1 medium	onion, chopped</li><li onclick="handleItemClick()">1			green pepper chopped</li><li onclick="handleItemClick()">2			jalapeno peppers, chopped</li><li onclick="handleItemClick()">1 stalk		celery, diced</li><li onclick="handleItemClick()">¼ cup		oil</li><li onclick="handleItemClick()">1 large can	Italian tomatoes</li><li onclick="handleItemClick()">½ teasp		coriander</li><li onclick="handleItemClick()">1 heaping teasp	cumin</li><li onclick="handleItemClick()">¼ cup		soy sauce</li></ul>' ] );
