ingredients_array.push( [ 'CostanzoRecipes_Entrees_ButternutSquashSoup', '<ul><li onclick="handleItemClick()">3 lbs butternut squash</li><li onclick="handleItemClick()">7 Tbsp butter</li><li onclick="handleItemClick()">2 leeks - thinly sliced (onions will do in a pinch!)</li><li onclick="handleItemClick()">1 qt vegetable stock</li><li onclick="handleItemClick()">¼ tsp nutmeg</li><li onclick="handleItemClick()">½ cup peas (frozen or fresh)</li><li onclick="handleItemClick()">8 cups fresh spinach (approx. ½ lbs = 10 oz. bag)</li><li onclick="handleItemClick()">1¼ cup light cream</li><li onclick="handleItemClick()">salt and pepper to taste</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_ButternutSquashSoup', '<ol><li onclick="handleItemClick()">Slice squash length-wise in half. Place in microwave-proof pan with a small amount of water and microwave on high until flesh is tender (perhaps 20 minutes, depending on microwave).</li><li onclick="handleItemClick()">Wash and drain spinach, trim stems, chop and set aside.</li><li onclick="handleItemClick()">When squash is cool enough to handle, scoop out.</li><li onclick="handleItemClick()">Melt butter in a stock pot and add leeks. Saute until soft. Add stock, squash, nutmeg, salt and pepper. Bring to a boil. </li><li onclick="handleItemClick()">Puree soup in a food processor.</li><li onclick="handleItemClick()">Return to pot and add spinach and peas. Simmer until spinach is slightly tender.</li><li onclick="handleItemClick()">Stir in cream, heat and serve.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_ButternutSquashSoup', '<ul><li onclick="handleItemClick()">[Served Easter weekend, April 2004 at Tracey and John\'s]</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_BlackBeanandRiceEnchiladas', '<ul><li onclick="handleItemClick()">1 tablespoon olive oil</li><li onclick="handleItemClick()">1 green bell pepper, chopped</li><li onclick="handleItemClick()">1 onion, chopped</li><li onclick="handleItemClick()">3 cloves garlic, minced</li><li onclick="handleItemClick()">1 (15 ounce) can black beans, rinsed and drained</li><li onclick="handleItemClick()">1 (14.5 ounce) can diced tomatoes and green chilies</li><li onclick="handleItemClick()">¼ cup picante sauce</li><li onclick="handleItemClick()">1 tablespoon chili powder</li><li onclick="handleItemClick()">1 teaspoon ground cumin</li><li onclick="handleItemClick()">¼ teaspoon red pepper flakes</li><li onclick="handleItemClick()">2 cups cooked brown rice</li><li onclick="handleItemClick()">8 (6 inch) flour tortillas, warmed</li><li onclick="handleItemClick()">1 cup salsa</li><li onclick="handleItemClick()">1 cup shredded Cheddar cheese</li><li onclick="handleItemClick()">3 tablespoons chopped fresh cilantro leaves</li><li onclick="handleItemClick()">¼ cup shredded Cheddar cheese</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_BlackBeanandRiceEnchiladas', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees F (175 degrees C). Lightly grease a 9x13-inch baking dish.</li><li onclick="handleItemClick()">Heat oil in a large skillet over medium heat; cook and stir green pepper, onion, and garlic until tender, about 7 minutes.</li><li onclick="handleItemClick()">Stir in beans, tomatoes, picante sauce, chili powder, cumin, and red pepper flakes; bring to a boil. Reduce heat to low and simmer, uncovered, until heated through and mixture thickens, about 5 minutes.</li><li onclick="handleItemClick()">Fold in rice and 1 cup Cheddar cheese; cook until heated through, about 5 minutes.</li><li onclick="handleItemClick()">Spoon a rounded ½ cup bean mixture down the center of each tortilla. Fold sides over filling and roll up. Place enchiladas seam side down in baking dish; spoon salsa over each tortilla. Cover baking dish with aluminum foil.</li><li onclick="handleItemClick()">Bake in preheated oven for 25 minutes.</li><li onclick="handleItemClick()">Uncover and sprinkle with cilantro and ¼ cup Cheddar cheese. Bake until cheese is melted, 2 to 3 minutes.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_BlackBeanandRiceEnchiladas', '<a href="https://www.allrecipes.com/recipe/222598/black-bean-and-rice-enchiladas/print/?recipeType=Recipe&servings=8&isMetric=false" target="_blank">https://www.allrecipes.com/recipe/222598/black-bean-and-rice-enchiladas/print/?recipeType=Recipe&servings=8&isMetric=false</a>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_BellPepperCasserole', '<ul><li onclick="handleItemClick()">½ cup olive oil</li><li onclick="handleItemClick()">1 large onion chopped</li><li onclick="handleItemClick()">1 cup carrots grated</li><li onclick="handleItemClick()">4 bell peppers chopped</li><li onclick="handleItemClick()">5 tomatoes chopped (one large can)</li><li onclick="handleItemClick()">2 cups cooked brown rice</li><li onclick="handleItemClick()">1 cup or can cooked black beans</li><li onclick="handleItemClick()">5 cloves garlic chopped</li><li onclick="handleItemClick()">1 cup panko breadcrumbs</li><li onclick="handleItemClick()">sea salt and paprika to taste</li><li onclick="handleItemClick()">2 cups mozzarella (or several types of) cheese, grated <i class="conditional-space-after"></i>1½ cups Nutritional yeast flakes</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_BellPepperCasserole', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees.</li><li onclick="handleItemClick()">In a large saucepan, warm up half the amount of olive oil and sautee the onions for 1-2 minutes.</li><li onclick="handleItemClick()">Add the carrots and the peppers.</li><li onclick="handleItemClick()">Cook on high flame for about 2-3 minutes, stirring constantly.</li><li onclick="handleItemClick()">Add the remaining oil and the tomatoes.</li><li onclick="handleItemClick()">Lower the flame, cover and simmer for about 4 minutes.</li><li onclick="handleItemClick()">Add sea salt, paprika and garlic; mix well.</li><li onclick="handleItemClick()">Lightly oil a casserole dish.</li><li onclick="handleItemClick()">Put half of the vegetable mix on the bottom of it.</li><li onclick="handleItemClick()">Put brown rice on top of the vegetable mix.</li><li onclick="handleItemClick()">Layer black beans over the rice.</li><li onclick="handleItemClick()">Pour the rest of the vegetable mixture on top.</li><li onclick="handleItemClick()">Sprinkle with cheese or nutritional yeast flakes. (If using flakes, lightly mix them with the vegetable layer.)</li><li onclick="handleItemClick()">Top with cracker bits.</li><li onclick="handleItemClick()">Bake for 35 minutes.</li><li onclick="handleItemClick()">Serve with raw avocado sour cream.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_BellPepperCasserole', '<ul><li onclick="handleItemClick()">From <a href="https://healthymamainfo.com/2012/01/bell-pepper-casserole-vegan/" target="_blank">https://healthymamainfo.com/2012/01/bell-pepper-casserole-vegan/</a></li><li onclick="handleItemClick()">date created: [2021-06-22 Tue] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_BakedTofuWithPeanutSauceandCoconutLimeRice', '<ul><li onclick="handleItemClick()">2 tablespoons peanut or vegetable oil, plus more for brushing the pan and drizzling</li><li onclick="handleItemClick()">⅔ cup lime juice (from about 5 limes), and zest of 1 lime</li><li onclick="handleItemClick()">Kosher salt</li><li onclick="handleItemClick()">8 baby bell peppers or 1 medium bell pepper (any color will do), stemmed and thinly sliced lengthwise</li><li onclick="handleItemClick()">Black pepper</li><li onclick="handleItemClick()">1 cup long-grain rice like jasmine or basmati</li><li onclick="handleItemClick()">½ cup full-fat coconut milk</li><li onclick="handleItemClick()">1 cup smooth, natural peanut butter</li><li onclick="handleItemClick()">1 tablespoon red miso</li><li onclick="handleItemClick()">1 tablespoon grated ginger</li><li onclick="handleItemClick()">1 tablespoon fish sauce (optional)</li><li onclick="handleItemClick()">2 teaspoons chopped habanero pepper, stem and seeds removed, or 1 tablespoon sambal</li><li onclick="handleItemClick()">2 tablespoons buckwheat honey or molasses</li><li onclick="handleItemClick()">2 (14-ounce) package extra-firm tofu, drained and sliced crosswise, ¼-inch thick</li><li onclick="handleItemClick()">3 cups peppery greens, like arugula, mizuna or baby mustard greens</li><li onclick="handleItemClick()">2 scallions, trimmed and thinly sliced</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_BakedTofuWithPeanutSauceandCoconutLimeRice', '<ol><li onclick="handleItemClick()">Heat the oven to 450 degrees and lightly brush a large rimmed sheet pan with oil.</li><li onclick="handleItemClick()">In a small bowl, stir 4 tablespoons lime juice with ½ teaspoon salt until salt dissolves.</li><li onclick="handleItemClick()">Add the sliced peppers, a few cracks of black pepper and set aside.</li><li onclick="handleItemClick()">In a small pot, combine the rice with 1 cup water and the coconut milk. Season with salt and bring to a simmer. Cover and cook over medium-low until the rice is just tender, 12 to 15 minutes. Remove from the heat and let sit, covered, until ready to serve.</li><li onclick="handleItemClick()">In a medium bowl, whisk 4 tablespoons lime juice with the peanut butter, miso, ginger, fish sauce (if using), habanero, 2 tablespoons oil, 1 tablespoon honey and ¾ cup water. Stir until smooth and season to taste with salt.</li><li onclick="handleItemClick()">Arrange the tofu pieces in a single layer on the oiled baking sheet and season with salt. Spoon about 2 tablespoons of the peanut sauce over each, covering the top and allowing the sauce to run down and coat the sides. Drizzle the tops with some oil, and roast until glaze is set, deep brown and caramelized along the edges, 18 to 20 minutes.</li><li onclick="handleItemClick()">Add the remaining lime juice and 1 tablespoon honey to the leftover peanut sauce in the bowl to make the dressing; set aside.</li><li onclick="handleItemClick()">Divide the greens among bowls. Add the lime zest and half the sliced scallions to the rice, then fluff with a fork. Top the greens with the rice, then the tofu. Spoon the peanut dressing over everything, and garnish with the drained pickled peppers and remaining sliced scallions.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_BakedTofuWithPeanutSauceandCoconutLimeRice', '<ul><li onclick="handleItemClick()">From <a href="https://cooking.nytimes.com/recipes/1020530-baked-tofu-with-peanut-sauce-and-coconut-lime-rice" target="_blank">https://cooking.nytimes.com/recipes/1020530-baked-tofu-with-peanut-sauce-and-coconut-lime-rice</a></li><li onclick="handleItemClick()">YIELD: 4 servings</li><li onclick="handleItemClick()">TIME: 25 minutes</li><li onclick="handleItemClick()">date created: [2021-01-27 Wed] </li><li onclick="handleItemClick()">[2022-02-19 Sat] Lots of interesting flavors going on which work well together. This took about 90 minutes from start to finish, so allocate time for these many steps. The rice was tasty, but a bit too crunchy. I’d use more than a cup of water next time (maybe 1½ cups?)</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_BakedRisotto', '<ul><li onclick="handleItemClick()">1 tablespoon extra-virgin olive oil</li><li onclick="handleItemClick()">½ onion, finely chopped</li><li onclick="handleItemClick()">¾ cup (150 g) Arborio rice</li><li onclick="handleItemClick()">¼ cup (60 ml) dry white wine</li><li onclick="handleItemClick()">2 to 2¼  cups (480 to 540 ml) hot water or broth</li><li onclick="handleItemClick()">¾ teaspoon kosher salt</li><li onclick="handleItemClick()">Pinch of freshly ground black pepper</li><li onclick="handleItemClick()">1 to 2 tablespoons unsalted butter</li><li onclick="handleItemClick()">¼  cup (30 g) freshly grated Parmigiano-Reggiano cheese, plus more for garnish</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_BakedRisotto', '<ol><li onclick="handleItemClick()">Preheat the oven to 400°F / 200°C / gas 6.</li><li onclick="handleItemClick()">Roast the vegetables on a single baking sheet/tray on the top rack of the oven (the risotto will bake on the bottom rack).</li><li onclick="handleItemClick()">Meanwhile, heat the olive oil in an ovenproof saucepan or Dutch oven over medium-high heat.</li><li onclick="handleItemClick()">Add the onion and cook, stirring, until it is soft and translucent, about 3 minutes.</li><li onclick="handleItemClick()">Add the rice and stir to coat with the oil.</li><li onclick="handleItemClick()">Stir in the wine and cook until the wine has evaporated, 1 minute more.</li><li onclick="handleItemClick()">Stir in 2 cups (480 ml) of the hot water or broth, salt, and pepper, and bring to a boil.</li><li onclick="handleItemClick()">Cover and transfer to the oven.</li><li onclick="handleItemClick()">Bake on the bottom rack during the last 25 minutes of roasting time for the vegetables.</li><li onclick="handleItemClick()">After 25 minutes, check the risotto. Most of the liquid should be absorbed and the rice just cooked.</li><li onclick="handleItemClick()">Remove the risotto from the oven and stir in another ½ cup (120 ml) hot cups of water or broth and the butter and cheese.</li><li onclick="handleItemClick()">Serve topped with roasted vegetables with thin shavings of Parmigiano-Reggiano.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_BakedRisotto', '<ul><li onclick="handleItemClick()">From <a href="https://www.epicurious.com/recipes/food/views/baked-risotto-with-roasted-vegetables-395552" target="_blank">https://www.epicurious.com/recipes/food/views/baked-risotto-with-roasted-vegetables-395552</a></li><li onclick="handleItemClick()">date created: [2021-07-31 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_AsparagusFrittatawithBasilShallotsandParmesan', '<ul><li onclick="handleItemClick()">1 pound thin asparagus</li><li onclick="handleItemClick()">2 Tbls extra-virgin olive oil</li><li onclick="handleItemClick()">3 medium shallots, minced (onions will do in a pinch!)</li><li onclick="handleItemClick()">6 large eggs -- egg beaters work just fine!</li><li onclick="handleItemClick()">½ cup freshly grated Parmigiano-Reggiano cheese (I use Pecorino Romano)</li><li onclick="handleItemClick()">¼ cup shredded fresh basil leaves (I use 1 tsp dried)</li><li onclick="handleItemClick()">kosher salt and freshly ground black pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_AsparagusFrittatawithBasilShallotsandParmesan', '<ol><li onclick="handleItemClick()">Snap and discard tough asparagus ends. Slice the asparagus on the bias into 1-inch-long pieces. Steam the asparagus in a bamboo steamer (or boil in salt water for 1½ minutes), until almost tender.</li><li onclick="handleItemClick()">Preheat the broiler. Heat the oil in a 10-inch nonstick skillet with an oven proof handle. Swirl the oil to coat the bottom of the pan evenly. Add the shallots and saute over medium heat until translucent, about 3 minutes. Add the asparagus and cook for 30 seconds. </li><li onclick="handleItemClick()">In a medium bowl, use a fork to lightly beat the eggs, cheese, basil and salt and pepper. Add the egg mixture to the pan and stir gently with a fork to incorporate the vegetables. Cook over medium-low heat, occasionally sliding a spatula around the edges of the pan to loosen the frittata as it sets. Continue cooking until the frittata is set, except for the top, about 8 minutes.</li><li onclick="handleItemClick()">Place the pan directly under the broiler and cook just until the top is golden brown and set, 1 to 2 minutes. Do not let the frittata burn.</li><li onclick="handleItemClick()">Invert the frittata onto a large platter. (Optionally sprinkle with a little kosher salt.) Cut it into wedges and serve. The frittata may also be cooled to room temperature and then cut and served. </li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_AsparagusFrittatawithBasilShallotsandParmesan', '<ul><li onclick="handleItemClick()">[As served at Easter Brunch at Tracey and John\'s, April 2004. Recipe source: The Complete Italian Vegetarian Cookbook, by Jack Bishop, page 245.]</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Entrees_ArrabbiataSauce', '<ul><li onclick="handleItemClick()">½ tablespoon plus ½ teaspoon olive oil</li><li onclick="handleItemClick()">2 cups chopped onion</li><li onclick="handleItemClick()">8 cloves garlic, minced</li><li onclick="handleItemClick()">¾ cup red wine</li><li onclick="handleItemClick()">⅛ cup white sugar</li><li onclick="handleItemClick()">⅛ cup chopped fresh basil</li><li onclick="handleItemClick()">½ tablespoon plus ½ teaspoon crushed red pepper flakes</li><li onclick="handleItemClick()">¼ cup tomato paste</li><li onclick="handleItemClick()">⅛ cup lemon juice</li><li onclick="handleItemClick()">1 teaspoon Italian seasoning</li><li onclick="handleItemClick()">½ teaspoon ground black pepper</li><li onclick="handleItemClick()">4 (14.5 ounce) cans peeled and diced tomatoes</li><li onclick="handleItemClick()">¼ cup chopped fresh parsley</li></ul><ul><li onclick="handleItemClick()">1 tablespoon plus 1 teaspoon olive oil</li><li onclick="handleItemClick()">4 cups chopped onion</li><li onclick="handleItemClick()">16 cloves garlic, minced</li><li onclick="handleItemClick()">1½  cups red wine</li><li onclick="handleItemClick()">¼ cup white sugar</li><li onclick="handleItemClick()">¼ cup chopped fresh basil</li><li onclick="handleItemClick()">1 tablespoon plus 1 teaspoon crushed red pepper flakes</li><li onclick="handleItemClick()">½ cup tomato paste</li><li onclick="handleItemClick()">¼ cup lemon juice</li><li onclick="handleItemClick()">2 teaspoons Italian seasoning</li><li onclick="handleItemClick()">1 teaspoon ground black pepper</li><li onclick="handleItemClick()">8 (14.5 ounce) cans peeled and diced tomatoes</li><li onclick="handleItemClick()">½ cup chopped fresh parsley</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Entrees_ArrabbiataSauce', '<ol><li onclick="handleItemClick()">Heat oil in a large skillet or saucepan over medium heat.</li><li onclick="handleItemClick()">Sauté onion and garlic in oil for 5 minutes.</li><li onclick="handleItemClick()">Stir in wine, sugar, basil, red pepper, tomato paste, lemon juice, Italian seasoning, black pepper and tomatoes.</li><li onclick="handleItemClick()">Bring to a boil.</li><li onclick="handleItemClick()">Reduce heat to medium and simmer uncovered for about 15 minutes.</li><li onclick="handleItemClick()">Stir in parsley.</li><li onclick="handleItemClick()">Ladle over hot cooked pasta of your choice.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Entrees_ArrabbiataSauce', '<ul><li onclick="handleItemClick()">From <a href="https://www.allrecipes.com/recipe/11839/arrabbiata-sauce/" target="_blank">https://www.allrecipes.com/recipe/11839/arrabbiata-sauce/</a></li><li onclick="handleItemClick()">date created: [2021-08-02 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">4 teaspoons corn oil,</li><li onclick="handleItemClick()">½ cup minced red onion,</li><li onclick="handleItemClick()">2 tablespoons minced garlic,</li><li onclick="handleItemClick()">½ teaspoon hot chili pepper</li><li onclick="handleItemClick()">2 tablespoons sugar</li><li onclick="handleItemClick()">2 tablespoons vinegar,</li><li onclick="handleItemClick()">⅓ cup peanut butter,</li><li onclick="handleItemClick()">1 cup of water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">In a blender, combine corn oil, onion, garlic and hot chili pepper; blend for 1 minute</li><li onclick="handleItemClick()">Empty the mixture into a saucepan and place over low heat until the mixture starts releasing aroma. Add peanut butter and mix well over low heat.</li><li onclick="handleItemClick()">Add water and let it simmer for 10 minutes or until thickened.</li><li onclick="handleItemClick()">Stir in vinegar and sugar; continue to simmer for another 1-2 minutes. Taste and add more vinegar and sugar if the mixture does not have the sour and sweet taste.</li><li onclick="handleItemClick()">Place sauce in a shallow plate for satay dipping or pour over fresh salad.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">Submitted by: Pat; downloaded 26 Jan 2009</li><li onclick="handleItemClick()">date created: [2009-01-26 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">1 avocado - halved & stoned</li><li onclick="handleItemClick()">15ml (1tbsp) Coleraine Cheddar Cheese w/ beer & garlic - grated</li><li onclick="handleItemClick()">5ml (1tsp) lemon juice</li><li onclick="handleItemClick()">45ml (3tbsp) Yogurt</li><li onclick="handleItemClick()">30ml (2tbsp) dry roasted peanuts - coarsely chopped</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">Scoop flesh out of avocado and finely chop.</li><li onclick="handleItemClick()">Blend w/ cheese and lemon juice to make a paste.</li><li onclick="handleItemClick()">Fold in yogurt.</li><li onclick="handleItemClick()">Spoon mixture into avocado shells.</li><li onclick="handleItemClick()">Chill.</li><li onclick="handleItemClick()">Sprinkle with peanuts just before serving.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">Ulster Tatler April 1997</li><li onclick="handleItemClick()">Brier Country House B&B</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed]  Crispy Cauliflower Buffalo Wings</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">½ head cauliflower, chopped into bite size pieces</li><li onclick="handleItemClick()">1 cup garbanzo bean (or wheat) flour</li><li onclick="handleItemClick()">1 cup water</li><li onclick="handleItemClick()">1 tsp. garlic powder (or minced fresh garlic)</li><li onclick="handleItemClick()">½ tsp. salt</li><li onclick="handleItemClick()">1 tsp. melted butter or ghee</li><li onclick="handleItemClick()">⅔ cup hot sauce</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">Preheat oven to 450F.</li><li onclick="handleItemClick()">In a medium size bowl, combine flour, water, garlic powder and salt. Whisk together until smooth.</li><li onclick="handleItemClick()">Toss cauliflower into batter making sure to coat each piece completely, then place battered   cauliflower on a lightly greased, non-stick baking sheet. </li><li onclick="handleItemClick()">Bake for 15 minutes, tossing half way through.</li><li onclick="handleItemClick()">In the meantime, combine melted butter and hot sauce in a large bowl, stirring.</li><li onclick="handleItemClick()">When cauliflower is done, remove it from the oven and gently toss it in the hot sauce mixture.</li><li onclick="handleItemClick()">Place cauliflower back on the baking sheet and cook for an additional 25 minutes or until it   becomes crispy. Allow cauliflower to cool for 15 minutes before serving. </li><li onclick="handleItemClick()">Serve with your favorite creamy dressing.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Dishes_Sides', '' ] );
