ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', 'Makes 1 cup; serves 4-6<ul><li onclick="handleItemClick()">2 tablespoons	olive oil</li><li onclick="handleItemClick()">1 tablespoon	butter</li><li onclick="handleItemClick()">4 cups		sliced mild onions</li><li onclick="handleItemClick()"> teaspoon	dried rosemary, crumbled</li><li onclick="handleItemClick()">⅛ teaspoon	dried thyme</li><li onclick="handleItemClick()">⅓ cup		water</li><li onclick="handleItemClick()">2 tablespoons	white wine</li><li onclick="handleItemClick()">6			oil-marinated sun-dried tomato halves</li><li onclick="handleItemClick()">1 tablespoon	chopped fresh parsley</li><li onclick="handleItemClick()"> teaspoon	capers (optional!)</li><li onclick="handleItemClick()">6 small		pitted black olives (For best results use a good flavorful olive such as a kalamata.)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">In a large skillet over medium-high heat, heat the oil and the butter.</li><li onclick="handleItemClick()">Add the onion; cook, stirring until softened about 2 minutes. Stir in the</li><li onclick="handleItemClick()">the rosemary and thyme. Lower the heat and cook slowly, uncovered, until onions are golden, stirring occasionally, about 45 minutes. [Don\'t try to hurry the onions; they\'ll know this and won\'t caramelize! -jc]</li><li onclick="handleItemClick()">Add the water, wine, sun-dried tomatoes, parsley and capers (if you have to!). Bring to a boil. Remove from heat and transfer to a food processor container fitted with a steel blade. Add the olives. Cover and process until everything is finely chopped.</li><li onclick="handleItemClick()">Variation: Substitute water for the wine.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">As served by John and Tracey at their house in November, 2002 from a recipe appearing on page 65 of the book "1,000 Vegetarian Recipes" by Carol Gelles.</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">2 lbs. potatoes, unpeeled</li><li onclick="handleItemClick()">⅔ cup milk</li><li onclick="handleItemClick()">4-5 scallions, finely chopped</li><li onclick="handleItemClick()">- cup butter</li><li onclick="handleItemClick()">salt and pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">Champ, also known as cally, poundies and pandy, is one of the most famous ways of serving Ireland\'s best loved vegetable--the potato. Champ is the country\'s way of serving mashed potatoes.</li><li onclick="handleItemClick()">Heat a pan of salted water and boil the potatoes in their skins until tender. Drain and dry over low heat covered with a paper towel. Peel and mash well.</li><li onclick="handleItemClick()">While the potatoes are cooking, put the milk and chopped scallions into a saucepan, bring to a boil, and simmer for a few minutes. Gradually beat the milk and onion mixture into the mashed potatoes to form a soft, but not sloppy, mixture. Beat in half the butter and searson with salt pepper. Divide among 4 warm plates or bowls. Make a well in the center of each serving, cut the remaining butter into 4 pieces, and put one piece in each of the hollows. Serve immediately.</li><li onclick="handleItemClick()">Cook\'s notes:</li><li onclick="handleItemClick()">Traditionally, champ would have been served as a main meal, with a glass of milk or buttermilk. Today, however, it is used to acocompany meats such as boiled ham and broiled sausages. Parsley, young nettle tops, peas and fava beans can be substituted for the scallions.</li><li onclick="handleItemClick()">Serves 4.</li><li onclick="handleItemClick()">Prep time: 5 minutes</li><li onclick="handleItemClick()">Cooking time: 20-25 minutes</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">Irish Food & Folklore by Clare Connery</li><li onclick="handleItemClick()">Greg\'s 9/3/01 </li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">½ c. white grits</li><li onclick="handleItemClick()">¾ tsp. salt</li><li onclick="handleItemClick()">2½ c. boiling water</li><li onclick="handleItemClick()">¼ lb. cheddar cheese, grated</li><li onclick="handleItemClick()">1 egg, well beaten</li><li onclick="handleItemClick()">Pinch of cayenne pepper</li><li onclick="handleItemClick()">Paprika</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">Gradually stir grits and salt into the boiling water. Cover and cook for about 10 minutes, until grits are done, stirring often. </li><li onclick="handleItemClick()">Add all but ⅓ cup of the grated cheese and the egg. Season with cayenne and stir until mixture is smooth. Cover and cook a little longer until cheese is melted. Pour into a well greased casserole and top with remaining cheese and dust with paprika. Bake in a 325 degree oven for 25 minutes.</li><li onclick="handleItemClick()">Serves 2.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">date created: [2008-05-17 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', 'Serves 8<ul><li onclick="handleItemClick()">1 (16 ounce) can garbanzo beans, drained and rinsed</li><li onclick="handleItemClick()">1 tablespoon olive oil</li><li onclick="handleItemClick()">1 medium red bell pepper, cut into ½ inch pieces</li><li onclick="handleItemClick()">1 tablespoon tahini</li><li onclick="handleItemClick()">1 fresh lime, juiced</li><li onclick="handleItemClick()">1½ tablespoons water</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">¼ teaspoon ground black pepper</li><li onclick="handleItemClick()">¼ teaspoon garlic powder</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">In a food processor or blender, mix the garbanzo beans, olive oil, red bell pepper, tahini, lime juice, water, salt, black pepper, and garlic powder. Blend until smooth. </li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">Posted by: "New Hope-L\'ville Vegetarians"  nhlveg@yahoo.com     nhlveg</li><li onclick="handleItemClick()">Sat Dec 13, 2008 7:16 am (PST)</li><li onclick="handleItemClick()">Here\'s yet another "Recipe of the Week".  Please don\'t forget to send in your favorite recipes so we can keep this going.</li><li onclick="handleItemClick()">date created: [2008-12-15 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', 'Makes 16<ul><li onclick="handleItemClick()">1 cup water</li><li onclick="handleItemClick()">½ cup unsalted butter, cut into pieces</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">⅛ teaspoon white pepper (black works too)</li><li onclick="handleItemClick()">⅛ teaspoon cayenne pepper</li><li onclick="handleItemClick()">1 cup all purpose flour</li><li onclick="handleItemClick()">4 eggs at room temperature</li><li onclick="handleItemClick()">¾ cup to 1½ cups finely shredded gruyere cheese (about 2 oz) - you can experiment with different kinds of cheese</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">Place water, butter, salt and pepper in heavy medium saucepan.  Heat over medium heat stirring   until butter is melted and mixture boils. </li><li onclick="handleItemClick()">Stir in flour all at once.  Beat  with wooden spoon over heat until begins to form a ball, about   1 minute. </li><li onclick="handleItemClick()">Remove from heat and beat until slightly cooled about 30 seconds.</li><li onclick="handleItemClick()">Add eggs to flour mixture one at a time while beating with electric hand mixer between each   addition until mixture has a dull satiny sheen. </li><li onclick="handleItemClick()">Stir in cheese until well blended.</li><li onclick="handleItemClick()">Butter and flour large baking sheet, or line with parchment paper.  Drop warm paste by heaping   tablespoonfuls onto baking sheet at least 2 inches apart. </li><li onclick="handleItemClick()">Bake until very well browned at 350 degrees, about 35 minutes.  It could take longer for them to   be well browned. </li><li onclick="handleItemClick()">Remove from oven and transfer to wire rack.  Cut tiny slit in side of each puff to allow steam to   escape. </li><li onclick="handleItemClick()">These are best eaten the day they are baked.  You can freeze them on the baking sheet before   cooking (add 10 minutes to cooking time) or heat them briefly to crisp them up again if you make   them the previous day. </li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">Great with soup or salad.</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">2 egg yolks</li><li onclick="handleItemClick()">3 Tbls lemon juice</li><li onclick="handleItemClick()">½ cup butter</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">Stir 2 egg yolks, slightly beaten, and 3 tablespoons lemon juice vigorously in 1-quart saucepan with wooden spoon.</li><li onclick="handleItemClick()">Add ¼ cup butter. Heat over very low heat, stirring constantly, until butter is melted.</li><li onclick="handleItemClick()">Add ¼ cup butter, stirring vigorously until butter is melted and sauce thickens.</li><li onclick="handleItemClick()">(Be sure butter melts slowly; this give eggs time to cook and thicken sauce without curdling.) Serve hot or at room temperature. </li></ol>' ] );
