ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">½ onion</li><li onclick="handleItemClick()">½ cup canola oil</li><li onclick="handleItemClick()">½ cup rice vinegar</li><li onclick="handleItemClick()">¼ cup soy sauce</li><li onclick="handleItemClick()">1 inch chunk of fresh ginger</li><li onclick="handleItemClick()">1 tbs sugar</li><li onclick="handleItemClick()">Salt and pepper to taste</li></ol>' ] );
