ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">salt and pepper; to taste</li><li onclick="handleItemClick()">1 Onion, sliced</li><li onclick="handleItemClick()">4 tb Sultanas or currants</li><li onclick="handleItemClick()">3 lg Or 4 medium carrots</li><li onclick="handleItemClick()">100 ml Water</li><li onclick="handleItemClick()">8 Fresh dates</li><li onclick="handleItemClick()">2 tb olive oil</li><li onclick="handleItemClick()">Original recipe makes 4 Servings</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">This side dish with a difference goes very well with plainly   grilled or roasted chicken or braised lamb.</li><li onclick="handleItemClick()">Wash 3 large or 4 medium carrots and slice into rounds.</li><li onclick="handleItemClick()">Peel one onion and slice. </li><li onclick="handleItemClick()">Stone 8 fresh dates (or substitute dried) and cut into slices lengthwise.</li><li onclick="handleItemClick()">Have ready 4 tablespoons of currants or sultanas.</li><li onclick="handleItemClick()">Heat 2 tablespoons olive oil in a wide saucepan. Add all the   prepared ingredients and stir-fry for a minute or two, then add 100   mL water, cover and bring to a fast boil. Add salt to taste and put   back the lid at an angle so that steam can escape. Cook for about   10 minutes, stirring occasionally, until the carrots are tender and   the water has evaporated. If water remains, remove the lid and   raise the heat to dry it off.</li><li onclick="handleItemClick()">Serve.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">Posted by Stephen Ceideburg From an article by Meryl Constance in The</li><li onclick="handleItemClick()">Sydney Morning Herald, 6/8/93.</li><li onclick="handleItemClick()">Courtesy Mark Herron.</li><li onclick="handleItemClick()"><a href="http://www.bigoven.com/recipe/persian-carrots/4291" target="_blank">http://www.bigoven.com/recipe/persian-carrots/4291</a>** Credits:</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', 'Time: 45 minutes <ul><li onclick="handleItemClick()">1 cup chickpea flour </li><li onclick="handleItemClick()">1 teaspoon salt </li><li onclick="handleItemClick()">1 teaspoon, at least, ground black pepper </li><li onclick="handleItemClick()">4 to 6 tablespoons olive oil </li><li onclick="handleItemClick()">½ large onion, thinly sliced, optional </li><li onclick="handleItemClick()">1 tablespoon fresh rosemary leaves, optional. </li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">Heat oven to 450 degrees. Put a well-seasoned or nonstick 12-inch pizza pan or cast-iron skillet in oven.</li><li onclick="handleItemClick()">Sift chickpea flour into a bowl.</li><li onclick="handleItemClick()">Add salt and pepper, then slowly add 1 cup lukewarm water, whisking to eliminate lumps.</li><li onclick="handleItemClick()">Stir in 2 tablespoons olive oil.</li><li onclick="handleItemClick()">Cover, and let sit while oven heats, or as long as 12 hours. Batter should be about the consistency of heavy cream.</li><li onclick="handleItemClick()">If using onion and rosemary, stir them into batter.</li><li onclick="handleItemClick()">Pour 2 tablespoons oil into heated pan, and swirl to cover pan evenly.</li><li onclick="handleItemClick()">Pour in batter, and bake 12 to 15 minutes, or until pancake is firm and edges set.</li><li onclick="handleItemClick()">Heat broiler, and brush top of socca with 1 or 2 tablespoons of oil if it looks dry. </li><li onclick="handleItemClick()">Set socca a few inches away from broiler for a few minutes, just long enough to brown it spottily. Cut it into wedges, and serve hot, or at least warm. </li></ol>' ] );
