ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">1 cup parmesean cheese</li><li onclick="handleItemClick()">1 cup pecorino romano cheese</li><li onclick="handleItemClick()"> cup fine dry bread crumbs</li><li onclick="handleItemClick()">1 Tblsp parsley</li><li onclick="handleItemClick()">4 large eggs, lightly beaten</li><li onclick="handleItemClick()">2 cloves garlic</li><li onclick="handleItemClick()">2 Tblsp olive oil</li><li onclick="handleItemClick()"> pound bitter greens, chopped</li><li onclick="handleItemClick()">(e.g., escarole, chickory)</li><li onclick="handleItemClick()">2 quarts broth</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">In a large bowl combine parmesean, romano, bread crumbs, parley, eggs and half of the garlic. Stir until a soft dough forms. Using moistened hands, roll the mixture in to  inch balls and arrange in a single layer on a baking sheet lined with plastic wrap. Refrigerate about 30 minutes.</li><li onclick="handleItemClick()">Meanwhile, in a medium saucepan, heat the olive oil until shimmering. Add the remaining garlic and cook over moderately high heat, about 30 seconds. Add the greens and cook, stirring, until wilted and just beginning to brown, about 3-4 minutes longer.</li><li onclick="handleItemClick()">Add the stock and bring to simmer. Drop the dumplings into the stock and cook until they rise to the surface, about 5 minutes.</li><li onclick="handleItemClick()">Season with salt and pepper and serve in deep bowls, passing extra pecorino at the table. </li><li onclick="handleItemClick()">Make ahead: the uncooked dumplings may be made overnight.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">Food and Wine April 2003</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">3 T Olive Oil</li><li onclick="handleItemClick()">1½ tortillas cut into 1" squares</li><li onclick="handleItemClick()">1½ T minced garlic</li><li onclick="handleItemClick()">2 T minced white onions</li><li onclick="handleItemClick()">l ½ t minced jalapeno pepper</li><li onclick="handleItemClick()">1 lb white corn kernels</li><li onclick="handleItemClick()">1½ lb chopped tomatoes</li><li onclick="handleItemClick()">⅓ C tomato paste</li><li onclick="handleItemClick()">2½ t ground cumin</li><li onclick="handleItemClick()">1 T Kosher salt</li><li onclick="handleItemClick()">⅛ t ground white pepper</li><li onclick="handleItemClick()">½ t chili powder</li><li onclick="handleItemClick()">1½ C water</li><li onclick="handleItemClick()">1 Quart (chicken) stock</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ol><li onclick="handleItemClick()">Fry tortilla squares in olive oil until they begin to crisp.</li><li onclick="handleItemClick()">Add onion, garlic, and jalapeno.</li><li onclick="handleItemClick()">Cook 1 - 2 minutes until onion becomes translucent.</li><li onclick="handleItemClick()">Add half the corn and all other ingredients.</li><li onclick="handleItemClick()">Bring soup to a low, even boil.</li><li onclick="handleItemClick()">Boil for 5 minutes; then remove from heat and puree.</li><li onclick="handleItemClick()">Return soup to burner, add reserved corn.</li><li onclick="handleItemClick()">Bring soup to boil again, carefully.</li><li onclick="handleItemClick()">Serve garnished with blue chips, cilantro, or sour cream.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Sides', '<ul><li onclick="handleItemClick()">Jim Brega - February 2007</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">1 pound thin asparagus</li><li onclick="handleItemClick()">2 Tbls extra-virgin olive oil</li><li onclick="handleItemClick()">3 medium shallots, minced (onions will do in a pinch!)</li><li onclick="handleItemClick()">6 large eggs -- egg beaters work just fine!</li><li onclick="handleItemClick()"> cup freshly grated Parmigiano-Reggiano cheese (I use Pecorino Romano)</li><li onclick="handleItemClick()"> cup shredded fresh basil leaves (I use 1 tsp dried)</li><li onclick="handleItemClick()">kosher salt and freshly ground black pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Snap and discard tough asparagus ends. Slice the asparagus on the bias into 1-inch-long pieces. Steam the asparagus in a bamboo steamer (or boil in salt water for 1 minutes), until almost tender.</li><li onclick="handleItemClick()">Preheat the broiler. Heat the oil in a 10-inch nonstick skillet with an oven proof handle. Swirl the oil to coat the bottom of the pan evenly. Add the shallots and saut over medium heat until translucent, about 3 minutes. Add the asparagus and cook for 30 seconds. </li><li onclick="handleItemClick()">In a medium bowl, use a fork to lightly beat the eggs, cheese, basil and salt and pepper. Add the egg mixture to the pan and stir gently with a fork to incorporate the vegetables. Cook over medium-low heat, occasionally sliding a spatula around the edges of the pan to loosen the frittata as it sets. Continue cooking until the frittata is set, except for the top, about 8 minutes.</li><li onclick="handleItemClick()">Place the pan directly under the broiler and cook just until the top is golden brown and set, 1 to 2 minutes. Do not let the frittata burn.</li><li onclick="handleItemClick()">Invert the frittata onto a large platter. (Optionally sprinkle with a little kosher salt.) Cut it into wedges and serve. The frittata may also be cooled to room temperature and then cut and served. </li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">[As served at Easter Brunch at Tracey and John\'s, April 2004. Recipe source: The Complete Italian Vegetarian Cookbook, by Jack Bishop, page 245.]</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">3 lbs butternut squash</li><li onclick="handleItemClick()">7 Tbsp butter</li><li onclick="handleItemClick()">2 leeks - thinly sliced (onions will do in a pinch!)</li><li onclick="handleItemClick()">1 qt vegetable stock</li><li onclick="handleItemClick()"> tsp nutmeg</li><li onclick="handleItemClick()"> cup peas (frozen or fresh)</li><li onclick="handleItemClick()">8 cups fresh spinach (approx.  lbs = 10 oz. bag)</li><li onclick="handleItemClick()">1 cup light cream</li><li onclick="handleItemClick()">salt and pepper to taste</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Slice squash length-wise in half. Place in microwave-proof pan with a small amount of water and microwave on high until flesh is tender (perhaps 20 minutes, depending on microwave).</li><li onclick="handleItemClick()">Wash and drain spinach, trim stems, chop and set aside.</li><li onclick="handleItemClick()">When squash is cool enough to handle, scoop out.</li><li onclick="handleItemClick()">Melt butter in a stock pot and add leeks. Saut until soft. Add stock, squash, nutmeg, salt and pepper. Bring to a boil. </li><li onclick="handleItemClick()">Pure soup in a food processor.</li><li onclick="handleItemClick()">Return to pot and add spinach and peas. Simmer until spinach is slightly tender.</li><li onclick="handleItemClick()">Stir in cream, heat and serve.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">[Served Easter weekend, April 2004 at Tracey and John\'s]</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">1 cup long grain brown rice</li><li onclick="handleItemClick()"> cup oil</li><li onclick="handleItemClick()">⅔ cup dried lentils</li><li onclick="handleItemClick()">1 teasp. salt</li><li onclick="handleItemClick()">2 cups diced onion</li><li onclick="handleItemClick()">1 cup celery, chopped</li><li onclick="handleItemClick()">1 cup diced green pepper</li><li onclick="handleItemClick()">4 chopped jalapeo peppers</li><li onclick="handleItemClick()">1 Tblsp garlic, chopped</li><li onclick="handleItemClick()">1 cup pecans, chopped</li><li onclick="handleItemClick()"> cup sesame seeds</li><li onclick="handleItemClick()"> teasp black pepper</li><li onclick="handleItemClick()">1 pinch white pepper</li><li onclick="handleItemClick()">2 cups TVP</li><li onclick="handleItemClick()">1 cups barbecue sauce</li><li onclick="handleItemClick()">9 eggs</li><li onclick="handleItemClick()">1 pound cheddar cheese grated</li><li onclick="handleItemClick()">8 ounces tomato juice</li><li onclick="handleItemClick()"> cup soy sauce</li></ul><ul><li onclick="handleItemClick()">1 cup		tomato sauce</li><li onclick="handleItemClick()"> teasp		liquid smoke</li><li onclick="handleItemClick()"> cup		sugar</li><li onclick="handleItemClick()"> cup		cider vinegar</li><li onclick="handleItemClick()"> cup		tomato paste</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()"> cup long grain brown rice</li><li onclick="handleItemClick()">2 Tbls oil</li><li onclick="handleItemClick()">⅓ cup dried lentils</li><li onclick="handleItemClick()">¾ teasp. salt</li><li onclick="handleItemClick()">1 cup diced onion</li><li onclick="handleItemClick()"> cup celery, chopped</li><li onclick="handleItemClick()"> cup diced green pepper</li><li onclick="handleItemClick()">2 chopped jalapeo peppers</li><li onclick="handleItemClick()"> Tblsp garlic, chopped</li><li onclick="handleItemClick()"> cup pecans, chopped</li><li onclick="handleItemClick()"> cup sesame seeds</li><li onclick="handleItemClick()"> teasp black pepper</li><li onclick="handleItemClick()">1 pinch white pepper</li><li onclick="handleItemClick()">1 cup TVP</li><li onclick="handleItemClick()">¾ cups barbecue sauce</li><li onclick="handleItemClick()">4 eggs</li><li onclick="handleItemClick()"> pound cheddar cheese grated</li><li onclick="handleItemClick()">4 ounces tomato juice</li><li onclick="handleItemClick()">2 Tbls soy sauce</li></ul><ul><li onclick="handleItemClick()">1 cup		tomato sauce</li><li onclick="handleItemClick()"> teasp		liquid smoke</li><li onclick="handleItemClick()"> cup		sugar</li><li onclick="handleItemClick()"> cup		cider vinegar</li><li onclick="handleItemClick()"> cup		tomato paste</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Take half the oil, and saut uncooked rice over low heat until golden. Stir often.</li><li onclick="handleItemClick()">Add 3 (1.5 for half) cups water, and cook uncovered until rice is tender.</li><li onclick="handleItemClick()">In another saut pan, place lentils, 4 cups (2 cups for half) water and  teaspoon salt. Cook until tender, about 30 minutes and drain. (Do not overcook; lentils should be chewy.)</li><li onclick="handleItemClick()">In a large saut pan, take the rest of the oil and saut half the onions until brown.</li><li onclick="handleItemClick()">Add the rest of onions, celery and peppers and cook until tender, or about 5 minutes.</li><li onclick="handleItemClick()">Mix in the rest of the ingredients, except eggs, cheese and tomato juice. Let cool, then beat eggs with tomato juice and add to mixture.</li><li onclick="handleItemClick()">Add  cup (or 2 Tbls for half) soy sauce. Knead. Wait 5 minutes so TVP can soak up moisture. Taste TVP to see if smooth. If crunchy, add water. Add cheese and place in baking dish. (Optionally, cover loaf with paper thin cheese: e.g., mozerella.)</li><li onclick="handleItemClick()">Cover with aluminum foil and bake at 275 for 1 hour or until center is cooked.</li><li onclick="handleItemClick()">The meat loaf may be served with ketchup, or with the spicy chili sauce, below.</li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">1 medium	onion, chopped</li><li onclick="handleItemClick()">1			green pepper chopped</li><li onclick="handleItemClick()">2			jalapeo peppers, chopped</li><li onclick="handleItemClick()">1 stalk		celery, diced</li><li onclick="handleItemClick()"> cup		oil</li><li onclick="handleItemClick()">1 large can	Italian tomatoes</li><li onclick="handleItemClick()"> teasp		coriander</li><li onclick="handleItemClick()">1 heaping teasp	cumin</li><li onclick="handleItemClick()"> cup		soy sauce</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Saut onions. Add peppers, celery and jalapeo peppers and saut until tender. Break tomatoes into pieces with fingers and add spices. Cook for 10 minutes. Salt to taste.</li></ol>' ] );
