ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">2 eggs</li><li onclick="handleItemClick()">1 box jiffy corn mix</li><li onclick="handleItemClick()"> cup butter (melted)</li><li onclick="handleItemClick()">1 cup sour cream</li><li onclick="handleItemClick()">1 can corn kernels</li><li onclick="handleItemClick()">1 can creamed corn</li><li onclick="handleItemClick()">1 cup cheddar cheese (shredded)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Mix together all ingredients except cheese.</li><li onclick="handleItemClick()">Bake at 350 for 35 minutes. Put 1 cup of cheddar cheese on the top after it has been cooking for 15 minutes.</li><li onclick="handleItemClick()">1½2/01 from Mary Ann Heimburg</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ol>' ] );
