ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">12 ears of corn, husks and silk removed</li><li onclick="handleItemClick()">½ cup olive oil, plus extra for brushing the corn</li><li onclick="handleItemClick()">¼ cup aged sherry vinegar</li><li onclick="handleItemClick()">1 tablespoon Dijon mustard</li><li onclick="handleItemClick()">2 large red bell peppers, diced</li><li onclick="handleItemClick()">1 large Vidalia onion, thinly sliced (or use a Maui or Walla Walla onion)</li><li onclick="handleItemClick()">4 ripe plum tomatoes, finely chopped</li><li onclick="handleItemClick()">1 jalapeno pepper, finely chopped</li><li onclick="handleItemClick()">¼ cup finely chopped chives</li><li onclick="handleItemClick()">kosher salt and freshly ground pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Preheat a gas or charcoal grill to medium.</li><li onclick="handleItemClick()">In a large pot of boiling water, over high heat, cook the corn 5 minutes until barely tender. Brush with olive oil and grill until slightly charred on all sides, above 2 minutes.</li><li onclick="handleItemClick()">Remove from the grill and with a sharp knife, scrape the kernels into a medium bowl, or stand each ear on a cutting surface and scrape downward to remove the kernels.</li><li onclick="handleItemClick()">Combine the vinegar, mustard and garlic in a large bowl and slowly whisk in the remaining ½ cup olive oil until emulsified.</li><li onclick="handleItemClick()">Add the corn kernels, bell peppers, onion and tomatoes, jalapeno and chives.</li><li onclick="handleItemClick()">Toss to coat with the dressing.</li><li onclick="handleItemClick()">Season with salt and pepper.</li></ol>' ] );
