ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">2 large eggplants (2 pounds)</li><li onclick="handleItemClick()">2 large bell peppers</li><li onclick="handleItemClick()">olive oil</li><li onclick="handleItemClick()">2 large red onions, peeled and sliced</li><li onclick="handleItemClick()">3 cloves garlic, chopped</li><li onclick="handleItemClick()">2 T olive oil</li><li onclick="handleItemClick()">4 c tomatoes, peeled and chopped</li><li onclick="handleItemClick()">3 T fresh basil, chopped</li><li onclick="handleItemClick()">3 T parsley, chopped</li><li onclick="handleItemClick()">1-2 t fresh oregano, chopped</li><li onclick="handleItemClick()">salt and pepper</li><li onclick="handleItemClick()"> c dry red wine</li><li onclick="handleItemClick()">1 pound rigatoni</li><li onclick="handleItemClick()"> pound mozzarella, grated</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Slice the eggplants lengthwise, into -in slices. Salt each slice on both sides and let sit for 30-45 minutes, until sweating a tan-colored water. Rinse each slice for just a second and pat dry. </li><li onclick="handleItemClick()">Quarter the peppers lengthwise and remove seeds and stems.</li><li onclick="handleItemClick()">Brush eggplants and peppers with olive oil and grill over charcoal: eggplant, until tender, peppers (skin side down), until charred. Put the peppers in paper bag for a few minutes, then remove the skins. Cut eggplant and peppers into wide strips and set aside.</li><li onclick="handleItemClick()">Heat 2 T olive oil, then saut onion and garlic until golden. Add 3 c tomatoes, the herbs, salt and pepper, and the wine. Simmer until thickened, about 30 minutes.</li><li onclick="handleItemClick()">Preheat oven to 350 and oil the gratin dish.</li><li onclick="handleItemClick()">Cook the rigatoni until just al dente. Drain and mix with tomato sauce and grilled vegetables.</li><li onclick="handleItemClick()">Pour into gratin dish, sprinkle with remaining tomatoes and mozzarella cheese.</li><li onclick="handleItemClick()">Bake until very hot and cheese is beginning to color, about 30-40 minutes. If you like a brown, bubbly gratin topping, place under the broiler for a minute.</li><li onclick="handleItemClick()">Serve immediately.</li></ol>' ] );
