ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">1 pound canned pinto, pink or black beans, drained and rinsed</li><li onclick="handleItemClick()">14 ounce can diced or stewed tomatoes</li><li onclick="handleItemClick()">4 ounce can chopped mild green chilies</li><li onclick="handleItemClick()">2 cups frozen corn kernels, thawed</li><li onclick="handleItemClick()">2 scallions</li><li onclick="handleItemClick()"> tsp ground cumin</li><li onclick="handleItemClick()"> tsp dried oregano</li><li onclick="handleItemClick()">8 corn tortillas</li><li onclick="handleItemClick()">1 cups grated cheese (Monterrey Jack or cheddar)</li><li onclick="handleItemClick()">reduced-fat sour cream</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Preheat the oven to 400</li><li onclick="handleItemClick()">Combine the first 7 ingredients in a mixing bowl. Mix thoroughly.</li><li onclick="handleItemClick()">Lightly oil a wide, 2-quart casserole dish and layer as follows:<ul><li onclick="handleItemClick()">4 tortillas, overlapping each other</li><li onclick="handleItemClick()">half the bean mixture</li><li onclick="handleItemClick()">half the cheese</li></ul></li><li onclick="handleItemClick()">Repeat layers.</li><li onclick="handleItemClick()">Bake the casserole for 12 to 15 minutes, until cheese is bubbly. Let stand for a minute or two, then cut into squares to serve. Top with sour cream, if desired.</li></ol>' ] );
