ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">½ large onion, chopped</li><li onclick="handleItemClick()">2 scallions, chopped</li><li onclick="handleItemClick()">4 cloves garlic, minced</li><li onclick="handleItemClick()">1½ cup of mushrooms, minced</li><li onclick="handleItemClick()">2 tablespoons of sherry</li><li onclick="handleItemClick()">1 tablespoon of olive oil</li><li onclick="handleItemClick()">2 stalks celery, minced</li><li onclick="handleItemClick()">½ cup of walnuts</li><li onclick="handleItemClick()">½ cup of bread crumbs, whole grain</li><li onclick="handleItemClick()">1 pinch of rosemary</li><li onclick="handleItemClick()">½ teaspoon of thyme</li><li onclick="handleItemClick()">1 tablespoon of tamari sauce</li><li onclick="handleItemClick()">½ teaspoon of basil, fresh, of course</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Heat oil in skillet and add onion. Saut, stirring, until limp but not browned. Add mushrooms, garlic and sherry. Saut one - two minutes until mushrooms begin to juice. Stir in rosemary, thyme, tamari, salt and basil. </li><li onclick="handleItemClick()">Put remaining ingredients into food processor and combine until minced. Add mushroom mixture and blend. Put mixture into bowl and refrigerate two hours. </li><li onclick="handleItemClick()">Spread on bread and crackers or hollow out a loaf of French bread and stuff.</li></ol>' ] );
