ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">3 Eggs</li><li onclick="handleItemClick()">1 Tbsp of Cinnamon</li><li onclick="handleItemClick()">1 Tbsp Vanilla Extract</li><li onclick="handleItemClick()">2 - 2.5 Cups of Sugar (all depends on how sweet you like it)</li><li onclick="handleItemClick()">1 lb Bag of Broad Noodles</li><li onclick="handleItemClick()">1.5 lbs Container of Cottage Cheese</li><li onclick="handleItemClick()">1 lb Container of Sour Cream</li><li onclick="handleItemClick()">2 Sticks of Unsalted Butter</li><li onclick="handleItemClick()">1 Aluminum Lasagna Pan</li><li onclick="handleItemClick()">1 Small Box of Corn Flakes</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Beat 3 eggs. </li><li onclick="handleItemClick()">Melt 1 Stick of Butter.</li><li onclick="handleItemClick()">Boil Noodles.  Drain.  </li><li onclick="handleItemClick()">Put noodles, Cottage Cheese, Sour Cream, Sugar, Eggs, Cinnamon, Vanilla Extract and melted butter into a large bowl and mix.  Once mixed pour contents into the Aluminum Lasagna pan.</li><li onclick="handleItemClick()">Take Corn Flakes and put them in a zip lock bag.  Crush.</li><li onclick="handleItemClick()">Once crushed, sprinkle Corn Flake Crumbs over the top of the entire Kugel.  Take the remaining stick of butter and cut into thin pieces and dot the top of the kugel</li><li onclick="handleItemClick()">Bake in over for 90 minutes at about 400.</li></ol>' ] );
