ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', 'Serves 6<ul><li onclick="handleItemClick()">1¼ lb. eggplant, cut into ½ in cubes</li><li onclick="handleItemClick()">salt & pepper</li><li onclick="handleItemClick()">3 tbsp. olive oil</li><li onclick="handleItemClick()">½ oz. butter or margarine</li><li onclick="handleItemClick()">1 garlic clove, chopped</li><li onclick="handleItemClick()">16 fl. oz canned chopped tomatoes</li><li onclick="handleItemClick()">12 oz. pasta quills (penne)</li><li onclick="handleItemClick()">4 oz. firm goat cheese, cubed</li><li onclick="handleItemClick()">3 tbsp. shredded fresh basil or 1 tsp. dried basil</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Put the eggplant cubes in a large colander and sprinkle them lightly with salt. Let drain at least 30 minutes.</li><li onclick="handleItemClick()">Rinse the eggplant under cold water and drain well. Dry on kitchen paper.</li><li onclick="handleItemClick()">Heat the oil and butter in a large saucepan. Add the eggplant and fry until just golden on all sides, stirring frequently.</li><li onclick="handleItemClick()">Stir in the garlic and tomatoes. Simmer until thickened, about 15 minutes. Season with salt & pepper.</li><li onclick="handleItemClick()">Cook the penne in a large pan of boiling salted water until just tender (check packet instructions for timing). Drain well and transfer to a warmed serving bowl.</li><li onclick="handleItemClick()">Add the eggplant sauce, goat cheese and basil to the pasta and toss well together. Serve immediately.</li></ol>' ] );
