ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">1 cup potato, diced</li><li onclick="handleItemClick()">1 cup onion, diced</li><li onclick="handleItemClick()">1 cup celery, diced</li><li onclick="handleItemClick()">1 cup carrot, diced</li><li onclick="handleItemClick()">⅓ cup melted butter</li><li onclick="handleItemClick()">½ cup all-purpose flour</li><li onclick="handleItemClick()">2 cups vegetable broth</li><li onclick="handleItemClick()">1 cup half-and-half</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">¼ teaspoon pepper</li><li onclick="handleItemClick()">½ teaspoon of rosemary (optional)</li><li onclick="handleItemClick()">½ teaspoon of thyme (optional)</li><li onclick="handleItemClick()">½ cup TVP and/or mock meat (optional)</li><li onclick="handleItemClick()">1 pie crust (either store bought or your own recipe)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Preheat oven to 400 degreesF.</li><li onclick="handleItemClick()">Saute onion, celery, carrots and potatoes in butter for 10 minutes.</li><li onclick="handleItemClick()">Add flour to sauteed mixture, stirring well, cook one minute stirring constantly.</li><li onclick="handleItemClick()">Combine broth and half and half.</li><li onclick="handleItemClick()">Gradually stir into vegetable mixture.</li><li onclick="handleItemClick()">Cook over medium heat stirring constantly until thickened and bubbly.</li><li onclick="handleItemClick()">Stir in salt and pepper; add TVP and/or mock meat and stir well.</li><li onclick="handleItemClick()">Pour into shallow 2 quart casserole dish and top with pie shells.</li><li onclick="handleItemClick()">Cut slits to allow steam to escape.</li><li onclick="handleItemClick()">Bake for 40-50 minutes or until pastry is golden brown and filling is bubbly and cooked through.</li></ol>' ] );
