ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">6 large eggs</li><li onclick="handleItemClick()">1 tsp. salt</li><li onclick="handleItemClick()">1.5 cups frozen shredded hash brown potatoes, thawed</li><li onclick="handleItemClick()">½ medium red bell pepper, diced</li><li onclick="handleItemClick()">½ cup fresh or frozen corn kernels, thawed if frozen</li><li onclick="handleItemClick()">2 green onions (white and green parts), thinly sliced</li><li onclick="handleItemClick()">2 tbsp. chopped fresh cilantro</li><li onclick="handleItemClick()">¾ cup shredded or crumbled Cheddar cheese</li><li onclick="handleItemClick()">½ cup low-fat milk</li><li onclick="handleItemClick()">2 chipotle chiles in adobo sauce, w/ 2 tsp. sauce reserved</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Preheat oven to 375 degrees F. Coat the pie dish with cooking spray. Whisk together 1 egg and ¼ tsp. salt in a medium bowl. Stir in shredded hash browns. Press the potato mixture into the bottom and sides of the pie dish to form crust. Bake for 15 minutes, or until lightly browned.</li><li onclick="handleItemClick()">Sprinkle the bell pepper, corn, green onions, cilantro, and cheese over the potato crust.</li><li onclick="handleItemClick()">In a blender, mix together the remaining eggs, milk, ¾ tsp. salt, chiles and adobo sauce. Pour mixture over vegetables in pie dish. Bake 20 to 25 minutes, or until knife inserted in center comes out clean. Let stand 5 minutes before serving.</li><li onclick="handleItemClick()">Serves 6.</li><li onclick="handleItemClick()">I served the quiche topped with avocado slices and good store-bought salsa (I had Mrs. Renfros Black Bean Salsa on hand). It was quite tasty, and everyone wanted seconds. Ill make this again, but I think next time Ill serve it with some black beans or a salad on the side, to add some fiber, and maybe add a third chipotle pepper (love the smokey flavor they add). Adapted from January 2007 Vegetarian Times recipe.</li></ol>' ] );
