ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', 'by mlsawatzky of Sandbrook Meadow Farm<ul><li onclick="handleItemClick()">3 medium summer squash cubed</li><li onclick="handleItemClick()">1 sweet onion, sliced</li><li onclick="handleItemClick()">2 cloves of garlic sliced</li><li onclick="handleItemClick()">2 TBLSP olive oil</li><li onclick="handleItemClick()">1 - 2 TBLSP red curry paste (MASRE brand good)</li><li onclick="handleItemClick()">1 - 2 cans coconut milk (lite is good)</li><li onclick="handleItemClick()">1  TBLSP fish sauce</li><li onclick="handleItemClick()">1 TBLSP brown sugar</li><li onclick="handleItemClick()">Salt</li><li onclick="handleItemClick()">Sweet (Thai) Basil</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Saut curry paste in olive oil 1-2 minutes to bring out flavor.  Add 1 cup coconut milk  & simmer 4 minutes.  Add onion, garlic and squash.  Cook until beginning to get tender.  Add 1  cup coconut milk or water and fish sauce & sugar.  Add salt to taste & remove from heat and add sweet basil</li><li onclick="handleItemClick()">May use other vegetables as well</li><li onclick="handleItemClick()">From Mary Laura @ Sandbrook 11-July-2012</li></ol>' ] );
