ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', 'Makes about 29 ounces (820 grams) dough, enough for 2 pizzas This is what I’d call the quintessential American pizza dough, inspired by New York–style pizza: medium thin, satisfyingly chewy, and the ideal companion to mozzarella, tomato sauce, and the pizza toppings Americans love best, from pepperoni and sausage to olives, mushrooms, and other vegetables. It’s the dough I teach first to new students, and the one I recommend experimenting with because it’s so versatile and user-friendly.<ul><li onclick="handleItemClick()">2.2 grams (¾ teaspoon) active dry yeast</li><li onclick="handleItemClick()">70 grams (¼ cup plus 1 tablespoon) warm water (80 degreesF to 85 degreesF)</li><li onclick="handleItemClick()">453 grams flour (3-½ cups) with 13 to 14 percent protein, preferably All Trumps, Pendleton Flour Mills Power, Giusto’s High Performer, King Arthur Sir Lancelot Unbleached Hi-Gluten, or Tony’s California Artisan Flour</li><li onclick="handleItemClick()">10 grams (1 tablespoon plus ¼ teaspoon) diastatic malt</li><li onclick="handleItemClick()">210 grams (¾ cup plus 2 tablespoons) ice water, plus more as needed</li><li onclick="handleItemClick()">90 grams Poolish (see sidebar) or Tiga (see sidebar)</li><li onclick="handleItemClick()">10 grams (2 teaspoons) fine sea salt</li><li onclick="handleItemClick()">5 grams (1 teaspoon) extra virgin</li><li onclick="handleItemClick()">olive oil</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Put the yeast in a small bowl, add the warm water, and whisk vigorously for 30 seconds. The yeast should dissolve in the water and the mixture should foam. If it doesn’t and the yeast granules float, the yeast is “dead” and should be discarded. Begin again with a fresh amount of yeast and water.</li><li onclick="handleItemClick()">Combine the flour and malt in the bowl of a stand mixer fitted with the dough hook.</li><li onclick="handleItemClick()">With the mixer running on the lowest speed, pour in most of the icewater, reserving about 2 tablespoons, followed by the yeast-water mixture. Pour the reserved water into the yeast bowl, swirl it around to dislodge any bits of yeast stuck to the bowl, and add to the mixer. Mix for about 15 seconds, stop the mixer, and add the poolish or tiga.</li><li onclick="handleItemClick()">Continue to mix the dough at the lowest speed for about 1 minute, until most of the dough comes together around the hook. Stop the mixer. Use your fingers to pull away any dough clinging to the hook, and scrape the sides and bottom of the bowl with a bowl scraper or rubber spatula. Check the bottom of the bowl for any unincorporated flour. Turn the dough over and press it into the bottom of the bowl to pick up any stray pieces. If the dough isn’t holding together, add small amounts of water (about ½ teaspoon to start) and mix until the dough is no longer dry and holds together.</li><li onclick="handleItemClick()">Add the salt and mix on the lowest speed for 1 minute to combine.</li><li onclick="handleItemClick()">Stop the mixer, pull the dough off the hook, and add the oil. Mix the dough for 1 to 2 minutes, stopping the mixer from time to time to pull the dough off the hook and scrape down the sides of the bowl, until all of the oil is absorbed. The dough won’t look completely smooth.</li><li onclick="handleItemClick()">Use a bowl scraper to transfer the dough to an unfloured work surface, then knead it for 2 to 3 minutes, until smooth. Cover the dough with a damp dish towel and let rest at room temperature for 20 minutes. Use the dough cutter to loosen the dough and to cut it in half.  Weigh the dough, adjusting the quantity as necessary to give you two 13-ounce pieces. Form each piece into a ball. Any remaining dough can be discarded.</li><li onclick="handleItemClick()">Form the dough into balls. Set the balls on a half sheet pan, spacing them about 3 inches apart. Or, if you will be baking the balls on different days, place each ball on a quarter sheet pan. Wrap the pan(s) airtight with a double layer of plastic wrap, sealing the wrap well under the pan(s). Put the pan(s) in a level spot in the refrigerator and refrigerate for 24 to 48 hours.</li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', 'Makes 90 grams<ul><li onclick="handleItemClick()">0.14 gram (one-third of ⅛ teaspoon) active dry yeast or 0.42 gram  fresh yeast, broken into small pieces</li><li onclick="handleItemClick()">39 grams (2 tablespoons plus 2 teaspoons) cold tap water</li><li onclick="handleItemClick()">55 grams (¼ cup plus 3 tablespoons) flour used in dough recipe</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Put the yeast in a small bowl, add the water, and whisk vigorously for 30 seconds. The mixture should bubble on top. If it doesn’t and the yeast granules float, the yeast is “dead” and should be discarded. Begin again with a fresh amount of yeast and water.</li><li onclick="handleItemClick()">Add the flour and stir well with a rubber spatula to combine. The consistency will be quite thick.</li><li onclick="handleItemClick()">Scrape down the sides of the bowl, cover the bowl with plastic wrap, and let sit at room temperature for 18 hours. Refrigerate for 30 minutes to cool slightly before using.</li><li onclick="handleItemClick()">If you are not using the starter right away, you can store it in the refrigerator, though I suggest keeping it for no more than 8 hours. Bring it to cool room temperature before using.</li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', 'Makes 90 grams<ul><li onclick="handleItemClick()">0.12 gram (one-third of ⅛ teaspoon) active dry yeast or 0.36 gram  fresh yeast, broken into small pieces</li><li onclick="handleItemClick()">47 grams (3 tablespoons plus 1 teaspoon) cold tap water</li><li onclick="handleItemClick()">47 grams (¼ cup plus 2 tablespoons) flour used in dough recipe</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Put the yeast in a small bowl, add the water, and whisk vigorously for 30 seconds. The mixture should bubble on top. If it doesn’t and the yeast granules float, the yeast is “dead” and should be discarded. Begin again with a fresh amount of yeast and water.</li><li onclick="handleItemClick()">Add the flour and stir well with a rubber spatula to combine. The consistency will be quite thick, resembling a thick pancake batter.</li><li onclick="handleItemClick()">Scrape down the sides of the bowl, cover the bowl with plastic wrap, and let sit at room temperature for 18 hours. Refrigerate for 30 minutes to cool slightly before using.</li><li onclick="handleItemClick()">If you are not using the starter right away, you can store it in the refrigerator, though I suggest keeping it for no more than 8 hours. Bring to cool room temperature before using.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Entrees', 'Here are the two starters I use most frequently in this book and in my restaurants. Tiga is my slightly more hydrated version of a classic biga starter, which is usually between 50 and 60 percent water. This “Tony’s biga,” which I call “Tiga,” has 70 percent hydration.My poolish follows the traditional proportions of equal parts water and flour, so its hydration is much higher at 100 percent. In general, unless I specify otherwise, use the same flour in your starter that you will be using in your dough. I always make starters with cold water to slow down the fermentation process for greater flavor complexity. It’s helpful to use a clear glass bowl so you can see how well your starter is fermenting.Tony Gemignani\'s Master Dough with Starter<a href="http://www.pri.org/stories/2015-02-25/how-tony-gemignani-shocked-pizza-world" target="_blank">http://www.pri.org/stories/2015-02-25/how-tony-gemignani-shocked-pizza-world</a>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', 'These make great do-ahead meals, and you can store shaped, ready-to-cook patties in the refrigerator for a week\'s worth of work lunches. Sprouted garbanzos are becoming more readily available, but if you can\'t find them, canned or cooked garbanzos (chickpeas) will work great. Sprouting boosts their already fantastic nutritional value even more...<ul><li onclick="handleItemClick()">2½ cups sprouted garbanzo beans (chickpeas) OR canned garbanzos, drained and rinsed</li><li onclick="handleItemClick()">4 large eggs</li><li onclick="handleItemClick()">½ teaspoon fine-grain sea salt</li><li onclick="handleItemClick()">⅓ cup chopped fresh cilantro</li><li onclick="handleItemClick()">1 onion, chopped</li><li onclick="handleItemClick()">Grated zest of one large lemon</li><li onclick="handleItemClick()">1 cup micro sprouts, chopped (try brocolli, onion, or alfalfa sprouts - optional)</li><li onclick="handleItemClick()">1 cup toasted (whole-grain) bread crumbs</li><li onclick="handleItemClick()">1 tablespoon extra-virgin olive oil (or clarified butter)</li></ul>Method:<ol><li onclick="handleItemClick()">If you are using sprouted garbanzos, steam them until just tender, about 10 minutes. Most of you will be using canned beans, so jump right in and combine the garbanzos, eggs, and salt in a food processor. Puree until the mixture is the consistency of a very thick, slightly chunky hummus. Pour into a mixing bowl and stir in the cilantro, onion, zest, and sprouts. Add the breadcrumbs, stir, and let sit for a couple of minutes so the crumbs can absorb some of the moisture. At this point, you should have a moist mixture that you can easily form into twelve 1½-inch-thick patties. I err on the moist side here, because it makes for a nicely textured burger. You can always add more bread crumbs a bit at a time to firm up the dough if need be. Conversely, a bit of water or more egg can be used to moisten the batter.</li><li onclick="handleItemClick()">Heat the oil in a heavy skillet over medium low, add 4 patties, cover, and cook for 7 to 10 minutes, until the bottoms begin to brown. Turn up the heat if there is no browning after 10 minutes. Flip the patties and cook the second side for 7 minutes, or until golden. Remove from the skillet and cool on a wire rack while you cook the remaining patties. Carefully cut each patty in half, insert your favorite fillings, and enjoy immediately.</li><li onclick="handleItemClick()">Makes 12 mini burgers.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">101 Cookbooks <a href="http://www.101cookbooks.com/" target="_blank">http://www.101cookbooks.com/</a></li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()">3 tbsp. vegetable oil</li><li onclick="handleItemClick()">1 onion, minced</li><li onclick="handleItemClick()">1 clove garlic, minced or pressed</li><li onclick="handleItemClick()">1 green pepper, chopped fine</li><li onclick="handleItemClick()">3 stalks celery, chopped fine</li><li onclick="handleItemClick()">1 c. chopped parsley</li><li onclick="handleItemClick()">1 c. coarsely grated zucchini</li><li onclick="handleItemClick()">2 c. green beans, chopped sm.</li><li onclick="handleItemClick()">1 tsp. salt</li><li onclick="handleItemClick()">Dash each of chili, cumin powder, corn flour</li><li onclick="handleItemClick()">2 c. grated cheddar or Jack cheese</li><li onclick="handleItemClick()">3½ c. Red Sauce</li><li onclick="handleItemClick()">12 corn or whole wheat flour tortillas</li><li onclick="handleItemClick()">½ c. chopped black olives</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Saute onion, garlic, pepper and celery in oil. Add parsley, zucchini and green beans with salt, cumin, and chili powder and cook, covered, until tender.</li><li onclick="handleItemClick()">If vegetables are very wet, thicken with corn flour. Add 1 cup of the cheese and ¾ cup of the red sauce. Preheat oven to 350 degrees.</li><li onclick="handleItemClick()">Fill each tortilla with ⅓ cup of vegetable mixture. Roll them up and place in a baking dish, seam-side down, close together and cover with remaining sauce. Top with remaining cheese and olives and heat until sauce bubbles.</li><li onclick="handleItemClick()">RED SAUCE:</li><li onclick="handleItemClick()">½ lg. onion, chopped</li><li onclick="handleItemClick()">2 tbsp. oil</li><li onclick="handleItemClick()">1 bay leaf</li><li onclick="handleItemClick()">1 tsp. cumin</li><li onclick="handleItemClick()">3 c. tomatoes</li><li onclick="handleItemClick()">1 tsp. salt</li><li onclick="handleItemClick()">1 clove garlic, minced</li><li onclick="handleItemClick()">2 tbsp. chopped green pepper</li><li onclick="handleItemClick()">1 tsp. oregano</li><li onclick="handleItemClick()">½ tsp. chili powder</li><li onclick="handleItemClick()">1 (6 oz.) can tomato paste</li><li onclick="handleItemClick()">Saute onion and garlic in oil. Add pepper, bay leaf, oregano, cumin, chili powder, tomatoes, tomato paste and salt. Simmer for half and hour and remove bay leaf. Serves 6.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()"><a href="http://www.cooks.com/rec/doc/0,1649,144160-243196,00.html" target="_blank">http://www.cooks.com/rec/doc/0,1649,144160-243196,00.html</a></li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Entrees', 'These make great do-ahead meals, and you can store shaped, ready-to-cook patties in the refrigerator for a week\'s worth of work lunches. I use black lentils in this recipe, some of the other types of lentils are too mushy when cooked - so I\'d stick with the black lentils. Feel free to spice up the batter by experimenting with your favorite seasonings.<ul><li onclick="handleItemClick()">3 cups cooked black lentils</li><li onclick="handleItemClick()">4 large eggs</li><li onclick="handleItemClick()">½ teaspoon fine-grain sea salt</li><li onclick="handleItemClick()">1 onion, finely chopped</li><li onclick="handleItemClick()">1 cup toasted fine (whole-grain) bread crumbs</li><li onclick="handleItemClick()">1 tablespoon extra-virgin olive oil (or clarified butter)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ol><li onclick="handleItemClick()">Combine the lentils, eggs, and salt in a food processor. Puree until the mixture is the consistency of a runny yet textured hummus - it\'s o.k. if many of the lentils remain whole (see photo). Pour into a mixing bowl and stir in the onion. Add the breadcrumbs, stir, and let sit for a couple of minutes so the crumbs can absorb some of the moisture. At this point, you should have a very moist mixture that you can easily form into twelve 1½-inch-thick patties. I err on the moist side here, because it makes for a nicely textured burger. You can always add more bread crumbs a bit at a time to firm up the dough if need be. Conversely, a bit of water or more egg can be used to moisten the batter.</li><li onclick="handleItemClick()">Heat the oil in a heavy skillet over medium low, add 4 patties, cover, and cook for 7 to 10 minutes, until the bottoms begin to brown. Turn up the heat if there is no browning after 10 minutes. Flip the patties and cook the second side for 7 minutes, or until golden. Remove from the skillet and cool on a wire rack while you cook the remaining patties. Carefully cut each patty in half, insert your favorite fillings, and enjoy immediately.</li><li onclick="handleItemClick()">Makes 12 mini burgers.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Entrees', '<ul><li onclick="handleItemClick()"><a href="http://www.101cookbooks.com/archives/print/vegetarian-lentil-burgers-recipe.html" target="_blank">http://www.101cookbooks.com/archives/print/vegetarian-lentil-burgers-recipe.html</a></li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', 'This macaroon type dough is rolled in sliced almonds for a double tasty treat!<ul><li onclick="handleItemClick()">Time:</li><li onclick="handleItemClick()">25 minutes to assemble </li><li onclick="handleItemClick()">20 minutes to chill</li><li onclick="handleItemClick()">12-14 minutes to bake</li></ul><ul><li onclick="handleItemClick()">1 box (7 oz) Odense Almond Paste, grated </li><li onclick="handleItemClick()">¾ cup confectionary sugar </li><li onclick="handleItemClick()">1 large egg (room temperature), separated </li><li onclick="handleItemClick()">1 Tbsp & 2 tsp all purpose flour </li><li onclick="handleItemClick()">1 cup thinly sliced almonds, slightly crushed </li><li onclick="handleItemClick()">4 oz bittersweet chocolate </li><li onclick="handleItemClick()">1 Line cookie sheet with parchment or foil. </li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ol><li onclick="handleItemClick()">In a food processor or with a mixer combine Almond Paste and sugar. Mix until the texture of fine crumbs. Add egg white and flour, reserving yolk. Mix until dough becomes a smooth paste, it will be slightly sticky.</li><li onclick="handleItemClick()">Turn dough out onto a lightly floured surface. With floured hands roll dough into a 12 inch log. Divide into 12 equal pieces and roll into balls. Roll balls between palms into 3 inch logs, slightly tapered at ends.</li><li onclick="handleItemClick()">Spread almonds on a plate. Beat reserved egg yolk with 2 tablespoons of water. Dampen log with beaten yolk. Roll each log in almonds until coated, bending into crescents. Place crescents 2 inches apart on cookie sheet and refrigerate for 20 minutes. Preheat oven to 350 F.</li><li onclick="handleItemClick()">Bake 12 to 14 minutes or until light golden in color. Cool sheet on wire rack for 5 minutes, and loosen crescents with a spatula. Slide parchment off of sheet and back onto wire rack to finish cooling cookies.</li><li onclick="handleItemClick()">Melt chocolate in a double boiler or microwave. Dip cookie ends into melted chocolate. Place back on parchment until chocolate is dry. Layer "Almond Horns" between sheets of wax paper in an airtight container.</li></ol>' ] );
