ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ul><li onclick="handleItemClick()">⅔ cup all-purpose flour</li><li onclick="handleItemClick()"> cup sugar</li><li onclick="handleItemClick()">1 teasp baking powder</li><li onclick="handleItemClick()"> teasp salt, if desired</li><li onclick="handleItemClick()">⅔ cup skim milk</li><li onclick="handleItemClick()">2 Tbls butter or marg, melted</li><li onclick="handleItemClick()">2 cups blueberries (clean & wash)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ol><li onclick="handleItemClick()">In a medium bowl, combine the flour, sugar, baking powder and salt. Stir in the milk and mix the batter until it is smooth.</li><li onclick="handleItemClick()">Pour the melted butter or margarine into a 1- or 1-quart casserole-type baking dish. Pour in the batter, sprinkle the blueberries on top.</li><li onclick="handleItemClick()">Bake the cobbler in a preheated 350 oven for 40 to 45 minutes or until it is lightly browned. Spoon out the cobbler onto individual dishes to serve.</li><li onclick="handleItemClick()">8 servings.</li></ol>' ] );
