ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ul><li onclick="handleItemClick()">1 cup unbleached flour (I use King Arthur  organic if I can find it)</li><li onclick="handleItemClick()">1 cup King Arthur white or regular whole wheat flour</li><li onclick="handleItemClick()"> cup quick cooking oatmeal (uncooked) I use what I have on hand, not necessarily quick cooking.</li><li onclick="handleItemClick()">1 tsp. baking soda</li><li onclick="handleItemClick()">1 tsp. coarse salt</li><li onclick="handleItemClick()">1 cup unsalted butter, softened</li><li onclick="handleItemClick()"> cup white sugar</li><li onclick="handleItemClick()"> cup brown sugar</li><li onclick="handleItemClick()">2 tsp. vanilla extract</li><li onclick="handleItemClick()">1 egg</li><li onclick="handleItemClick()">1 lb premium quality bittersweet chocolate (see note below) cut into medium-sized chunks.</li><li onclick="handleItemClick()">2 cups walnuts, coarsely chopped (the Supreme Cookie Dude aka Pat, likes big chunks of nuts and lots of em)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ol><li onclick="handleItemClick()">About the chocolate: I do not use chocolate chips because IMHO the better the chocolate, the better the cookie.</li><li onclick="handleItemClick()">If I cant afford the really good stuff I dont make these. I like to use Valhrona bittersweet chocolate that comes</li><li onclick="handleItemClick()">in thin bars (not sure of the weight but the bars are around 6 by 3 and maybe  deep -- I use several) so that</li><li onclick="handleItemClick()">the chocolate is sort of in layers in the cookie. Scharffen Berger, Green and Blacks dark baking, and Callebaut</li><li onclick="handleItemClick()">all work well. The best buy is from Trader Joes though (sorry, Jen!!!) and its their 1 lb. Plus bars which are</li><li onclick="handleItemClick()">actually made by Callebaut. I use either the 72% (especially if making these cookies for adults) or the Dark</li><li onclick="handleItemClick()">Chocolate (which is closer to semi-sweet and better for kids). But they also have the best price around on</li><li onclick="handleItemClick()">Valhrona too.</li><li onclick="handleItemClick()">In a medium bowl, whisk together flour, oats, baking soda, and salt. In a large mixing bowl, cream together</li><li onclick="handleItemClick()">butter and sugars. Blend in vanilla and egg. Slowly add in the flour mixture until nearly combined. Add in</li><li onclick="handleItemClick()">chocolate chips and nuts and stir by in by hand (this is normally Pats job). It may seem like the dough wont</li><li onclick="handleItemClick()">handle all the chocolate and nuts but it does. Drop by rounded tablespoonfuls onto baking sheets (I use one of</li><li onclick="handleItemClick()">those cool cookie scoops that has the releasing mechanism)  you can put them very close together. Refrigerate</li><li onclick="handleItemClick()">for 24 hours or longer (or freeze) then I take out only what I need for one pan at a time and bake on sheets.</li><li onclick="handleItemClick()">These are great to have in the freezer to bake at a moments notice  do not thaw or allow to come to room temp</li><li onclick="handleItemClick()">before baking.</li><li onclick="handleItemClick()">Line baking sheets with parchment paper or use silpat sheets and preheat over to 350o. Bake one sheet at a</li><li onclick="handleItemClick()">time for 7 minutes, then turn sheets around 180o and bake for another 6 minutes until lightly browned. (Your</li><li onclick="handleItemClick()">oven may run hotter or colder than mine but this it what works in mine). Remove pan from the oven but leave</li><li onclick="handleItemClick()">cookies on the paper and slip the paper onto a wire rack to cool. Since theres so much chocolate in these and</li><li onclick="handleItemClick()">it\'s in big pieces, if you take the cookies off the paper the chocolate will drip while its still hot.</li></ol>' ] );
