ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ul><li onclick="handleItemClick()">4 squares (1 oz. each) unsweetened chocolate</li><li onclick="handleItemClick()">2 cups (12 oz.) semi-sweet chocolate chips, divided</li><li onclick="handleItemClick()">⅓ cup butter</li><li onclick="handleItemClick()">1 cup sugar</li><li onclick="handleItemClick()">3 eggs</li><li onclick="handleItemClick()">1 teaspoons vanilla extract</li><li onclick="handleItemClick()"> cup all-purpose flour</li><li onclick="handleItemClick()">2 tablespoons baking cocoa</li><li onclick="handleItemClick()"> teaspoon baking powder</li><li onclick="handleItemClick()">teaspoon salt</li><li onclick="handleItemClick()">Confectioners Sugar</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ol><li onclick="handleItemClick()">In a microwave or double boiler, melt unsweetened chocolate, 1 cup of chocolate chips and butter. Cool for 10 minutes.</li><li onclick="handleItemClick()">In a mixing bowl, beat sugar and eggs for 2 minutes until well blended. Beat in vanilla and the chocolate mixture. Mix in flour, cocoa and baking powder. Stir in remaining chocolate chips.</li><li onclick="handleItemClick()">Cover and chll for at least 3 hours.</li><li onclick="handleItemClick()">Prehat oven to 350. With lightly floured hands, roll into 1-inch balls. Place on ungreased cookie sheets. Bake at 350 for 10-12 minutes or until lightly puffed and set. Cool on pan 3-4 minutes before removing to wire rack to cool completely. Dust with confectioners sugar.</li></ol>' ] );
