ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ul><li onclick="handleItemClick()">2½ cups (12.5 ounces) all-purpose flour</li><li onclick="handleItemClick()">2 Tbsp. sugar</li><li onclick="handleItemClick()">1 tsp. salt</li><li onclick="handleItemClick()">8 Tbsp. vegetable shortening, cut into ½-inch pieces and chilled</li><li onclick="handleItemClick()">12 Tbsp. unsalted butter, cut into ¼-inch pieces and chilled</li><li onclick="handleItemClick()">About 6-8 tablespoons ice water, plus more as needed</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ol><li onclick="handleItemClick()">Process flour, sugar and salt in food processor until combined, about 5 seconds. Scatter shortening over top and process until mixture resembles coarse cornmeal, about 10 seconds. Scatter butter over top and pulse until mixture resembles coarse crumbs, about 10 pulses.</li><li onclick="handleItemClick()">Transfer mixture to a large bowl. Sprinkle 6 tablespoons of ice water over mixture. Stir and press dough together, using stiff rubber spatula, until dough sticks together. If dough does not come together, stir in remaining ice water, 1 tablespoon at a time, until it does.</li><li onclick="handleItemClick()">Divide dough into 2 even pieces. Turn each piece of dough onto a sheet of plastic wrap and flatten each into 4-inch disk. Wrap each piece tightly in plastic and refrigerate for 1 hour. Before rolling out dough, let it sit on counter to soften slightly, about 10 minutes. (Dough can be wrapped tightly in plastic and refrigerated for up to 2 days or frozen for up to 1 month. If frozen, let dough thaw completely on counter before rolling it out.)</li></ol>' ] );
