ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', 'Serves: 16<ul><li onclick="handleItemClick()">¼ cup poppy seeds</li><li onclick="handleItemClick()">1½ cups whole-wheat pastry flour</li><li onclick="handleItemClick()">1 cup all-purpose flour</li><li onclick="handleItemClick()">1½ teaspoons baking powder</li><li onclick="handleItemClick()">½ teaspoon baking soda</li><li onclick="handleItemClick()">¼ teaspoon salt</li><li onclick="handleItemClick()">1 cup buttermilk or equivalent buttermilk powder</li><li onclick="handleItemClick()">¼ cup canola oil</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li><li onclick="handleItemClick()">2 tablespoons freshly grated lemon zest</li><li onclick="handleItemClick()">2 tablespoons lemon juice</li><li onclick="handleItemClick()">2 large eggs, at room temperature</li><li onclick="handleItemClick()">2 large egg whites, at room temperature</li><li onclick="handleItemClick()">1¼ cups sugar</li><li onclick="handleItemClick()">¾ cup confectioners\' sugar, plus more for dusting</li><li onclick="handleItemClick()">3 tablespoons lemon juice</li><li onclick="handleItemClick()">1 tablespoon water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees F. Coat a 10-inch (12-cup) Bundt pan, preferably nonstick, with cooking spray and dust with flour (or use cooking spray with flour).</li><li onclick="handleItemClick()">Toast poppy seeds in a small dry skillet over medium heat, stirring constantly, until fragrant, 3 to 4 minutes. Transfer to a plate to cool.</li><li onclick="handleItemClick()">Whisk whole-wheat flour, all-purpose flour, baking powder, baking soda, salt and the poppy seeds in a medium bowl. Combine buttermilk, oil, vanilla, lemon zest and lemon juice in a glass measuring cup.</li><li onclick="handleItemClick()">Beat eggs, egg whites and sugar in a large bowl with an electric mixer on high speed until thickened and pale, about 5 minutes.</li><li onclick="handleItemClick()">Fold the dry ingredients into the egg mixture with a rubber spatula, a third at a time, alternating with 2 additions of the buttermilk mixture. Scrape the batter into the prepared pan, spreading evenly.</li><li onclick="handleItemClick()">Bake the cake until the top springs back when touched lightly and a toothpick inserted in the center comes out clean, 35 to 40 minutes. Let cool in the pan on a wire rack for 5 minutes. Loosen the edges and turn the cake out onto the rack.</li><li onclick="handleItemClick()">Meanwhile, prepare glaze: Sift ¾ cup confectioners\' sugar into a small bowl; mix with lemon juice and water to create a thin glaze. Poke 1-inch-deep holes all over the cake with a skewer. Coat the warm cake with the glaze using a pastry brush. Let cool completely. To serve, set the cake on a serving plate and dust with confectioners\' sugar.</li></ol>' ] );
