ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ul><li onclick="handleItemClick()">4-July-06:</li><li onclick="handleItemClick()">Needs much more ginger! used 1 tsp + 2 tsp fresh... not enough!</li><li onclick="handleItemClick()">A bit too sweet.</li></ul><ul><li onclick="handleItemClick()">2 cups all-purpose flour</li><li onclick="handleItemClick()">1 teaspoon ground ginger</li><li onclick="handleItemClick()">1 teaspoon ground cinnamon</li><li onclick="handleItemClick()">2 teaspoons baking soda</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">¾ cup vegetable shortening</li><li onclick="handleItemClick()">1 cup granulated sugar</li><li onclick="handleItemClick()">¼ cup light molasses</li><li onclick="handleItemClick()">1 large egg</li><li onclick="handleItemClick()">Sugar for rolling</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ol><li onclick="handleItemClick()">Preheat oven to 350*F (175*C).</li><li onclick="handleItemClick()">In medium bowl combine flour, ginger, cinnamon, baking soda and salt; set aside.</li><li onclick="handleItemClick()">Cream together shortening and sugar, add egg and beat until fluffy. Stir in molasses and mix well. Stir in flour mixture until just mixed</li><li onclick="handleItemClick()">Form tablespoonfuls of dough into round balls. Roll tops of balls in sugar. Place on a cookie sheet about 2-inches apart. (These cookies flatten as they bake.) Bake for exactly 9 minutes. Transfer cookies to wire racks to cool completely. </li></ol>' ] );
