ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ul><li onclick="handleItemClick()">1½ cups (packed) powdered sugar, sifted</li><li onclick="handleItemClick()">2 tablespoons (or more) fresh lemon Juice</li><li onclick="handleItemClick()">1½ cups all purpose flour</li><li onclick="handleItemClick()">⅓ cup yellow cornmeal</li><li onclick="handleItemClick()">¾ cup sugar</li><li onclick="handleItemClick()">3½ teaspoons baking powder</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">1 cup buttermilk</li><li onclick="handleItemClick()">2 large eggs</li><li onclick="handleItemClick()">1 tablespoon finely grated lemon peel</li><li onclick="handleItemClick()">¾ teaspoon vanilla extract</li><li onclick="handleItemClick()">½ cup (1 stick) unsalted butter, melted, cooled</li><li onclick="handleItemClick()">Crushed-Blueberry Sauce</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ol><li onclick="handleItemClick()">For glaze: Combine powdered sugar and 2 tablespoons lemon juice in small bowl. Stir with spoon until smooth and paste-like, adding more lemon juice by ½ teaspoonfuls if glaze is too thick to spread. Set aside.</li><li onclick="handleItemClick()">For cake: Position rack in center of oven and preheat to 350F. Butter 9-inch-diameter cake pan with 2-inch-high sides; line bottom with parchment. Combine flour, cornmeal, sugar, baking powder, and salt in large bowl; whisk to blend. Whisk buttermilk, eggs, lemon peel, and vanilla in small bowl. Pour buttermilk mixture and melted butter into flour mixture. Using rubber spatula, gently fold liquids into flour mixture until just blended (do not stir). Scrape batter into pan; spread evenly.</li><li onclick="handleItemClick()">Bake cake until tester inserted into center comes out clean and cake pulls away from sides of pan, about 30 minutes.</li><li onclick="handleItemClick()">Immediately run knife around sides of cake. Place rack atop cake in pan. Using oven mitts, hold pan and rack firmly together and invert cake onto rack. Remove pan from cake. Place another rack on bottom of cake; invert 1 more time so that cake is top side up. Stir glaze until blended. While cake is still very hot, drop glaze by tablespoonfuls onto cake; spread to within ½ inch of edge (some glaze may drip down sides of cake). Cool completely. Serve with Crushed-Blueberry Sauce.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ul><li onclick="handleItemClick()">Bon Apptit</li><li onclick="handleItemClick()">April 2009</li><li onclick="handleItemClick()">by Abigail Johnson Dodge</li><li onclick="handleItemClick()">[TC made on 29-June-12. Yum! (Don\'t forget the baking powder!)]</li><li onclick="handleItemClick()">You can view the complete recipe online at: <a href="http://www.epicurious.com/recipes/food/views/Lemon-Cornmeal-Cake-with-Lemon-Glaze-and-Crushed-Blueberry-Sauce-352048?mbid=ipapp" target="_blank">http://www.epicurious.com/recipes/food/views/Lemon-Cornmeal-Cake-with-Lemon-Glaze-and-Crushed-Blueberry-Sauce-352048?mbid=ipapp</a></li><li onclick="handleItemClick()">date created: [2012-07-02 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ul><li onclick="handleItemClick()">1 yellow cake mix</li><li onclick="handleItemClick()">3 eggs</li><li onclick="handleItemClick()">¾ cup cooking oil</li><li onclick="handleItemClick()">1 can mandarin oranges (include juice)</li><li onclick="handleItemClick()">1 large can crushed pineapple (include juice)</li><li onclick="handleItemClick()">1 instant vanilla pudding mix</li><li onclick="handleItemClick()">½ teaspoon vanilla</li><li onclick="handleItemClick()">whipped topping</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ol><li onclick="handleItemClick()">Mix cake mix, eggs, oil and oranges. Beat well. Pour into sheet cake pan or two round pans.</li><li onclick="handleItemClick()">Bake at 350 degrees for 30 to 35 minutes.</li><li onclick="handleItemClick()">Topping</li><li onclick="handleItemClick()">Beat the instant pudding with the pinapple and vanilla. Add whipped topping enough to spread on cake.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ul><li onclick="handleItemClick()">Delicious.</li><li onclick="handleItemClick()">Ellen Willis 18 May 2000 (via Doris Heimburg)</li><li onclick="handleItemClick()">a.k.a. Better Than Sex</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ul><li onclick="handleItemClick()"> cup softened, unsalted butter plus more for greasing the pans</li><li onclick="handleItemClick()">1 cup sugar</li><li onclick="handleItemClick()"> cup brown sugar</li><li onclick="handleItemClick()">3 eggs</li><li onclick="handleItemClick()">1 teaspoons pure vanilla extract</li><li onclick="handleItemClick()">finely grated zest of 1 lemon</li><li onclick="handleItemClick()"> cup fresh lemon juice</li><li onclick="handleItemClick()">2 cups all purpose flour</li><li onclick="handleItemClick()">1 teaspoons baking soda</li><li onclick="handleItemClick()"> teaspoon salt</li><li onclick="handleItemClick()">1 cups buttermilk</li><li onclick="handleItemClick()">4 pounds ripe peaches</li><li onclick="handleItemClick()">2 tablespoons fresh lemon juice</li><li onclick="handleItemClick()">2 tablespoons sugar</li><li onclick="handleItemClick()">2 cups heavy cream</li><li onclick="handleItemClick()">1 teaspoons pure vanilla extract</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ol><li onclick="handleItemClick()">Raspberry Melba Sauce (see recipe)</li><li onclick="handleItemClick()">Preheat the oven to 350F. Butter and flour two 9-inch cake pans (line with buttered and floured wax paper for easier removal, optional).</li><li onclick="handleItemClick()">Cream the  cup butter and sugars in a mixing bowl. Addd the eggs, one at a time, beating well after each adition. Beat in the vanilla, lemon zest and juice.</li><li onclick="handleItemClick()">Sift together the flour, baking soda and salt; add to mixture in the bowl, alternating with buttermilk, to make batter.</li><li onclick="handleItemClick()">Scrape batter into the pans. Bake until a toothpick inserted in the center comes out clean, about 35 to 40 minutes. Cool the cakes in their pans on a rack for 15 minutes, then turn them out onto the rack, peel off wax paper and cool completely.</li><li onclick="handleItemClick()">Shortly before serving, peel, pit and slice the peaches. Toss with lemon juice and 1 tablespoon sugar; set aside for 15 minutes.</li><li onclick="handleItemClick()">Whip the cream with the vanilla and the remaining 1 tablespoons of sugar until it holds soft peaks.</li><li onclick="handleItemClick()">Place on cake on a serving platter. Spread with half the cream, then half the peaches. Cover with second cake and top with remaining peaches. Top with a dollop of cream and, if desired, a mint sprig. Serve immediately, with the Raspberry Melba Sauce on the side or drizzled over the cake.</li><li onclick="handleItemClick()">Serves 10. </li><li onclick="handleItemClick()">Per serving: 651 calories, 82g carbs, 9g protein, 34 g fat, 167 mg cholesterol.</li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ul><li onclick="handleItemClick()">2 cups raspberries</li><li onclick="handleItemClick()"> cup confectioners\' sugar</li><li onclick="handleItemClick()">1 tablespoon fresh lemon juice</li><li onclick="handleItemClick()"> cup apple juice</li></ul>' ] );
