ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ul><li onclick="handleItemClick()">2 cups all-purpose flour</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">⅔ -  cup solid veg. shortening</li><li onclick="handleItemClick()">4 to 5 tablespoons ice water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ol><li onclick="handleItemClick()">Combine the flour and salt in a food processor. Add the shortening; pulse the machine on and off until the mixture resembles coarse meal.</li><li onclick="handleItemClick()">With the machine running,trickle in 4 tablespoons of ice water through the feed tube, until the dough just gathers together. (If the dough seems dry, add up to 1 tablespoon more of ice water,  teaspoon at a time.)</li><li onclick="handleItemClick()">Divide the dough in half, forming each half into a thick disk. Wrap each disk in plastic; refrigerate for at least 1 hour to chill.</li><li onclick="handleItemClick()">Remove half the dough from the refrigerator and roll it out on a lightly floured work surface or between 2 sheets of wax paper to form a circle about ⅛-inch thick and 2 inches larger than the pie plate. (Work quickly, as the dough can become sticky.) With the help of a spatula, gently transfer the dough to a pie plate, pressing it lightly into the plate to fit. If the dough should tear, just press it together gently. Trim the dough, leaving a 1-inch overhang. If making a single-crust pie, turn the edge under and flute it decoratively.</li><li onclick="handleItemClick()">Repeat for a top crust or for another bottom crust. The diameter for a top crust should be one inch larger than for the pie.</li><li onclick="handleItemClick()">Follow the individual pie recipes for filling and baking.</li></ol>' ] );
