ingredients_array.push( [ 'CostanzoRecipes_Dishes_Desserts', 'From Gourmet, Dec. 2005Makes 25-30 sandwich cookies<ul><li onclick="handleItemClick()">2 sticks (1 cup) cold unsalted butter, cut into pieces</li><li onclick="handleItemClick()"> cup sugar</li><li onclick="handleItemClick()">2 tsp vanilla</li><li onclick="handleItemClick()">2 cups flour</li><li onclick="handleItemClick()">1 tsp baking soda</li><li onclick="handleItemClick()">⅛ tsp salt, slightly rounded</li><li onclick="handleItemClick()"> cup fruit preserves (your choice  cherry and strawberry are good)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Desserts', '<ol><li onclick="handleItemClick()">Fill kitchen sink with about 2 inches of cold water. Melt butter in a 2- to 3-quart heavy saucepan over moderate heat and cook, stirring occasionally, until butter turns golden with a nutlike fragrance and flecks on bottom of pan turn a rich caramel brown, 10 to 12 minutes. (Butter will initially form, then dissipate. A thicker form will appear and cover the surface just before butter begins to brown; stir more frequently toward end of cooking.) Place pan in sink to stop cooking, then cool, stirring frequently, until butter starts to look opaque, about 4 minutes. Remove pan from sink and stir in sugar and vanilla.</li><li onclick="handleItemClick()">Whisk together flour, salt, and baking soda and stir into butter mixture until a dough forms. Shape into a ball, wrap with plastic wrap, and let stand at cool room temperature 1 to 2 hours (to allow flavors to develop).</li><li onclick="handleItemClick()">Put oven rack in middle position and preheat oven to 325F. </li><li onclick="handleItemClick()">Press a piece of dough into bowl of teaspoon (table type teaspoon, not one for measuring), flattening top, then slide out and place, flat side down, on an ungreased baking sheet. (Dough will feel crumbly, but will become cohesive when pressed.) Continue forming cookies and arranging on sheet. Bake cookies until just pale golden, 8 to 15 minutes. Cool cookies on sheet on a rack 5 minutes, then transfer cookies to rack and cool completely, about 30 minutes. Cookies are very delicate when hot.</li><li onclick="handleItemClick()">While cookies cool, heat preserves in a small saucepan over low heat until just runny, then pour through a sieve into a small bowl, pressing hard on solids, and cool completely. Spread the flat side of a cookie with a thin layer of preserves. Sandwich with flat side of another cookie. Continue with remaining cookies and preserves, then let stand until set, about 45 minutes. Transfer cookies to an airtight contain and (this is the hard part) WAIT 2 DAYS BEFORE EATING.</li><li onclick="handleItemClick()">Dough can be made 12 hours before baking and chilled, covered. Bring to room temperature to soften slightly before forming cookies, about 30 minutes. Cookies keep in an airtight container at room temperature 2 weeks.</li></ol>' ] );
