credits_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()"><a href="http://lifehacker.com/5924332/simmer-balsamic-vinegar-with-sugar-and-port-to-get-sweet-syrupy-aged-balsamic-in-minutes" target="_blank">http://lifehacker.com/5924332/simmer-balsamic-vinegar-with-sugar-and-port-to-get-sweet-syrupy-aged-balsamic-in-minutes</a></li><li onclick="handleItemClick()">9 July 2012</li><li onclick="handleItemClick()">date created: [2012-07-09 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()">½ c shortening (I use butter)</li><li onclick="handleItemClick()">1 c less 1 Tablespoon sugar</li><li onclick="handleItemClick()">2 eggs</li><li onclick="handleItemClick()">1 c mashed ripe bananas</li><li onclick="handleItemClick()">2 c flour</li><li onclick="handleItemClick()">2 tsp baking powder</li><li onclick="handleItemClick()">1 tsp baking soda</li><li onclick="handleItemClick()">½ tsp. salt</li><li onclick="handleItemClick()">3 T milk</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">Preheat oven to 400 ( I use 375). Grease muffin cups.  In mixing bowl, cream butter and sugar. Beat in eggs. Add bananas. Beat thoroughly.  Combine dry ingredients. Stir into banana mixture alternately with milk.  Spoon batter into muffin cups, filling them two-thirds full. Bake in preheated oven for 20 to 25 min.  Makes 12.</li><li onclick="handleItemClick()">from America Cooks via Mary Jane Legere 2009-06-23</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()">date created: [2009-06-23 Tue] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()">1 teaspoon active dry yeast</li><li onclick="handleItemClick()">5 cups bread flour</li><li onclick="handleItemClick()">2 teaspoons salt, plus more for boiling</li><li onclick="handleItemClick()">1 tablespoon diastatic malt powder</li><li onclick="handleItemClick()">¼ cup poppy seeds, optional</li><li onclick="handleItemClick()">¼ cup sesame seeds, optional</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">Put the yeast in the bowl of a standing mixer. Add 1⅔ cups lukewarm water and allow the yeast to activate, about 5 minutes. Add flour, salt and malt powder and mix at low speed for 5 minutes using the paddle attachment. Cover the dough and allow to rise at room temperature for about 2 hours.</li><li onclick="handleItemClick()">Punch the dough down and shape into a rough rectangle about 1 to 1½ inches thick, and about 2 times longer than it is wide. If you are having trouble forming the dough, stretch it, wait for the gluten to relax and reform.</li><li onclick="handleItemClick()">Cut the dough into 10 pieces of about 3 ounces each. Roll each into an 8-inch-long snakelike shape, tapering the dough at each end. Circle the dough around your hand, pinching the ends together and rolling under your palm once or twice to seal. Put the bagels on a Silpat or other nonstick baking sheet on top of a jellyroll pan. Cover well with plastic wrap and refrigerate for about 10 hours, or up to 24 hours.</li><li onclick="handleItemClick()">Heat the oven to 425 degrees. If you have a baking stone or brick you use for baking, put it on a rack near the bottom of the oven; it will retain heat and produce a crisper bagel. Bring a large pot of water to boil, throw a handful of salt into the boiling water and remove the bagels from the refrigerator.</li><li onclick="handleItemClick()">Using your hands, carefully place just enough bagels into the pot to cover the surface of the water, making sure that there are no bagels resting on top of one another. Let them float on one side for about 30 seconds before flipping them to the other side for another 30 seconds or so. Remove the bagels and drain well on a cooling rack.</li><li onclick="handleItemClick()">Pour poppy or sesame seeds into a bowl wider than the bagels. Working very quickly, remove the bagels one by one and dip them into the topping. Place them back on the Silpat-covered baking sheet, topping side down.</li><li onclick="handleItemClick()">Bake on the second to highest shelf of the oven for about 7 minutes. Then flip the bagels and continue baking for about 8 minutes, or until they are golden brown.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<a href="http://cooking.nytimes.com/recipes/1014445-baron-bagels" target="_blank">http://cooking.nytimes.com/recipes/1014445-baron-bagels</a>[2016-07-03 Sun] Made for Tracey and Doris who liked the flavor. They were rather flat. I made a dozen; perhaps try for 10 next time?' ] );
