ingredients_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', 'By Donna Pilato, About.com<ul><li onclick="handleItemClick()">It\'s difficult to picture a tea party that doesn\'t have at least one scone on the menu. Here is a simple recipe for buttermilk scones that turn out fluffy and buttery in absolutely no time. They\'re best served warm from the oven, but are still pretty tasty the following day.</li><li onclick="handleItemClick()">Prep Time: 15 minutes</li><li onclick="handleItemClick()">Cook Time: 15 minutes</li></ul><ul><li onclick="handleItemClick()">1¾ cups all-purpose flour</li><li onclick="handleItemClick()">1 teaspoon sugar</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">2 teaspoons baking powder</li><li onclick="handleItemClick()">½ teaspoon baking soda</li><li onclick="handleItemClick()">5 tablespoons unsalted butter, room temperature</li><li onclick="handleItemClick()">½ cup raisins</li><li onclick="handleItemClick()">¾ cup buttermilk, or slightly more as needed</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">Preparation:</li><li onclick="handleItemClick()">Preheat the oven to 450 degrees.</li><li onclick="handleItemClick()">Mix thoroughly the flour, sugar, salt, baking powder and baking soda in a large bowl with a whisk or spoon.</li><li onclick="handleItemClick()">Cut in the butter until the mixture resembles coarse meal. Stir in the raisins. Using a large spoon, blend in buttermilk until a soft dough forms.</li><li onclick="handleItemClick()">Place dough on a floured board and roll out to ½ inch thickness. Using a sharp knife, cut dough into six squares, then cut each square again on the diagonal. Place triangles on ungreased baking sheet. Bake for 10 to 12 minutes until golden brown.</li></ol>' ] );
