methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">In another bowl, whisk together:</li><li onclick="handleItemClick()">1 Tblsp	grated orange zest</li><li onclick="handleItemClick()">1		egg</li><li onclick="handleItemClick()">1 cup	buttermilk</li><li onclick="handleItemClick()">⅓ cup	vegetable oil</li><li onclick="handleItemClick()">Mix:</li></ol>½ cup	rinsed cranberries into dry ingredients. Pour into liquid mixture. Stir.<ol><li onclick="handleItemClick()">Spoon into paper-lined muffine tin about ⅔ full.</li><li onclick="handleItemClick()">Bake at 400 for 25 minutes.</li></ol>' ] );
