ingredients_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', 'By Kim Carlson, from the Culinate Kitchen collectionAlthough I used to be a fan of super-sweet and cakey muffins, that\'sno longer the case. But I still love the little package that a muffinrepresents-- it\'s an easy snack.I came up with this recipe, and although it contains only a relativelylittle sugar, the fruit adds plenty of sweetness.I hope you\'ll experiment with the amount of sugar you like.Serve these muffins with butter and honey -- or not.<ul><li onclick="handleItemClick()">1 	cup whole-wheat pastry flour</li><li onclick="handleItemClick()">1 	cup unbleached all-purpose flour</li><li onclick="handleItemClick()">¼ 	cup sugar (or less; see Note)</li><li onclick="handleItemClick()">1 	tsp. baking powder</li><li onclick="handleItemClick()">½ 	tsp. baking soda</li><li onclick="handleItemClick()">½ 	tsp. salt</li><li onclick="handleItemClick()">2 	large eggs</li><li onclick="handleItemClick()">½ 	cup low-fat buttermilk</li><li onclick="handleItemClick()">¼ 	cup canola oil</li><li onclick="handleItemClick()">1 	cup ripe bananas, mashed</li><li onclick="handleItemClick()">1 	cup frozen blueberries</li><li onclick="handleItemClick()">½ 	cup chopped and toasted nuts, such as hazelnuts (optional)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">Preheat the oven to 350 degrees. Line a 12-muffin pan with paper   baking cups.</li><li onclick="handleItemClick()">Combine the flours, sugar, baking powder, baking soda, and salt in   a large mixing bowl.</li><li onclick="handleItemClick()">Whisk together the eggs, buttermilk, and oil in a 4-cup glass   measuring cup with a pour spout or a medium bowl. Stir in the   mashed bananas.</li><li onclick="handleItemClick()">Pour the wet ingredients into the dry ingredients and, using a   rubber spatula, stir just until blended. Fold in the blueberries   and nuts.</li><li onclick="handleItemClick()">Fill the muffin cups ¾ full (add more batter to each cup if you   have extra). Bake for 20 minutes, then check to see if the muffins   are browning. If they need more time, bake 5 minutes longer.</li><li onclick="handleItemClick()">Cool for 10 minutes before serving, or serve at room temperature.</li></ol>' ] );
