credits_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()">I\'ve made these muffins with just two tablespoons of sugar and  without any sugar at all. Both options are good.</li><li onclick="handleItemClick()">This content is from the Culinate Kitchen collection:</li><li onclick="handleItemClick()"><a href="http://www.culinate.com/recipes/collections/Culinate+Kitchen/Breakfast/fruit_and_nut_muffins/print" target="_blank">http://www.culinate.com/recipes/collections/Culinate+Kitchen/Breakfast/fruit_and_nut_muffins/print</a></li><li onclick="handleItemClick()">28-Mar-2011</li><li onclick="handleItemClick()">date created: [2011-03-28 Mon] </li></ul>' ] );
