methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">Preheat oven to 425 degrees. While oven is preheating, melt 1 tablespoon butter in 9-inch square pan by putting it in the preheating oven.</li><li onclick="handleItemClick()">In large bowl, using a wire whisk, beat together: ½ cup milk ½ cup flour 2 eggs dash salt dash cinnamon</li><li onclick="handleItemClick()">Pour batter into 9-inch square pan that has the melted butter. Put it back in the oven.</li><li onclick="handleItemClick()">Bake for 12-15 minutes.</li><li onclick="handleItemClick()">Serve with powdered sugar or syrup. (Some people like to put lemon juice on it as well as the powdered sugar.)</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()"><a href="http://www.cooks.com/rec/doc/0,165,130177-249195,00.html" target="_blank">http://www.cooks.com/rec/doc/0,165,130177-249195,00.html</a></li><li onclick="handleItemClick()">date created: [2009-03-23 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()">¼ cup butter</li><li onclick="handleItemClick()">¼ cup (85 grams) honey</li><li onclick="handleItemClick()">3 cup rolled oats</li><li onclick="handleItemClick()">1 cup sunflower seeds</li><li onclick="handleItemClick()">1½ teaspoon cinnamon</li><li onclick="handleItemClick()">1 cup nuts (almonds are nice)</li><li onclick="handleItemClick()">1 cup shredded and/or flaked coconut</li><li onclick="handleItemClick()">½ cup wheat germ and/or flax seed</li><li onclick="handleItemClick()">⅔ cup raisins</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees.</li><li onclick="handleItemClick()">In a large oven-proof 9x13 inch baking pan, melt butter and stir in honey.</li><li onclick="handleItemClick()">Add the oats, seeds, cinnamon and nuts. Bake for 15 minutes, stirring occasionally.</li><li onclick="handleItemClick()">Add coconut, wheat germ and/or flax seed. Bake for 10 minutes longer, or until the mixture is lightly browned.</li><li onclick="handleItemClick()">Remove granola from the oven, stir in raisins and cool granola completely before transferring to a storage container.</li></ol>' ] );
