ingredients_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', 'Recipe courtesy of Gourmet MagazineServes: 14 (4-inch) pancakes<ul><li onclick="handleItemClick()">1 cup old fashion oats</li><li onclick="handleItemClick()">1 cup all-purpose flour</li><li onclick="handleItemClick()">¼ cup (packed) light brown sugar</li><li onclick="handleItemClick()">2 teaspoons baking powder</li><li onclick="handleItemClick()">½ teaspoon baking soda</li><li onclick="handleItemClick()">½ teaspoon cinnamon</li><li onclick="handleItemClick()">1⅔ cups buttermilk</li><li onclick="handleItemClick()">2 large eggs</li><li onclick="handleItemClick()">4 tablespoons unsalted butter, melted</li><li onclick="handleItemClick()">½ teaspoon pure vanilla extract</li><li onclick="handleItemClick()">1 cup plump raisins</li><li onclick="handleItemClick()">Cinnamon Sour cream, recipe follows</li><li onclick="handleItemClick()">Maple syrup for topping</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">In a medium bowl, whisk together the oats, flour, brown sugar, baking powder, baking soda, and cinnamon. </li><li onclick="handleItemClick()">In another bowl, whisk together buttermilk, eggs, melted butter and vanilla, blend thoroughly. </li><li onclick="handleItemClick()">Pour the liquid ingredients over the dry ingredients and mix with the whisk until just combined. Don\'t worry if the batter is a bit lumpy. </li><li onclick="handleItemClick()">With a rubber spatula gently fold in the raisins. The batter will thicken as it stands. </li><li onclick="handleItemClick()">If necessary, lightly butter, oil, or spray your griddle or skillet. Preheat over medium heat or if using an electric griddle set to 350 degrees F. If you want to hold the pancakes until serving time preheat your oven to 200 degrees F.</li><li onclick="handleItemClick()">Spoon ¼ cup of batter onto griddle for each pancake, allowing space for spreading, and use a spatula or the back of your spoon to lightly press the batter into rounds.</li><li onclick="handleItemClick()">When the underside of the pancake are golden and the tops are speckled with bubbles that pop and stay open, flip over with a wide spatula and cook on the other side until light brown.</li><li onclick="handleItemClick()">Serve immediately or place in oven while you make the rest of the batch.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()">date created: [2009-04-19 Sun] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()">1 egg</li><li onclick="handleItemClick()">1 cup buttermilk</li><li onclick="handleItemClick()">2 Tblsp shortening (melted) -or- vegetable oil</li><li onclick="handleItemClick()">1 cup flour</li><li onclick="handleItemClick()">1 Tblsp sugar</li><li onclick="handleItemClick()">1 teasp baking powder</li><li onclick="handleItemClick()"> teasp baking soda</li><li onclick="handleItemClick()"> teasp salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">Beat egg with hand beater until fluffy; beat in remaining   ingredients just until smooth. For thinner pancakes, stir in   additional  cup milk. Grease heated griddle if necessary. (To test   griddle, sprinkle with few drops water. If bubbles skitter around,   heat is just right.)</li><li onclick="handleItemClick()">Pour about 3 tablespoons batter from tip of large spoon or from   pitcher onto hot griddle. Cook pancakes until puffed and dry around   edges. Turn and cook other sides until golden brown. (To keep   pancakes hot, stack on hot plate with paper towel in between.)</li><li onclick="handleItemClick()">About six 4-inch pancakes.</li></ol>' ] );
