ingredients_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()">2½ cup flour</li><li onclick="handleItemClick()">¼ cup rolled oats</li><li onclick="handleItemClick()">1 tsp. cream of tartar</li><li onclick="handleItemClick()">1 tsp. baking soda</li><li onclick="handleItemClick()">2 Tbsp. sugar</li><li onclick="handleItemClick()">¼ cup butter</li><li onclick="handleItemClick()">1 cup raisins (alternate is a mix of pecans, chocolate chips and zest of one orange)</li><li onclick="handleItemClick()">1 cup buttermilk</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">Preheat oven to 425.  Mix dry ingredients in a large bowl.  Cut in butter with a pastry blender until the mixture resembles coarse crumbs.  Add the raisins and mix slightly.  Pour milk until dry ingredients are moistened.  Turn out onto a lightly floured surface.  Using your hands, form into an approximately 9" circle.  Cut into 8 wedges.  Place on ungreased baking sheet and bake 12-15 minutes or until golden brown.  Serve hot with butter or jam.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()">From Jan Holms 26 Feb 07</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()">8 (1-inch thick) slices bread (See Kelly’s Note)</li><li onclick="handleItemClick()">4 ounces (½ of an 8-oz. package) cream cheese, at room temp</li><li onclick="handleItemClick()">2 teaspoons vanilla extract</li><li onclick="handleItemClick()">1½ teaspoons fresh lemon juice</li><li onclick="handleItemClick()">1 teaspoon grated lemon zest</li><li onclick="handleItemClick()">1½ cups diced strawberries, divided</li><li onclick="handleItemClick()">¾ cup heavy cream</li><li onclick="handleItemClick()">4 large eggs</li><li onclick="handleItemClick()">1 teaspoon cinnamon</li><li onclick="handleItemClick()">1 Tablespoon sugar</li><li onclick="handleItemClick()">Unsalted butter, for cooking</li><li onclick="handleItemClick()">Maple syrup, for serving</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">Cut a wide pocket into each slice of bread without cutting all the way through the bread.</li><li onclick="handleItemClick()">In the bowl of a stand mixer fitted with the paddle attachment, beat together the cream cheese, vanilla extract, lemon juice, lemon zest and ½ cup diced strawberries until well combined, about 2 minutes.</li><li onclick="handleItemClick()">Slather a portion of the cream cheese mixture inside each bread pocket and press each bread pocket closed.</li><li onclick="handleItemClick()">In a medium bowl, whisk together the eggs, heavy cream, cinnamon and sugar.</li><li onclick="handleItemClick()">Place a large pan over medium heat and add 2 tablespoons of butter. Once the butter has melted, dip each stuffed slice of toast into the egg mixture on all sides and shake off any excess. Place the bread immediately into the pan and cook until golden, about 2 minutes. Flip once and continue cooking until golden, about 2 minutes. Repeat the coating the cooking process with the remaining slices of bread. (Do not overcrowd the pan.)</li><li onclick="handleItemClick()">Serve the French toast immediately topped with maple syrup and the remaining diced strawberries.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<a href="http://www.justataste.com/strawberry-cheesecake-stuffed-french-toast-recipe/" target="_blank">http://www.justataste.com/strawberry-cheesecake-stuffed-french-toast-recipe/</a>Any variety of bread will work in this recipe. A few of my favorites include a loaf of sourdough, a French baguette or (extra-thick) Texas toast. Use whatever type of bread you prefer, however stale bread works best for French Toast, as it absorbs the most liquid.<ul><li onclick="handleItemClick()">[2016-07-17 Sun] Made for Colwills, Doris and TC. Good, but <i class="conditional-space-after"></i>too lemony... even though I used about half the zest and none of the lemon juice.</li></ul>' ] );
