ingredients_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()">2 cups whole wheat pastry flour</li><li onclick="handleItemClick()">½ cup honey</li><li onclick="handleItemClick()">1 Tbsp baking powder</li><li onclick="handleItemClick()">1 cup milk or apple juice</li><li onclick="handleItemClick()">1 egg (beaten) or ¼ cup apple sauce</li><li onclick="handleItemClick()">⅓ cup vegetable oil</li><li onclick="handleItemClick()">¾ cup mashed bananas</li><li onclick="handleItemClick()">½ cup chopped walnuts</li><li onclick="handleItemClick()">dash cinnamon and/or nutmeg</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">Preat oven to 400. Grease a 12-cup muffin pan. Sift flour, spices   and baking powder into a medium bowl. Make a well in the center.</li><li onclick="handleItemClick()">Mix wet ingredients in a small bowl. Pour mixture into well and mix   batter until just moistened. Fold in walnuts. Do not overmix.</li><li onclick="handleItemClick()">Spoon batter into prepared muffin cups. Bake until a toothpick   inserted in center comes out clean or until muffins are golden   brown, about 15 minutes.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ul><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', 'Make-Ahead Ooey-Gooey Sticky Buns<ul><li onclick="handleItemClick()">1 package	dry yeast (2 tsp?)</li><li onclick="handleItemClick()">1 teaspoon	granulated sugar</li><li onclick="handleItemClick()"> cup		warm water (105-115)</li><li onclick="handleItemClick()">4 cups		flour</li><li onclick="handleItemClick()"><1 teaspoon	ground nutmeg</li><li onclick="handleItemClick()"> teaspoon	salt</li><li onclick="handleItemClick()">1 cup		evaporated skim milk, divided</li><li onclick="handleItemClick()"> cup		water</li><li onclick="handleItemClick()">1 large		egg, lightly beaten</li><li onclick="handleItemClick()">Cooking spray</li><li onclick="handleItemClick()">1 c. packed	dark brown sugar, divided</li><li onclick="handleItemClick()">⅓ cup		dark corn syrup</li><li onclick="handleItemClick()">2 tablespoons	stick butter</li><li onclick="handleItemClick()"> cup chopped pecans</li><li onclick="handleItemClick()">1 Tbs		ground cinnamon</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Breakfast', '<ol><li onclick="handleItemClick()">Dissolve yeast and 1 teaspoon granulated sugar in  cup warm water in a small bowl; let stand 5 minutes. Lightly spoon flour into dry measuring cups; level with a knife. Place 3 cups flour,  cup granulated sugar, nutmeg, and salt in a food processor; pulse 2 times or until blended. Combine ⅔ cup milk,  cup water and egg. With processor on, slowly add milk mixture and yeast mixture through food chute; process until dough forms a ball. Process for an additional minute. Turn dough out onto a lightly floured surface; knead until smooth and elastic (about 8 minutes); add enough of remaining flour, 1 tablespoon at a time to prevent dough sticking to hands.</li><li onclick="handleItemClick()">Place dough in a large bowl coated with cooking spray, turning to coat top. Cover and let rise in a warm place (85), free from drafts, 45 minutes or until doubled in size. Combine ⅓ cup milk, 1 cup brown sugar, corn syrup and butter in a small saucepan; bring to a boil, sitrring constantly. Remove from heat. Divide pecans evenly between 2 (9-inch) round cake pans coated with cooking spray. Top each with half of brown sugar mixture.</li><li onclick="handleItemClick()">Punch down dough; let rest 5 minutes. Roll into a 24 x 10-inch rectangle on a lightly floured surface; coat entire surface of dough with cooking spray. Combine  cup brown sugar and cinnamon in a small bowl; sprinkle evenly over dough. Beginning with a long side, roll up jelly-roll fashion; pich seam to seal (do not seal ends of rolls). Cut roll into 24 (1-inch) slices, using string or dental floss. Arrange 12 slices, cut sides up in each pan. Cover with plastic wrap coated with cooking spray, and let rise in refrigerator 8 to 24 hours or until doubled in size.</li><li onclick="handleItemClick()">Preheat oven to 375.</li><li onclick="handleItemClick()">Bake rolls at 375 for 23 minutes. Run a  knife around outiside   edges of pans. Place a plate upside down on top of pan; invert onto   plate. Yield: 2 dozen (serving size: 1 bun).</li><li onclick="handleItemClick()">Calories: 188 (19% from fat). Fat 4g. (sat 0.5g; mono 2.1 g, poly 1g) Protein: 3.7g; Carb 35.1 g; Fiber 1g; Chol 10mg; Iron 1.5mg; Sodium 110 mg; Calc 51 mg</li><li onclick="handleItemClick()">Mixer Variation: Combine yeast mixture, 3 cups flour, granulated sugar, nutmeg and salt in a bowl. Add ⅔ cup milk,  cup water and egg. Beat at medium speed of a mixer until blended. Turn dough out onto a lightly floured surface; knead until smooth and elastic (about 8 minutes); add enough remaining flour, 1 tablespoon at a time, to prevent dough from sticking to hands. Proceed to step 2.</li></ol>' ] );
