ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">1 tablespoon yeast</li><li onclick="handleItemClick()">1 tablespoon sugar</li><li onclick="handleItemClick()">1 cup warm water</li><li onclick="handleItemClick()">2½ cups flour</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">2 tablespoons fresh rosemary</li><li onclick="handleItemClick()">2 tablespoons vegan margarine</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">Place yeast, sugar and water in large bowl or food processor and allow mixture to become bubbly. Mix in 1 tablespoon margarine, salt, and 2 cups of flour. Add one tablespoon of the fresh chopped rosemary. Knead for about 10 minutes by hand or in food processor about 5 minutes until smooth and elastic. Add more flour if necessary.</li><li onclick="handleItemClick()">Oil a bowl, put dough in it and cover with a towel. Let dough rise in a warm place for one hour until doubled.</li><li onclick="handleItemClick()">Punch down dough and divide in half. Let dough rest about 5 minutes.</li><li onclick="handleItemClick()">Spray baking pan or cookie sheet with cooking spray. Shape the dough into 2 small rounded oval loaves. Sprinkle remaining 1 Tablespoon of rosemary over the loaves and press lightly into the surface.  Let loaves rise again until doubled, about 45 minutes.</li><li onclick="handleItemClick()">Preheat oven to 375 degrees Fahrenheit. Bake for 15 to 20 minutes, until lightly browned. Carefully remove from oven, brush with remaining vegan margarine (and salt if desired).</li></ol>' ] );
