ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">3¾ cups (450g) unbleached all-purpose flour, plus more for dusting the work surface.</li><li onclick="handleItemClick()">2 teaspoons salt</li><li onclick="handleItemClick()">½ cup warm low fat milk (about 110 degrees)</li><li onclick="handleItemClick()">½ cup heavy cream</li><li onclick="handleItemClick()">⅓ cup warm water</li><li onclick="handleItemClick()">2¼ teaspoons rapid rise yeast</li><li onclick="handleItemClick()">2 teaspoons sugar</li><li onclick="handleItemClick()">2½ tablespoons unsalted butter, melted</li><li onclick="handleItemClick()">¼ cup sugar</li><li onclick="handleItemClick()">1½ large eggs, beaten (crack one egg into a bowl, whisk, and then use half that amount with 1 whole egg.)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">Adjust oven rack to the lowest position and heat to 200 degrees. once the oven temp reaches 200, maintain the heat for 10 minutes and turn off the oven.</li><li onclick="handleItemClick()">Mix 3½ cups of the flour and the salt in a bowl.</li><li onclick="handleItemClick()">Mix the milk,cream, butter, and ¼ cup sugar in a saucepan and heat over medium heat until foam forms around the edges. remove from the burner and place on a hot pad in the fridge to cool only to luke warm. you do not want cold milk, but it cannot be hot either.</li><li onclick="handleItemClick()">In a glass measuring cup, add the warm water and yeast with the 2 teaspoons of sugar. allow to foam for 5-10 minutes.</li><li onclick="handleItemClick()">In a bowl of a standing mixer, add the milk mixture and about 1 cup of the flour. using the dough hook, mix for about 30 seconds. scrape down the sides of the bowl and add the yeast mixture. beat again for 3 minutes. add the eggs and beat for 30 seconds. add the remaining flour and beat on medium then medium high for 1-2 minutes or until the dough is pulling away from the mixer but still slightly sticky to the touch.</li><li onclick="handleItemClick()">Place in a clean, lightly oiled bowl and cover with a towel to rise for 1-2 hours, sometimes i let mine go for 3 hours.</li><li onclick="handleItemClick()">Punch down the dough and place on a lightly floured surface. form into balls and then roll in butter, herb mixture and then place in greased pie dishes (about 2 dishes), covered lightly with a towel to rise for 1 hour or until doubled in size.</li><li onclick="handleItemClick()">Bake at 375 for 15-20 minutes or until lightly golden on top. serve immediately. see notes for further instructions on freezing etc.</li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">¼ teaspoon parsley</li><li onclick="handleItemClick()">¼ teaspoon dill</li><li onclick="handleItemClick()">¼ teaspoon thyme</li><li onclick="handleItemClick()">¼ teaspoon basil</li><li onclick="handleItemClick()">¼ teaspoon rosemary</li><li onclick="handleItemClick()">½ cup parmesan cheese, (kraft powdered kind)</li><li onclick="handleItemClick()">½ cup butter, melted</li><li onclick="handleItemClick()">2 teaspoons garlic</li></ul>instructions' ] );
