ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">7½ cups (900g) unbleached all-purpose flour, plus more for dusting the work surface.</li><li onclick="handleItemClick()">4 teaspoons salt</li><li onclick="handleItemClick()">1 cup warm low fat milk (about 110 degrees)</li><li onclick="handleItemClick()">1 cup heavy cream</li><li onclick="handleItemClick()">⅔ cup warm water</li><li onclick="handleItemClick()">2 scant tablespoons rapid rise yeast</li><li onclick="handleItemClick()">4 teaspoons sugar</li><li onclick="handleItemClick()">5 tablespoons unsalted butter, melted</li><li onclick="handleItemClick()">½ cup sugar</li><li onclick="handleItemClick()">3 large eggs, beaten</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">Adjust oven rack to the lowest position and heat to 200 degrees. once the oven temp reaches 200, maintain the heat for 10 minutes and turn off the oven.</li><li onclick="handleItemClick()">Mix 7 cups (840g) of the flour and the salt in a bowl.</li><li onclick="handleItemClick()">Mix the milk,cream, butter, and ½ cup sugar in a saucepan and heat over medium heat until foam forms around the edges. Remove from the burner and place on a hot pad in the fridge to cool only to luke warm. You do not want cold milk, but it cannot be hot either.</li><li onclick="handleItemClick()">In a glass measuring cup, add the warm water and yeast with the 4 teaspoons of sugar. Allow to foam for 5-10 minutes.</li><li onclick="handleItemClick()">In a bowl of a standing mixer, add the milk mixture and about 2 cups (240g) of the flour. Using the dough hook, mix for about 30 seconds. scrape down the sides of the bowl and add the yeast mixture. beat again for 3 minutes. Add the eggs and beat for 30 seconds. Add the remaining flour and beat on medium then medium high for 1-2 minutes or until the dough is pulling away from the mixer but still slightly sticky to the touch.</li><li onclick="handleItemClick()">Place in a clean, lightly oiled bowl and cover with a towel to rise for 1-2 hours, sometimes I let mine go for 3 hours.</li><li onclick="handleItemClick()">Punch down the dough and place on a lightly floured surface. form into balls and then roll in butter, herb mixture and then place in greased pie dishes (about 2 dishes), covered lightly with a towel to rise for 1 hour or until doubled in size.</li><li onclick="handleItemClick()">Bake at 375 for 15-20 minutes or until lightly golden on top. Serve immediately.</li></ol>' ] );
