methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">½ cup butter, softened</li><li onclick="handleItemClick()">1 cup brown sugar</li><li onclick="handleItemClick()">2 tsp. cinnamon</li><li onclick="handleItemClick()">4 oz. cream cheese, softened</li><li onclick="handleItemClick()">¼ cup butter, softened</li><li onclick="handleItemClick()">1½ cup confectioners sugar</li><li onclick="handleItemClick()">½ tsp. vanilla</li><li onclick="handleItemClick()">1½ tsp. milk</li><li onclick="handleItemClick()">Place ingredients in machine following the specifications of that</li><li onclick="handleItemClick()">particular machine. Set for dough cycle. After complete on dough</li><li onclick="handleItemClick()">cycle, remove from machine and roll out to 17x10" (approx.) rectangle.</li><li onclick="handleItemClick()">Mix together brown sugar and cinnamon. Spread softened butter over</li><li onclick="handleItemClick()">dough. Sprinkle brown sugar and cinnamon mixture over top. Roll</li><li onclick="handleItemClick()">tightly from long end, pinching edges closed when completely rolled.</li><li onclick="handleItemClick()">Slice rolled dough into ½" slices (or large if a larger bun is</li><li onclick="handleItemClick()">preferred).  Place into greased cake pans or a cookie sheet.  If</li><li onclick="handleItemClick()">using cake pans, use 3 9" pans. Let rise until doubled. Bake at</li><li onclick="handleItemClick()">350 for 15-20 minutes, until golden. Do not overbake.</li><li onclick="handleItemClick()">Spread on very warm rolls. They are best when eaten fresh, but we</li><li onclick="handleItemClick()">have found that 10-15 seconds in the microwave rejuvenates them.</li><li onclick="handleItemClick()">Note:  You may add chopped nuts with the filling, and use twice</li><li onclick="handleItemClick()">the amount of cinnamon.</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ol>' ] );
