ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">4 cups soda bread flour (or all-purpose plus 1 heaping teaspoon baking soda and 1 heaping teaspoon of cream of tartar)</li><li onclick="handleItemClick()">1 heaping teaspoon baking soda</li><li onclick="handleItemClick()">pinch salt</li><li onclick="handleItemClick()"> cup granulated sugar</li><li onclick="handleItemClick()">4 oz. dried fruit</li><li onclick="handleItemClick()">1-2 cups buttermilk</li><li onclick="handleItemClick()">1 tablespoon butter</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">Sift the flour and baking soda into a large mixing bowl, then stir in th esalt, sugar, and fruit. Make a well in the ceter and pour in almost all the buttermilk.  Stir with a broad-bladed knife or wooden spoon to form a loose dough, adding the rest of the milk if necessary.</li><li onclick="handleItemClick()">Use the butter to grease an 8-inch round cake pan, approximately 3 inches deep. Place the dough in the pan, leaving the surface rough. Sprinkle with a little flour, set the pan on a baking sheet, and bake in a preheated oven for 30 minutes.</li><li onclick="handleItemClick()">Reduce the temperature and cook for a further 30 minutes until the bread is golden-brown and crisp to the touch. A skewer inserted in the center should come out clean.  Remove from the cake pan and wrap in a clean cloth. When col, cut in slices and serve buttered.</li><li onclick="handleItemClick()">makes 1 round loaf</li><li onclick="handleItemClick()">Prep time: 10-15 minutes</li><li onclick="handleItemClick()">Cooking time: 1-1 hours</li><li onclick="handleItemClick()">Oven temperature: 400F for 30 minutes, then reduce the temperature to 300F for a further 30-40 minutes.</li></ol>' ] );
