ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">1 (¼ ounce) package active dry years</li><li onclick="handleItemClick()">1 cup warm water</li><li onclick="handleItemClick()">2 Tbls butter, softened</li><li onclick="handleItemClick()">1 Tbl sugar</li><li onclick="handleItemClick()">½ tsp salt</li><li onclick="handleItemClick()">2¾ cup all-purpose flour</li><li onclick="handleItemClick()">4 cup water</li><li onclick="handleItemClick()">2 Tbls baking soda</li><li onclick="handleItemClick()">Coarse salt</li><li onclick="handleItemClick()">Prepared mustard</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">In large mixing bowl, dissoved yeast in warm water. Add butter, sugar, salt and 2 cups flour. Beat until smooth. Stir in remaining flour for soft dough.</li><li onclick="handleItemClick()">Cover and let rise in warm place for 20 minutes.</li><li onclick="handleItemClick()">Punch dough down. Divide into equal pieces.</li><li onclick="handleItemClick()">On a lightly floured surface, roll each piece into a 15-inch long strip. Twist into pretzel shapes to make 1 dozen.</li><li onclick="handleItemClick()">In a large non-aluminum saucepan, bring water to a boil. Add baking soda.</li><li onclick="handleItemClick()">Drop 2 pretzels into water, boil for 1 minute. Remove with slotted spoon; drain.</li><li onclick="handleItemClick()">Place on greased baking sheet; sprinkle with coarse salt.</li><li onclick="handleItemClick()">Repeat with remaining pretzels.</li><li onclick="handleItemClick()">Bake in oven at 475 degrees for 10 to 12 minutes.</li></ol>' ] );
