ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', 'Printed from COOKS.COM<ul><li onclick="handleItemClick()">2 c. unsifted all-purpose flour</li><li onclick="handleItemClick()">2 tbsp. sugar</li><li onclick="handleItemClick()">1 tsp. baking powder</li><li onclick="handleItemClick()">1 tsp. baking soda</li><li onclick="handleItemClick()">½ tsp. salt</li><li onclick="handleItemClick()">3 tbsp. butter, softened</li><li onclick="handleItemClick()">½ c. dark seedless raisins</li><li onclick="handleItemClick()">1 c. buttermilk</li><li onclick="handleItemClick()">1 tbsp. butter, melted</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">Preheat oven to 375 degrees. Using solid vegetable shortening, lightly grease the surface of a small baking sheet. Set aside until bread is shaped.</li><li onclick="handleItemClick()">Assemble all ingredients for Irish soda bread. (Make bread the same day you plan to serve it.)</li><li onclick="handleItemClick()">Put flour, sugar, baking powder, baking soda and salt in a sifter; sift over a large bowl.</li><li onclick="handleItemClick()">Add softened butter and cut into flour mixture, using a pastry blender or fork until mixture looks like fine crumbs.</li><li onclick="handleItemClick()">Add raisins and toss thoroughly.</li><li onclick="handleItemClick()">Pour buttermilk into flour mixture all at once.</li><li onclick="handleItemClick()">Gently toss mixture together with a fork until all dry ingredients are just moistened. Do not overmix.</li><li onclick="handleItemClick()">Using hands, gently gather flour mixture together and press firmly into a ball.</li><li onclick="handleItemClick()">Put dough on a lightly floured pastry cloth or board. Knead gently with the palms of your hands until dough is smooth (about 1 minute). Shape into a smooth round ball and place on the prepared baking sheet.</li><li onclick="handleItemClick()">Using hands, flatten dough into a circle that is about seven inches in diameter. (Dough will be about 1½" thick.) Press a large floured knife into center of loaf, halfway through dough. Repeat, at right angle, to divide loaf into quarters.</li><li onclick="handleItemClick()">Bake bread for 30 to 40 minutes, or until top is golden brown and loaf sounds hollow when tapped on the bottom and sides with a wooden spoon.</li><li onclick="handleItemClick()">Remove to a wire rack to cool. Brush top with melted butter and later, dust with flour. Makes one loaf.</li></ol>' ] );
