ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', 'By Carroll Pellegrinelli, About.com<ul><li onclick="handleItemClick()">"Using a cake mix make making these muffins so much easier."</li><li onclick="handleItemClick()">Serve these muffins warm with real butter.</li><li onclick="handleItemClick()">Prep Time: 25 minutes</li><li onclick="handleItemClick()">Cook Time: 25 minutes</li></ul><ul><li onclick="handleItemClick()">2 large eggs</li><li onclick="handleItemClick()">1 cup milk</li><li onclick="handleItemClick()">½ cup oil or ½ cup butter, softened</li><li onclick="handleItemClick()">juice and zest of 1 lemon</li><li onclick="handleItemClick()">1 18.25 ounce lemon cake mix</li><li onclick="handleItemClick()">4 tablespoons poppy seeds</li><li onclick="handleItemClick()">Optional Lemon Glaze:<ul><li onclick="handleItemClick()">4 teaspoons lemon juice</li><li onclick="handleItemClick()">¼ cup powdered sugar</li><li onclick="handleItemClick()">zest of 1 lemon</li></ul></li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees F.</li><li onclick="handleItemClick()">Grease 18 muffin cups or grease and flour 2-9" x 5" loaf pans.</li><li onclick="handleItemClick()">In a large bowl, with a hand mixer combine eggs, milk and oil.</li><li onclick="handleItemClick()">Add lemon juice and zest. Blend.</li><li onclick="handleItemClick()">Hand stir in cake mix and poppy seeds, only stirring until ingredients are moistened. There will be some lumps.</li><li onclick="handleItemClick()">Bake for 25 minutes or until tester comes out clean.</li><li onclick="handleItemClick()">Remove from muffin pan and cool on wire rack.</li><li onclick="handleItemClick()">If using glaze: Stir together juice, sugar and zest. Drizzle over warm muffins. </li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()"><a href="http://baking.about.com/od/quickandsweetbreads/r/lemonpoppyseed.htm" target="_blank">http://baking.about.com/od/quickandsweetbreads/r/lemonpoppyseed.htm</a></li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">3     cups unbleached all-purpose flour</li><li onclick="handleItemClick()">1¾ teaspoons salt</li><li onclick="handleItemClick()">½ teaspoon yeast</li><li onclick="handleItemClick()">1½ cups water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">In a large mixing bowl, whisk together flour, salt and yeast.</li><li onclick="handleItemClick()">Add water and mix until a shaggy mixture forms.</li><li onclick="handleItemClick()">Cover bowl with plastic wrap and set aside for 12 - 18 hours.   Overnight works great.</li><li onclick="handleItemClick()">Heat oven to 450 degrees.  When the oven has reached 450 degrees   place a cast iron pot with a lid in the oven and heat the pot for   30 minutes.</li><li onclick="handleItemClick()">[optional] Meanwhile, pour dough onto a heavily floured surface and   shape into a ball.  Cover with plastic wrap and let set while the   pot is heating.</li><li onclick="handleItemClick()">Remove hot pot from the oven and drop in the dough.</li><li onclick="handleItemClick()">Cover and return to oven for 30 minutes.</li><li onclick="handleItemClick()">After 30 minutes remove the lid and bake an additional 15 minutes.</li><li onclick="handleItemClick()">Remove bread from oven and place on a cooling rack to cool.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<a href="http://www.simplysogood.com/2013/03/artisan-no-knead-bread.html" target="_blank">http://www.simplysogood.com/2013/03/artisan-no-knead-bread.html</a>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">1 cup warm water</li><li onclick="handleItemClick()">1 pkg dry yeast</li><li onclick="handleItemClick()">3  cups unbleached flour</li><li onclick="handleItemClick()"> tsp salt</li><li onclick="handleItemClick()">Soften yeast in water. Add salt then start adding flour until a wet dough forms. Knead briefly, just to form a consistent dough. Place ball of dough in a large plastic Ziploc bag (or large bowl) that has been coated with olive oil. Place in refrigerator for 4-5 hours. About the time you turn the oven on to pre-heat, pull dough out of refrigerator. Punch down and then let rest for 10 minutes. Divide ball in half and coat well with flour. Start patting each ball of dough out into a circle, the thinner the better, letting rest if it won\'t spread out.</li><li onclick="handleItemClick()">Place an oven rack at the very lowest position  remove other racks and set aside. Place baking tiles or pizza stone on the rack and preheat the oven to 500 F for an hour or so. Make sure stone is in the oven from the beginning otherwise the high heat might crack it.</li><li onclick="handleItemClick()">New York Style Tomato Sauce</li><li onclick="handleItemClick()">1 can (28 ounces) Italian plum tomatoes - buy the best you can find</li><li onclick="handleItemClick()">2 tbl. tomato paste</li><li onclick="handleItemClick()">1 or 2 garlic cloves, minced or pressed</li><li onclick="handleItemClick()">1 tsp. dried oregano</li><li onclick="handleItemClick()">Salt and freshly ground black pepper</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">Crush the tomatoes with your hands or a fork and place in a heavy saucepan over medium heat. Stir in the tomato paste, garlic, oregano and salt and pepper to taste. Bring the mixture just to a boil, then reduce the heat to low and simmer the sauce, stirring occasionally, until thick and flavorful, 30 minutes to 1 hour. Remove from the heat. (This may be stored in the refrigerator for up to 1 week or frozen up to 4 months)</li><li onclick="handleItemClick()">To bake: Turn the smoke alarm off. Cover pizza peel with coarse corn meal. Place one flattened piece of the dough onto the peel, spread with olive oil, cover with a thick layer of tomato sauce then add toppings. Sprinkle on a thick layer of parmesan cheese then drizzle with olive oil. Slide pizza onto the hot stone and bake 10 to 15 minutes until the top of the pie is beginning to brown. Remove pizza from oven and place on a cutting board. Let sit for a few minutes then slice and eat while hot.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">date created: [2008-01-16 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', 'Recipe Courtesy of Cathy LowePrep Time: 20 minCook Time: 60-70 minServes: 2 loaves<ul><li onclick="handleItemClick()">3 cups sugar</li><li onclick="handleItemClick()">1 cup vegetable oil</li><li onclick="handleItemClick()">4 eggs, lightly bean</li><li onclick="handleItemClick()">16 ounces canned unsweetened pumpkin</li><li onclick="handleItemClick()">3½ cups flour</li><li onclick="handleItemClick()">2 teaspoons salt</li><li onclick="handleItemClick()">2 teaspoons baking soda</li><li onclick="handleItemClick()">1 teaspoon baking powder</li><li onclick="handleItemClick()">1 teaspoon nutmeg</li><li onclick="handleItemClick()">1 teaspoon allspice</li><li onclick="handleItemClick()">1 teaspoon cinnamon</li><li onclick="handleItemClick()">½ teaspoon cloves</li><li onclick="handleItemClick()">⅔ cup water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees. Butter and flour two 9x5 loaf pans. Stir together sugar and oil. Stir in eggs and pumpkin.</li><li onclick="handleItemClick()">Combine dry ingredients in separate bowl. Blend dry ingredients and water into wet mixture, alternating.</li><li onclick="handleItemClick()">Divide batter between two loaf pans.</li><li onclick="handleItemClick()">Bake for 60 to 70 minutes or until cake tester comes out clean. Let stand 10 minutes. Remove from pans and cool.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()"><a href="http://www.foodnetwork.com/food/cda/recipe_print/0,1946,FOOD_9936_4067_RECIPE-PRINT-FULL-PAGE-FORMATTER,00.html" target="_blank">http://www.foodnetwork.com/food/cda/recipe_print/0,1946,FOOD_9936_4067_RECIPE-PRINT-FULL-PAGE-FORMATTER,00.html</a></li><li onclick="handleItemClick()">[2016-06-26 Sun] made for TC, Doris and Joanne; still a hit!</li><li onclick="handleItemClick()">[2006-12-11 Mon] A hit! Made for Kate, Jan, Ian, Dan, TLC</li><li onclick="handleItemClick()">[2009-12-13 Sun] Again on (for HLTA and DJ work colleagues). Another hit.</li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">2 cups gluten flour</li><li onclick="handleItemClick()">1 teaspoon garlic powder</li><li onclick="handleItemClick()">1 teaspoon ground ginger</li><li onclick="handleItemClick()">1-¼ cups water or vegetable stock</li><li onclick="handleItemClick()">3 Tablespoons lite tamari, Braggs liquid amino acids, or soy sauce</li><li onclick="handleItemClick()">1-3 teaspoons toasted sesame oil (optional)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">Add garlic powder and ginger to flour and stir. Mix liquids together and add to flour mixture all at once. Mix vigorously with a fork. When it forms a stiff dough knead it 10 to 15 times.</li><li onclick="handleItemClick()">Let the dough rest 2 to 5 minutes, then knead it a few more times. Let it rest another 15 minutes before proceeding.</li><li onclick="handleItemClick()">Cut gluten into 6 to 8 pieces and stretch into thin cutlets. Simmer in broth for 30 to 60 minutes.</li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">4 cups water</li><li onclick="handleItemClick()">¼ cup tamari or soy sauce</li><li onclick="handleItemClick()">3-inch piece of kombu (a type of seaweed)</li><li onclick="handleItemClick()">3-4 slices ginger (optional)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">Combine all ingredients in a large saucepan. Bring broth to a boil. Add cutlets one at a time. Reduce heat to barely simmer when saucepan is covered. Seitan may be used, refrigerated, or frozen at this point.</li></ol>' ] );
