ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', 'Makes 2 large loaves<ul><li onclick="handleItemClick()">½ cup wheat berries or cracked wheat (optional)</li><li onclick="handleItemClick()">Preferment:</li><li onclick="handleItemClick()">>12.5 oz. water (1½ cups)</li><li onclick="handleItemClick()">⅛ teaspoon instant yeast</li><li onclick="handleItemClick()">1 lb. bread flour (3½ cups)</li><li onclick="handleItemClick()">½ tablespoon salt</li></ul><ul><li onclick="handleItemClick()">12.5 oz. water (1½ cups)</li><li onclick="handleItemClick()">½ teaspoon instant yeast</li><li onclick="handleItemClick()">8 oz. bread flour (2  cups)</li><li onclick="handleItemClick()">8 oz. whole wheat or rye flour or a mixture of them (around 2 cups)</li><li onclick="handleItemClick()">¼ cup or so flax meal (optional) </li><li onclick="handleItemClick()">½ tablespoon salt</li><li onclick="handleItemClick()">all of the preferment </li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">If using grains, soak in water, enough to cover, over night.</li><li onclick="handleItemClick()">Put the yeast in the water and stir. Mix the flour and salt together in a bowl and pour in the yeasted water. Mix until the flour is hydrated, adding more water if necessary. Cover the bowl with plastic wrap and leave the pre-ferment out at room temperature overnight (up to 16 hours... if you need more time before baking put it in the refrigerator).</li><li onclick="handleItemClick()">To make the final dough, combine all of the ingredients except the pre-ferment in a mixing bowl. Chop the pre-ferment up into small pieces and mix or knead it into the final dough until they are thoroughly combined. This is quite difficult to do by hand: Hamelman assumes the baker has a mixer and can mix it for 5 minutes by machine. I mix and knead my dough by hand for about 10 minutes. At the end of that time the new and old dough aren\'t perfectly combined-- you can still see a few streaks of the lighter colored pre-ferment in it-- but they are sufficiently combined that loaves bake evenly.</li><li onclick="handleItemClick()">Place the dough back in a greased bowl and ferment for 2½ hours, punching down or folding the dough twice during that time.</li><li onclick="handleItemClick()">(Folding the dough consists of taking the dough out of the bowl, spreading it out a little on a clean surface, folding it in thirds like a letter, rotating it 90 degrees and folding it up again, and then returning the dough to the bowl and covering it again. Like punching down, folding degases the dough some, but it also encourages gluten development. More on this topic in a future post.)</li><li onclick="handleItemClick()">At the end of the fermentation, divide the dough into two pieces and preshape each into a ball. Cover with a clean towel and let each rest for 5 to 10 minutes before shaping into the final shape. Once shaped, cover the loaves with a clean towel and set aside for a final rise, approximately 1¼ to 1½ hours.</li><li onclick="handleItemClick()">Halfway though the final rise, begin preheating the oven to 450 degrees. If you are using a baking stone, preheat it as well. 8. Right before placing it in the oven, score the loaves. Place them in the oven and use whatever technique you use to create stream in the oven (squirt bottle, skillet full of hot water, etc) to encourage proper crust development.</li><li onclick="handleItemClick()">After 20 minutes of baking, rotate the loaves 180 degrees so that they\'ll bake evenly. Bake until an instant read thermometer reads around 200 degrees, which took approximately 35 minutes for my batard ("football") shaped loaves.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">(I\'ve tried preheating to 500 degrees, then lowering to 450 degrees and baking for 20 minutes on speed bake. Crispy crust, moist and tender, but a bit gummy inside.)</li><li onclick="handleItemClick()">From <a href="http://www.thefreshloaf.com/recipes/rusticbread" target="_blank">http://www.thefreshloaf.com/recipes/rusticbread</a>February 2011</li><li onclick="handleItemClick()">date created: [2011-03-04 Fri] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', 'By Diana Rattray, About.com<ul><li onclick="handleItemClick()">This cornbread is made with cream style corn and chile peppers, along with shredded cheese.</li><li onclick="handleItemClick()">1½ cups yellow cornmeal</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">1 teaspoon baking soda</li><li onclick="handleItemClick()">1½ cups buttermilk</li><li onclick="handleItemClick()">1 large egg, lightly beaten</li><li onclick="handleItemClick()">2 tablespoons melted butter or bacon drippings</li><li onclick="handleItemClick()">¼ cup chopped chile peppers, mild or hot, or use chopped and drained canned or pickled</li><li onclick="handleItemClick()">jalapeno chile peppers to taste</li><li onclick="handleItemClick()">1 cup cream-style corn</li><li onclick="handleItemClick()">1 cup shredded sharp Cheddar cheese</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">Preparation:</li><li onclick="handleItemClick()">Preheat the oven to 425 or 400 for a glass baking dish. In mixing bowl, combine cornmeal, salt, and baking soda. Add buttermilk and egg; beat until batter is smooth. Place butter in 8-inch square pan or baking dish and heat in preheated oven. Pour half of the batter into the hot pan. Spoon cream-style corn evenly over batter, scatter chile peppers over corn layer, and sprinkle with the shredded cheese. Top with remaining batter. Bake cornbread until golden brown, about 20 to 25 minutes. Serve hot.</li><li onclick="handleItemClick()">Serves 6 to 8.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()"><a href="http://southernfood.about.com/od/cornbread/r/bl01002b.htm" target="_blank">http://southernfood.about.com/od/cornbread/r/bl01002b.htm</a></li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ul><li onclick="handleItemClick()">1 cup flour</li><li onclick="handleItemClick()">¼ tsp salt</li><li onclick="handleItemClick()">½ tsp baking powder</li><li onclick="handleItemClick()">4 Tbl crisco</li><li onclick="handleItemClick()">⅓ cup water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Bread', '<ol><li onclick="handleItemClick()">Mix dry ingredients. Add crisco and water, mixing until combined. Knead until smooth and elastic. Divide into 4 pieces. Roll in to small smalls and roll out with hands.</li><li onclick="handleItemClick()">Cook until done on both sides, about 3-4 minutes.</li><li onclick="handleItemClick()">Eat \'em while they\'re hot!</li><li onclick="handleItemClick()">Makes 4 tortillas.</li></ol>' ] );
