methods_array.push( [ 'CostanzoRecipes_Dishes_Beverages', '<ol><li onclick="handleItemClick()">Boil fennel, cardamom, cloves, cinnamon, ginger root, pepper corns, bay leaves and water for 5 minutes, then steep for 10 minutes.</li><li onclick="handleItemClick()">Add tea, honey and milk. Bring to a boil and simmer 5 minutes. Strain.</li></ol>' ] );
