ingredients_array.push( [ 'CostanzoRecipes_Dishes_Beverages', '<ul><li onclick="handleItemClick()">Total Time: 5 mins</li><li onclick="handleItemClick()">Servings: 1</li></ul><ul><li onclick="handleItemClick()">crushed ice</li><li onclick="handleItemClick()">12 leaves fresh spearmint</li><li onclick="handleItemClick()">3 tablespoons lime juice ( preferably fresh, do not use Rose\'s Lime)</li><li onclick="handleItemClick()">1-2 tablespoon sugar syrup, to taste</li><li onclick="handleItemClick()">1½-2 ounces rum, to taste</li><li onclick="handleItemClick()">2 ounces club soda, more to taste</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Dishes_Beverages', '<ol><li onclick="handleItemClick()">Fill a glass ⅓ full with crushed ice, and place mint leaves and sugar syrup on top.</li><li onclick="handleItemClick()">Using a muddle stick or wooden pestle, mash them together for about 20 seconds.</li><li onclick="handleItemClick()">Add the rum and club soda and lime juice and stir well.</li><li onclick="handleItemClick()">Garnish with mint sprig, serve, and enjoy!</li><li onclick="handleItemClick()">*To make sugar syrup, dissolve 1 part sugar into 1 part hot water and boil until thickened.</li></ol>' ] );
