ingredients_array.push( [ 'CostanzoRecipes_Desserts_VeganPumpkinBread', '<ul><li onclick="handleItemClick()">1 tablespoon ground flax seeds</li><li onclick="handleItemClick()">2.5 tablespoons water</li><li onclick="handleItemClick()">15 ounces canned pumpkin puree</li><li onclick="handleItemClick()">1 ¼ cups brown sugar</li><li onclick="handleItemClick()">½ cup canola oil</li><li onclick="handleItemClick()">¼ cup soy milk</li></ul><ul><li onclick="handleItemClick()">1 ¾ cups (210g) all purpose flour</li><li onclick="handleItemClick()">1 teaspoon baking soda</li><li onclick="handleItemClick()">½ teaspoon baking powder</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">2 teaspoons ground cinnamon</li><li onclick="handleItemClick()">¼ teaspoon ground nutmeg</li><li onclick="handleItemClick()">¼ teaspoon ground cloves</li></ul><ul><li onclick="handleItemClick()">½ cup pepitas</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_VeganPumpkinBread', '<ol><li onclick="handleItemClick()">Preheat the oven to 350 degrees F and grease a loaf pan.</li><li onclick="handleItemClick()">In a small bowl, combine the ground flax seed and water. Set aside to thicken; this is your flax egg.</li><li onclick="handleItemClick()">In a large bowl, whisk together the pumpkin, brown sugar, canola oil, flax egg and soy milk until smooth.</li><li onclick="handleItemClick()">Add the flour, then sprinkle the baking soda, baking powder, salt, cinnamon, nutmeg and cloves on top of the flour. Stir with a large spoon or spatula, gently, until just combined. Do not over mix.</li><li onclick="handleItemClick()">Pour into the prepared pan and sprinkle the pepitas on top. Bake for about 1 hour and 15 minutes, until a toothpick inserted in the center comes out clean.</li><li onclick="handleItemClick()">Let it cool in the pan for 10-15 minutes, then transfer the loaf to a cooling rack. Slice carefully right away, or let cool completely for easier slicing and serving.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_VeganPumpkinBread', '<ul><li onclick="handleItemClick()">For oil free, you can substitute applesauce for the oil, but the loaf will not be as moist or fluffy. It tends to make a denser, gummier loaf. You can also use coconut oil or another oil if you\'d like.</li><li onclick="handleItemClick()">Feel free to sub any non-dairy milk for soy milk.</li><li onclick="handleItemClick()">For whole grain, you may sub whole wheat flour for the white flour, it just won\'t be as light and fluffy. I haven\'t tried this gluten free, but it may work with a gluten free mix. Do not sub with almond or coconut flour, it will not work!</li><li onclick="handleItemClick()">Other optional add ins: I like the loaf as is, but feel free to mix in chocolate chips, walnuts, pecans, raisins, currants, cranberries or even shredded coconut.</li></ul>IsVegan<ul><li onclick="handleItemClick()">From <a href="https://www.noracooks.com/wprm_print/5674" target="_blank">https://www.noracooks.com/wprm_print/5674</a></li><li onclick="handleItemClick()">date created: [2023-01-21 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_VeganPeanutButterCookies', '<ul><li onclick="handleItemClick()">1 cup natural peanut butter (270g), creamy or crunchy (or almond butter)</li><li onclick="handleItemClick()">1 cup coconut sugar or pure cane sugar (192g)</li><li onclick="handleItemClick()">6 tablespoons almond milk, room temp</li><li onclick="handleItemClick()">2 teaspoons vanilla extract</li><li onclick="handleItemClick()">1 cup flour (120g), spelt, unbleached all-purpose, almond flour, or 1-1 gluten-free blend</li><li onclick="handleItemClick()">1 teaspoon baking soda</li><li onclick="handleItemClick()">generous pinch of mineral salt (only use if nut butter is unsalted)<span class="note">  Reduce the sugar to ¾ cup for a less sweet cookie. It’s just as delicious!</span></li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_VeganPeanutButterCookies', '<ol><li onclick="handleItemClick()">Preheat the oven to 350°F.</li><li onclick="handleItemClick()">Line a cookie sheet with silicone mat, parchment paper or leave ungreased.</li><li onclick="handleItemClick()">In a large bowl, add the peanut butter and sugar and mix until creamy.</li><li onclick="handleItemClick()">Stir in the almond milk and vanilla.</li><li onclick="handleItemClick()">Next, add the flour, baking soda, and salt, mix to combine. The dough will be tough to stir, using your hands to mix it together will be easier.</li><li onclick="handleItemClick()">Using a 1½ tablespoon scooper, scoop out the dough and roll into balls, about 1¼ inch.</li><li onclick="handleItemClick()">Place the balls of dough about 2½ inches apart on a baking sheet.</li><li onclick="handleItemClick()">Using the back of a fork, flatten in a crisscross pattern.</li><li onclick="handleItemClick()">Optionally, sprinkle with sugar or coarse salt.</li><li onclick="handleItemClick()">Place in the oven and bake for 10 – 13 minutes (13 minutes will yield a crispier cookie that’s tender inside).</li><li onclick="handleItemClick()">Let cool a few minutes, transfer cookies to wire rack and repeat with remaining dough.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Desserts_VeganPeanutButterCookies', 'Makes 20 – 24 cookies.' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_VeganPeanutButterCookies', 'IsVegan<ul><li onclick="handleItemClick()">From <a href="https://simple-veganista.com/vegan-peanut-butter-cookies/print/25652/" target="_blank">https://simple-veganista.com/vegan-peanut-butter-cookies/print/25652/</a></li><li onclick="handleItemClick()">date created: [2022-08-01 Mon] </li><li onclick="handleItemClick()">[2022-08-01 Mon] Made for Pickleball picnic. T says these are a keeper! They are good, but perhaps a tad too much vanilla.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_Tiramisu', '<ul><li onclick="handleItemClick()">3 eggs</li><li onclick="handleItemClick()">½ cup sugar</li><li onclick="handleItemClick()">1 cup espresso (or strong coffee)</li><li onclick="handleItemClick()">8 oz. mascarpone cheese</li><li onclick="handleItemClick()">2 Tbls cognac or brandy</li><li onclick="handleItemClick()">⅛ cup cocoa</li><li onclick="handleItemClick()">20 lady finger or egg cookies</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_Tiramisu', '<ol><li onclick="handleItemClick()">Combine 3 egg yolks, 1 tablespoon espresso, sugar and cognac into large mixing bowl. Beat 2-3 minutes. Add mascarpone and beat 3-5 minutes until smooth.</li><li onclick="handleItemClick()">In another bowl, combine 3 egg whites and a pinch of sugar. Beat until mixture forms stiff peaks. Gently fold into mascarpone mixture.</li><li onclick="handleItemClick()">Pour rest of espresso into flat dish. Dip one side of each cookie and layer on bottom of serving dish.</li><li onclick="handleItemClick()">Spread ⅓ of mascarpone mixture and sprinkle with cocoa. Continue layering and finish with mascarpone layer.</li><li onclick="handleItemClick()">Sprinkle with cocoa and refrigerate for at least 1 hour before serving. <i class="conditional-space-after"><b class="conditional-space-after">so</b></i></li></ol>' ] );
