credits_array.push( [ 'CostanzoRecipes_Desserts_Tiramisu', '<ul><li onclick="handleItemClick()">date created: [2019-01-29 Tue] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_SuperMoistChocolateCake', '<ul><li onclick="handleItemClick()">2 cups (500 mL) all-purpose flour</li><li onclick="handleItemClick()">⅔ cup (150 mL) unsweetened cocoa powder</li><li onclick="handleItemClick()">1 ¼ tsp. (6 mL) baking soda</li><li onclick="handleItemClick()">¼ tsp. (1 mL) baking powder</li><li onclick="handleItemClick()">3 eggs</li><li onclick="handleItemClick()">1 ⅔ cups (400 mL) sugar</li><li onclick="handleItemClick()">1 tsp. (5 mL) vanilla extract</li><li onclick="handleItemClick()">1 cup (250 mL) Hellmann\'s® Real Mayonnaise</li><li onclick="handleItemClick()">1 ⅓ cups (325 mL) water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_SuperMoistChocolateCake', '<ol><li onclick="handleItemClick()">Preheat oven to 350°F (180°C).</li><li onclick="handleItemClick()">Grease and lightly flour two 9-inch/ 23 cm/ 1.5 L, round cake pans*; set aside.</li><li onclick="handleItemClick()">Combine flour, cocoa, baking soda and baking powder in medium bowl; set aside.</li><li onclick="handleItemClick()">Beat eggs, sugar and vanilla in large bowl with electric mixer at high speed until light and fluffy, about 3 minutes.</li><li onclick="handleItemClick()">Beat in Hellmann\'s® Real Mayonnaise at low speed until blended.</li><li onclick="handleItemClick()">Alternately beat in flour mixture with water, beginning and ending with flour mixture.</li><li onclick="handleItemClick()">Pour into prepared pans.</li><li onclick="handleItemClick()">Bake 30 minutes or until toothpick inserted in centers comes out clean.</li><li onclick="handleItemClick()">Cool 10 minutes on wire racks; remove from pans and cool completely.</li><li onclick="handleItemClick()">Frost with your favorite frosting or generously sprinkle with confectioners sugar.</li></ol>Unknown type: ’entity’Or, prepare cake mix as above in 13 x 9-inch (33 x 23-cm / 3.5 L) baking pan and bake 40 minutes or until toothpick inserted in center comes out clean.For chocolate frosting: icing sugar and a softened stick of Earth Balance, cocoa powder or melted dark baking chocolate, oat milk, vanilla and butteressence, mix and taste :).' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_SuperMoistChocolateCake', '<ul><li onclick="handleItemClick()">Substitute “Follow Your Heart Vegan Eggs” for the eggs</li><li onclick="handleItemClick()">Substitute Hellman’s vegan mayo/salad dressing, which is on the shelf with all the other mayos, not refrigerated.</li></ul>IsVegan<ul><li onclick="handleItemClick()">From <a href="https://www.hellmanns.com/ca/en/recipes/super-moist-chocolate-cake.html" target="_blank">https://www.hellmanns.com/ca/en/recipes/super-moist-chocolate-cake.html</a>via Alastair Norcross</li><li onclick="handleItemClick()">date created: [2022-08-27 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_StrawberryCake', '<ul><li onclick="handleItemClick()">275 grams eggs (5 to 6 large eggs)</li><li onclick="handleItemClick()">½ cup plus 2 tablespoons (124 grams) granulated sugar</li><li onclick="handleItemClick()">3 tablespoons (45 grams) whole (or almond) milk</li><li onclick="handleItemClick()">1 cup plus 3 tablespoons (146 grams) cake flour</li><li onclick="handleItemClick()">1 tablespoons (14 grams) unsalted butter, melted</li><li onclick="handleItemClick()">16 ounces (454 grams) fresh strawberries</li></ul><ul><li onclick="handleItemClick()">1¾ plus 3 tablespoons (465 grams) cold heavy whipping cream</li><li onclick="handleItemClick()">¼ cup plus 1 tablespoons (62 grams) castor sugar</li><li onclick="handleItemClick()">½ teaspoon (2 grams) vanilla extract</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_StrawberryCake', '<ol><li onclick="handleItemClick()">Preheat oven to 325°F (170°C).</li><li onclick="handleItemClick()">Line two 8-inch round cake pans with parchment paper.</li><li onclick="handleItemClick()">In the top of a double boiler, combine eggs and sugar. Cook over simmering water, stirring occasionally, just until an instant-read thermometer registers 98°F (37°C).</li><li onclick="handleItemClick()">In the bowl of a stand mixer fitted with the whisk attachment, beat the egg mixture at high speed for 4 minutes; reduce mixer to medium speed and beat until you can see clear ribbons in batter, about 5 minutes.</li><li onclick="handleItemClick()">In a small microwave-safe bowl, heat milk on high heat for 30 seconds.</li><li onclick="handleItemClick()">Sift one-third of flour over egg mixture.</li><li onclick="handleItemClick()">Using a rubber spatula gently fold until combined.</li><li onclick="handleItemClick()">Repeat procedure with remaining flour in two additions.</li><li onclick="handleItemClick()">Add warm milk and melted butter and gently fold until combined, stopping to scrape sides and bottom of bowl to ensure everything is incorporated.</li><li onclick="handleItemClick()">Pour into prepared pans.</li><li onclick="handleItemClick()">Lightly tap pans on counter a few times to release any big air bubbles.</li><li onclick="handleItemClick()">bake until a wooden pick inserted in center comes out clean, 18 to 25 minutes.</li><li onclick="handleItemClick()">Spray a wire rack with cooking spray.</li><li onclick="handleItemClick()">Vigorouly tap pans once on counter.</li><li onclick="handleItemClick()">Invert cakes onto prepared rack and let cool for 15 to 20 minutes</li><li onclick="handleItemClick()">Turn right side up and let cool completely.</li><li onclick="handleItemClick()">In the bowl of a stand mixer fitted with the whisk attachment beat all Whipped Cream ingredients at high speed until soft to stiff peaks form.</li><li onclick="handleItemClick()">Level cooled cake layers, if necessary.</li><li onclick="handleItemClick()">Place one cake layer on a cake plate.</li><li onclick="handleItemClick()">Spread ¾ cup Whipped Cream on first cake layer.</li><li onclick="handleItemClick()">Slice all but 3 strawberries into ⅛-inch slices and arrange in a single layer over Whipped Cream atop the first cake layer.</li><li onclick="handleItemClick()">Spread ¼ cup more Whipped Cream over the strawberries.</li><li onclick="handleItemClick()">Top with second cake layer.</li><li onclick="handleItemClick()">Spread remaining Whipped Cream on top and sides of cake, decorating as desired.</li><li onclick="handleItemClick()">Top with remaining strawberries, sliced in half.</li><li onclick="handleItemClick()">Refrigerate in an airtight container for up to 2 days.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_StrawberryCake', '<ul><li onclick="handleItemClick()">From Belle’s Bread, via <i class="conditional-space-after"></i>, May/June 2021, page 35</li><li onclick="handleItemClick()">date created: [2021-05-27 Thu] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_SpoonCookies', 'From Gourmet, Dec. 2005Makes 25-30 sandwich cookies<ul><li onclick="handleItemClick()">2 sticks (1 cup) cold unsalted butter, cut into pieces</li><li onclick="handleItemClick()">¾ cup (148.5 grams) sugar</li><li onclick="handleItemClick()">2 tsp vanilla</li><li onclick="handleItemClick()">2 cups (240 grams) flour</li><li onclick="handleItemClick()">1 tsp baking soda</li><li onclick="handleItemClick()">⅛ tsp salt, slightly rounded</li><li onclick="handleItemClick()">½ cup fruit preserves (your choice: cherry and strawberry are good)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_SpoonCookies', '<ol><li onclick="handleItemClick()">Fill kitchen sink with about 2 inches of cold water. Melt butter in a 2- to 3-quart heavy saucepan over moderate heat and cook, stirring occasionally, until butter turns golden with a nutlike fragrance and flecks on bottom of pan turn a rich caramel brown, 10 to 12 minutes. (Butter will initially foam, then dissipate. A thicker foam will appear and cover the surface just before butter begins to brown; stir more frequently toward end of cooking.) Place pan in sink to stop cooking, then cool, stirring frequently, until butter starts to look opaque, about 4 minutes. Remove pan from sink and stir in sugar and vanilla.</li><li onclick="handleItemClick()">Whisk together flour, salt, and baking soda and stir into butter mixture until a dough forms. Shape into a ball, wrap with plastic wrap, and let stand at cool room temperature 1 to 2 hours (to allow flavors to develop).</li><li onclick="handleItemClick()">Put oven rack in middle position and preheat oven to 325 degrees F.</li><li onclick="handleItemClick()">Press a piece of dough into bowl of teaspoon (table type teaspoon, not one for measuring), flattening top, then slide out and place, flat side down, on an ungreased baking sheet. (Dough will feel crumbly, but will become cohesive when pressed.) Continue forming cookies and arranging on sheet. Bake cookies until just pale golden, 8 to 15 minutes. Cool cookies on sheet on a rack 5 minutes, then transfer cookies to rack and cool completely, about 30 minutes. Cookies are very delicate when hot.</li><li onclick="handleItemClick()">While cookies cool, heat preserves in a small saucepan over low heat until just runny, then pour through a sieve into a small bowl, pressing hard on solids, and cool completely. Spread the flat side of a cookie with a thin layer of preserves. Sandwich with flat side of another cookie. Continue with remaining cookies and preserves, then let stand until set, about 45 minutes. Transfer cookies to an airtight contain and (this is the hard part) WAIT 2 DAYS BEFORE EATING.</li><li onclick="handleItemClick()">Dough can be made 12 hours before baking and chilled, covered. Bring to room temperature to soften slightly before forming cookies, about 30 minutes. Cookies keep in an airtight container at room temperature 2 weeks.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_SpoonCookies', '<ul><li onclick="handleItemClick()">courtesy of Nancy Burnett 3-Feb-06</li><li onclick="handleItemClick()">See <a href="http://www.epicurious.com/recipes/food/views/spoon-cookies-233297" target="_blank">http://www.epicurious.com/recipes/food/views/spoon-cookies-233297</a></li><li onclick="handleItemClick()">I made these [2016-12-15 Thu] and cooked them for 14 minutes. I had a bit of trouble forming the cookies, but even some of the well-formed ones wound up spreading out in the oven. Filled variously with strawberry, fig and mixed berries preserves.</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_SourCreamCoffeeCake', '<ul><li onclick="handleItemClick()">16 tablespoons (2 sticks) sweet butter</li><li onclick="handleItemClick()">2¾ cups granulated sugar</li><li onclick="handleItemClick()">2 eggs, beaten</li><li onclick="handleItemClick()">2 cups unbleached all-purpose flour</li><li onclick="handleItemClick()">1 tablespoon baking powder</li><li onclick="handleItemClick()">¼ teaspoon salt</li><li onclick="handleItemClick()">2 cups dairy sour cream</li><li onclick="handleItemClick()">1 tablespoon vanilla extract</li><li onclick="handleItemClick()">2 cups shelled pecans or walnuts, chopped</li><li onclick="handleItemClick()">1 tablespoon ground cinnamon</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_SourCreamCoffeeCake', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees F.</li><li onclick="handleItemClick()">Grease a 10-inch Bundt pan and lightly dust the inside with flour.</li><li onclick="handleItemClick()">Cream together the butter and 2 cups of the sugar.</li><li onclick="handleItemClick()">Add eggs, blending well, then the sour cream and vanilla.</li><li onclick="handleItemClick()">Sift together the flour, baking powder and salt.</li><li onclick="handleItemClick()">Fold the dry ingredients into the creamed mixture and beat until just blended. Do not overbeat.</li><li onclick="handleItemClick()">In a separate bowl, mix remaining ¾ cup sugar with the nuts and cinnamon.</li><li onclick="handleItemClick()">Pour half (perhaps a bit less) of the batter into the Bundt pan.</li><li onclick="handleItemClick()">Sprinkle with half of the nut and sugar mixture.</li><li onclick="handleItemClick()">Add remaining batter and top with the rest of the nut mixture.</li><li onclick="handleItemClick()">Set on the middle rack of the oven and bake for about 60 minutes or until a cake tester inserted in the center comes out clean.</li><li onclick="handleItemClick()">Serve warm.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_SourCreamCoffeeCake', '<ul><li onclick="handleItemClick()">From <i class="conditional-space-after"></i>by Julee Rosso and Sheila Lukins (with Michael McLaughlin), page 321.</li><li onclick="handleItemClick()">date created: [2020-07-26 Sun] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_SourCreamApplePie', '<ul><li onclick="handleItemClick()">2 ½ cups unbleached all-purpose flour</li><li onclick="handleItemClick()">5 tablespoons granulated sugar</li><li onclick="handleItemClick()">¾ teaspoon salt</li><li onclick="handleItemClick()">¾ teaspoon cinnamon</li><li onclick="handleItemClick()">6 tablespoons sweet butter, chilled</li><li onclick="handleItemClick()">6 tablespoons shortening, chilled</li><li onclick="handleItemClick()">4 to 6 tablespoons apple cider or juice, chilled</li></ul><ul><li onclick="handleItemClick()">5 to 7 tart apples</li><li onclick="handleItemClick()">⅔ cup dairy sour cream</li><li onclick="handleItemClick()">⅓ cup granulated sugar</li><li onclick="handleItemClick()">1 egg, lightly beaten</li><li onclick="handleItemClick()">¼ teaspoon salt</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li><li onclick="handleItemClick()">3 tablespoons unbleached all-purpose flour</li></ul><ul><li onclick="handleItemClick()">3 tablespoons brown sugar</li><li onclick="handleItemClick()">3 tablespoons granulated sugar</li><li onclick="handleItemClick()">1 teaspoon ground cinnamon</li><li onclick="handleItemClick()">1 cup shelled walnuts, chopped</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_SourCreamApplePie', '<ol><li onclick="handleItemClick()">Sift flour, sugar, salt and cinnamon into a bowl.</li><li onclick="handleItemClick()">Cut butter and shortening with a fork or pasty cutter until mixture resembles rolled oats.</li><li onclick="handleItemClick()">Moisten with just enough cider, tossing ingredients lightly with a fork, to permit the dough to be formed into a ball.</li><li onclick="handleItemClick()">Wrap and refrigerate for 2 hours.</li><li onclick="handleItemClick()">Cut off on third of the dough and return it to the refrigerator.</li><li onclick="handleItemClick()">Roll out the other two thirds between 2 sheets of wax paper (or plastic wrap).</li><li onclick="handleItemClick()">Line a greased 9-inch pie pan with the dough.</li><li onclick="handleItemClick()">Trim overhang and crimp decoratively.</li><li onclick="handleItemClick()">Preheat the oven to 350 degrees F.</li></ol><ol><li onclick="handleItemClick()">Peel, core and thinly slice apples.</li><li onclick="handleItemClick()">Drop slices into a mixing bowl.</li><li onclick="handleItemClick()">Whisk together sour cream, sugar, egg, salt, vanilla and flour in a small bowl.</li><li onclick="handleItemClick()">Pour mixutre over apples and toss well to coat.</li><li onclick="handleItemClick()">Spoon apples into pastry-lined pie pan.</li></ol><ol><li onclick="handleItemClick()">Mix sugars, cinnamon and walnuts together and sprinkle evenly over apple filling.</li><li onclick="handleItemClick()">Roll out remaining pastry between sheets of wax paper to form a 10-inch circle.</li><li onclick="handleItemClick()">Cut into ½-inch strips and arrange these lattice-fashion over apples.</li><li onclick="handleItemClick()">Trim ends and crimp edge of crust decoratively.</li><li onclick="handleItemClick()">Set pie on middle rack of the oven and bake for 55 to 65 minutes.</li><li onclick="handleItemClick()">If crust browns too quickly, cover loosely with foil.</li><li onclick="handleItemClick()">Pie is done when juices are bubbling and apples are tender.</li><li onclick="handleItemClick()">Serve warm or cool, topped, if you like, with whipped cream or vanilla ice cream.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_SourCreamApplePie', '<ul><li onclick="handleItemClick()">From  <i class="conditional-space-after"></i>by Julee Rosso and Sheila Lukins (with Michael McLaughlin), page 273.</li><li onclick="handleItemClick()">date created: [2020-07-26 Sun] </li><li onclick="handleItemClick()">Ok... The lattice crust. I just don\'t see it as worth the effort. Yes, it looks rustic and homey, but it\'s a lot of work. So I use the dough to make a solid crust. For that, I use about ⅓ of the dough for the bottom and ⅔ for the top.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_RicottaCookies', 'Italian Ricotta Cookies recipe are incredibly soft with a tender texture, delicious, and absolutely perfect for any holiday, not just for Christmas.<ul><li onclick="handleItemClick()">1 cup unsalted butter (2 sticks), softened to room temperature</li><li onclick="handleItemClick()">2 cups sugar</li><li onclick="handleItemClick()">2 eggs</li><li onclick="handleItemClick()">15 ounces full-fat Ricotta cheese</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li><li onclick="handleItemClick()">2 tablespoons orange or lemon zest</li><li onclick="handleItemClick()">4½ cups all purpose flour</li><li onclick="handleItemClick()">1 teaspoon baking powder</li><li onclick="handleItemClick()">1 teaspoon baking soda</li><li onclick="handleItemClick()">½ teaspoon salt</li></ul><ul><li onclick="handleItemClick()">¼ cup butter, melted</li><li onclick="handleItemClick()">2 cups powdered sugar</li><li onclick="handleItemClick()">3 tablespoons heavy cream</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_RicottaCookies', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees.</li><li onclick="handleItemClick()">In the bowl of an electric mixer, cream together butter, sugar medium speed.</li><li onclick="handleItemClick()">Add eggs and beat those in, as well.</li><li onclick="handleItemClick()">Add Ricotta cheese and mix until smooth and fully incorporated. Add vanilla extract and orange zest and blend.</li><li onclick="handleItemClick()">In a separate medium bowl, whisk together flour with baking powder, baking soda and salt.</li><li onclick="handleItemClick()">Gradually add the flour mixture to the wet ingredients (one cup at a time) on low speed until a dough is formed.</li><li onclick="handleItemClick()">Drop the dough by heaping tablespoons onto an ungreased baking sheet (they will puff up while baking).</li><li onclick="handleItemClick()">Bake for 10-12 minutes (this will depend on size of cookies and your oven so keep an eye on them). Cookies will just be started to get lightly golden around the bottom edges. You want them to remain soft and not get too over-baked.</li><li onclick="handleItemClick()">Remove from baking sheet and place on a cooling rack to cool completely before putting on the glaze.</li><li onclick="handleItemClick()">Spoon glaze onto cookies, add sprinkles of your choosing before glaze dries, and allow it to fully set before storing.</li></ol><ol><li onclick="handleItemClick()">Mix together melted butter, powdered sugar, heavy cream, vanilla extract in a bowl until smooth and no lumps remain.</li><li onclick="handleItemClick()">Add additional splashes of milk or cream to get the desired consistency.</li><li onclick="handleItemClick()">You don\'t want it to be so thick that it\'s not spreadable, but also not too runny.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Desserts_RicottaCookies', 'FavoriteServes: about 4 dozen' ] );
