ingredients_array.push( [ 'CostanzoRecipes_Desserts_PerfectChocolateCake', '<ul><li onclick="handleItemClick()">1 cup cocoa (unsweetened)</li><li onclick="handleItemClick()">2 cup boiling water</li><li onclick="handleItemClick()">2¾ cup all purpose flour</li><li onclick="handleItemClick()">2 t baking soda</li><li onclick="handleItemClick()">½ t salt</li><li onclick="handleItemClick()">½ t baking powder</li><li onclick="handleItemClick()">1 cup butter</li><li onclick="handleItemClick()">2½ cup sugar</li><li onclick="handleItemClick()">4 eggs</li><li onclick="handleItemClick()">1½ t pure vanilla extract</li></ul><ul><li onclick="handleItemClick()">6 ounces unsweetened baking chocolate</li><li onclick="handleItemClick()">1 cup butter</li><li onclick="handleItemClick()">½ cup heavy cream</li><li onclick="handleItemClick()">2½ cups powered sugar, sifted</li></ul><ul><li onclick="handleItemClick()">1 cup heavy cream</li><li onclick="handleItemClick()">¼ cup powered sugar</li><li onclick="handleItemClick()">1 tablespoon pure vanilla extract</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_PerfectChocolateCake', '<ul><li onclick="handleItemClick()">Preheat the oven to 350 degrees.</li><li onclick="handleItemClick()">Butter and flour three 9" round cake pans (line bottoms with parchment or waxed paper).</li><li onclick="handleItemClick()">Combine cocoa with 2 cups boiling water, stirring until smooth.</li><li onclick="handleItemClick()">Cool completely.</li><li onclick="handleItemClick()">Sift together dry ingredients.</li><li onclick="handleItemClick()">In a large bowl beat together butter, sugar, eggs and vanilla.</li><li onclick="handleItemClick()">Alternate adding the dry ingredients and the cocoa mixture to the creamed mixture. Do not over mix. Blend just enough to moisten the dry ingredients.</li><li onclick="handleItemClick()">Divide the batter evenly into cake pans.</li><li onclick="handleItemClick()">Bake 25-30 minutes.</li><li onclick="handleItemClick()">Cool in the pans for 10 minutes then remove the cakes from the pans to cool completely before frosting.</li><li onclick="handleItemClick()">While the cake is cooling, prepare the frosting.</li><li onclick="handleItemClick()">In a medium saucepan, melt the chocolate and butter.</li><li onclick="handleItemClick()">Stir in the cream until smooth.</li><li onclick="handleItemClick()">Remove the pan from the stove and place it in a large bowl filled with ice.</li><li onclick="handleItemClick()">Using a whisk or electric mixer, beat in the powdered sugar until the frosting holds a stiff shape. Chill.</li><li onclick="handleItemClick()">Whip all the filling ingredients together until stiff. Chill.</li><li onclick="handleItemClick()">Construct the cake when all parts are cool.</li><li onclick="handleItemClick()">Spread the filling between the layers and the frosting on the top and sides.</li><li onclick="handleItemClick()">Plan to serve the cake soon after completion or provide a large space in the refrigerator to keep it cool until it is served.</li></ul><span class="note">NoteNoteNoteNote</span><span class="warning">Warning: mooWarning: mooWarning: mooWarning: moo</span><span class="tip">TipTipTipTip</span><span class="info">Some infoSome infoSome infoSome info</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_PerfectChocolateCake', '<ul><li onclick="handleItemClick()">From the <i class="conditional-space-after"></i>cookbook, pg 266, via <a href="https://recipes.sparkpeople.com/recipe-detail.asp?recipe=592947" target="_blank">https://recipes.sparkpeople.com/recipe-detail.asp?recipe=592947</a></li><li onclick="handleItemClick()">date created: [2020-08-02 Sun] </li><li onclick="handleItemClick()">Yields a 3 layer 9 inch cake (serving size 1/8 of cake)</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_PeachMelbaCreamCake', '<ul><li onclick="handleItemClick()">¾ cup softened, unsalted butter plus more for greasing the pans</li><li onclick="handleItemClick()">1 cup sugar</li><li onclick="handleItemClick()">½ cup brown sugar</li><li onclick="handleItemClick()">3 eggs</li><li onclick="handleItemClick()">1½ teaspoons pure vanilla extract</li><li onclick="handleItemClick()">finely grated zest of 1 lemon</li><li onclick="handleItemClick()">¼ cup fresh lemon juice</li><li onclick="handleItemClick()">2½ cups all purpose flour</li><li onclick="handleItemClick()">1½ teaspoons baking soda</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">1½ cups buttermilk</li><li onclick="handleItemClick()">4 pounds ripe peaches</li><li onclick="handleItemClick()">2 tablespoons fresh lemon juice</li><li onclick="handleItemClick()">2½ tablespoons sugar</li><li onclick="handleItemClick()">2 cups heavy cream</li><li onclick="handleItemClick()">1½ teaspoons pure vanilla extract</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_PeachMelbaCreamCake', '<ol><li onclick="handleItemClick()">Raspberry Melba Sauce (see recipe)</li><li onclick="handleItemClick()">Preheat the oven to 350 degrees F. Butter and flour two 9-inch cake pans (line with buttered and floured wax paper for easier removal, optional).</li><li onclick="handleItemClick()">Cream the ¾ cup butter and sugars in a mixing bowl. Addd the eggs, one at a time, beating well after each adition. Beat in the vanilla, lemon zest and juice.</li><li onclick="handleItemClick()">Sift together the flour, baking soda and salt; add to mixture in the bowl, alternating with buttermilk, to make batter.</li><li onclick="handleItemClick()">Scrape batter into the pans. Bake until a toothpick inserted in the center comes out clean, about 35 to 40 minutes. Cool the cakes in their pans on a rack for 15 minutes, then turn them out onto the rack, peel off wax paper and cool completely.</li><li onclick="handleItemClick()">Shortly before serving, peel, pit and slice the peaches. Toss with lemon juice and 1 tablespoon sugar; set aside for 15 minutes.</li><li onclick="handleItemClick()">Whip the cream with the vanilla and the remaining 1½ tablespoons of sugar until it holds soft peaks.</li><li onclick="handleItemClick()">Place on cake on a serving platter. Spread with half the cream, then half the peaches. Cover with second cake and top with remaining peaches. Top with a dollop of cream and, if desired, a mint sprig. Serve immediately, with the Raspberry Melba Sauce on the side or drizzled over the cake.</li><li onclick="handleItemClick()">Serves 10. </li><li onclick="handleItemClick()">Per serving: 651 calories, 82g carbs, 9g protein, 34 g fat, 167 mg cholesterol.</li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_PeachMelbaCreamCake', '<ul><li onclick="handleItemClick()">2 cups raspberries</li><li onclick="handleItemClick()">½ cup confectioners\' sugar</li><li onclick="handleItemClick()">1 tablespoon fresh lemon juice</li><li onclick="handleItemClick()">¼ cup apple juice</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_PeachMelbaCreamCake', '<ol><li onclick="handleItemClick()">Puree all ingredients, the pass through a strainer to remove the seeds.</li><li onclick="handleItemClick()">Makes 2 cups.</li><li onclick="handleItemClick()">Per 2 tablespoons: 61 calories, 15g carbohydrates, 0g protein, 0g fat, 0mg cholesterol.</li></ol>' ] );
