ingredients_array.push( [ 'CostanzoRecipes_Desserts_NewYorkTimesExtraFlakyPieCrust', '<ul><li onclick="handleItemClick()">2½ cups (320 grams) unbleached all-purpose flour</li><li onclick="handleItemClick()">1 tablespoon granulated sugar</li><li onclick="handleItemClick()">1 teaspoon baking powder, preferably aluminum-free</li><li onclick="handleItemClick()">1 teaspoon fine sea salt</li><li onclick="handleItemClick()">½ cup (120 milliliters) ice water</li><li onclick="handleItemClick()">1 tablespoon cider vinegar</li><li onclick="handleItemClick()">1 cup (225 grams) cold unsalted butter (2 sticks), cut into 1-inch cubes</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_NewYorkTimesExtraFlakyPieCrust', '<ol><li onclick="handleItemClick()">In a medium bowl, whisk together the flour, sugar, baking powder and salt; set aside.</li><li onclick="handleItemClick()">In a measuring cup or a small bowl, combine the water and vinegar; set aside.</li><li onclick="handleItemClick()">Gently toss the butter in the flour mixture until coated, then use a pastry blender to cut the butter into the flour. (You should have pieces of butter that range from sandy patches to pea-size chunks, with some larger bits as well.)</li><li onclick="handleItemClick()">Drizzle in about half of the ice water mixture and stir lightly with a fork until the flour is evenly moistened and the dough starts to come together. If the dough seems dry, add a little more ice water, 1 to 2 tablespoons at a time. The dough will still look a bit shaggy at this point. If you grab a small piece of dough and press it slightly with your hand, it should mostly hold together.</li><li onclick="handleItemClick()">Dump the dough out onto an unfloured work surface and gather it together into a tight mound. Using the heel of your hand, smear the dough a little at a time, pushing it away from you and working your way down the mass of dough to create flat layers of flour and butter. Gather the dough back together with a bench scraper, layering the clumps of dough on top of one another.</li><li onclick="handleItemClick()">Repeat the process once or twice more; the dough should still have some big pieces of butter visible.</li><li onclick="handleItemClick()">Cut the dough in half. Shape each piece into a disk and flatten it. Wrap the disks in plastic and put in the refrigerator for at least 1 hour, or overnight, to rest.</li><li onclick="handleItemClick()">The dough can be stored for 3 days in the refrigerator or up to 1 month in the freezer. If making the dough in advance to freeze: Roll out the dough on a piece of parchment paper, then carefully roll it up in the parchment. Write the date on the parchment and pop into the freezer to firm up, about 30 minutes. Then wrap the crust securely in plastic wrap. Defrost the dough in the refrigerator overnight or thaw it on the kitchen counter for about 30 minutes before using.)</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_NewYorkTimesExtraFlakyPieCrust', '<ul><li onclick="handleItemClick()">From <a href="https://cooking.nytimes.com/recipes/1021241-extra-flaky-pie-crust" target="_blank">https://cooking.nytimes.com/recipes/1021241-extra-flaky-pie-crust</a></li><li onclick="handleItemClick()">date created: [2021-08-06 Fri] </li><li onclick="handleItemClick()">[2021-08-04 Wed] Made for a peach pie for T Matt, Jill, Greg and MaryAnn. Per the recipe’s comments, I used a food processor for steps 3 and 4 and probably overworked the dough since it wasn’t terribly flaky. But it was easy to work with. Next time, pulse much, much less.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_MississippiMudCake', '<ul><li onclick="handleItemClick()">2 cups unbleached white flour</li><li onclick="handleItemClick()">1 tsp baking soda</li><li onclick="handleItemClick()">¼  tsp salt</li><li onclick="handleItemClick()">1¾  cups strong, freshly brewed coffee</li><li onclick="handleItemClick()">¼ cup bourbon, brandy, or a coffee, chocolate, or mocha liqueur</li><li onclick="handleItemClick()">5 oz unsweetened chocolate</li><li onclick="handleItemClick()">1 cup butter (2 sticks or 16 tbsp)</li><li onclick="handleItemClick()">2 cups sugar</li><li onclick="handleItemClick()">2 eggs lightly beaten</li><li onclick="handleItemClick()">1 tsp pure vanilla extract</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_MississippiMudCake', '<ol><li onclick="handleItemClick()">Preheat oven to 275 degrees. (Yes, that really is 275 degrees!)</li><li onclick="handleItemClick()">Generously butter a 10 inch bundt pan and dust with cocoa.</li><li onclick="handleItemClick()">Sift together the flour, baking soda, and salt.</li><li onclick="handleItemClick()">Heat the coffee and liqueur on low heat for 5 minutes.</li><li onclick="handleItemClick()">Add the chocolate and butter.</li><li onclick="handleItemClick()">Stir until melted.</li><li onclick="handleItemClick()">When mixture is smooth, add sugar, and stir until dissolved.</li><li onclick="handleItemClick()">Let cool for several minutes; transfer to a large mixing bowl.</li><li onclick="handleItemClick()">Add the flour mix to chocolate mix, 1/2 cup at a time, beating after each addition til smooth.</li><li onclick="handleItemClick()">Add eggs and vanilla, beat 1 minute.</li><li onclick="handleItemClick()">Pour batter into pan.</li><li onclick="handleItemClick()">Bake 1½ hours, until the cake pulls away from the sides of the pan and springs back when touched in the middle.</li><li onclick="handleItemClick()">Remove from oven and let cool for 10 minutes in the pan.</li><li onclick="handleItemClick()">Then invert the cake onto a plate.</li><li onclick="handleItemClick()">Remove the bundt pan when the cake is completely cool. </li><li onclick="handleItemClick()">This cake is great plain or with whipped cream or brush the surface with 2-3 ounces of semi-sweet chocolate, melted and mixed with 1-2 tbsp of cream or coffee.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_MississippiMudCake', '<ul><li onclick="handleItemClick()">From the <i class="conditional-space-after"></i>cookbook, pg 270.  Described as a “very dark, moist, adult chocolate cake which keeps and travels well.” by way of <a href="http://www.thesmithlife.com/recipes/desserts/mississippi_mud_cake.html" target="_blank">http://www.thesmithlife.com/recipes/desserts/mississippi_mud_cake.html</a></li><li onclick="handleItemClick()">date created: [2020-08-02 Sun] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_LemonPoppyseedCake', '<ul><li onclick="handleItemClick()">2 Tbsp plus 1 ¼ cups sugar</li><li onclick="handleItemClick()">2 cups all purpose flour</li><li onclick="handleItemClick()">3 Tbsp poppy seeds</li><li onclick="handleItemClick()">2 tsp baking powder</li><li onclick="handleItemClick()">1 tsp baking soda</li><li onclick="handleItemClick()">½ tsp salt</li><li onclick="handleItemClick()">1 large egg</li><li onclick="handleItemClick()">1 cup buttermilk</li><li onclick="handleItemClick()">3 Tbsp veg oil</li><li onclick="handleItemClick()">2 tsp freshly grated lemon zest</li><li onclick="handleItemClick()">1 tsp vanilla extract</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_LemonPoppyseedCake', '<ol><li onclick="handleItemClick()">Preheat oven to 350°.</li><li onclick="handleItemClick()">Lightly oil a tube or bundt pan.</li><li onclick="handleItemClick()">Sprinkle pan with 2 Tbsp sugar, tapping out excess.</li><li onclick="handleItemClick()">In a large bowl, mix flour, poppy seeds, baking powder, baking soda, and salt,</li><li onclick="handleItemClick()">In another bowl, whisk egg until frothy.</li><li onclick="handleItemClick()">Add in remaining 1 and ¼ cups sugar, buttermilk, oil, lemon zest, and vanilla.</li><li onclick="handleItemClick()">Gradually add wet ingredients to dry ingredients, mixing until just moistened.</li><li onclick="handleItemClick()">Pour batter into prepared pan.</li><li onclick="handleItemClick()">Bake cake 30-40 minutes, or until top springs back when touched lightly and a skewer inserted in the center comes out clean.</li><li onclick="handleItemClick()">Immediately loosen edges and invert onto a wire rack.</li><li onclick="handleItemClick()">Let cool completely.</li><li onclick="handleItemClick()">Once cooled, put about a cup of confectioner’s sugar into a bowl and mix in enough of some kind of liquid to make a pourable frosting; drizzle over cake.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_LemonPoppyseedCake', '<ul><li onclick="handleItemClick()">One cup soy milk with a healthy dollop of apple cider vinegar (to make buttermilk; do this first so the milk has time to curdle; also, soy works better than oat milk).</li><li onclick="handleItemClick()">One prune puree in place of the egg.</li></ul>IsVegan<ul><li onclick="handleItemClick()">From Diana Norcross</li><li onclick="handleItemClick()">date created: [2022-08-27 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_LemonCreamwithRaspberriesandBlackberries', '<ul><li onclick="handleItemClick()">1 tablespoon plus 1 teaspoon lemon zest, divided</li><li onclick="handleItemClick()">¼ cup fresh lemon juice</li><li onclick="handleItemClick()">¼ cup maple syrup (or hone)</li><li onclick="handleItemClick()">1 (16-ounce) package of silken tofu</li><li onclick="handleItemClick()">½ cup raspberries (or other berries)</li><li onclick="handleItemClick()">½ cup blackberries (or other berries)</li><li onclick="handleItemClick()">slivered or chopped nuts (walnut, almonds, etc.), <i class="conditional-space-after"></i></li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_LemonCreamwithRaspberriesandBlackberries', '<ol><li onclick="handleItemClick()">Add 1 tablespoon lemon zest, lemon juice, maple syrup and silken tofu to a blender or food processor and blend until smooth.</li><li onclick="handleItemClick()">Divide this lemon cream among four bowls or serving glasses.</li><li onclick="handleItemClick()">Top each serving with beries and the reserved 1 teaspoon lemon zest.</li><li onclick="handleItemClick()">An optional topping is slivered or chopped nuts.</li><li onclick="handleItemClick()">Serve immediately or store in the fridge for up to three days.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_LemonCreamwithRaspberriesandBlackberries', 'IsVegan<ul><li onclick="handleItemClick()">From edibleasheville.com: Winter 2022</li><li onclick="handleItemClick()">date created: [2022-03-12 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_LemonCornmealCakewithLemonGlazeandCrushedBlueberrySauce', '<ul><li onclick="handleItemClick()">1½ cups (packed) powdered sugar, sifted</li><li onclick="handleItemClick()">2 tablespoons (or more) fresh lemon juice</li><li onclick="handleItemClick()">1½ cups all purpose flour</li><li onclick="handleItemClick()">⅓ cup yellow cornmeal</li><li onclick="handleItemClick()">¾ cup sugar</li><li onclick="handleItemClick()">3½ teaspoons baking powder</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">1 cup buttermilk</li><li onclick="handleItemClick()">2 large eggs</li><li onclick="handleItemClick()">1 tablespoon finely grated lemon peel</li><li onclick="handleItemClick()">¾ teaspoon vanilla extract</li><li onclick="handleItemClick()">½ cup (1 stick) unsalted butter, melted, cooled</li><li onclick="handleItemClick()">Crushed-Blueberry Sauce</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_LemonCornmealCakewithLemonGlazeandCrushedBlueberrySauce', '<ol><li onclick="handleItemClick()">For glaze: Combine powdered sugar and 2 tablespoons lemon juice in small bowl. Stir with spoon until smooth and paste-like, adding more lemon juice by ½ teaspoonfuls if glaze is too thick to spread. Set aside.</li><li onclick="handleItemClick()">For cake: Position rack in center of oven and preheat to 350 degrees F. Butter 9-inch-diameter cake pan with 2-inch-high sides; line bottom with parchment. Combine flour, cornmeal, sugar, baking powder, and salt in large bowl; whisk to blend. Whisk buttermilk, eggs, lemon peel, and vanilla in small bowl. Pour buttermilk mixture and melted butter into flour mixture. Using rubber spatula, gently fold liquids into flour mixture until just blended (do not stir). Scrape batter into pan; spread evenly.</li><li onclick="handleItemClick()">Bake cake until tester inserted into center comes out clean and cake pulls away from sides of pan, about 30 minutes.</li><li onclick="handleItemClick()">Immediately run knife around sides of cake. Place rack atop cake in pan. Using oven mitts, hold pan and rack firmly together and invert cake onto rack. Remove pan from cake. Place another rack on bottom of cake; invert 1 more time so that cake is top side up. Stir glaze until blended. While cake is still very hot, drop glaze by tablespoonfuls onto cake; spread to within ½ inch of edge (some glaze may drip down sides of cake). Cool completely. Serve with Crushed-Blueberry Sauce.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_LemonCornmealCakewithLemonGlazeandCrushedBlueberrySauce', '<ul><li onclick="handleItemClick()">Bon Appetit</li><li onclick="handleItemClick()">April 2009</li><li onclick="handleItemClick()">by Abigail Johnson Dodge</li><li onclick="handleItemClick()">[TC made on 29-June-12. Yum! (Don\'t forget the baking powder!)]</li><li onclick="handleItemClick()">You can view the complete recipe online at: <a href="http://www.epicurious.com/recipes/food/views/Lemon-Cornmeal-Cake-with-Lemon-Glaze-and-Crushed-Blueberry-Sauce-352048?mbid=ipapp" target="_blank">http://www.epicurious.com/recipes/food/views/Lemon-Cornmeal-Cake-with-Lemon-Glaze-and-Crushed-Blueberry-Sauce-352048?mbid=ipapp</a></li><li onclick="handleItemClick()">date created: [2012-07-02 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_GingerSnaps', '<ul><li onclick="handleItemClick()">4-July-06:</li><li onclick="handleItemClick()">Needs much more ginger! used 1 tsp + 2 tsp fresh... not enough!</li><li onclick="handleItemClick()">A bit too sweet.</li></ul><ul><li onclick="handleItemClick()">2 cups all-purpose flour</li><li onclick="handleItemClick()">1 teaspoon ground ginger</li><li onclick="handleItemClick()">1 teaspoon ground cinnamon</li><li onclick="handleItemClick()">2 teaspoons baking soda</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">¾ cup vegetable shortening</li><li onclick="handleItemClick()">1 cup granulated sugar</li><li onclick="handleItemClick()">¼ cup light molasses</li><li onclick="handleItemClick()">1 large egg</li><li onclick="handleItemClick()">Sugar for rolling</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_GingerSnaps', '<ol><li onclick="handleItemClick()">Preheat oven to 350*F (175*C).</li><li onclick="handleItemClick()">In medium bowl combine flour, ginger, cinnamon, baking soda and salt; set aside.</li><li onclick="handleItemClick()">Cream together shortening and sugar, add egg and beat until fluffy. Stir in molasses and mix well. Stir in flour mixture until just mixed</li><li onclick="handleItemClick()">Form tablespoonfuls of dough into round balls. Roll tops of balls in sugar. Place on a cookie sheet about 2-inches apart. (These cookies flatten as they bake.) Bake for exactly 9 minutes. Transfer cookies to wire racks to cool completely. </li></ol>' ] );
