ingredients_array.push( [ 'CostanzoRecipes_Desserts_FreshPineappleUpsideDownCake', '<ul><li onclick="handleItemClick()">12 tablespoons (170 grams) unsalted butter, softened (1½  sticks)</li><li onclick="handleItemClick()">½ cup (100 grams) lightly packed brown sugar</li><li onclick="handleItemClick()">½ teaspoon ground cinnamon</li><li onclick="handleItemClick()">8 ounces (225 grams) fresh pineapple, cut into ½-inch-thick wedges (about ¼ pineapple)</li><li onclick="handleItemClick()">1 cup (200 grams) granulated sugar</li><li onclick="handleItemClick()">2 teaspoons lime or lemon zest</li><li onclick="handleItemClick()">2 large eggs, separated</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li><li onclick="handleItemClick()">2 teaspoons baking powder</li><li onclick="handleItemClick()">¼ teaspoon fine sea salt</li><li onclick="handleItemClick()">1½  cups (195 grams) all-purpose flour</li><li onclick="handleItemClick()">½ cup (125 grams) sour cream or plain yogurt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_FreshPineappleUpsideDownCake', '<ol><li onclick="handleItemClick()">Position an oven rack in the lower third of the oven and heat oven to 350° Fahrenheit.</li><li onclick="handleItemClick()">Using the back of a spoon, spread 4 tablespoons of the butter over the bottom of a 9-inch cake pan. Scatter the brown sugar and cinnamon evenly over butter. Arrange the pineapple wedges in one even layer over the butter and sugar.</li><li onclick="handleItemClick()">In a large bowl, beat the remaining 8 tablespoons of butter, granulated sugar and zest with an electric mixer on high speed until light and fluffy, 2 to 3 minutes. Add the egg yolks and vanilla and beat until smooth.</li><li onclick="handleItemClick()">In a medium bowl, whisk or sift the flour with the baking powder and salt. Mix in a third of the flour mixture until only a few streaks of flour remain then mix in the remaining flour. Add the egg whites and sour cream and mix just until smooth.</li><li onclick="handleItemClick()">Spoon cake batter on top of the pineapple and spread into an even layer. Bake for 35 to 40 minutes or until a toothpick inserted in the center of the cake comes out clean.</li><li onclick="handleItemClick()">Cool cake in the pan for 5 minutes then run a knife around the edges and invert it onto a plate to cool. If some pineapple slices stick to the pan, use a spatula to transfer them back on top of the cake and spread a little of the gooey brown sugar sauce over them to cover it up.</li><li onclick="handleItemClick()">Serve warm or at room temperature. Refrigerate leftover cake up to 3 days. You can also rewarm slices in the microwave for about 10 seconds.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_FreshPineappleUpsideDownCake', '<ul><li onclick="handleItemClick()">From <a href="https://www.inspiredtaste.net/23363/fresh-pineapple-upside-down-cake-recipe/#itr-recipe-23363" target="_blank">https://www.inspiredtaste.net/23363/fresh-pineapple-upside-down-cake-recipe/#itr-recipe-23363</a></li><li onclick="handleItemClick()">date created: [2021-06-14 Mon] </li><li onclick="handleItemClick()">[2021-06-13 Sun] Made for TC, Greg, MaryAnn, Josh and Jeff. Very light and tasty.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_FrenchAppleCake', '<ul><li onclick="handleItemClick()">1 cup all-purpose flour, spooned into measuring cup and leveled-off</li><li onclick="handleItemClick()">1 teaspoon baking powder</li><li onclick="handleItemClick()">¼ teaspoon salt</li><li onclick="handleItemClick()">1 stick (½ cup) unsalted butter, at room temperature</li><li onclick="handleItemClick()">⅔ cup granulated sugar, plus more for sprinkling over cake</li><li onclick="handleItemClick()">2 large eggs</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li><li onclick="handleItemClick()">3 tablespoons dark rum</li><li onclick="handleItemClick()">2 baking apples, peeled, cored and cut into ½-inch cubes (I like Honeycrisp, Fuji or Granny Smith) (3½ - 4 cups chopped)</li><li onclick="handleItemClick()">Confectioners\' sugar (optional), for decorating cake</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_FrenchAppleCake', '<ol><li onclick="handleItemClick()">Preheat the oven to 350°F and set an oven rack in the middle position.</li><li onclick="handleItemClick()">Grease a 9-inch springform or regular cake pan with butter or nonstick cooking spray. If using a regular cake pan, line the bottom of the pan with parchment paper and grease again.</li><li onclick="handleItemClick()">In a small bowl, whisk together the flour, baking powder and salt.</li><li onclick="handleItemClick()">Using a handheld mixer with beaters or a stand mixer with the paddle attachment, cream the butter and granulated sugar until light and fluffy, about 3 minutes.</li><li onclick="handleItemClick()">Add the eggs, one at a time, beating well and scraping down the sides of the bowl after each addition. Beat in the vanilla and rum. Don\'t worry if the batter looks grainy at this point; that\'s okay. Add the flour mixture and mix on low speed until just combined.</li><li onclick="handleItemClick()">Using a rubber spatula, fold in the chopped apples.</li><li onclick="handleItemClick()">Scrape the batter into the prepared pan and even the top.</li><li onclick="handleItemClick()">Sprinkle evenly with 1 tablespoon of granulated sugar.</li><li onclick="handleItemClick()">Bake for about 40 minutes, or until the cake is golden and a toothpick inserted into the center comes out clean.<span class="tip">   <i class="conditional-space-after"></i></span></li><li onclick="handleItemClick()">Allow the cake to cool on a rack in the pan.</li><li onclick="handleItemClick()">Once cool, run a blunt knife around the edges of the cake. If using a springform pan, remove the sides. If using a regular cake pan, carefully invert the cake onto the rack, remove the parchment paper, then gently flip the cake over and place right-side-up on a platter. Using a fine sieve, dust with confectioners\' sugar (if using).</li><li onclick="handleItemClick()">Cake can be served warm or room temperature, plain or with lightly sweetened whipped cream or vanilla ice cream.</li></ol><span class="details">    The cake can be frozen for up to 3 months. After it is completely cooled, cover it tightly with aluminum foil or freezer wrap. Thaw overnight on the counter top before serving.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_FrenchAppleCake', '<ul><li onclick="handleItemClick()">From <a href="https://www.onceuponachef.com/recipes/french-apple-cake.html#tabrecipe" target="_blank">https://www.onceuponachef.com/recipes/french-apple-cake.html#tabrecipe</a></li><li onclick="handleItemClick()">Servings: 6-8</li><li onclick="handleItemClick()">Prep Time: 20 Minutes</li><li onclick="handleItemClick()">Cook Time: 40 Minutes</li><li onclick="handleItemClick()">Total Time: 1 Hour</li><li onclick="handleItemClick()">date created: [2021-01-22 Fri] </li><li onclick="handleItemClick()">[2021-01-24 Sun] Made a batch and a half in a 10” springform pan and needed to bake for an extra 5 minutes. Substituted bourbon for the rum and called it “French <i class="conditional-space-after"></i>Apple Cake”.  Brought to Greg and Mary Ann’s and shared with Matt and family. Seemed to go over well. </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_EasyPeachCrisp', '<ul><li onclick="handleItemClick()">7-8 ripe peaches, halved, pits removed and chopped (<i class="conditional-space-after"></i>: throw in a few cherries or blueberries)</li><li onclick="handleItemClick()">1 cup gluten-free rolled oats</li><li onclick="handleItemClick()">¼ cup almond meal</li><li onclick="handleItemClick()">¼ cup gluten-free flour (DIY blend or sub all-purpose flour or more almond meal)</li><li onclick="handleItemClick()">½ cup roughly chopped pecans</li><li onclick="handleItemClick()">2 Tbsp packed light brown sugar (or sub muscovado sugar)</li><li onclick="handleItemClick()">2 Tbsp coconut sugar (or sub more brown sugar)</li><li onclick="handleItemClick()">1 pinch sea salt</li><li onclick="handleItemClick()">4 Tbsp olive oil or coconut oil (coconut oil will impart a more intense coconut flavor // plus more for coating pan)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_EasyPeachCrisp', '<ol><li onclick="handleItemClick()">Preheat oven to 350° F (176 ° C) and lightly coat an 8×8 (or similar size) baking dish with coconut or olive oil.</li><li onclick="handleItemClick()">Add fruit directly to the dish as you chop it and spread flat.</li><li onclick="handleItemClick()">To a mixing bowl add crumble ingredients (including oil) and, using your hands or a wooden spoon, mix until all everything is evenly distributed.</li><li onclick="handleItemClick()">Add to the top of the fruit in an even layer and bake for 40-45 minutes, or until the fruit is bubbling and the top is crisp and golden.</li><li onclick="handleItemClick()">Serve as is, or with dairy-free ice cream!</li></ol><span class="tip">Best when fresh, though leftovers keep for 2-3 days covered in the refrigerator.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_EasyPeachCrisp', 'IsVegan<ul><li onclick="handleItemClick()">From <a href="https://minimalistbaker.com/easy-peach-crisp-vegan-gf/#wprm-recipe-container-35569" target="_blank">https://minimalistbaker.com/easy-peach-crisp-vegan-gf/#wprm-recipe-container-35569</a></li><li onclick="handleItemClick()">date created: [2022-07-04 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_East62ndStreetLemonCake', 'By Craig Claiborne<ul><li onclick="handleItemClick()">TIME About 2 hours</li><li onclick="handleItemClick()">This is Maida Heatter\'s recipe</li></ul><ul><li onclick="handleItemClick()">Fine dry bread crumbs or flour for dusting the pan</li><li onclick="handleItemClick()">3 cups flour</li><li onclick="handleItemClick()">2 teaspoons baking powder</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">1 cup unsalted butter (2 sticks), at room temperature</li><li onclick="handleItemClick()">2 cups sugar</li><li onclick="handleItemClick()">4 eggs</li><li onclick="handleItemClick()">1 cup milk</li><li onclick="handleItemClick()">2 tablespoons lemon zest</li></ul><ul><li onclick="handleItemClick()">⅓ cup lemon juice</li><li onclick="handleItemClick()">¾ cup sugar</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_East62ndStreetLemonCake', '<ol><li onclick="handleItemClick()">Heat oven to 325 degrees. Butter a 9‑inch tube pan. Coat it with the bread crumbs.</li><li onclick="handleItemClick()">Sift together the flour, baking powder and salt and set aside.</li><li onclick="handleItemClick()">Cream the butter and sugar together. Beat in the eggs one at a time.</li><li onclick="handleItemClick()">Fold in the dry ingredients alternately with the milk. Stir in the lemon zest. Pour the batter into the pan and smooth the top of the batter. Bake 1¼ hours, or until the cake tests done.</li><li onclick="handleItemClick()">While the cake bakes, make the glaze. Warm the juice and sugar in a small saucepan over medium-low heat until all of the sugar is dissolved. Cover and remove from heat.</li><li onclick="handleItemClick()">When the cake is done, immediately unmold the cake onto a cake rack and apply the glaze with a pastry brush to the top and sides of the cake until it is all absorbed.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Desserts_East62ndStreetLemonCake', '' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_East62ndStreetLemonCake', '<ul><li onclick="handleItemClick()">Recommended (heartily!) by Nancy Burnett [2018-04-08 Sun] </li><li onclick="handleItemClick()"><a href="https://cooking.nytimes.com/recipes/1019169-east-62nd-street-lemon-cake" target="_blank">https://cooking.nytimes.com/recipes/1019169-east-62nd-street-lemon-cake</a></li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_DoubleLemonPoppySeedBundtCake', 'Serves: 16<ul><li onclick="handleItemClick()">¼ cup poppy seeds</li><li onclick="handleItemClick()">1½ cups whole-wheat pastry flour</li><li onclick="handleItemClick()">1 cup all-purpose flour</li><li onclick="handleItemClick()">1½ teaspoons baking powder</li><li onclick="handleItemClick()">½ teaspoon baking soda</li><li onclick="handleItemClick()">¼ teaspoon salt</li><li onclick="handleItemClick()">1 cup buttermilk or equivalent buttermilk powder</li><li onclick="handleItemClick()">¼ cup canola oil</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li><li onclick="handleItemClick()">2 tablespoons freshly grated lemon zest</li><li onclick="handleItemClick()">2 tablespoons lemon juice</li><li onclick="handleItemClick()">2 large eggs, at room temperature</li><li onclick="handleItemClick()">2 large egg whites, at room temperature</li><li onclick="handleItemClick()">1¼ cups sugar</li><li onclick="handleItemClick()">¾ cup confectioners\' sugar, plus more for dusting</li><li onclick="handleItemClick()">3 tablespoons lemon juice</li><li onclick="handleItemClick()">1 tablespoon water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_DoubleLemonPoppySeedBundtCake', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees F. Coat a 10-inch (12-cup) Bundt pan, preferably nonstick, with cooking spray and dust with flour (or use cooking spray with flour).</li><li onclick="handleItemClick()">Toast poppy seeds in a small dry skillet over medium heat, stirring constantly, until fragrant, 3 to 4 minutes. Transfer to a plate to cool.</li><li onclick="handleItemClick()">Whisk whole-wheat flour, all-purpose flour, baking powder, baking soda, salt and the poppy seeds in a medium bowl. Combine buttermilk, oil, vanilla, lemon zest and lemon juice in a glass measuring cup.</li><li onclick="handleItemClick()">Beat eggs, egg whites and sugar in a large bowl with an electric mixer on high speed until thickened and pale, about 5 minutes.</li><li onclick="handleItemClick()">Fold the dry ingredients into the egg mixture with a rubber spatula, a third at a time, alternating with 2 additions of the buttermilk mixture. Scrape the batter into the prepared pan, spreading evenly.</li><li onclick="handleItemClick()">Bake the cake until the top springs back when touched lightly and a toothpick inserted in the center comes out clean, 35 to 40 minutes. Let cool in the pan on a wire rack for 5 minutes. Loosen the edges and turn the cake out onto the rack.</li><li onclick="handleItemClick()">Meanwhile, prepare glaze: Sift ¾ cup confectioners\' sugar into a small bowl; mix with lemon juice and water to create a thin glaze. Poke 1-inch-deep holes all over the cake with a skewer. Coat the warm cake with the glaze using a pastry brush. Let cool completely. To serve, set the cake on a serving plate and dust with confectioners\' sugar.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Desserts_DoubleLemonPoppySeedBundtCake', '' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_DoubleLemonPoppySeedBundtCake', '<ul><li onclick="handleItemClick()">Per Serving<ul><li onclick="handleItemClick()">Calories: 201 kcal</li><li onclick="handleItemClick()">Carbohydrates: 35 g</li><li onclick="handleItemClick()">Dietary Fiber: 1 g</li><li onclick="handleItemClick()">Fat: 5 g</li><li onclick="handleItemClick()">Protein: 4 g</li><li onclick="handleItemClick()">Sugars: 22 g</li></ul></li><li onclick="handleItemClick()"><a href="http://food.yahoo.com/recipes/eatingwell/285/double-lemon-poppy-seed-bundt-cake/print" target="_blank">http://food.yahoo.com/recipes/eatingwell/285/double-lemon-poppy-seed-bundt-cake/print</a></li><li onclick="handleItemClick()">23 May 2009</li><li onclick="handleItemClick()">date created: [2009-05-26 Tue] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_DoubleChocolateCupcakes', '<ul><li onclick="handleItemClick()">1 cup all-purpose flour</li><li onclick="handleItemClick()">1 cup granulated sugar</li><li onclick="handleItemClick()">½ teaspoon baking powder</li><li onclick="handleItemClick()">½ teaspoon baking soda</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">½ cup unsweetened cocoa powder</li><li onclick="handleItemClick()">½ cup vegetable oil</li><li onclick="handleItemClick()">1 cup hot water</li><li onclick="handleItemClick()">1 large egg</li></ul><ul><li onclick="handleItemClick()">1 cup (2 sticks) unsalted butter</li><li onclick="handleItemClick()">4 ounces unsweetened chocolate, melted and cooled for 5 minutes</li><li onclick="handleItemClick()">1 pound powdered sugar</li><li onclick="handleItemClick()">¼ cup unsweetened cocoa powder</li><li onclick="handleItemClick()">2 teaspoons pure vanilla extract</li><li onclick="handleItemClick()">1-3 tablespoons milk</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_DoubleChocolateCupcakes', '<ol><li onclick="handleItemClick()">Preheat oven to 350°F.</li><li onclick="handleItemClick()">Line a 12-cup standard muffin tin with paper liners.</li><li onclick="handleItemClick()">In a large bowl, whisk together the flour, sugar, baking powder, baking soda, salt and cocoa powder.</li><li onclick="handleItemClick()">Add in vegetable oil, hot water, egg and vanilla and whisk until well-combined and smooth. (Batter will be thin.)</li><li onclick="handleItemClick()">Use a large scoop (about 3 tablespoons) to divide the batter between lined muffin cups.</li><li onclick="handleItemClick()">Bake in preheated oven for 17-20 minutes, until the tops spring back when touched lightly.</li><li onclick="handleItemClick()">Place on a cooling rack until cupcakes are cool to the touch.</li></ol><ol><li onclick="handleItemClick()">In the bowl of a stand mixer fitted with the paddle attachment, beat butter on medium-high speed for about 6 minutes.<span class="note">   This process will lighten the color of the butter and ensure your buttercream is extra fluffy.</span></li><li onclick="handleItemClick()">Add cooled, melted chocolate to the butter and mix until combined, scraping down the sides of the bowl as needed.</li><li onclick="handleItemClick()">Sift together the powdered sugar and cocoa powder.</li><li onclick="handleItemClick()">With the mixer on low speed, gradually add in the powdered sugar mixture and continue mixing on low speed until the powdered sugar is completely incorporated.</li><li onclick="handleItemClick()">Add in 1-2 tablespoons milk and vanilla extract. mixing to combine.</li><li onclick="handleItemClick()">Turn mixer back up to medium-high speed and beat the mixture for an additional 5 minutes.</li><li onclick="handleItemClick()">If needed, add a little more milk, 1 teaspoon at a time until you reach the consistency you desire.</li><li onclick="handleItemClick()">Pipe buttercream onto cooled cupcakes.<span class="tip">   If desired, top with chocolate sprinkles or mini chocolate chips.</span></li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_DoubleChocolateCupcakes', '<ul><li onclick="handleItemClick()">From <a href="http://chocolatechocolateandmore.com/double-chocolate-cupcakes" target="_blank">http://chocolatechocolateandmore.com/double-chocolate-cupcakes</a>via Louise</li><li onclick="handleItemClick()">date created: [2020-02-21 Fri] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_CongoBars', '<ul><li onclick="handleItemClick()">1½ cups unsweetened shredded coconut</li><li onclick="handleItemClick()">1½ cups (7½ ounces) all-purpose flour</li><li onclick="handleItemClick()">1 teaspoon baking powder</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">1½ cups packed (10½ ounces) light brown sugar</li><li onclick="handleItemClick()">12 tablespoons unsalted butter, melted and cooled</li><li onclick="handleItemClick()">2 large eggs</li><li onclick="handleItemClick()">1½ teaspoons vanilla extract</li><li onclick="handleItemClick()">1 cup pecans, toasted and coarsely chopped</li><li onclick="handleItemClick()">1 cup (6 ounces) semisweet chocolate chips</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_CongoBars', '<ol><li onclick="handleItemClick()">Adjust an oven rack to the middle position and heat oven to 350°</li><li onclick="handleItemClick()">Make a foil sling for a 13 by 9-inch baking pan by folding 2 long sheets of aluminum foil; the first sheet should be 13 inches wide and the second sheet should be 9 inches wide. Lay sheets of foil in pan perpendicular to one another, with extra foil hanging over the edges of the pan. Push foil into corners and up the sides of the pan, smoothing foil flush to the pan. Grease foil and set pan aside.</li><li onclick="handleItemClick()">Toast coconut on rimmed baking sheet, stirring two or three times, until lightly golden, 4 to 5 minutes. Let cool.</li><li onclick="handleItemClick()">Whisk flour, baking powder and salt together in  medium bowl; set aside.</li><li onclick="handleItemClick()">Whisk brown sugar and melted butter together in a medium bowl until combined.</li><li onclick="handleItemClick()">Add eggs and vanilla and mix well.</li><li onclick="handleItemClick()">Using rubber spatula, fold dry ingredients into egg mixture until just combined. Do not overmix.</li><li onclick="handleItemClick()">Fold in nuts, chocolate chips and coconut.</li><li onclick="handleItemClick()">Transfer batter to prepared pan, smoothing top with rubber spatula.</li><li onclick="handleItemClick()">Bake until top is shiny and cracked and feels firm to the touch, 22 to 25 minutes.</li><li onclick="handleItemClick()">Transfer pan to wire rack and let cool completely.</li><li onclick="handleItemClick()">Remove from pan, using foil.</li><li onclick="handleItemClick()">Cut into 2 by 1½ inch bars and serve.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_CongoBars', '<ul><li onclick="handleItemClick()">From Cook’s Illustrated Baking Book, page 240</li><li onclick="handleItemClick()">date created: [2021-05-27 Thu] </li><li onclick="handleItemClick()">[2021-05-25 Tue] Made for T’s 60<sup>th</sup>birthday and they were well received!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_CoconutLayerCake', '<ul><li onclick="handleItemClick()">1 cup (2 sticks) unsalted butter, softened, plus more for coating pans </li><li onclick="handleItemClick()">3 cups cake flour, plus more for coating pans </li><li onclick="handleItemClick()">1 tsp. baking powder </li><li onclick="handleItemClick()">½ tsp. baking soda </li><li onclick="handleItemClick()">½ tsp. salt </li><li onclick="handleItemClick()">1¾ cups sugar </li><li onclick="handleItemClick()">1 cup Coco GOYA® Cream of Coconut </li><li onclick="handleItemClick()">4 large eggs, separated </li><li onclick="handleItemClick()">1 tsp. GOYA® Vanilla Extract </li><li onclick="handleItemClick()">1 cup GOYA® Coconut Milk </li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_CoconutLayerCake', '<ol><li onclick="handleItemClick()">Adjust oven racks to upper and lower thirds; heat oven to 350 degreesF. Butter three 9-inch-diameter cake pans. Line bottom of pans with parchment paper rounds; butter parchment paper. Dust bottom and sides of pans with flour, knocking out excess. Set pans in refrigerator.</li><li onclick="handleItemClick()">In medium bowl, using whisk, whisk together flour, baking powder, baking soda and salt; set aside.</li><li onclick="handleItemClick()">In large mixing bowl, using electric mixer, beat together sugar, butter and cream of coconut on medium-high speed until fluffy, about 2 minutes.</li><li onclick="handleItemClick()">Beat in egg yolks, one at a time, and vanilla extract until well combined.</li><li onclick="handleItemClick()">On low speed, beat in reserved flour mixture, scraping sides of bowl with spatula, until incorporated.</li><li onclick="handleItemClick()">Beat in 1 cup coconut milk until just blended; set aside.</li><li onclick="handleItemClick()">In separate medium mixing bowl, using clean dry beaters, beat egg whites until stiff but not dry. Using spatula, stir ⅓ beaten egg whites into cake batter until well blended. Gently fold in remaining beaten egg whites until well combined.</li><li onclick="handleItemClick()">Divide cake batter evenly among prepared pans. Bake cakes, rotating after about 15 minutes, until tops are golden brown and cake tester inserted into center comes out clean, 30-32 minutes.</li><li onclick="handleItemClick()">Cool cakes in pans on cooling racks about 15 minutes. Loosen cakes from sides of pans with thin knife, invert cakes onto racks. Cool cakes to room temperature; remove and discard parchment rounds.</li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_CoconutLayerCake', '<ul><li onclick="handleItemClick()">4 egg whites </li><li onclick="handleItemClick()">1 cup sugar </li><li onclick="handleItemClick()">⅛ tsp. salt </li><li onclick="handleItemClick()">1 tsp. GOYA® Vanilla Extract </li><li onclick="handleItemClick()">3 cups unsweetened flaked coconut </li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_CoconutLayerCake', '<ol><li onclick="handleItemClick()">Meanwhile, in heatproof bowl, whisk together egg whites, sugar and salt. Set bowl over saucepan containing about 1" simmering water (making sure bottom of bowl does not touch water). Whisk constantly until mixture is opaque and warm to the touch (about 120 degreesF on quick-read thermometer), about 3 minutes. Remove bowl from heat.</li><li onclick="handleItemClick()">Using electric mixer, beat egg whites on high speed until glossy white and sticky and mixture cools to about 80 degreesF on quick-read thermometer, about 4 minutes. Reduce speed to medium and beat in vanilla; set aside.</li></ol>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_CoconutLayerCake', '<ol><li onclick="handleItemClick()">Place one cooled cake round (top side-up) on cake plate.</li><li onclick="handleItemClick()">Using off-set metal spatula, evenly spread with ½ cup frosting; sprinkle with ¾ cup flaked coconut.</li><li onclick="handleItemClick()">Stack second cake layer (top side-up) on frosted cake.</li><li onclick="handleItemClick()">Evenly spread cake with another ½ cup frosting; sprinkle with ¾ cup flaked coconut.</li><li onclick="handleItemClick()">Stack last cake layer (top side-up) on frosted cake.</li><li onclick="handleItemClick()">Evenly spread remaining frosting on top and sides of cake.</li><li onclick="handleItemClick()">Sprinkle top of cake with about ¾ cup flaked coconut.</li><li onclick="handleItemClick()">Using hands, press remaining coconut on sides of cake.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_CoconutLayerCake', 'A Fantastic, Moist and Fluffy Coconut Cake RecipeFluffy layers of coconut cake, sweet, sticky 7-minute frosting and flakes of unsweetened coconut are piled high to create a dramatic, delicious Coconut Layer Cake that looks beautiful and tastes spectacular. Prep time: 10 min.Total time: 1 hr., plus cooling timeServes 8<a href="http://www.goya.com/english/recipes/print_recipe.html?recipeID=579&langID=0" target="_blank">http://www.goya.com/english/recipes/print_recipe.html?recipeID=579&langID=0</a>[2016-09-01 Thu] Collected this recipe, but I haven\'t made it yet.' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_ClassicPieDough', '<ul><li onclick="handleItemClick()">1¼ cups (150g | 6.25 ounces) all-purpose flour</li><li onclick="handleItemClick()">1 Tbsp. sugar</li><li onclick="handleItemClick()">½ tsp. salt</li><li onclick="handleItemClick()">4 Tbsp. (23g) vegetable shortening, cut into ½-inch pieces and chilled</li><li onclick="handleItemClick()">6 Tbsp. unsalted butter, cut into ¼-inch pieces and chilled</li><li onclick="handleItemClick()">About 3-4 tablespoons ice water, plus more as needed</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_ClassicPieDough', '<ol><li onclick="handleItemClick()">Process flour, sugar and salt in food processor until combined, about 5 seconds. Scatter shortening over top and process until mixture resembles coarse cornmeal, about 10 seconds. Scatter butter over top and pulse until mixture resembles coarse crumbs, about 10 pulses.</li><li onclick="handleItemClick()">Transfer mixture to a large bowl. Sprinkle 3 tablespoons of ice water over mixture. Stir and press dough together, using stiff rubber spatula, until dough sticks together. If dough does not come together, stir in remaining ice water, ½ tablespoon at a time, until it does.</li><li onclick="handleItemClick()">Divide dough into 2 even pieces. Turn each piece of dough onto a sheet of plastic wrap and flatten each into 4-inch disk. Wrap each piece tightly in plastic and refrigerate for 1 hour. Before rolling out dough, let it sit on counter to soften slightly, about 10 minutes. (Dough can be wrapped tightly in plastic and refrigerated for up to 2 days or frozen for up to 1 month. If frozen, let dough thaw completely on counter before rolling it out.)</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Desserts_ClassicPieDough', '1 pie crust' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_ClassicPieDough', 'From Cook\'s Illustrated Baking Book (page 372)' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_ClassicPieCrustKingArthur', '<ul><li onclick="handleItemClick()">46g (¼ cup) vegetable shortening</li><li onclick="handleItemClick()">297g (2½ cups) King Arthur Unbleached All-Purpose Flour   or   283g King Arthur Perfect Pastry Blend</li><li onclick="handleItemClick()">1¼ teaspoons salt [2]</li><li onclick="handleItemClick()">142g (10 tablespoons) very cold unsalted butter</li><li onclick="handleItemClick()">85g to 142g (6 to 10 tablespoons) ice water [3]</li></ul><ul><li onclick="handleItemClick()">23g (⅛ cup) vegetable shortening</li><li onclick="handleItemClick()">148.5g (1¼ cups) King Arthur Unbleached All-Purpose Flour or 141.5g King Arthur Perfect Pastry Blend</li><li onclick="handleItemClick()">⅝ teaspoons salt [2]</li><li onclick="handleItemClick()">71g (5 tablespoons) very cold unsalted butter</li><li onclick="handleItemClick()">42.5g to 71g (3 to 5 tablespoons) ice water [3]</li></ul>[1] See <a href="https://www.kingarthurflour.com/blog/2016/10/16/make-pie-crust-in-your-stand-mixer" target="_blank">https://www.kingarthurflour.com/blog/2016/10/16/make-pie-crust-in-your-stand-mixer</a>by PJ Hamel[2] Reduce the salt to 1 teaspoon (½ teaspoon for single crust) if you use salted butter.[3] Use the lesser amount of water if you use <i class="conditional-space-after"></i>.' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_ClassicPieCrustKingArthur', '<ol><li onclick="handleItemClick()">Whisk together the flour and salt.</li><li onclick="handleItemClick()">Add the shortening, working it in until the mixture is evenly crumbly.</li><li onclick="handleItemClick()">Cut the butter into small (about ½") cubes.</li><li onclick="handleItemClick()">Add the butter to the flour mixture, and work it in roughly with your fingers, a pastry cutter, or a mixer. Don\'t be too thorough; the mixture should be very uneven, with big chunks of butter in among the smaller ones.</li><li onclick="handleItemClick()">Add 4 (or 2 for single crust) tablespoons of water, and toss to combine.</li><li onclick="handleItemClick()">Toss with enough additional water to make a chunky, fairly cohesive mixture. It should hold together when you gather it up and squeeze it in your hand.</li><li onclick="handleItemClick()">Divide the dough in half, and gather each half into a rough disk. Smooth the disks; it\'s OK if they have a few cracks in the surface. Smooth the disks\' edges by running them along a floured surface like a wheel.</li><li onclick="handleItemClick()">Wrap in plastic, and chill for 30 minutes, or up to overnight. Or wrap in aluminum foil over the plastic, and freeze for up to 2 months.</li><li onclick="handleItemClick()">When you\'re ready to make pie, remove the crust from the refrigerator or freezer, leaving it wrapped. Allow it to thaw (if it\'s frozen) or warm a bit (if it\'s been chilled longer than 30 minutes), until it\'s softened enough to roll, but still feels cold to the touch.</li><li onclick="handleItemClick()">Next, measure the bottom diameter, and up the sides of your pie pan. If your pan is 7" across the bottom, and 1 ½" up each side, that\'s a total of 10". This means you should roll your bottom crust to a diameter between 11" and 12", which gives you enough extra for crimping the edges.</li><li onclick="handleItemClick()">Place the crust on a floured work surface; our silicone rolling mat is a fine choice. Roll it to the desired width. See the big chunks of butter? That\'s a good thing.</li><li onclick="handleItemClick()">Place the crust in the pan by folding in quarters and placing in the pan. Or you can simply pick it up with a piecrust lifter, and move it that way.</li><li onclick="handleItemClick()">For a single-crust pie, fold the edges of the crust under, and gently squeeze them together. Crimp as desired. It\'s nice to make a tall crimp, as the filling for a single-crust pie is usually fairly liquid (think pumpkin or custard), and it\'s good to have that tall "dam."</li><li onclick="handleItemClick()">For a double-crust pie, leave the edges of the bottom crust as is (no folding or crimping). Once you\'ve added the pie filling, roll out the top crust to the outside diameter of your pan, and place it atop the filling.</li><li onclick="handleItemClick()">Trim excess crust with a pair of scissors, then press the two edges together.</li><li onclick="handleItemClick()">Crimp as desired. A simple fork crimp is fast and easy. At this point, it helps to return the pie to the refrigerator for 20 to 30 minutes; this chills the fat, which ultimately increases the crust\'s flakiness.</li><li onclick="handleItemClick()">Cut a hole in the center of the crust for steam to escape. Or slash the pie\'s top surface several times.</li><li onclick="handleItemClick()">Brush with milk and sprinkle with coarse sparkling sugar, if desired.</li><li onclick="handleItemClick()">Bake... enjoy!</li></ol>' ] );
