ingredients_array.push( [ 'CostanzoRecipes_Desserts_ClassicKouignAmannBretonButterCake', '<ul><li onclick="handleItemClick()">2¼ cups (270g) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">¾ teaspoon (4g) salt</li><li onclick="handleItemClick()">½ teaspoon (2g) instant yeast</li><li onclick="handleItemClick()">¾ cup + 1 tablespoon (184g) water, at warm room temperature (75°F)</li></ul><ul><li onclick="handleItemClick()">12 tablespoons (170g) salted butter, cold</li><li onclick="handleItemClick()">1 cup (198g) granulated sugar</li></ul><ul><li onclick="handleItemClick()">1 large egg, lightly beaten with a pinch of salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_ClassicKouignAmannBretonButterCake', '<ol><li onclick="handleItemClick()"><b class="conditional-space-after">To make the dough</b>: Weigh your flour; or measure it by gently spooning it into a cup, then sweeping off any excess.</li><li onclick="handleItemClick()">In a medium bowl, combine the flour, salt, and yeast. Add the water and, using your hands, mix and knead until you no longer see any dry flour and the dough is somewhat uniform, but still shaggy; it’s important not to overwork the dough (develop too much gluten) at this point.</li><li onclick="handleItemClick()">Cover the bowl loosely and let the dough sit at warm room temperature (75°F) until puffy and about 1 1/2 times its original volume, 90 to 120 minutes.</li><li onclick="handleItemClick()">To prepare the parchment packet for the butter block: Fold one short end of a 16" x 12" sheet of parchment toward the center to form a 12" square. Next, fold 5” of the opposite short side down to form a 7” x 12” rectangle. Finally, fold 2 1/2" of both 7” sides toward the center. This should result in a 7” square with folds (or flaps) on all four sides. Crease the folds crisply, then unfold. Set aside.</li><li onclick="handleItemClick()"><b class="conditional-space-after">To prepare the butter block</b>: Place the butter in the center of a clean work surface and gently tap it with a rolling pin until it’s just pliable; 8 to 10 taps should do it.</li><li onclick="handleItemClick()">Using a dough scraper or dull knife, divide the butter into rough 1/2" pieces and place the pieces in a medium bowl with the sugar.</li><li onclick="handleItemClick()">Using your hands and a pastry blender or fork, cut and knead the butter and sugar until it forms a uniform dough-like mixture.</li><li onclick="handleItemClick()">Transfer the butter-sugar mixture to the center of the parchment square.</li><li onclick="handleItemClick()">Refold the parchment to enclose the butter-sugar mixture then invert the packet so the flaps are face down. Roll gently until the butter block is evenly thick and fills the packet completely. Refrigerate until needed.</li><li onclick="handleItemClick()">Toward the end of the dough’s rising time (about 15 minutes before it’s ready), remove the butter block from the refrigerator.</li><li onclick="handleItemClick()">Place an oven rack in the upper-middle position and preheat the oven to 375°F.</li><li onclick="handleItemClick()"><b class="conditional-space-after">To laminate the dough</b>: Transfer the dough to a well-floured work surface. Flour the top of the dough liberally and roll it into a 16" x 8" oval with the short ends facing you; use a dry brush to remove any excess flour from the surface of the dough. Note: It\'s very important to flour the countertop and the exterior of the dough generously (more than you think!), to keep the dough from sticking or smearing. Just be sure to brush off any excess flour from the top of the dough before performing each of the three folding steps.</li><li onclick="handleItemClick()">Unwrap the butter block (reserving the parchment) and place it on top of the dough, in the middle of the oval. Fold the two short ends over the butter square so that they meet in the middle. They should overlap slightly and also overhang the long edges so that the butter block is completely covered by dough.</li><li onclick="handleItemClick()">Using the rolling pin, press down along the sides of the dough packet to seal the edges. Generously flour the top of the dough and your work surface again and rotate the dough 90°.</li><li onclick="handleItemClick()">Holding the rolling pin parallel to the edge of the countertop, press straight down along the length of the dough from the back edge to the front edge to elongate the packet and seal the flaps fully, 15 to 20 presses.</li><li onclick="handleItemClick()">Roll the dough away from and toward yourself to form an 18" x 8" rectangle, adding flour to both sides of the dough as needed to prevent sticking. If any large bubbles form in the dough, pop them gently with the tip of a paring knife.</li><li onclick="handleItemClick()">With a dry brush, sweep off any excess flour and fold the dough into thirds like a business letter; you should have an 8” x 6" rectangle. Generously flour the top of the dough and your work surface again. Rotate the dough 90° in the same direction you rotated the dough the first time.</li><li onclick="handleItemClick()">Repeat steps 15 through 17.</li><li onclick="handleItemClick()">To shape the kouign-amann: Generously flour the top of the dough and your work surface, and roll the dough into a 14" square – if the dough is elastic and springs back as you roll it, just get it as close to a square as possible.</li><li onclick="handleItemClick()">Brush off any excess flour then fold and join the corners of the square at the center to form a smaller 7” to 8” square. Gently push the new corners of the square into the center and gather the dough into a 7" disk.</li><li onclick="handleItemClick()">Invert the dough disk onto the center of the reserved parchment. Flour the top of the dough lightly and roll it gently into a 9" round. Brush off any excess flour from the surface of the dough.</li><li onclick="handleItemClick()">With a sharp paring knife or a straight-bladed lame, make a series of 1/4"-deep parallel cuts across the top of the dough, spacing them about 1" apart. Rotate the dough (or yourself) 30° and repeat the cuts to create an oblique diamond crosshatch pattern.</li><li onclick="handleItemClick()">At evenly spaced intersections of the crosshatched pattern, use a toothpick or wooden skewer to poke 6 to 8 holes that go all the way down to the bottom of the kouign-amann.</li><li onclick="handleItemClick()">Using the parchment as a sling, transfer the dough to a 9" round cake pan and gently press it into the corners of the pan.</li><li onclick="handleItemClick()">Brush the top of the kouign-amann with the egg wash.</li><li onclick="handleItemClick()">To bake the kouign-amann: Bake the kouign-amann until deep golden brown on top, 50 to 60 minutes.</li><li onclick="handleItemClick()">Remove the kouign-amann from the oven and allow it to cool for about 1 hour before slicing and serving; it should still be a bit warm.</li><li onclick="handleItemClick()">Storage information: Store leftovers, well wrapped, at room temperature for up to 24 hours.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_ClassicKouignAmannBretonButterCake', '<ul><li onclick="handleItemClick()">From <a href="https://www.kingarthurbaking.com/recipes/classic-kouign-amann-breton-butter-cake-recipe" target="_blank">https://www.kingarthurbaking.com/recipes/classic-kouign-amann-breton-butter-cake-recipe</a></li><li onclick="handleItemClick()">date created: [2022-01-30 Sun] </li><li onclick="handleItemClick()">[2022-01-30 Sun] Delicious!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_ChocolateZucchiniCake', '<ul><li onclick="handleItemClick()">½ cup (1 stick) unsalted butter, room temperature</li><li onclick="handleItemClick()">½ cup vegetable oil</li><li onclick="handleItemClick()">1¾ cups sugar</li><li onclick="handleItemClick()">2 large eggs</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li><li onclick="handleItemClick()">½ cup buttermilk</li><li onclick="handleItemClick()">2 cups grated unpeeled zucchini (about 2 1/2 medium)</li><li onclick="handleItemClick()">2½ cups all purpose flour</li><li onclick="handleItemClick()">½ teaspoon baking powder</li><li onclick="handleItemClick()">4 tablespoons unsweetened cocoa powder</li><li onclick="handleItemClick()">1 teaspoon baking soda</li><li onclick="handleItemClick()">½ teaspoon cinnamon</li><li onclick="handleItemClick()">1 cup semisweet chocolate chips</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_ChocolateZucchiniCake', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees.</li><li onclick="handleItemClick()">Cream together the butter, oil and sugar. Stir in the eggs, vanilla and buttermilk. Mix in the zucchini.</li><li onclick="handleItemClick()">Add the dry ingredients and mix well; fold in the chocolate chips.</li><li onclick="handleItemClick()">Pour into 9x12 inch baking pan. Bake for 40-50 minutes, until tester inserted into center comes out clean. (Mini loaf pan baked for 35(?) minutes.)</li><li onclick="handleItemClick()">Serve cool and dusted with confectioner\'s sugar. Of course the cake doesn\'t complain if it is served with fresh whipped cream or ice cream!</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_ChocolateZucchiniCake', '<ul><li onclick="handleItemClick()">date created: [2007-08-18 Sat] </li><li onclick="handleItemClick()">This moist and delicious cake came to us by way of our friend Pat Ryan.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_ChocolateTruffleCookies', '<ul><li onclick="handleItemClick()">4 squares (1 oz. each) unsweetened chocolate</li><li onclick="handleItemClick()">2 cups (12 oz.) semi-sweet chocolate chips, divided</li><li onclick="handleItemClick()">⅓ cup butter</li><li onclick="handleItemClick()">1 cup sugar</li><li onclick="handleItemClick()">3 eggs</li><li onclick="handleItemClick()">1½ teaspoons vanilla extract</li><li onclick="handleItemClick()">½ cup all-purpose flour</li><li onclick="handleItemClick()">2 tablespoons baking cocoa</li><li onclick="handleItemClick()">¼ teaspoon baking powder</li><li onclick="handleItemClick()">¼teaspoon salt</li><li onclick="handleItemClick()">Confectioners Sugar</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_ChocolateTruffleCookies', '<ol><li onclick="handleItemClick()">In a microwave or double boiler, melt unsweetened chocolate, 1 cup of chocolate chips and butter. Cool for 10 minutes.</li><li onclick="handleItemClick()">In a mixing bowl, beat sugar and eggs for 2 minutes until well blended. Beat in vanilla and the chocolate mixture. Mix in flour, cocoa and baking powder. Stir in remaining chocolate chips.</li><li onclick="handleItemClick()">Cover and chll for at least 3 hours.</li><li onclick="handleItemClick()">Prehat oven to 350 degrees. With lightly floured hands, roll into 1-inch balls. Place on ungreased cookie sheets. Bake at 350 degrees for 10-12 minutes or until lightly puffed and set. Cool on pan 3-4 minutes before removing to wire rack to cool completely. Dust with confectioners sugar.</li></ol>' ] );
