ingredients_array.push( [ 'CostanzoRecipes_Desserts_ChocolateCreamPie', '<ul><li onclick="handleItemClick()">181g King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">46g vegetable shortening</li><li onclick="handleItemClick()">57g (½ stick) cold unsalted butter</li><li onclick="handleItemClick()">28 to 57g ice water</li></ul><ul><li onclick="handleItemClick()">28g unsalted butter</li><li onclick="handleItemClick()">227g semisweet chocolate, chopped</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li><li onclick="handleItemClick()">131g granulated sugar</li><li onclick="handleItemClick()">3 tablespoons cornstarch</li><li onclick="handleItemClick()">11g unsweetened cocoa powder</li><li onclick="handleItemClick()">1 teaspoon espresso powder, optional; for richer chocolate flavor</li><li onclick="handleItemClick()">⅛ teaspoon salt</li><li onclick="handleItemClick()">3 large egg yolks</li><li onclick="handleItemClick()">227g heavy cream, divided</li><li onclick="handleItemClick()">454g milk</li></ul><ul><li onclick="handleItemClick()">227g heavy cream</li><li onclick="handleItemClick()">28g confectioners\' sugar</li><li onclick="handleItemClick()">½ teaspoon vanilla extract</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_ChocolateCreamPie', '<ul><li onclick="handleItemClick()">3 large egg whites (reserved from filling)</li><li onclick="handleItemClick()">pinch of salt</li><li onclick="handleItemClick()">½ cup (3½ ounces) sugar</li><li onclick="handleItemClick()">3 tablespoons (1½ ounces) water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_ChocolateCreamPie', '<ol><li onclick="handleItemClick()">Place the egg whites in a clean bowl with clean beaters. Add the pinch of salt.</li><li onclick="handleItemClick()">In a small saucepan, bring the sugar and water to a boil, stirring occasionally, until the sugar dissolves. Boil for 2 minutes, then remove from the heat.</li><li onclick="handleItemClick()">Whip the egg whites until they turn white and the whisk begins to leave tracks in the bowl. Slowly add the hot sugar syrup, and continue beating until the whites make stiff peaks.</li><li onclick="handleItemClick()">Preheat the oven to 400 degreesF.</li><li onclick="handleItemClick()">Pipe or spoon the meringue over the top of the filled, chilled pie, making sure you cover the filling completely.</li><li onclick="handleItemClick()">Place the pie in the oven for 5 to 7 minutes, until the top of the meringue is golden brown. Remove from the oven and refrigerate until ready to serve</li></ol>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_ChocolateCreamPie', '<ol><li onclick="handleItemClick()">In a medium bowl, whisk together the flour, and salt.</li><li onclick="handleItemClick()">Cut in the shortening until it\'s in lumps the size of small peas.</li><li onclick="handleItemClick()">Dice the butter into ½" pieces, and cut into the mixture until you have flakes of butter the size of your fingernail.</li><li onclick="handleItemClick()">Add the water, two tablespoons at a time, mixing with a fork as you sprinkle the water into the dough.</li><li onclick="handleItemClick()">When the dough is moist enough to hold together when you squeeze it, transfer it to a piece of wax or parchment paper. It\'s ok if there are dry spots in the pile. Use a spray bottle of water to lightly spritz these places; that way you\'ll add just enough water to bring the dough together without adding too much or creating a wet spot.</li><li onclick="handleItemClick()">Fold it over on itself three or four times to bring it together, then pat it into a disk ¾" thick</li><li onclick="handleItemClick()">Roll the disk on its edge, like a wheel, to smooth out the edges. This step will ensure your dough will roll out evenly, without a lot of cracks and splits at the edges later. Wrap in plastic and refrigerate for 30 minutes before rolling.</li><li onclick="handleItemClick()">To blind bake the crust: Preheat the oven to 400 degreesF. Lightly grease a 9" pie pan that\'s at least 2" deep. This will make serving the pie easier after it\'s finished.</li><li onclick="handleItemClick()">Roll out the pastry for the pie to a 13" circle. Transfer it to the prepared pan, and trim the edges so they overlap the edge by an inch all the way around. Tuck the edges up and under, and flute them. Put the lined pie pan in the refrigerator to chill for 10 minutes.</li><li onclick="handleItemClick()">Line the crust with foil or parchment paper, and fill it with pie weights or dried beans. Bake the crust for 20 minutes. Remove it from the oven, and gently remove foil or parchment with the weights or beans. Return the crust to the oven for 10 to 20 more minutes, until it\'s golden brown all over. If the edges of the crust start becoming too brown, cover them with a pie shield, or strips of aluminum foil. Remove the crust from the oven and cool completely.</li></ol><ol><li onclick="handleItemClick()">Place the chopped chocolate, butter, and vanilla extract in a 2-quart mixing bowl; set aside.</li><li onclick="handleItemClick()">In a medium saucepan away from heat, whisk together the sugar, cornstarch, cocoa, espresso powder, and salt. Whisk in ¼ cup of cold heavy cream until the mixture is smooth, with no lumps. Repeat with another ¼ cup of the cream. Whisk in the egg yolks.</li><li onclick="handleItemClick()">Place the saucepan over medium heat, and gradually whisk in the remaining cream and milk.</li><li onclick="handleItemClick()">Bring to a boil, whisking constantly as the mixture thickens; boil for 1 minute.</li><li onclick="handleItemClick()">Remove the pan from the heat and pour the mixture over the reserved chocolate and butter.</li><li onclick="handleItemClick()">Whisk until the chocolate is melted and the mixture is smooth.</li><li onclick="handleItemClick()">(optionally) Pass the filling through a strainer into a bowl to remove any lumps.</li><li onclick="handleItemClick()">Place plastic wrap or buttered parchment paper on the surface to prevent a skin from forming, and chill thoroughly.</li></ol><ol><li onclick="handleItemClick()">Place the heavy cream in a chilled mixing bowl.</li><li onclick="handleItemClick()">Whip until the whisk begins to leave tracks in the bowl.</li><li onclick="handleItemClick()">Add the sugar and vanilla and whip until the cream holds a medium peak.</li><li onclick="handleItemClick()">Assembly</li><li onclick="handleItemClick()">Transfer the cooled filling to the cooled, baked pie crust. Level the top with the back of a spoon or an offset spatula.</li><li onclick="handleItemClick()">Spoon or pipe the whipped cream on top.</li><li onclick="handleItemClick()">Chill the pie until ready to serve. Note: If you\'re not planning on serving the entire pie at once, top individual slices with a dollop of whipped cream just before serving.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_ChocolateCreamPie', '<a href="http://www.kingarthurflour.com/recipes/chocolate-cream-pie-recipe" target="_blank">http://www.kingarthurflour.com/recipes/chocolate-cream-pie-recipe</a>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_ChocolateChipCookies', '<ul><li onclick="handleItemClick()">1 cup unbleached flour (I use King Arthur - organic if I can find it)</li><li onclick="handleItemClick()">1 cup King Arthur white or regular whole wheat flour</li><li onclick="handleItemClick()">½ cup quick cooking oatmeal (uncooked) I use what I have on hand, not necessarily quick cooking.</li><li onclick="handleItemClick()">1 tsp. baking soda</li><li onclick="handleItemClick()">1 tsp. coarse salt</li><li onclick="handleItemClick()">1 cup unsalted butter, softened</li><li onclick="handleItemClick()">¾ cup white sugar</li><li onclick="handleItemClick()">¾ cup brown sugar</li><li onclick="handleItemClick()">2 tsp. vanilla extract</li><li onclick="handleItemClick()">1 egg</li><li onclick="handleItemClick()">1 lb premium quality bittersweet chocolate (see note below) cut into medium-sized chunks.</li><li onclick="handleItemClick()">2 cups walnuts, coarsely chopped (the Supreme Cookie Dude aka Pat, likes big chunks of nuts and lots of!)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_ChocolateChipCookies', '<ol><li onclick="handleItemClick()">About the chocolate: I do not use chocolate chips because IMHO the better the chocolate, the better the cookie.</li><li onclick="handleItemClick()">If I can\'t afford the really good stuff I don\'t make these. I like to use Valhrona bittersweet chocolate that comes</li><li onclick="handleItemClick()">in thin bars (not sure of the weight but the bars are around 6" by 3" and maybe  ½" deep -- I use several) so that</li><li onclick="handleItemClick()">the chocolate is sort of in layers in the cookie. Scharffen Berger, Green and Black\'s dark baking, and Callebaut</li><li onclick="handleItemClick()">all work well. The best buy is from Trader Joe\'s though (sorry, Jen!!!) and it\'s their 1 lb. Plus bars which are</li><li onclick="handleItemClick()">actually made by Callebaut. I use either the 72% (especially if making these cookies for adults) or the Dark</li><li onclick="handleItemClick()">Chocolate (which is closer to semi-sweet and better for kids). But they also have the best price around on</li><li onclick="handleItemClick()">Valhrona too.</li><li onclick="handleItemClick()">In a medium bowl, whisk together flour, oats, baking soda, and salt. In a large mixing bowl, cream together</li><li onclick="handleItemClick()">butter and sugars. Blend in vanilla and egg. Slowly add in the flour mixture until nearly combined. Add in</li><li onclick="handleItemClick()">chocolate chips and nuts and stir by in by hand (this is normally Pat\'s job). It may seem like the dough won\'t</li><li onclick="handleItemClick()">handle all the chocolate and nuts but it does. Drop by rounded tablespoonfuls onto baking sheets (I use one of</li><li onclick="handleItemClick()">those cool cookie scoops that has the releasing mechanism) - you can put them very close together. Refrigerate</li><li onclick="handleItemClick()">for 24 hours or longer (or freeze) then I take out only what I need for one pan at a time and bake on sheets.</li><li onclick="handleItemClick()">These are great to have in the freezer to bake at a moment\'s notice - do not thaw or allow to come to room temp</li><li onclick="handleItemClick()">before baking.</li><li onclick="handleItemClick()">Line baking sheets with parchment paper or use silpat sheets and preheat over to 350o. Bake one sheet at a</li><li onclick="handleItemClick()">time for 7 minutes, then turn sheets around 180o and bake for another 6 minutes until lightly browned. (Your</li><li onclick="handleItemClick()">oven may run hotter or colder than mine but this it what works in mine). Remove pan from the oven but leave</li><li onclick="handleItemClick()">cookies on the paper and slip the paper onto a wire rack to cool. Since there\'s so much chocolate in these and</li><li onclick="handleItemClick()">it\'s in big pieces, if you take the cookies off the paper the chocolate will drip while it\'s still hot.</li></ol>' ] );
