ingredients_array.push( [ 'CostanzoRecipes_Desserts_ChocolateAquafabaMousse', '<ul><li onclick="handleItemClick()">5 ounces chocolate chips (heaping ¾ cup measurement; see notes)</li><li onclick="handleItemClick()">¾ cup aquafaba (liquid from a can of chickpeas)</li><li onclick="handleItemClick()">¼ teaspoon cream of tartar</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_ChocolateAquafabaMousse', '<ol><li onclick="handleItemClick()">Melt the chocolate chips, stirring until smooth. I do this by arranging a heat-safe bowl over a saucepan filled with an inch of water, to make a double-boiler. Bring the water to a boil, and let the steam gently melt the chocolate in the bowl above it.</li><li onclick="handleItemClick()">Once the chocolate is smooth, set it aside to cool and set a timer for 20 minutes. (Do this if you\'re using a stand mixer; if you are going to whip the aquafaba with a hand held electric mixer or you\'re using another variety of bean liquid, you may want to start the next step right away, in case it takes closer to 15 minutes.)</li><li onclick="handleItemClick()">When the timer goes off, pour the aquafaba and cream of tartar into the bowl of your stand mixer. Mix the two together, starting on low and then moving up to the highest speed possible, until the mixture creates a thick white foam that forms "stiff peaks." You should be able to turn the bowl completely upside down with nothing falling out. If you can\'t do that, keep whipping until it happens. This typically takes my stand mixer about 3 minutes when I used canned chickpea liquid. If you use home-cooked chickpea liquid, or the liquid from another type of bean, it can take up to 15 minutes of whipping.</li><li onclick="handleItemClick()">Once you have achieved a fluffy white foam, keep the mixer running on a medium-low speed and pour the melted chocolate into the foam. It\'s normal for the foam to sink a little bit when you add the chocolate, but it should not be liquid-y. Stop and scrape down the sides of the bowl to make sure the melted chocolate gets evenly incorporated.</li><li onclick="handleItemClick()">Depending on the type of chocolate you use, you\'ll either be able to pour the chocolate mousse into 6 small glass dishes, or you\'ll need to use a spoon to scoop it into the serving dishes. (I usually have to use a spoon to scoop it, because it\'s already fluffy.)</li><li onclick="handleItemClick()">Let the mousse chill for at least an hour before serving. I like to top it with fresh berries and a dollop of coconut whipped cream. Leftover mousse can be stored in the fridge, tightly covered, for up to a week.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_ChocolateAquafabaMousse', '<ul><li onclick="handleItemClick()">From <a href="https://detoxinista.com/aquafaba-mousse/" target="_blank">https://detoxinista.com/aquafaba-mousse/</a></li><li onclick="handleItemClick()">date created: [2020-06-02 Tue] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_BrownieBakedOatmeal', '<ul><li onclick="handleItemClick()">2 cups coconut milk</li><li onclick="handleItemClick()">½ cup maple syrup</li><li onclick="handleItemClick()">⅓ cup peanut butter</li><li onclick="handleItemClick()">1 tsp vanilla</li><li onclick="handleItemClick()">2 cups rolled oats</li><li onclick="handleItemClick()">¼ cup cocoa</li><li onclick="handleItemClick()">1 tsp baking powder</li><li onclick="handleItemClick()">1 tbsp flax</li><li onclick="handleItemClick()">pinch of salt</li><li onclick="handleItemClick()">⅓ cup chocolate chips</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_BrownieBakedOatmeal', '<ol><li onclick="handleItemClick()">Preheat oven to 350 F.</li><li onclick="handleItemClick()">Add all wet ingredients to a bowl.</li><li onclick="handleItemClick()">Then add dry ingredients and mix.</li><li onclick="handleItemClick()">Add chocolate chips and mix.</li><li onclick="handleItemClick()">Pour into 6” x 9” pan and bake for 40 minutes.</li><li onclick="handleItemClick()">Enjoy!</li></ol><span class="note">Store in fridge and reheat when you want to eat.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_BrownieBakedOatmeal', 'IsVegan<ul><li onclick="handleItemClick()">From </li><li onclick="handleItemClick()">date created: [2022-07-04 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_BreadPudding', '<ul><li onclick="handleItemClick()">2 eggs</li><li onclick="handleItemClick()">2 cups hot milk</li><li onclick="handleItemClick()">½ cup brown sugar</li><li onclick="handleItemClick()">¼ teasp salt</li><li onclick="handleItemClick()">½ teasp cinnamon</li><li onclick="handleItemClick()">½ teasp vanilla</li><li onclick="handleItemClick()">½ cup raisins</li><li onclick="handleItemClick()">1 Tblspn butter</li><li onclick="handleItemClick()">3 slices bread, cubed</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_BreadPudding', '<ol><li onclick="handleItemClick()">Heat oven to 375 degrees.</li><li onclick="handleItemClick()">In a large bowl, beat eggs. Mix in milk,sugar,salt, cinnamon, vanilla and raisins.</li><li onclick="handleItemClick()">Melt butter and spread around casserole. Add cubed bread. Pour liquid mixture over bread. Bake until brown, at least 40 minutes.</li></ol>' ] );
