ingredients_array.push( [ 'CostanzoRecipes_Desserts_BlueberryZucchiniSnackCakewithLemonButtercream', '<ul><li onclick="handleItemClick()">Prep Time: 20 minutes</li><li onclick="handleItemClick()">Cook Time: 50 minutes</li><li onclick="handleItemClick()">Total Time: 1 hour, 10 minutes</li></ul><ul><li onclick="handleItemClick()">3 large eggs</li><li onclick="handleItemClick()">1 cup vegetable oil</li><li onclick="handleItemClick()">1 Tbsp vanilla extract</li><li onclick="handleItemClick()">2¼ cups sugar</li><li onclick="handleItemClick()">2 cups shredded zucchini</li><li onclick="handleItemClick()">3 cups all purpose flour</li><li onclick="handleItemClick()">1 tsp salt</li><li onclick="handleItemClick()">1 tsp baking powder</li><li onclick="handleItemClick()">¼ tsp baking soda</li><li onclick="handleItemClick()">1 pint blueberries (tossed in 1 tsp flour)</li></ul><ul><li onclick="handleItemClick()">1 cup butter, (2 sticks, 8 ounces) at room temperature</li><li onclick="handleItemClick()">4 cups confectioners\' sugar</li><li onclick="handleItemClick()">juice of one lemon</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_BlueberryZucchiniSnackCakewithLemonButtercream', '<ol><li onclick="handleItemClick()">Set oven to 350F.</li><li onclick="handleItemClick()">Lightly grease and flour a 9x13 baking pan.</li><li onclick="handleItemClick()">Beat the eggs, oil, vanilla and sugar until well blended. Fold in the zucchini.</li><li onclick="handleItemClick()">Whisk the flour, salt, baking powder, and baking soda to combine. Slowly add it to the wet mixture, mixing just enough to blend.</li><li onclick="handleItemClick()">Fold in the blueberries, and pour the batter into the prepared pan.</li><li onclick="handleItemClick()">Bake for about 50 minutes, just until the top is turning golden and a toothpick inserted in the center comes out without wet batter clinging to it.</li><li onclick="handleItemClick()">Cool on a rack.</li><li onclick="handleItemClick()">To make the frosting, put the softened butter into the bowl of a food processor and process until creamy. Add the sifted powdered sugar, one cup at a time, processing till smooth after each addition. After the second cup of sugar add in the lemon juice. Scrape down the sides of the machine as necessary. Adjust the texture by adding a little more lemon or a little more sugar.</li><li onclick="handleItemClick()">Frost the cooled cake and store in the refrigerator.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Desserts_BlueberryZucchiniSnackCakewithLemonButtercream', 'Serves 12' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_BlueberryZucchiniSnackCakewithLemonButtercream', '<ul><li onclick="handleItemClick()">Author: Sue Moran</li><li onclick="handleItemClick()"><a href="https://theviewfromgreatisland.com/blueberry-zucchini-snack-cake-with-lemon-buttercream/" target="_blank">https://theviewfromgreatisland.com/blueberry-zucchini-snack-cake-with-lemon-buttercream/</a></li><li onclick="handleItemClick()">[2019-08-22 Thu] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_BlueberrySauce', '<ul><li onclick="handleItemClick()">½ cups water</li><li onclick="handleItemClick()">½ cup sugar (<i class="conditional-space-after"><b class="conditional-space-after">¼ cup</b></i>)</li><li onclick="handleItemClick()">2 tablespoons fresh lemon juice</li><li onclick="handleItemClick()">2 teaspoons cornstarch</li><li onclick="handleItemClick()">4 pints fresh blueberries</li><li onclick="handleItemClick()">¼ cup red currant (or similar) jelly</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_BlueberrySauce', '<ol><li onclick="handleItemClick()">Bring first 4 ingredients to a boil in a large saucepan, stirring constantly to dissolve sugar and cornstarch.</li><li onclick="handleItemClick()">Add blueberries and jelly.</li><li onclick="handleItemClick()">Bring to boil.</li><li onclick="handleItemClick()">Reduce heat to medium-low; simmer until mixture is slightly thickened and reduced, stirring frequently, about 30 minutes.</li><li onclick="handleItemClick()">Serve warm or at room temperature.</li></ol><span class="tip">May be made 4 days ahead. Cover and chill. Rewarm sauce before serving, if desired.</span><span class="tip">May also be frozen.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_BlueberrySauce', '<ul><li onclick="handleItemClick()">From <a href="https://www.bonappetit.com/recipe/summer-s-best-blueberry-sauce" target="_blank">https://www.bonappetit.com/recipe/summer-s-best-blueberry-sauce</a></li><li onclick="handleItemClick()">date created: [2020-07-05 Sun] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_BlueberryHandPies', '<ul><li onclick="handleItemClick()">2 cups (240g; 8½ ounces) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">¾ teaspoon salt</li><li onclick="handleItemClick()">½ teaspoon baking powder</li><li onclick="handleItemClick()">1 cup (16 tablespoons) cold unsalted butter</li><li onclick="handleItemClick()">½ cup cold sour cream</li><li onclick="handleItemClick()">2 cups blueberries, fresh or frozen</li><li onclick="handleItemClick()">2 tablespoons cornstarch or 1 tablespoon Instant ClearJel (<i class="conditional-space-after"></i>)</li><li onclick="handleItemClick()">⅓ cup sugar</li><li onclick="handleItemClick()">⅛ teaspoon salt (a large pinch)</li><li onclick="handleItemClick()">1 tablespoon lemon juice</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_BlueberryHandPies', '<ol><li onclick="handleItemClick()">First, make the pastry. Gather the first group of ingredients.</li><li onclick="handleItemClick()">Cut the cold butter into small cubes or thin pats. A baker\'s bench knife is ideal for this task.</li><li onclick="handleItemClick()">Whisk together the flour, salt, and baking powder. Add the butter.</li><li onclick="handleItemClick()">Work the butter in, but leave most of it in large, pea-sized pieces. You\'ll have a coarse, crumbly mixture.</li><li onclick="handleItemClick()">Add the sour cream, and stir until the mixture starts to come together in chunks.</li><li onclick="handleItemClick()">Turn it out onto a floured work surface and bring it together with a few quick kneads.</li><li onclick="handleItemClick()">Pat the dough into a rough log. Roll it into an 8" x 10" rectangle. Dust both sides of the dough with flour, and starting with a shorter end, fold it in three like a business letter.</li><li onclick="handleItemClick()">Give the dough a 90 degrees turn on your work surface, and roll it again into an 8" x 10" rectangle. Fold it in three again.</li><li onclick="handleItemClick()">Wrap the dough in plastic wrap or waxed paper. Chill for at least 30 minutes before using.</li></ol><ol><li onclick="handleItemClick()">If you\'re using fresh berries, rinse and drain well. Place fresh or frozen berries in a saucepan. Whisk the cornstarch or ClearJel with the sugar, and pour over the berries. Add the salt and lemon juice, stirring to combine.</li><li onclick="handleItemClick()">Place the saucepan on a burner set to medium-high heat and cook, stirring, until the small amount of liquid in the bottom of the pan comes to a simmer. Reduce the heat to medium and continue to cook, stirring frequently, until the mixture starts to thicken, about 5 minutes.</li><li onclick="handleItemClick()">Transfer the cooked berries to a bowl and let cool to room temperature. It\'s fine to make the filling ahead of time, and refrigerate until you\'re ready to use it.</li></ol><ol><li onclick="handleItemClick()">Preheat the oven to 425 degrees F. place a rack on the middle shelf. Line a baking sheet with parchment paper.</li><li onclick="handleItemClick()">Roll the dough into a 14" x 14" square. With a straight edge and pastry wheel, or a 3½" square cutter, cut out sixteen 3½" squares.</li><li onclick="handleItemClick()">Divide the filling among eight of the squares, using about a heaping tablespoon for each; a slightly heaped tablespoon cookie scoop works well here.</li><li onclick="handleItemClick()">Whisk 1 large egg until frothy. Brush some of the beaten egg along the edges of each filled square.</li><li onclick="handleItemClick()">Use a knife to cut a vent into each of the remaining eight squares; or use a decorative cutter of your choice.</li><li onclick="handleItemClick()">Top each filled square with a vented square, and press along the edges with the tines of a fork to seal.<span class="tip">   If at any time during assembly the pies become sticky and hard to work with, simply refrigerate them for about 20 minutes, until firm.   <i class="conditional-space-after"></i></span><ol><li onclick="handleItemClick()">Brush the top of each pie with the remaining beaten egg and sprinkle with sparkling sugar. The sugar\'s a nice touch: it adds both flavor and crunch.</li></ol></li><li onclick="handleItemClick()">Bake the pies for 18 to 20 minutes, until they\'re a light golden brown. Remove them from the oven.</li><li onclick="handleItemClick()">Let the pies cool for 20 minutes before serving.</li><li onclick="handleItemClick()">Store pies, lightly wrapped, at room temperature for a couple of days; freeze for longer storage (if they last that long!).</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_BlueberryHandPies', '<ul><li onclick="handleItemClick()">courtesy of Nancy Burnett [2017-07-15 Sat] </li><li onclick="handleItemClick()">From Blueberry Hand Pies Bakealong: challenge #12 </li><li onclick="handleItemClick()"><a href="http://blog.kingarthurflour.com/2017/07/03/blueberry-hand-pies-bakealong/" target="_blank">http://blog.kingarthurflour.com/2017/07/03/blueberry-hand-pies-bakealong/</a></li><li onclick="handleItemClick()">Also see <a href="https://docs.google.com/document/d/1k7ZZ-iRT1OjR1yYY2pCiqD6T9xaX6Nr9UzoDJFvCysE/edit#heading=h.gjdgxs" target="_blank">https://docs.google.com/document/d/1k7ZZ-iRT1OjR1yYY2pCiqD6T9xaX6Nr9UzoDJFvCysE/edit#heading=h.gjdgxs</a>.</li><li onclick="handleItemClick()">[2017-08-05 Sat] <ul><li onclick="handleItemClick()">Made them for T\'s breakfast.</li><li onclick="handleItemClick()">The pastry was light and flaky if a wee bit greasy.</li><li onclick="handleItemClick()">I used a heart-shaped cookie cutter for the vent and simply offset the cut-out onto the pastry.</li><li onclick="handleItemClick()">Half of the pies looked really good.</li><li onclick="handleItemClick()">The others: not so much.</li><li onclick="handleItemClick()">The problem was in the final (14x14) rolling: the middle was a bit thick (not much of a problem) but the extremities were very thin and not quite square. This made pulling up those square difficult.</li><li onclick="handleItemClick()">After rolling I did pop them in the refrigerator for ~20 minutes which helped a heck of a lot.</li></ul></li><li onclick="handleItemClick()">[2017-11-11 Sat] <ul><li onclick="handleItemClick()"><b class="conditional-space-after">DO NOT USE WAX PAPER UNDER THE PIES!</b>(They stick!)</li><li onclick="handleItemClick()">I used 4 cups of strawberries, which made me go wild with filling. I think I filled some way too much. Not a help!</li></ul></li><li onclick="handleItemClick()">[2020-05-16 Sat] <ul><li onclick="handleItemClick()">The roll wound up being 14x12, which worked ok. Good pies.</li></ul></li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_BlueberryCrumbBars', '<ul><li onclick="handleItemClick()">Cooking spray</li><li onclick="handleItemClick()">1 cup all-purpose flour</li><li onclick="handleItemClick()">¾ cup old-fashioned rolled oats</li><li onclick="handleItemClick()">½ cup finely chopped almonds</li><li onclick="handleItemClick()">½ cup packed light brown sugar</li><li onclick="handleItemClick()">1 teaspoon ground cinnamon</li><li onclick="handleItemClick()">¼  teaspoon kosher salt</li><li onclick="handleItemClick()">½ cup (1 stick) cold unsalted butter, cut into 8 pieces</li></ul><ul><li onclick="handleItemClick()">2 cups fresh blueberries, washed and dried</li><li onclick="handleItemClick()">¼ cup granulated sugar</li><li onclick="handleItemClick()">1 tablespoon cornstarch</li><li onclick="handleItemClick()">Finely grated zest of 1 medium lemon</li><li onclick="handleItemClick()">Juice of 1 lemon (about 2 tablespoons)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_BlueberryCrumbBars', '<ol><li onclick="handleItemClick()">Arrange a rack in the middle of the oven and heat to 350°F.</li><li onclick="handleItemClick()">Line an 8-inch square baking dish with aluminum foil, leaving overhang on all sides.</li><li onclick="handleItemClick()">Grease the foil lightly with cooking spray; set aside.</li><li onclick="handleItemClick()">Make the crust and topping: Place the flour, oats, almonds, brown sugar, cinnamon, and salt in a large bowl and stir to combine.</li><li onclick="handleItemClick()">Add the butter and, using a pastry cutter or your fingertips, incorporate until no large pieces of butter remain. (The mixture should be crumbly and hold together when squeezed.)</li><li onclick="handleItemClick()">Set aside 1 cup of the mixture.</li><li onclick="handleItemClick()">Transfer the remaining mixture to the prepared baking dish and press it firmly and evenly into the pan to form the crust.</li><li onclick="handleItemClick()">Make the filling: Place the blueberries in a medium bowl.</li><li onclick="handleItemClick()">Add the sugar, cornstarch, and lemon zest and lemon juice and toss gently to combine.</li><li onclick="handleItemClick()">Transfer the mixture to the baking dish and spread into an even layer over the crust.</li><li onclick="handleItemClick()">Sprinkle the reserved 1 cup crumb mixture over the blueberries.</li><li onclick="handleItemClick()">Bake until the filling is bubbling and the top is golden-brown, about 40 minutes.</li><li onclick="handleItemClick()">Let cool at least 2 hours before cutting into bars.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_BlueberryCrumbBars', '<ul><li onclick="handleItemClick()">From <a href="https://www.thekitchn.com/blueberry-crumb-bars-258364#post-recipe-12714" target="_blank">https://www.thekitchn.com/blueberry-crumb-bars-258364#post-recipe-12714</a></li><li onclick="handleItemClick()">date created: [2022-03-12 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_BlueberryCobbler', '<ul><li onclick="handleItemClick()">⅔ cup all-purpose flour</li><li onclick="handleItemClick()">½ cup sugar</li><li onclick="handleItemClick()">1½ teasp baking powder</li><li onclick="handleItemClick()">¼ teasp salt, if desired</li><li onclick="handleItemClick()">⅔ cup skim milk</li><li onclick="handleItemClick()">2 Tbls butter or margarine, melted</li><li onclick="handleItemClick()">2 cups blueberries (clean & wash)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_BlueberryCobbler', '<ol><li onclick="handleItemClick()">In a medium bowl, combine the flour, sugar, baking powder and salt.</li><li onclick="handleItemClick()">Stir in the milk and mix the batter until it is smooth.</li><li onclick="handleItemClick()">Pour the melted butter or margarine into a 1- or 1½-quart casserole-type baking dish.</li><li onclick="handleItemClick()">Pour in the batter, sprinkle the blueberries on top.</li><li onclick="handleItemClick()">Bake the cobbler in a preheated 350° oven for 40 to 45 minutes or until it is lightly browned.</li><li onclick="handleItemClick()">Spoon out the cobbler onto individual dishes to serve.</li><li onclick="handleItemClick()">Makes 5 servings.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_BlueberryCobbler', '<ul><li onclick="handleItemClick()">Jane Brody\'s Good Food Book: Living the High Carbohydrate Way</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
