methods_array.push( [ 'CostanzoRecipes_Desserts_Biscotti', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees.</li><li onclick="handleItemClick()">Combine ingredients with hands. </li><li onclick="handleItemClick()">Add 1 cup toasted whole almonds. Add 3-4 eggs (8 ounces).</li><li onclick="handleItemClick()">Roll dough in sugar, bake 45-60 minutes. Take out, slice, back in oven 5-10 minutes.</li></ol><ul><li onclick="handleItemClick()">Dried figs + candied lemon peel (and ground cardamom)</li><li onclick="handleItemClick()">Cocoa + coffee extract + choc chips</li></ul>' ] );
