ingredients_array.push( [ 'CostanzoRecipes_Desserts_AppleCrisp', '<ul><li onclick="handleItemClick()">4 cups (about 4 medium) apples peeled, cored, cut into ¼-inch slices</li><li onclick="handleItemClick()">⅔ to ¾ cup packed brown sugar</li><li onclick="handleItemClick()">½ cup all-purpose flour</li><li onclick="handleItemClick()">½ cup oats</li><li onclick="handleItemClick()">¾ teaspoon ground cinnamon</li><li onclick="handleItemClick()">¾ teaspoon ground nutmeg</li><li onclick="handleItemClick()">⅓ cup butter</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_AppleCrisp', '<ol><li onclick="handleItemClick()">Preheat oven to 450 degrees.</li><li onclick="handleItemClick()">Arrange apples in a greased square pan 8x8x2 inches.</li><li onclick="handleItemClick()">Mix remaining ingredients and sprinkle over apples.</li><li onclick="handleItemClick()">Bake until topping is golden brown and apples are tender, about 30 minutes.</li><li onclick="handleItemClick()">Serve warm and, if desired, with cream or ice cream.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Desserts_AppleCrisp', '6 servings' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_AppleCrisp', '<ul><li onclick="handleItemClick()">Betty Crocker Cookbook, page 260.</li><li onclick="handleItemClick()">date created: [2020-08-29 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Desserts_AlmondHorns', 'This macaroon type dough is rolled in sliced almonds for a double tasty treat!<ul><li onclick="handleItemClick()">Time:</li><li onclick="handleItemClick()">25 minutes to assemble </li><li onclick="handleItemClick()">20 minutes to chill</li><li onclick="handleItemClick()">12-14 minutes to bake</li></ul><ul><li onclick="handleItemClick()">1 box (7 oz) Odense Almond Paste, grated </li><li onclick="handleItemClick()">¾ cup confectionary sugar </li><li onclick="handleItemClick()">1 large egg (room temperature), separated </li><li onclick="handleItemClick()">1 Tbsp & 2 tsp all purpose flour </li><li onclick="handleItemClick()">1 cup thinly sliced almonds, slightly crushed </li><li onclick="handleItemClick()">4 oz bittersweet chocolate </li><li onclick="handleItemClick()">1 Line cookie sheet with parchment or foil. </li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Desserts_AlmondHorns', '<ol><li onclick="handleItemClick()">In a food processor or with a mixer combine Almond Paste and sugar. Mix until the texture of fine crumbs. Add egg white and flour, reserving yolk. Mix until dough becomes a smooth paste, it will be slightly sticky.</li><li onclick="handleItemClick()">Turn dough out onto a lightly floured surface. With floured hands roll dough into a 12 inch log. Divide into 12 equal pieces and roll into balls. Roll balls between palms into 3 inch logs, slightly tapered at ends.</li><li onclick="handleItemClick()">Spread almonds on a plate. Beat reserved egg yolk with 2 tablespoons of water. Dampen log with beaten yolk. Roll each log in almonds until coated, bending into crescents. Place crescents 2 inches apart on cookie sheet and refrigerate for 20 minutes. Preheat oven to 350 F.</li><li onclick="handleItemClick()">Bake 12 to 14 minutes or until light golden in color. Cool sheet on wire rack for 5 minutes, and loosen crescents with a spatula. Slide parchment off of sheet and back onto wire rack to finish cooling cookies.</li><li onclick="handleItemClick()">Melt chocolate in a double boiler or microwave. Dip cookie ends into melted chocolate. Place back on parchment until chocolate is dry. Layer "Almond Horns" between sheets of wax paper in an airtight container.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Desserts_AlmondHorns', '<ul><li onclick="handleItemClick()">12 cookies</li></ul>' ] );
credits_array.push( [ 'CostanzoRecipes_Desserts_AlmondHorns', '<ul><li onclick="handleItemClick()">From Cathy Petrakis, 31Dec08</li><li onclick="handleItemClick()">date created: [2009-01-01 Thu] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_WafflesVegan', '<ul><li onclick="handleItemClick()">1 cup (120 g) all-purpose flour</li><li onclick="handleItemClick()">1 teaspoon baking powder</li><li onclick="handleItemClick()">1 tablespoon coconut sugar or brown sugar</li><li onclick="handleItemClick()">½ pinch salt</li><li onclick="handleItemClick()">1 cup oat or almond milk</li><li onclick="handleItemClick()">1 tablespoon (15 g) melted coconut oil or canola oil</li><li onclick="handleItemClick()">1 tablespoon unsweetened apple sauce or an additional 1 tablespoon (15 g) melted coconut oil</li><li onclick="handleItemClick()">1 teaspoon natural vanilla extract</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_WafflesVegan', '<ol><li onclick="handleItemClick()">Combine all ingredients for the vegan waffles in a medium bowl.<span class="note">   A tablespoon of coconut oil weighs about 15 grams.</span></li><li onclick="handleItemClick()">Using a hand whisk, stir well until all lumps are removed.<span class="tip">   <i class="conditional-space-after"></i></span></li><li onclick="handleItemClick()">Heat your waffle maker and grease it with coconut oil or canola oil on both sides (top and bottom).</li><li onclick="handleItemClick()">Pour the batter with a ladle into the waffle iron. <i class="conditional-space-after"></i></li><li onclick="handleItemClick()">Close your waffle maker and bake the waffles for about 5 minutes until they\'re golden and crispy on the outside. Don\'t open the waffle maker too early.</li><li onclick="handleItemClick()">Serve the waffles immediately with maple syrup and berries or other fruits. Enjoy!</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_WafflesVegan', 'IsVegan<ul><li onclick="handleItemClick()">From <a href="https://veganheaven.org/recipe/vegan-waffles/" target="_blank">https://veganheaven.org/recipe/vegan-waffles/</a></li><li onclick="handleItemClick()">date created: [2022-07-07 Thu] </li><li onclick="handleItemClick()"><2022-07-07 Thu> Made for T, having substituted an extra tablespoon of coconut oil for the apple sauce I didn’t have. This recipe made 2 waffles. They were good, a bit less crispy than my go-to sourdough waffles and a bit sweeter. Next time, consider using just a tablespoon of brown sugar.</li><li onclick="handleItemClick()"><2022-07-17 Sun> I let them cook a bit longer and they were much crispier. 1 tablespoon of sugar is about right.</li><li onclick="handleItemClick()"><2023-02-11 Sat> I throw in ½ - 1 cup of sourdough discard per recipe</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_StuffedFrenchToast', '<ul><li onclick="handleItemClick()">8 (1-inch thick) slices bread (See Kelly\'s Note)</li><li onclick="handleItemClick()">4 ounces (½ of an 8-oz. package) cream cheese, at room temp</li><li onclick="handleItemClick()">2 teaspoons vanilla extract</li><li onclick="handleItemClick()">1½ teaspoons fresh lemon juice</li><li onclick="handleItemClick()">1 teaspoon grated lemon zest</li><li onclick="handleItemClick()">1½ cups diced strawberries, divided</li><li onclick="handleItemClick()">¾ cup heavy cream</li><li onclick="handleItemClick()">4 large eggs</li><li onclick="handleItemClick()">1 teaspoon cinnamon</li><li onclick="handleItemClick()">1 Tablespoon sugar</li><li onclick="handleItemClick()">Unsalted butter, for cooking</li><li onclick="handleItemClick()">Maple syrup, for serving</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_StuffedFrenchToast', '<ol><li onclick="handleItemClick()">Cut a wide pocket into each slice of bread without cutting all the way through the bread.</li><li onclick="handleItemClick()">In the bowl of a stand mixer fitted with the paddle attachment, beat together the cream cheese, vanilla extract, lemon juice, lemon zest and ½ cup diced strawberries until well combined, about 2 minutes.</li><li onclick="handleItemClick()">Slather a portion of the cream cheese mixture inside each bread pocket and press each bread pocket closed.</li><li onclick="handleItemClick()">In a medium bowl, whisk together the eggs, heavy cream, cinnamon and sugar.</li><li onclick="handleItemClick()">Place a large pan over medium heat and add 2 tablespoons of butter. Once the butter has melted, dip each stuffed slice of toast into the egg mixture on all sides and shake off any excess. Place the bread immediately into the pan and cook until golden, about 2 minutes. Flip once and continue cooking until golden, about 2 minutes. Repeat the coating the cooking process with the remaining slices of bread. (Do not overcrowd the pan.)</li><li onclick="handleItemClick()">Serve the French toast immediately topped with maple syrup and the remaining diced strawberries.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_StuffedFrenchToast', '<a href="http://www.justataste.com/strawberry-cheesecake-stuffed-french-toast-recipe/" target="_blank">http://www.justataste.com/strawberry-cheesecake-stuffed-french-toast-recipe/</a>Any variety of bread will work in this recipe. A few of my favorites include a loaf of sourdough, a French baguette or (extra-thick) Texas toast. Use whatever type of bread you prefer, however stale bread works best for French Toast, as it absorbs the most liquid.<ul><li onclick="handleItemClick()">[2016-07-17 Sun] Made for Colwills, Doris and TC. Good, but <i class="conditional-space-after"></i>too lemony... even though I used about half the zest and none of the lemon juice.</li></ul>' ] );
yields_array.push( [ 'CostanzoRecipes_Breakfast_StuffedFrenchToast', 'PREP: 15 MINUTESCOOK: 5 MINUTESYIELD: 4 SERVINGS' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_SconesVegan', '<ul><li onclick="handleItemClick()">250 g all-purpose flour / 2 cups</li><li onclick="handleItemClick()">1 Tbsp baking powder</li><li onclick="handleItemClick()">2 heaped Tbsp icing sugar or 1 tbsp stevia or erythritol</li><li onclick="handleItemClick()">⅛ tsp nutmeg</li><li onclick="handleItemClick()">¼ tsp salt</li><li onclick="handleItemClick()">50 g packed coconut oil ¼ cup - or extra virgin if you don’t mind coconut taste at room temperature</li><li onclick="handleItemClick()">160 ml coconut milk or almond milk ⅔ cup</li><li onclick="handleItemClick()">1 tsp vanilla</li><li onclick="handleItemClick()">¼ cup chopped dates about 4 medjool dates (optional)</li><li onclick="handleItemClick()">¼ cup chopped toasted almonds 1 handful (optional)</li><li onclick="handleItemClick()">1 cup blueberries (optional)</li><li onclick="handleItemClick()">juice and half the zest from one lemon (optional)</li></ul><ul><li onclick="handleItemClick()">1 tbsp almond milk or coconut milk</li><li onclick="handleItemClick()">1 tsp maple syrup</li><li onclick="handleItemClick()">1 tsp oil</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_SconesVegan', '<ol><li onclick="handleItemClick()">As a first step, sift the flour and baking powder into a large mixing bowl. This helps to get lighter scones but you can skip this step.</li><li onclick="handleItemClick()">Add sugar, nutmeg, and salt and mix to combine.</li><li onclick="handleItemClick()">Chop coconut oil small and then rub into the flour with your fingers until the flour looks pebbly. Do not rush this step or take shortcuts for light, nicely risen scones.</li><li onclick="handleItemClick()">Fold in chopped nuts, fruit or any add-ins. Mix milk and vanilla.</li><li onclick="handleItemClick()">Start adding your nut milk while bringing the dough together. I use a wooden spoon and then just dump everything on my kitchen counter and use my hands. Do not handle the dough too much, just until it’s combined. It does not have to look smooth.</li><li onclick="handleItemClick()">Shape into a disc and place the dough in the fridge on a piece of parchment paper for 15 minutes (no longer than that as the baking powder will lose its power).</li><li onclick="handleItemClick()">Preheat the oven to 425° F / 220° C and prepare a baking tray.</li><li onclick="handleItemClick()">After the dough has had a chance to rest a bit, pat it a bit more, if needed.</li><li onclick="handleItemClick()">Take a sharp kitchen knife and cut your round into 8 wedges with quick movements. Don\'t wiggle the knife around as that inhibits rising</li><li onclick="handleItemClick()">Alternatively, use a round cookie cutter that is 2″ / 5 cm in diameter and cut circles out of the dough. Again, do not twist the cutter, simply apply a lot of pressure to the cutter and then lift the cutter with a scone inside. Place over the baking tray and gently pop the scone out onto the tray. You can dip the cutter in flour and then shake the excess off before cutting, for easy release.</li><li onclick="handleItemClick()">If using a cutter, bring any dough leftovers very gently into a ball and cut out some more – they won’t be as good as the first batch, but if you handle the dough super gently, they will still be very tasty.</li><li onclick="handleItemClick()">Place the scones on the prepared baking tray, making sure there is some space around each one so that they can bake properly. Mix all the glaze ingredients together in a small bowl and glaze the tops of the scones with a pastry brush.</li><li onclick="handleItemClick()">Bake for about 12 minutes or until nicely browned. Most ovens are a bit uneven in their heat distribution. I rotated the tray after 8 minutes so that they are evenly browned on all sides.</li><li onclick="handleItemClick()">Let the scones cool down a little before cutting them in half and filling them with vegan lemon curd and vegan clotted cream or coconut cream.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_SconesVegan', '<ul><li onclick="handleItemClick()">IsVegan</li></ul><ul><li onclick="handleItemClick()">From <a href="https://cinnamonandcoriander.com/en/recipe-for-vegan-scones-with-vegan-clotted-cream/#wprm-recipe-container-11165" target="_blank">https://cinnamonandcoriander.com/en/recipe-for-vegan-scones-with-vegan-clotted-cream/#wprm-recipe-container-11165</a></li><li onclick="handleItemClick()">date created: [2023-04-17 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_SaltedCaramelSauce', '<ul><li onclick="handleItemClick()">1 cup (200g) granulated sugar</li><li onclick="handleItemClick()">6 Tablespoons (90g) salted butter, room temperature cut up into 6 pieces</li><li onclick="handleItemClick()">½ cup (120ml) heavy cream</li><li onclick="handleItemClick()">1 teaspoon salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_SaltedCaramelSauce', '<ol><li onclick="handleItemClick()">Heat granulated sugar in a medium saucepan over medium heat, stirring constantly with a high heat resistant rubber spatula or wooden spoon. Sugar will form clumps and eventually melt into a thick brown, amber-colored liquid as you continue to stir. Be careful not to burn.</li><li onclick="handleItemClick()">Once sugar is completely melted, immediately add the butter. Be careful in this step because the caramel will bubble rapidly when the butter is added.</li><li onclick="handleItemClick()">Stir the butter into the caramel until it is completely melted, about 2 minutes. If you notice the butter separating, remove from heat and vigorously whisk to combine it again. (If you’re nervous for splatter, wear kitchen gloves.)</li><li onclick="handleItemClick()">Very slowly drizzle in ½ cup of heavy cream while stirring. Since the heavy cream is colder than the caramel, the mixture will rapidly bubble when added. Allow the mixture to boil for 1 minute. It will rise in the pan as it boils.</li><li onclick="handleItemClick()">Remove from heat and stir in 1 teaspoon of salt. Allow to slightly cool down before using. Caramel thickens as it cools.</li><li onclick="handleItemClick()">Cover tightly and store for up to 1 month in the refrigerator. Reheat in the microwave or on the stove to desired consistency.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_SaltedCaramelSauce', '<ul><li onclick="handleItemClick()">From <a href="https://sallysbakingaddiction.com/homemade-salted-caramel-recipe/" target="_blank">https://sallysbakingaddiction.com/homemade-salted-caramel-recipe/</a></li><li onclick="handleItemClick()">date created: [2020-01-25 Sat] </li><li onclick="handleItemClick()">[2020-01-25 Sat] I made this for Mom but substituted half-and-half for the cream and it turned out well.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_RaspberryAlmondBakedOatmeal', '<ul><li onclick="handleItemClick()">1 ½ cups rolled oats</li><li onclick="handleItemClick()">1 tsp. ground ginger</li><li onclick="handleItemClick()">½ tsp. salt</li><li onclick="handleItemClick()">¼ cup dry-roasted almonds, coarsely chopped</li><li onclick="handleItemClick()">2 cups of unsweetened almond milk (or milk of choice)</li><li onclick="handleItemClick()">¼ cup honey (or maple syrup)</li><li onclick="handleItemClick()">2 Tbsp olive oil</li><li onclick="handleItemClick()">1 tsp. vanilla</li><li onclick="handleItemClick()">1 cup fresh raspberries + more for topping</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_RaspberryAlmondBakedOatmeal', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees F.</li><li onclick="handleItemClick()">In a large bowl, combine oats, ginger, salt, and chopped almonds.</li><li onclick="handleItemClick()">In a separate bowl, whisk together milk, honey (or maple syrup), oil and vanilla then add to oat mixture, stirring until just combined.</li><li onclick="handleItemClick()">Fold in fresh raspberries or berries of choice.</li><li onclick="handleItemClick()">Spread oat mixture into a prepared 8×8 (or 9×9) baking dish and bake for 30 to 35 minutes until oats have set.</li><li onclick="handleItemClick()">Remove oatmeal from oven and let stand for 10 minutes.</li><li onclick="handleItemClick()">Top with additional fruit and drizzle with a little honey or maple syrup if desired.</li><li onclick="handleItemClick()">Enjoy!</li></ol><span class="tip">To prep this recipe ahead of time, simply mix all of your ingredients together and place in a 8×8 (or 9×9) baking dish, cover and refrigerate overnight.  Then just pop it in the oven and let it bake for 30 to 40 minutes while you get ready for work!</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_RaspberryAlmondBakedOatmeal', '<ul><li onclick="handleItemClick()">From <a href="https://www.eatyourselfskinny.com/raspberry-almond-baked-oatmeal/" target="_blank">https://www.eatyourselfskinny.com/raspberry-almond-baked-oatmeal/</a></li><li onclick="handleItemClick()">(Also see <a href="https://www.keepingthepeas.com/vegan-baked-oatmeal/" target="_blank">https://www.keepingthepeas.com/vegan-baked-oatmeal/</a>for a variation with apples and walnuts; I also added raisins, making it for Vera.)</li><li onclick="handleItemClick()">date created: [2021-02-02 Tue] </li><li onclick="handleItemClick()">[2021-01-31 Sun] Made for T who really liked it. I mixed it up the night before (but, honestly, it\'s not much of a time saver).</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_PumpkinMuffins', '<ul><li onclick="handleItemClick()">Large can solid pumpkin pack (29 oz)</li><li onclick="handleItemClick()">2 c packed brown sugar</li><li onclick="handleItemClick()">2 sticks marg. or butter melted</li><li onclick="handleItemClick()">4 large eggs</li><li onclick="handleItemClick()">½ c apple cider or juice</li><li onclick="handleItemClick()">3 ½ c unbleached all purpose flour</li><li onclick="handleItemClick()">2 tsp baking soda</li><li onclick="handleItemClick()">2 tsp baking powder</li><li onclick="handleItemClick()">1 tsp salt</li><li onclick="handleItemClick()">4 ½ tsp ground cinnamon</li><li onclick="handleItemClick()">4 ½ tsp ground ginger</li><li onclick="handleItemClick()">1 tsp nutmeg</li><li onclick="handleItemClick()">1 tsp ground cloves</li><li onclick="handleItemClick()">1 tsp allspice</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_PumpkinMuffins', '<ol><li onclick="handleItemClick()">Combine pumpkin, sugar and marg/butter in mixing bowl.</li><li onclick="handleItemClick()">Add eggs one at a time and beat until smooth.</li><li onclick="handleItemClick()">Stir in cider/juice.</li><li onclick="handleItemClick()">Sift flour with other dry ingredients.</li><li onclick="handleItemClick()">Gradually add flour mixture to pumpkin mixture.</li><li onclick="handleItemClick()">Bake:<ol><li onclick="handleItemClick()">20-25 minutes at 350 degrees (regular sized muffins)</li><li onclick="handleItemClick()">40-45 minutes at 350 degrees (large sized muffins)</li></ol></li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Breakfast_PumpkinMuffins', 'This recipe makes about 3½ To 4 dozen regular sized muffins using a standard cupcake pan. You might want to cut in half or freeze  half of batter for later. ' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_PumpkinMuffins', 'Mary Malgieri [2018-10-24 Wed] "Also I sprinkle a bit of sugar in the raw on top before baking to give a crispy muffin top."' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_PancakesEggless', '<ul><li onclick="handleItemClick()">1½ cups all-purpose flour</li><li onclick="handleItemClick()">1 tablespoon baking powder</li><li onclick="handleItemClick()">1 tablespoon sugar, optional</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">3 tablespoons melted butter, optional</li><li onclick="handleItemClick()">1¼ cups milk, dairy or non-dairy</li><li onclick="handleItemClick()">1 egg substitute</li></ul><ol><li onclick="handleItemClick()">mix 3 tablespoons warm water with 1 tablespoon ground flax meal. Wait 10 minutes until a gel-like mixture forms.</li><li onclick="handleItemClick()">¼ cup mashed banana</li><li onclick="handleItemClick()">¼ cup canned pumpkin puree</li><li onclick="handleItemClick()">mix 3 tablespoons hot water with 1 tablespoon chia seeds. Wait 10 minutes until a gel-like mixture forms and use that in the recipe.</li><li onclick="handleItemClick()">see package directions for 1 egg. </li></ol>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_PancakesEggless', '<ol><li onclick="handleItemClick()">In a large bowl, combine the flour, baking powder, salt, and sugar (if using). </li><li onclick="handleItemClick()">Select your egg replacer, and once mixed and you’ve waited the amount of time listed, add it to the middle of the bowl. If you’re using canned pumpkin or mashed banana, there’s no waiting.</li><li onclick="handleItemClick()">Add the melted butter, if using, and milk to the bowl. </li><li onclick="handleItemClick()">From the middle, combine the wet ingredients with the dry ingredients, moving outwards to incorporate everything into a cohesive batter. </li><li onclick="handleItemClick()">Preheat a non-stick griddle or non-stick pan to medium-high heat. Grease it with butter or spray, and immediately pour a little less than ¼ cup of batter to form each pancake.</li><li onclick="handleItemClick()">Wait about 2 minutes, until defined edges form and the batter has begun to bubble up at the top to flip. Cook for an additional minute until the tops feel “bouncy” to the touch. </li><li onclick="handleItemClick()">Remove from heat and serve.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_PancakesEggless', '<ul><li onclick="handleItemClick()">From <a href="https://www.laurafuentes.com/pancakes-without-eggs/" target="_blank">https://www.laurafuentes.com/pancakes-without-eggs/</a></li><li onclick="handleItemClick()">date created: [2021-06-12 Sat] </li><li onclick="handleItemClick()">[2021-06-12 Sat] Made for T and Jeff. Pancakes were light and fluffy and we didn\'t notice lack of egg.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_PancakesButtermilk', '<ul><li onclick="handleItemClick()">1 egg</li><li onclick="handleItemClick()">1 cup buttermilk</li><li onclick="handleItemClick()">2 Tblsp shortening (melted) -or- vegetable oil</li><li onclick="handleItemClick()">1 cup (120g) flour</li><li onclick="handleItemClick()">1 Tblsp sugar</li><li onclick="handleItemClick()">1 teasp baking powder</li><li onclick="handleItemClick()">½ teasp baking soda</li><li onclick="handleItemClick()">½ teasp salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_PancakesButtermilk', '<ol><li onclick="handleItemClick()">Beat egg with hand beater until fluffy; beat in remaining ingredients just until smooth. For thinner pancakes, stir in additional ¼ cup milk.</li><li onclick="handleItemClick()">Grease heated griddle if necessary. (To test griddle, sprinkle with few drops water. If bubbles skitter around, heat is just right.)</li><li onclick="handleItemClick()">Pour about 3 tablespoons batter from tip of large spoon or from pitcher onto hot griddle. Cook pancakes until puffed and dry around edges. Turn and cook other sides until golden brown. (To keep pancakes hot, stack on hot plate with paper towel in between.)</li><li onclick="handleItemClick()">About six 4-inch pancakes.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_PancakesButtermilk', '<ul><li onclick="handleItemClick()">Betty Crocker\'s Cookbook</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_PancakesandWafflesSourdough', '<ul><li onclick="handleItemClick()">½ cup (120g) sourdough starter, unfed/discard</li><li onclick="handleItemClick()">1 cups (120g) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">1 tablespoon (14g) sugar</li><li onclick="handleItemClick()">1 cup (227g) buttermilk</li></ul><ul><li onclick="handleItemClick()">all of the overnight sponge</li><li onclick="handleItemClick()">1 large egg</li><li onclick="handleItemClick()">⅛ cup (25g) vegetable oil or melted butter</li><li onclick="handleItemClick()">⅜ teaspoon salt</li><li onclick="handleItemClick()">½ teaspoon baking soda</li></ul><ul><li onclick="handleItemClick()">1 cup (240g) sourdough starter, unfed/discard</li><li onclick="handleItemClick()">2 cups (240g) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">2 tablespoons (28g) sugar</li><li onclick="handleItemClick()">2 cups (454g) buttermilk</li></ul><ul><li onclick="handleItemClick()">all of the overnight sponge</li><li onclick="handleItemClick()">2 large eggs</li><li onclick="handleItemClick()">¼ cup (50g) vegetable oil or melted butter</li><li onclick="handleItemClick()">¾ teaspoon salt</li><li onclick="handleItemClick()">1 teaspoon baking soda</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_PancakesandWafflesSourdough', '<ol><li onclick="handleItemClick()">To make the overnight sponge, stir down your refrigerated starter, and remove this amount your need. Note: This is a good opportunity to feed the remainder, if necessary.</li><li onclick="handleItemClick()">In a large mixing bowl, stir together the unfed starter, flour, sugar, and buttermilk.</li><li onclick="handleItemClick()">Cover and let rest at cool room temperature (about 65°F to 70°F) for about 12 hours, or overnight.</li><li onclick="handleItemClick()">In a small bowl or mixing cup, beat together the eggs, and oil or butter. Add to the overnight sponge.</li><li onclick="handleItemClick()">Add the salt and baking soda, stirring to combine. The batter will bubble.</li><li onclick="handleItemClick()">Pour batter onto your preheated, greased iron, and bake according to the manufacturer\'s instructions.</li><li onclick="handleItemClick()">Serve immediately, to ensure crispness. Or hold in a warm oven till ready to serve.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Breakfast_PancakesandWafflesSourdough', '<ul><li onclick="handleItemClick()">1 dozen 8" waffles or about 2 dozen medium pancakes.</li><li onclick="handleItemClick()">Single recipe makes 3 Belgian style waffles; double make 6.</li></ul>' ] );
