ingredients_array.push( [ 'CostanzoRecipes_Breakfast_PancakesVegan', '<ul><li onclick="handleItemClick()">300 grams sourdough starter (Make sure the sourdough starter is bubbly and active.)</li><li onclick="handleItemClick()">150 grams Flour (plain white or whole-meal)</li><li onclick="handleItemClick()">35 grams sugar (or sugar-free erythritol)</li><li onclick="handleItemClick()">½ tsp baking soda</li><li onclick="handleItemClick()">330 ml tinned coconut milk</li></ul><span class="note">If needed, “feed” the sourdough starter as you usually do and leave it to rise and bubble until doubled in volume. This can take from 2 hours to 8 hours, depending on how warm is your kitchen and how lively is your sourdough.</span><span class="tip">If you have a lot of extra sourdough, but no time to feed, use an extra pinch of baking soda.</span>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_PancakesVegan', '<ol><li onclick="handleItemClick()">Prepare the pancake batter by mixing flour, sugar and baking soda in a bowl.<span class="tip">   You can swap plain white flour with whole-meal flour and replace sugar with the same amount of erythritol, a natural sugar-free sweetener for healthier, sugar-free sourdough pancakes.</span></li><li onclick="handleItemClick()">Then, tip in the sourdough starter and tinned coconut milk.</li><li onclick="handleItemClick()">Whisk all the ingredients into a smooth and pourable pancake batter.</li><li onclick="handleItemClick()">Put a large non-stick skillet on medium heat, and when hot, pour in half a ladle of pancake batter.</li><li onclick="handleItemClick()">Gently tilt the pan around to give the pancake a round shape.</li><li onclick="handleItemClick()">If they fit in the pan, you can cook more pancakes at once; but make sure you leave enough space between them as they spread out a little.</li><li onclick="handleItemClick()">Cook the pancakes until you notice little bubbles appearing on the surface and the bases are golden — about 2 minutes.</li><li onclick="handleItemClick()">Flip the pancakes over with the help of a spatula and cook them for 2 more minutes until golden on both sides.</li><li onclick="handleItemClick()">Keep the prepared pancakes warm under a bowl or in the oven at a low temperature while you finish cooking the others.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_PancakesVegan', 'IsVegan<ul><li onclick="handleItemClick()">From <a href="https://foodaciously.com/recipe/vegan-sourdough-pancakes" target="_blank">https://foodaciously.com/recipe/vegan-sourdough-pancakes</a></li><li onclick="handleItemClick()">date created: [2022-07-04 Mon] </li><li onclick="handleItemClick()"><2022-07-01 Fri> These were good; nearly as good as buttermilk pancakes. They had a strong coconut flavor, so in future I may try substituting some oat milk for half or all the coconut milk.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_PancakeGerman', '<ul><li onclick="handleItemClick()">1 tablespoon butter</li><li onclick="handleItemClick()">½ cup milk</li><li onclick="handleItemClick()">½ cup flour</li><li onclick="handleItemClick()">2 eggs</li><li onclick="handleItemClick()">dash salt</li><li onclick="handleItemClick()">dash cinnamon</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_PancakeGerman', '<ol><li onclick="handleItemClick()">Preheat oven to 425 degrees. While oven is preheating, melt 1 tablespoon butter in 9-inch square pan by putting it in the preheating oven.</li><li onclick="handleItemClick()">In large bowl, using a wire whisk, beat together: ½ cup milk, ½ cup flour, 2 eggs, dash salt and dash cinnamon.</li><li onclick="handleItemClick()">Pour batter into 9-inch square pan that has the melted butter. Put it back in the oven.</li><li onclick="handleItemClick()">Bake for 12-15 minutes.</li><li onclick="handleItemClick()">Serve with powdered sugar or syrup. (Some people like to put lemon juice on it as well as the powdered sugar.)</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_PancakeGerman', '<ul><li onclick="handleItemClick()"><a href="http://www.cooks.com/rec/doc/0,165,130177-249195,00.html" target="_blank">http://www.cooks.com/rec/doc/0,165,130177-249195,00.html</a></li><li onclick="handleItemClick()">date created: [2009-03-23 Mon] </li></ul>Three recipes fit into deep dish pan.' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_OvernightOats', '<ul><li onclick="handleItemClick()">2 cups (200 g) old-fashioned rolled oats</li><li onclick="handleItemClick()">2 cups (524 g) dairy milk or unsweetened non-dairy milk</li><li onclick="handleItemClick()">1 cup (285 g) plain Greek or non-dairy yogurt</li><li onclick="handleItemClick()">3 (60 g) tablespoons maple syrup or honey</li><li onclick="handleItemClick()">1 tablespoon chia seeds (optional)</li><li onclick="handleItemClick()">¼ teaspoon ground cinnamon</li><li onclick="handleItemClick()">¼ teaspoon kosher salt</li><li onclick="handleItemClick()">Optional toppings: fruits, nuts, seeds, nut butter</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_OvernightOats', '<ol><li onclick="handleItemClick()">Place all the ingredients in a large bowl.</li><li onclick="handleItemClick()">Stir together until well combined.</li><li onclick="handleItemClick()">Cover and refrigerate overnight. You can divide the oats into individual jars at this point if desired. Cover and refrigerate for at least 4 hours, preferably overnight.</li><li onclick="handleItemClick()">Stir again before serving with desired toppings.</li></ol>' ] );
