ingredients_array.push( [ 'CostanzoRecipes_Breakfast_OatmealRaisinPancakeswithCinnamonSourCream', 'Recipe courtesy of Gourmet MagazineServes: 14 (4-inch) pancakes<ul><li onclick="handleItemClick()">1 cup old fashion oats</li><li onclick="handleItemClick()">1 cup all-purpose flour</li><li onclick="handleItemClick()">¼ cup (packed) light brown sugar</li><li onclick="handleItemClick()">2 teaspoons baking powder</li><li onclick="handleItemClick()">½ teaspoon baking soda</li><li onclick="handleItemClick()">½ teaspoon cinnamon</li><li onclick="handleItemClick()">1⅔ cups buttermilk</li><li onclick="handleItemClick()">2 large eggs</li><li onclick="handleItemClick()">4 tablespoons unsalted butter, melted</li><li onclick="handleItemClick()">½ teaspoon pure vanilla extract</li><li onclick="handleItemClick()">1 cup plump raisins</li><li onclick="handleItemClick()">Cinnamon Sour cream, recipe follows</li><li onclick="handleItemClick()">Maple syrup for topping</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_OatmealRaisinPancakeswithCinnamonSourCream', '<ol><li onclick="handleItemClick()">In a medium bowl, whisk together the oats, flour, brown sugar, baking powder, baking soda, and cinnamon. </li><li onclick="handleItemClick()">In another bowl, whisk together buttermilk, eggs, melted butter and vanilla, blend thoroughly. </li><li onclick="handleItemClick()">Pour the liquid ingredients over the dry ingredients and mix with the whisk until just combined. Don\'t worry if the batter is a bit lumpy. </li><li onclick="handleItemClick()">With a rubber spatula gently fold in the raisins. The batter will thicken as it stands. </li><li onclick="handleItemClick()">If necessary, lightly butter, oil, or spray your griddle or skillet. Preheat over medium heat or if using an electric griddle set to 350 degrees F. If you want to hold the pancakes until serving time preheat your oven to 200 degrees F.</li><li onclick="handleItemClick()">Spoon ¼ cup of batter onto griddle for each pancake, allowing space for spreading, and use a spatula or the back of your spoon to lightly press the batter into rounds.</li><li onclick="handleItemClick()">When the underside of the pancake are golden and the tops are speckled with bubbles that pop and stay open, flip over with a wide spatula and cook on the other side until light brown.</li><li onclick="handleItemClick()">Serve immediately or place in oven while you make the rest of the batch.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_OatmealRaisinPancakeswithCinnamonSourCream', '<ul><li onclick="handleItemClick()">date created: [2009-04-19 Sun] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_OatBranMuffinstxt', 'Gourmet | January 2011by Ian Knauer<ul><li onclick="handleItemClick()">active time: 20 min</li><li onclick="handleItemClick()">total time:	 40 min</li><li onclick="handleItemClick()">Equipment: a muffin pan with 12 (½-cup) muffin cups</li></ul><ul><li onclick="handleItemClick()">2 cups all-purpose flour</li><li onclick="handleItemClick()">¾ cup oat bran</li><li onclick="handleItemClick()">¼ cup sugar</li><li onclick="handleItemClick()">2 teaspoons baking powder</li><li onclick="handleItemClick()">¾ teaspoons baking soda</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">½ teaspoon cinnamon</li><li onclick="handleItemClick()">1 cup well-shaken buttermilk</li><li onclick="handleItemClick()">⅓ cup mild honey</li><li onclick="handleItemClick()">½ stick unsalted butter, melted and cooled</li><li onclick="handleItemClick()">2 large eggs</li><li onclick="handleItemClick()">1 cup golden raisins</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_OatBranMuffinstxt', '<ol><li onclick="handleItemClick()">Preheat oven to 375 degrees F with rack in middle. Butter muffin pan.</li><li onclick="handleItemClick()">Whisk together flour, oat bran, sugar, baking powder, baking soda, salt, and cinnamon in a large bowl.</li><li onclick="handleItemClick()">In a separate bowl, whisk together buttermilk, honey, butter, and eggs. Add to dry ingredients along with raisins and stir until just combined.</li><li onclick="handleItemClick()">Divide batter among muffin cups. Bake until a wooden pick inserted into center of a muffin comes out clean, about 20 minutes. Turn out onto a rack to cool.</li><li onclick="handleItemClick()">Cooks\' note: Muffins keep in an airtight container at room temperature 3 days.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_OatBranMuffinstxt', '<ol><li onclick="handleItemClick()">Epicurious.com Unknown type: ’entity’Conde Nast Digital, Inc. All rights reserved.</li><li onclick="handleItemClick()"><a href="http://www.epicurious.com/recipes/food/printerfriendly/Golden-Raisin-Oat-Bran-Muffins-357450" target="_blank">http://www.epicurious.com/recipes/food/printerfriendly/Golden-Raisin-Oat-Bran-Muffins-357450</a>?</li><li onclick="handleItemClick()">27-Mar-14</li></ol>' ] );
