ingredients_array.push( [ 'CostanzoRecipes_Breakfast_LemonBlueberryScones', '<ul><li onclick="handleItemClick()">1 cup (125g) all-purpose flour (spoon & leveled), plus more for hands and work surface</li><li onclick="handleItemClick()">3 Tablespoons (37.5g) granulated sugar</li><li onclick="handleItemClick()">½ Tablespoon fresh lemon zest (about ½ lemon)</li><li onclick="handleItemClick()">1 and ¼ teaspoons baking powder</li><li onclick="handleItemClick()">¼ teaspoon salt</li><li onclick="handleItemClick()">¼ cup (½ stick; 57.5g) unsalted butter, frozen</li><li onclick="handleItemClick()">¼ cup (60ml) heavy cream (plus 1 Tbsp for brushing)</li><li onclick="handleItemClick()">½ large egg</li><li onclick="handleItemClick()">¾ teaspoons pure vanilla extract</li><li onclick="handleItemClick()">½ heaping cup (90g) fresh or frozen blueberries (do not thaw)</li><li onclick="handleItemClick()">for topping: coarse sugar</li></ul><ul><li onclick="handleItemClick()">2 cups (250g) all-purpose flour (spoon & leveled), plus more for hands and work surface</li><li onclick="handleItemClick()">6 Tablespoons (75g) granulated sugar</li><li onclick="handleItemClick()">1 Tablespoon fresh lemon zest (about 1 lemon)</li><li onclick="handleItemClick()">2 and ½ teaspoons baking powder</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">½ cup (1 stick; 115g) unsalted butter, frozen</li><li onclick="handleItemClick()">½ cup (120ml) heavy cream (plus 2 Tbsp for brushing)</li><li onclick="handleItemClick()">1 large egg</li><li onclick="handleItemClick()">1½ teaspoons pure vanilla extract</li><li onclick="handleItemClick()">1 heaping cup (180g) fresh or frozen blueberries (do not thaw)</li><li onclick="handleItemClick()">for topping: coarse sugar</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_LemonBlueberryScones', '<ol><li onclick="handleItemClick()">Whisk flour, sugar, lemon zest, baking powder, and salt together in a large bowl. Grate the frozen butter using a box grater. Add it to the flour mixture and combine with a pastry cutter, two forks, or your fingers until the mixture comes together in pea-sized crumbs. See video above for a closer look at the texture. Place in the refrigerator or freezer as you mix the wet ingredients together.</li><li onclick="handleItemClick()">Whisk ½ cup heavy cream, the egg, and vanilla extract together in a small bowl. Drizzle over the flour mixture, add the blueberries, then mix together until everything appears moistened.</li><li onclick="handleItemClick()">Pour onto the counter and, with floured hands, work dough into a ball as best you can. Dough will be sticky. If it’s too sticky, add a little more flour. If it seems too dry, add 1-2 more Tablespoons heavy cream. Press into an 8-inch disc and, with a sharp knife or bench scraper, cut into 8 wedges (or 4 if making a Single Recipe).</li><li onclick="handleItemClick()">Brush scones with remaining heavy cream and for extra crunch, sprinkle with coarse sugar. (You can do this before or after refrigerating in the next step.)</li><li onclick="handleItemClick()">Place scones on a plate or lined baking sheet (if your fridge has space!) and refrigerate for at least 15 minutes.</li><li onclick="handleItemClick()">Meanwhile, preheat oven to 400°F (204°C).</li><li onclick="handleItemClick()">Line a large baking sheet with parchment paper or silicone baking mat. After refrigerating, arrange scones 2-3 inches apart on the prepared baking sheet(s).</li><li onclick="handleItemClick()">Bake for 22-25 minutes or until golden brown around the edges and lightly browned on top. Remove from the oven and cool for a few minutes before topping with lemon icing.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>Make the icing: Whisk 1 cup (120g) confectioners’ sugar and 3 Tablespoons fresh lemon juice (about 1 large lemon) together. Drizzle over warm scones.</li><li onclick="handleItemClick()">Leftover iced or un-iced scones keep well at room temperature for 2 days or in the refrigerator for 5 days.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_LemonBlueberryScones', 'Favorite<ul><li onclick="handleItemClick()">From <a href="https://sallysbakingaddiction.com/glazed-lemon-blueberry-scones/" target="_blank">https://sallysbakingaddiction.com/glazed-lemon-blueberry-scones/</a></li><li onclick="handleItemClick()">date created: [2021-03-28 Sun] </li><li onclick="handleItemClick()">[2021-03-28 Sun] Made for second time, this time with no Lilly White flour -- King Arthur All Purpose instead. Just as light and fluffy on the inside and crispy on the outside.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_LaurenGrovemansBagels', '<ul><li onclick="handleItemClick()">3 to 4 tablespoons unsalted butter, melted, for brushing</li><li onclick="handleItemClick()">2 cups tepid water or any combination of slightly warmed milk and water to equal 2 cups, plus ¼ cup tepid water, for yeast</li><li onclick="handleItemClick()">3 rounded tablespoons (40.9 grams) solid vegetable shortening</li><li onclick="handleItemClick()">1 package (7 grams) active dry yeast</li><li onclick="handleItemClick()">2 tablespoons sugar or 1 tablespoon sugar and 1 tablespoon liquid (not dry) barley malt extract, plus ¼ cup sugar for when boiling the bagels</li><li onclick="handleItemClick()">1 tablespoon fine table-salt</li><li onclick="handleItemClick()">1 to 2 teaspoons freshly ground black pepper, optional</li><li onclick="handleItemClick()">Up to 6 cups (720 grams) high-gluten flour, including flour for dusting.<ul><li onclick="handleItemClick()">I prefer to use "super-gluten" flour, which I purchase at my neighborhood pizza place.</li><li onclick="handleItemClick()">If unavailable, use a supermarket brand of bread flour.</li></ul></li><li onclick="handleItemClick()">For the boiling water bath: Boiling water, as needed, ¼ cup granulated sugar and 1 teaspoon baking soda</li><li onclick="handleItemClick()">Glaze: 2 egg whites, at room temperature, lightly beaten with 1 teaspoon water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_LaurenGrovemansBagels', '<ol><li onclick="handleItemClick()">Brush the interior of a 5-quart mixing bowl with melted butter and set aside for rising the dough.</li><li onclick="handleItemClick()">To assemble liquid mixture: If using milk, heat in a medium-sized saucepan over medium-low heat until just warm throughout. Pour the milk into a large mixing bowl and add shortening and ½ cup lukewarm water. (If the milk became too hot, let it cool until just warm.) If not using milk, pour the 2 cups lukewarm water into a mixing bowl and add the shortening (no need to melt). Dissolve the yeast in ¼ cup lukewarm water with a pinch of the sugar. When yeast is creamy and starts to bubble, add to mixing bowl with 2 tablespoons of the sugar or the barley malt extract, salt and black pepper, if using.</li><li onclick="handleItemClick()">To complete and knead the dough: Briskly stir in enough flour, a cup or so at a time, to make dough that is not easily stirred in the bowl. Turn out the dough onto a floured wooden board and knead in a brisk push, fold and turning motion, until smooth and elastic, about 5 minutes. Add only as much additional flour as necessary to keep dough from sticking to your hands and work surface. As always, use a pastry scraper while kneading to scrape dough off the board cleanly as you continue to knead in a sufficient amount of flour.</li><li onclick="handleItemClick()">To rise the dough: Place the dough in the buttered bowl. Brush top of the dough with more melted butter, and then cover with buttered plastic wrap and a clean kitchen towel. Let rise in a warm, draft-free spot for 1 hour (or up to 2½ hours for an extremely light and flavorful bagel). Uncover bowl and punch down dough with several swift swats with the back of your hand. Recover bowl and refrigerate dough for 4 hours or, preferably, overnight (and up to two days!!).</li><li onclick="handleItemClick()">To set up for shaping bagels: Position the rack to the lower third of the oven.<ol><li onclick="handleItemClick()">If using a large pizza stone, place it on the oven rack and sprinkle a baker\'s peel generously with cornmeal and, if desired, a combination of seeds (poppy, sesame and caraway).</li><li onclick="handleItemClick()">Otherwise, brush or spray a large dark steel shallow baking sheet with vegetable oil and sprinkle the interior as described above. Place an (empty) heat proof pan on the rack underneath the tiles or stone.</li><li onclick="handleItemClick()">Preheat oven to 500 degrees F at least 30 minutes before you plan to shape, boil and bake bagels. (If working with a double oven, preheat the second oven as well). Pour the prepared egg-white glaze through a small medium-mesh sieve into another bowl to remove excess coagulation. Set the glaze next to your work surface. While the oven preheats, bring one or two large pots of water to a rapid boil. Lay a clean kitchen towel on each of 2 shallow trays or baking sheets (for 10 bagels) and sprinkle the towels lightly with flour.</li></ol></li><li onclick="handleItemClick()">To shape bagels: Remove the dough from the refrigerator. Punch the chilled dough down, with several swift blows, until totally deflated. Turn dough out onto a lightly floured board. Using the blade of a pastry scraper, divide the dough in half. I recommend baking only 5 bagels at a time (per oven) so each has enough space around it to bake properly. If not working with a double oven, place half of dough back in bowl, cover and refrigerate. Divide each half of dough into 5 equal pieces (for 10 in all). You\'ll work with 1 piece at a time, keeping the remaining pieces covered with a towel. Shape one piece of dough into a very tight, round ball by drawing dough up and pinching it at the top. Keep pinching and pulling upward, always keeping ball on a lightly floured board to prevent sticking. The ball should be perfectly round with the exception of a little knot of pinched dough on top. Turn ball (knot side down) and flatten gently. Push your index finger through the center of dough (right where the knot was). Gently stretch the hole, while being careful not to tear the rim, until hole measures about 2 to 2½ inches in diameter (the hole will shrink after rising and baking). As each bagel is shaped, place it on the prepared towel-lined trays spaced 2 inches apart. Cover bagels with another clean towel.</li><li onclick="handleItemClick()">To boil the bagels: Add ¼ cup sugar and the baking soda to the pot of boiling water. Bring 1 tray of risen bagels over to the stove and carefully lower 2 to 4 bagels into the water (one at a time). Bagels should be able to sit freely in the water without touching and will expand in the water. Once the bagels rise to the top of the pot, continue to boil for 1½ to 2 minutes on each side, turning with a large round slotted skimmer or a large slotted spoon. After bagels have cooked on the second side, remove them with spatula (draining water) and drain on a kitchen towel (smoothest side up). Repeat with the remaining bagels</li><li onclick="handleItemClick()">To glaze and top the bagels:  Place bagels (again, smoothest side up) on the prepared baker\'s peel or baking sheet. Using a pastry brush, paint boiled bagels with egg-white glaze. Don\'t worry if the glazed bagels seem wrinkled; this will smooth in the oven. When all of the bagels have been boiled and positioned on the peel or baking sheet, brush tops and sides of bagels once more with glaze. Sprinkle the desired toppings on each bagel or just glaze and leave plain. (Try not to let the glaze fall into puddles around bagels or into hole as this makes bagel dough stick to the peel. (Having the egg whites at room temperature and straining, helps remove their clumsy gelatinous quality.)</li><li onclick="handleItemClick()">To bake the bagels: Just before baking, place the ice cubes and a few tablespoons water into a cup and pour this into the pan that sits below the baker\'s stone. If using tiles, place baker\'s peel all the way to the back of the hot oven and with a swift jerk; remove the peel, leaving the bagels on the hot tiles (or place baking sheet on hot oven rack). Reduce oven temperature to 450 degrees F and bake for ~25 minutes (If working with a convection oven, bake the bagels at 450 for 20 minutes. Keep the rest of the instructions the same.); turn oven off and allow bagels to sit there for 5 minutes. Open oven and allow bagels to sit in oven for 5 minutes more. Remove bagels to wire racks when uniformly golden and crisp. Cool thoroughly before storing.</li><li onclick="handleItemClick()">To prepare the oven for the remaining batch of bagels (if not using a double oven): Before reheating the oven to 500 degrees F, sweep away any excess cornmeal and seeds from the tiles and onto a baking sheet to discard, using a cornmeal sweeper. (This is to prevent burning and smoking.) Preheat the oven, boil, and glaze, top and bake remaining bagels as described above.)</li><li onclick="handleItemClick()">To store: Store cooled bagels to be served on the day of baking in a paper bag. Store the remaining bagels in a jumbo-sized, heavy-duty plastic bag, at room temperature. Bagels also freeze well in well-sealed freezer bags. To thaw, remove from the freezer the night before and allow bagels to thaw, overnight, in the sealed bag.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_LaurenGrovemansBagels', '<a href="http://www.laurengroveman.com/recipes/breads/homemade-bagels/" target="_blank">http://www.laurengroveman.com/recipes/breads/homemade-bagels/</a>From Sarah\'s friend Kristen[2019-01-27 Sun] Made for brunch at Jan and Dan\'s with Nancy and Pat. Overall, pleased with the results.<ul><li onclick="handleItemClick()">I added about 1 Tbsp of gluten to the flour.</li><li onclick="handleItemClick()">I let the dough rise for about 2.5 hours and then put it in the refrigerator for the rest of the day.</li><li onclick="handleItemClick()">I formed the bagels just before going to bed.</li><li onclick="handleItemClick()">In the morning, I took the bagels from the refrigerator; they had puffed a bit and closed the hole somewhat. I used two chopsticks to open the hole and kept them covered and out for 2 hours.</li><li onclick="handleItemClick()">At bath time, I boiled water and added 4 Tbsps of non-diastatic malt. Big mistake! It boiled over all over the stove. I should take it down to a simmer.</li><li onclick="handleItemClick()">After the bath, instead of drying the bagels on towels, I used racks for the first few. Mistake: they are highly impressionable. Towels on top of racks is fine.</li><li onclick="handleItemClick()">I baked them on the pizza stone, using convection for 20 minutes with a pan of boiling water. Then 5 minutes with the oven off and the door closed, then 5 minutes with the door open before letting them cool on the rack.<ul><li onclick="handleItemClick()">They were good, but I\'d like them to be a bit crispier.</li><li onclick="handleItemClick()">Perhaps I ought to remove the pan half-way through?</li></ul></li></ul>[2016-09-23 Fri] : Modifications:<ul><li onclick="handleItemClick()">I used 1 cup water + 1 cup milk<ul><li onclick="handleItemClick()">Should try 1.5 cup water + .5 cup milk</li></ul></li><li onclick="handleItemClick()">I added 1.5 tablespoons gluten flour.<ul><li onclick="handleItemClick()">Should cut back to 1 tablespoon.</li></ul></li><li onclick="handleItemClick()">I added (slightly more than) 1 tablespoon diastatic malt powder.<ul><li onclick="handleItemClick()">Should try molasses or, better yet, malt syrup.</li></ul></li><li onclick="handleItemClick()">Some say each bagel ought to weigh between 2.5 - 3 oz (70 - 85 grams), but others liked them in the 120-140 gram range.<ul><li onclick="handleItemClick()">I used ~130g and this was the right size! I got 10 good-sized bagels out of this recipe.</li></ul></li><li onclick="handleItemClick()">In the morning, let dough warm for about an hour(!). Then after forming the bagels, let them rise for another 1 hour.<ul><li onclick="handleItemClick()">This seems crucial!</li></ul></li><li onclick="handleItemClick()"><a href="https://cookingupastory.com/authentic-east-coast-bagels" target="_blank">https://cookingupastory.com/authentic-east-coast-bagels</a></li><li onclick="handleItemClick()">I\'m not sure how long I baked them (T did a Google Hangout from Chicago in the middle and I never set the timer). It was probably a bit shy of 20 minutes, but the exteriors were as brown as I\'d want them. They were a bit doughy in the middle, but the exterior was great: crisp and just a tad chewy.</li><li onclick="handleItemClick()">I had pre-heated the oven to 500 degrees for an hour (made some granola in it, which worked fine) then turned down to 450 degrees before I baked.<ul><li onclick="handleItemClick()">I should probably have turned it down sooner.</li></ul></li><li onclick="handleItemClick()">I attempted to use a SilPat: a mistake. I couldn\'t easily get the SilPat off the peel onto the stone. I wound up putting the bagels directly on the stone (sans corn meal) and they stuck and oozed.<ul><li onclick="handleItemClick()">Next time: use parchment!</li></ul></li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_IrishScones', '<ul><li onclick="handleItemClick()">2½ cup flour</li><li onclick="handleItemClick()">¼ cup rolled oats</li><li onclick="handleItemClick()">1 tsp. cream of tartar</li><li onclick="handleItemClick()">1 tsp. baking soda</li><li onclick="handleItemClick()">2 Tbsp. sugar</li><li onclick="handleItemClick()">¼ cup butter</li><li onclick="handleItemClick()">1 cup raisins (alternate is a mix of pecans, chocolate chips and zest of one orange)</li><li onclick="handleItemClick()">1 cup buttermilk</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_IrishScones', '<ol><li onclick="handleItemClick()">Preheat oven to 425.  Mix dry ingredients in a large bowl.  Cut in butter with a pastry blender until the mixture resembles coarse crumbs.  Add the raisins and mix slightly.  Pour milk until dry ingredients are moistened.  Turn out onto a lightly floured surface.  Using your hands, form into an approximately 9" circle.  Cut into 8 wedges.  Place on ungreased baking sheet and bake 12-15 minutes or until golden brown.  Serve hot with butter or jam.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_IrishScones', '<ul><li onclick="handleItemClick()">From Jan Holms 26 Feb 07</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_GreatGranola', '<ul><li onclick="handleItemClick()">¼ cup butter</li><li onclick="handleItemClick()">¼ cup (85 grams) honey</li><li onclick="handleItemClick()">3 cup rolled oats</li><li onclick="handleItemClick()">1 cup sunflower seeds</li><li onclick="handleItemClick()">1½ teaspoon cinnamon</li><li onclick="handleItemClick()">1 cup nuts (almonds are nice)</li><li onclick="handleItemClick()">1 cup shredded and/or flaked coconut</li><li onclick="handleItemClick()">½ cup wheat germ and/or flax seed</li><li onclick="handleItemClick()">⅔ cup raisins</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_GreatGranola', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees.</li><li onclick="handleItemClick()">In a large oven-proof 9x13 inch baking pan, melt butter and stir in honey.</li><li onclick="handleItemClick()">Add the oats, seeds, cinnamon and nuts. Bake for 15 minutes, stirring occasionally.</li><li onclick="handleItemClick()">Add coconut, wheat germ and/or flax seed. Bake for 10 minutes longer, or until the mixture is lightly browned.</li><li onclick="handleItemClick()">Remove granola from the oven, stir in raisins and cool granola completely before transferring to a storage container.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_GreatGranola', '<ul><li onclick="handleItemClick()">Jan Brody\'s Good Food Book -- Living the High-Carbohydrate Way</li><li onclick="handleItemClick()">page 508</li><li onclick="handleItemClick()">27-March-2011</li><li onclick="handleItemClick()">date created: [2011-03-27 Sun] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_GingerbreadGranola', '<ul><li onclick="handleItemClick()">293 g rolled oats (GF for gluten-free eaters)</li><li onclick="handleItemClick()">193 g raw nuts (I used almonds, pecans, and a few walnuts)</li><li onclick="handleItemClick()">37 g organic cane sugar (or sub extra molasses or maple syrup mixed in with wet ingredients)</li><li onclick="handleItemClick()">¼ tsp sea salt</li><li onclick="handleItemClick()">1½ tsp ground cinnamon</li><li onclick="handleItemClick()">¾ tsp ground ginger</li><li onclick="handleItemClick()">1 pinch ground cloves (optional)</li></ul><ul><li onclick="handleItemClick()">60 ml coconut or olive oil</li><li onclick="handleItemClick()">80 ml maple syrup (sub agave, or honey if not vegan)</li><li onclick="handleItemClick()">30 ml molasses</li><li onclick="handleItemClick()">1 tsp vanilla extract (optional)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_GingerbreadGranola', '<ol><li onclick="handleItemClick()">Preheat oven to 325 degrees F (162 C).</li><li onclick="handleItemClick()">Mix the dry ingredients together in a large bowl.</li><li onclick="handleItemClick()">In a small saucepan over medium low heat, warm the coconut oil, maple syrup, molasses and vanilla extract. Pour over the dry ingredients and mix well.</li><li onclick="handleItemClick()">Spread the mixture evenly onto a a large baking sheet and bake for 18–22 minutes, stirring near the halfway point to ensure even cooking. The coconut oil will help this granola crisp up nicely, but be sure to watch it carefully as it browns quickly.</li><li onclick="handleItemClick()">Once the granola is visibly browned (about 19 minutes for me), remove from the oven and let cool completely on the pan before storing. Consider turning the oven off and leaving the pan in it for the granola to get extra crispy.</li><li onclick="handleItemClick()">Keep in a container that has an air-tight seal and it should keep for a few weeks.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Breakfast_GingerbreadGranola', '10½-cup servings' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_GingerbreadGranola', '<ul><li onclick="handleItemClick()"><a href="https://minimalistbaker.com/gingerbread-granola/" target="_blank">https://minimalistbaker.com/gingerbread-granola/</a></li><li onclick="handleItemClick()">date created: [2019-12-02 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_FruitandNutMuffins', 'By Kim Carlson, from the Culinate Kitchen collectionAlthough I used to be a fan of super-sweet and cakey muffins, that\'sno longer the case. But I still love the little package that a muffinrepresents-- it\'s an easy snack.I came up with this recipe, and although it contains only a relativelylittle sugar, the fruit adds plenty of sweetness.I hope you\'ll experiment with the amount of sugar you like.Serve these muffins with butter and honey -- or not.<ul><li onclick="handleItemClick()">1 	cup whole-wheat pastry flour</li><li onclick="handleItemClick()">1 	cup unbleached all-purpose flour</li><li onclick="handleItemClick()">¼ 	cup sugar (or less; see Note)</li><li onclick="handleItemClick()">1 	tsp. baking powder</li><li onclick="handleItemClick()">½ 	tsp. baking soda</li><li onclick="handleItemClick()">½ 	tsp. salt</li><li onclick="handleItemClick()">2 	large eggs</li><li onclick="handleItemClick()">½ 	cup low-fat buttermilk</li><li onclick="handleItemClick()">¼ 	cup canola oil</li><li onclick="handleItemClick()">1 	cup ripe bananas, mashed</li><li onclick="handleItemClick()">1 	cup frozen blueberries</li><li onclick="handleItemClick()">½ 	cup chopped and toasted nuts, such as hazelnuts (optional)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_FruitandNutMuffins', '<ol><li onclick="handleItemClick()">Preheat the oven to 350 degrees. Line a 12-muffin pan with paper   baking cups.</li><li onclick="handleItemClick()">Combine the flours, sugar, baking powder, baking soda, and salt in   a large mixing bowl.</li><li onclick="handleItemClick()">Whisk together the eggs, buttermilk, and oil in a 4-cup glass   measuring cup with a pour spout or a medium bowl. Stir in the   mashed bananas.</li><li onclick="handleItemClick()">Pour the wet ingredients into the dry ingredients and, using a   rubber spatula, stir just until blended. Fold in the blueberries   and nuts.</li><li onclick="handleItemClick()">Fill the muffin cups ¾ full (add more batter to each cup if you   have extra). Bake for 20 minutes, then check to see if the muffins   are browning. If they need more time, bake 5 minutes longer.</li><li onclick="handleItemClick()">Cool for 10 minutes before serving, or serve at room temperature.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Breakfast_FruitandNutMuffins', '' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_FruitandNutMuffins', '<ul><li onclick="handleItemClick()">I\'ve made these muffins with just two tablespoons of sugar and  without any sugar at all. Both options are good.</li><li onclick="handleItemClick()">This content is from the Culinate Kitchen collection:</li><li onclick="handleItemClick()"><a href="http://www.culinate.com/recipes/collections/Culinate+Kitchen/Breakfast/fruit_and_nut_muffins/print" target="_blank">http://www.culinate.com/recipes/collections/Culinate+Kitchen/Breakfast/fruit_and_nut_muffins/print</a></li><li onclick="handleItemClick()">28-Mar-2011</li><li onclick="handleItemClick()">date created: [2011-03-28 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_CrispyOvenRoastedBreakfastPotatoes', '<ul><li onclick="handleItemClick()">2 pounds new potatoes (or other small potato)</li><li onclick="handleItemClick()">1 tablespoon salt (for water)</li><li onclick="handleItemClick()">1 teaspoon baking soda</li><li onclick="handleItemClick()">⅓ cup olive oil</li><li onclick="handleItemClick()">< ½ teaspoon salt</li><li onclick="handleItemClick()">1 teaspoon pepper</li><li onclick="handleItemClick()">½ to 1 teaspoon each of the following spices: Turmeric, cayenne pepper, garlic powder, fajita seasoning, smoked paprika</li><li onclick="handleItemClick()">1 finely chopped jalapeno pepper, optional</li><li onclick="handleItemClick()">½ finely chopped red bell pepper, optional</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_CrispyOvenRoastedBreakfastPotatoes', '<ol><li onclick="handleItemClick()">Preheat oven to 450F.</li><li onclick="handleItemClick()">Wash potatoes - but don\'t peel. Cut potato into fourths, or into bite-sized pieces.</li><li onclick="handleItemClick()">Bring large pot of water to a boil, adding the salt and baking soda. Once water is boiling, add potato chunks. Boil for about 5 to 6 minutes, until potatoes are fork tender. Remove from heat and drain.</li><li onclick="handleItemClick()">In a large bowl, combine olive oil and spices. Add cooked potatoes and toss to ensure even coating.</li><li onclick="handleItemClick()">Place potatoes on a large baking sheet. Place in oven and bake for 20 minutes. Remove from oven and use a spatula to gently move potatoes around and unstick any stuck potatoes, to ensure even roasting.</li><li onclick="handleItemClick()">Return potatoes to oven and roast for an additional 30 to 40 minutes, until potatoes are cooked to your liking.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_CrispyOvenRoastedBreakfastPotatoes', '<ul><li onclick="handleItemClick()"><a href="https://www.cheaprecipeblog.com/wp-json/mv-create/v1/creations/5/print" target="_blank">https://www.cheaprecipeblog.com/wp-json/mv-create/v1/creations/5/print</a></li><li onclick="handleItemClick()">date created: [2020-01-18 Sat] </li><li onclick="handleItemClick()">[2020-01-19 Sun] Made for brunch with Mom, Lucille and John. Good, crispy. Used Penzy\'s Turkish spice.</li><li onclick="handleItemClick()">[2021-09-26 Sun] Made for brunch with Heimburgs. These potatoes are good. But they <i class="conditional-space-after"></i>spicy. Consider going lighter on the cayenne if there are non-spice lovers.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_CrepesWithVanillaCreamSauceBobEvans', '<ul><li onclick="handleItemClick()">⅞ cup milk</li><li onclick="handleItemClick()">2 whole (small) eggs</li><li onclick="handleItemClick()">1 tablespoon vanilla extract</li><li onclick="handleItemClick()">¾ cups all-purpose flour</li><li onclick="handleItemClick()">1 tablespoon sugar</li><li onclick="handleItemClick()">¼ teaspoon salt</li><li onclick="handleItemClick()">2.5 tablespoons melted butter</li></ul><ul><li onclick="handleItemClick()">4 ounces cream cheese, room temperature (soft)</li><li onclick="handleItemClick()">¼ cup powdered sugar (or to taste)</li><li onclick="handleItemClick()">2 tablespoons butter, melted</li><li onclick="handleItemClick()">½ teaspoon vanilla extract</li><li onclick="handleItemClick()">⅛ cup sour cream</li><li onclick="handleItemClick()">¼ cup heavy cream (a little thinner than pudding, add until it is thin enough to just drip)</li></ul><ul><li onclick="handleItemClick()">1¾ cups milk</li><li onclick="handleItemClick()">3 whole eggs</li><li onclick="handleItemClick()">2 tablespoons vanilla extract</li><li onclick="handleItemClick()">1½ cups all-purpose flour</li><li onclick="handleItemClick()">2 tablespoons sugar</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">5 tablespoons melted butter</li></ul><ul><li onclick="handleItemClick()">8 ounces cream cheese, room temperature (soft)</li><li onclick="handleItemClick()">½ cup powdered sugar (or to taste)</li><li onclick="handleItemClick()">4 tablespoons butter, melted</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li><li onclick="handleItemClick()">¼ cup sour cream</li><li onclick="handleItemClick()">½ cup heavy cream (a little thinner than pudding, add until it is thin enough to just drip)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_CrepesWithVanillaCreamSauceBobEvans', '<ol><li onclick="handleItemClick()">In a blender mix together the milk, eggs and vanilla.</li><li onclick="handleItemClick()">Stir in the flour, sugar, salt and melted butter until well blended.</li><li onclick="handleItemClick()">Heat a crepe pan or a good non stick 8" pan over medium heat until hot.</li><li onclick="handleItemClick()">Lightly coat with a tiny bit of olive oil.</li><li onclick="handleItemClick()">Pour ¼ cup of batter into the pan and tip pan to spread the batter evenly. When bubbles form on the top and the edges are dry, flip over and cook until lightly browned, it will have a lacy look.</li><li onclick="handleItemClick()">Place crepes on parchment papaer or wax paper to seperate each one.</li><li onclick="handleItemClick()">Fill crepes with the Vanilla Cream Sauce.</li></ol><ol><li onclick="handleItemClick()">Mix all ingredients for Vanilla Cream Sauce together.</li><li onclick="handleItemClick()">Spoon into center of crepe and fold over seam side down.</li><li onclick="handleItemClick()">Top with fresh fruit of choice. I like to also drizzle a lil bit of the vanilla cream sauce on top to keep blueberries from rolling off the crepes!</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_CrepesWithVanillaCreamSauceBobEvans', '<ul><li onclick="handleItemClick()">From <a href="https://www.food.com/recipe/crepes-with-vanilla-cream-sauce-bob-evans-467362" target="_blank">https://www.food.com/recipe/crepes-with-vanilla-cream-sauce-bob-evans-467362</a></li><li onclick="handleItemClick()">date created: [2020-01-25 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_CranberryMuffins', 'Preheat oven to <b class="conditional-space-after">400 degrees</b>.<ul><li onclick="handleItemClick()">⅔ cup sugar</li><li onclick="handleItemClick()">1¾ cup flour</li><li onclick="handleItemClick()">1 Tblsp baking powder</li><li onclick="handleItemClick()">dash salt</li><li onclick="handleItemClick()">1 Tblsp grated orange zest</li><li onclick="handleItemClick()">1	egg</li><li onclick="handleItemClick()">1 cup buttermilk</li><li onclick="handleItemClick()">⅓ cup vegetable oil</li><li onclick="handleItemClick()">½ cup rinsed cranberries</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_CranberryMuffins', '<ol><li onclick="handleItemClick()">Mix together:<ul><li onclick="handleItemClick()">sugar</li><li onclick="handleItemClick()">flour</li><li onclick="handleItemClick()">baking powder</li><li onclick="handleItemClick()">salt</li></ul></li><li onclick="handleItemClick()">In another bowl, whisk together:<ul><li onclick="handleItemClick()">orange zest</li><li onclick="handleItemClick()">egg</li><li onclick="handleItemClick()">buttermilk</li><li onclick="handleItemClick()">vegetable oil</li></ul></li><li onclick="handleItemClick()">Mix cranberries into dry ingredients. Pour into liquid mixture and stir.</li><li onclick="handleItemClick()">Spoon into paper-lined muffin tin about ⅔ full.</li><li onclick="handleItemClick()">Bake at 400 degrees for 25 minutes.</li></ol>' ] );
