ingredients_array.push( [ 'CostanzoRecipes_Breakfast_ClaridgesScones', '<ul><li onclick="handleItemClick()">11½	ounces (330 g.) plain flour, plus extra for dusting</li><li onclick="handleItemClick()">2¼	ounces (60 g.) caster sugar</li><li onclick="handleItemClick()">1½	tablespoons baking powder</li><li onclick="handleItemClick()">¼	teaspoon salt</li><li onclick="handleItemClick()">3¼	ounces cold unsalted butter, cubed</li><li onclick="handleItemClick()">2½	ounces (70 g.) raisins (optional)</li><li onclick="handleItemClick()">3¾	ounces (fluid ounce) (110 ml.) buttermilk</li><li onclick="handleItemClick()">3	ounces (fluid ounce) (90 ml.) milk</li><li onclick="handleItemClick()">1	beaten with a pinch of salt, for the egg wash</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_ClaridgesScones', '<ol><li onclick="handleItemClick()">In a large bowl, combine the flour, sugar, baking powder and salt, then add the butter and rub into the flour mixture with your fingers until you have a fine crumb (you could also pulse this five to six times in a food processor to achieve the same sandy texture, but it’s almost as fast to work by hand).</li><li onclick="handleItemClick()">If you’re making raisin scones, stir the raisins in now.</li><li onclick="handleItemClick()">Transfer to a smaller container, cover and leave to rest in the refrigerator overnight, or until thoroughly chilled.</li><li onclick="handleItemClick()">The next morning, preheat the oven to 475 degrees Fahrenheit (240 degrees Celsius), Gas Mark 9.</li><li onclick="handleItemClick()">Transfer the butter and flour mixture to the standing mixer. Slowly mix in the buttermilk and milk until the dough comes together.</li><li onclick="handleItemClick()">On a lightly floured surface, roll out the dough to form a circle, about 8 inches (21 cm.) in diameter and ¾ inch (2 cm.) thick, then cut out 12 scones using the pastry cutter. Transfer the scones to the prepared baking tray.</li><li onclick="handleItemClick()">Using a pastry brush, carefully brush the tops with the egg wash. We like to let our scones sit out for 20 minutes at room temperature to give the baking powder a chance to activate before we bake them.</li><li onclick="handleItemClick()">Bake until evenly golden, about 12–13 minutes. Leave to cool for 5 minutes, then serve warm.</li><li onclick="handleItemClick()">To serve: We strongly suggest serving these only on the day of baking. Leftover scones can be frozen and will remain good for up to three weeks: as needed, defrost completely, then reheat in a preheated 350 degree Fahrenheit (180 degree Celsius), Gas Mark 4 oven for 3 minutes.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Breakfast_ClaridgesScones', 'Makes: 12 small scones Prep time: 4 hrs 40 min Cook time: 12 min' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_ClaridgesScones', '<a href="https://food52.com/recipes/80618-claridge-s-scones" target="_blank">https://food52.com/recipes/80618-claridge-s-scones</a>[2019-03-17 Sun] : Made for TC. The batter was <i class="conditional-space-after"></i>sticky. I couldn\'t think of slicing the dough, so I used a biscuit cutter to roughly shape and move a bit of dough to the pan. The cutter I used was too large (4"?) so I lowered the heat to 450 degrees, but the scones turned out fine. (I did have them spend a bit of time on convection to crisp them up.) I also sprinkled with some coarse sugar. Oh yeah, and half of the flour I used was <a href="https://www.whitelily.com/white-lily-biscuits" target="_blank">https://www.whitelily.com/white-lily-biscuits</a>. And oh yeah, instead of raisins, I threw some frozen blueberries in. The dough turned purple, but it was ok.' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_CastIronSourdoughPancakes', '<ul><li onclick="handleItemClick()">½ to 1 cup sourdough starter</li><li onclick="handleItemClick()">2 cups all-purpose flour</li><li onclick="handleItemClick()">2 cups whole milk</li><li onclick="handleItemClick()">3 eggs</li><li onclick="handleItemClick()">1 teaspoon baking soda</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">1 tablespoon sugar</li><li onclick="handleItemClick()">1 tablespoon butter, plus more for serving</li><li onclick="handleItemClick()">3 to 4 peeled and sliced pears (you could also use sliced apples, peaches or strawberries, or whole blueberries)</li><li onclick="handleItemClick()">Maple syrup, for serving</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_CastIronSourdoughPancakes', '<ol><li onclick="handleItemClick()">Mix sourdough starter with flour and milk, then let it sit out at room temperature, covered with a cloth, overnight and up to 24 hours.</li><li onclick="handleItemClick()">Stir well, and transfer a scant cup of this mixture into a plastic container with lid or glass jar to store in the fridge, for another batch of pancakes.</li><li onclick="handleItemClick()">Whisk the eggs, baking soda, salt and sugar into the rest of the fermented flour and milk. The batter will loosen and take on the thick, airy liquid texture of a milkshake. If the batter seems a little too stiff, add a splash of milk.</li><li onclick="handleItemClick()">Preheat the oven to 450°, with a cast-iron skillet inside the oven. (You can use a 4-inch pan for individual pancakes or an 8-inch pan for a larger pancake, which can be cut to share.)</li><li onclick="handleItemClick()">When the pan is hot, remove it, and swirl in 1 tablespoon butter until melted, then add a thin layer of fruit, so that you can still see some parts of the bottom of the pan.</li><li onclick="handleItemClick()">If using firm fruits like apples or pears, place the pan on medium heat on the stove top, and let the fruit sizzle for a minute or two until it has softened on its edges, then add batter. If using softer fruits or berries, add the batter right away. Add enough batter to totally cover the fruit and make a substantial pancake about a half-inch in thickness.</li><li onclick="handleItemClick()">Return pan to oven for 15 minutes, or until the top of the pancake is evenly browned and the edges are crisp.</li><li onclick="handleItemClick()">Flip pancake onto a plate fruit-side up, and serve hot with another knob of butter on top and a generous glug of maple syrup.</li><li onclick="handleItemClick()">Repeat with remaining batter.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_CastIronSourdoughPancakes', '<ul><li onclick="handleItemClick()">From <a href="https://cooking.nytimes.com/recipes/1018663-cast-iron-sourdough-pancakes" target="_blank">https://cooking.nytimes.com/recipes/1018663-cast-iron-sourdough-pancakes</a></li><li onclick="handleItemClick()">date created: [2023-02-15 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_ButtermilkSyrup', '<ul><li onclick="handleItemClick()">½ cup unsalted butter</li><li onclick="handleItemClick()">1 cup sugar</li><li onclick="handleItemClick()">1 cup buttermilk</li><li onclick="handleItemClick()">2 teaspoons vanilla</li><li onclick="handleItemClick()">1 tablespoon Light karo syrup</li><li onclick="handleItemClick()">½ teaspoon baking soda</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_ButtermilkSyrup', '<ol><li onclick="handleItemClick()">In a large pot or saucepan over medium heat add the butter, sugar, buttermilk, vanilla and karo syrup. Heat until everything is well combined and bring to a boil.  </li><li onclick="handleItemClick()">Quickly remove the pot from the heat and add the baking soda, place back over the heat, stirring constantly. The syrup will grow large and threaten to boil over which is why a large pot is essential. If it gets too close to the edge remove from the burner and continue stirring to bring it down. </li><li onclick="handleItemClick()">Stir for 30 seconds over the heat (I often just take mine off so I don\'t risk boiling over) and serve immediately. </li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_ButtermilkSyrup', '<a href="http://www.ohsweetbasil.com/buttermilk-syrup.html" target="_blank">http://www.ohsweetbasil.com/buttermilk-syrup.html</a>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_ButtermilkSconeswithRaisins', 'By Donna Pilato, About.com<ul><li onclick="handleItemClick()">It\'s difficult to picture a tea party that doesn\'t have at least one scone on the menu. Here is a simple recipe for buttermilk scones that turn out fluffy and buttery in absolutely no time. They\'re best served warm from the oven, but are still pretty tasty the following day.</li><li onclick="handleItemClick()">Prep Time: 15 minutes</li><li onclick="handleItemClick()">Cook Time: 15 minutes</li></ul><ul><li onclick="handleItemClick()">1¾ cups all-purpose flour</li><li onclick="handleItemClick()">1 teaspoon sugar</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">2 teaspoons baking powder</li><li onclick="handleItemClick()">½ teaspoon baking soda</li><li onclick="handleItemClick()">5 tablespoons unsalted butter, room temperature</li><li onclick="handleItemClick()">½ cup raisins</li><li onclick="handleItemClick()">¾ cup buttermilk, or slightly more as needed</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_ButtermilkSconeswithRaisins', '<ol><li onclick="handleItemClick()">Preparation:</li><li onclick="handleItemClick()">Preheat the oven to 450 degrees.</li><li onclick="handleItemClick()">Mix thoroughly the flour, sugar, salt, baking powder and baking soda in a large bowl with a whisk or spoon.</li><li onclick="handleItemClick()">Cut in the butter until the mixture resembles coarse meal. Stir in the raisins. Using a large spoon, blend in buttermilk until a soft dough forms.</li><li onclick="handleItemClick()">Place dough on a floured board and roll out to ½ inch thickness. Using a sharp knife, cut dough into six squares, then cut each square again on the diagonal. Place triangles on ungreased baking sheet. Bake for 10 to 12 minutes until golden brown.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Breakfast_ButtermilkSconeswithRaisins', '' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_ButtermilkSconeswithRaisins', '<ol><li onclick="handleItemClick()"><a href="http://entertaining.about.com/od/recipesandmenus/r/buttermilkscone.htm" target="_blank">http://entertaining.about.com/od/recipesandmenus/r/buttermilkscone.htm</a></li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_BlueberryButtermilkMuffins', '<ul><li onclick="handleItemClick()">1 cup buttermilk</li><li onclick="handleItemClick()">½ cup butter or margarine -- melted</li><li onclick="handleItemClick()">2 eggs -- beaten</li><li onclick="handleItemClick()">2½ cups all-purpose flour</li><li onclick="handleItemClick()">1 cup sugar</li><li onclick="handleItemClick()">2½ teaspoons baking powder</li><li onclick="handleItemClick()">¼ teaspoon salt</li><li onclick="handleItemClick()">1½ cup Fresh Or Frozen Blueberries</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_BlueberryButtermilkMuffins', '<ol><li onclick="handleItemClick()">In small bowl, combine buttermilk, butter and eggs until blended. In large bowl, combine flour, sugar, baking powder and salt. Make well in center. Add buttermilk mixture, stirring until flour mixture is just moistened. Fold in blueberries. Spoon batter into greased muffin cups, filling ⅔ full. Bake in preheated 400 degree oven 20 minutes or until tops are golden and wooden pick inserted in center comes out clean. Remove from pan. Serve warm or cool on wire rack.</li><li onclick="handleItemClick()">This recipe for Blueberry Buttermilk Muffins serves/makes 18</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_BlueberryButtermilkMuffins', '<ul><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_BestButtermilkWaffles', '<ul><li onclick="handleItemClick()">2½ c. flour</li><li onclick="handleItemClick()">½ tsp. salt</li><li onclick="handleItemClick()">2 c. buttermilk</li><li onclick="handleItemClick()">8 tbsp. melted butter or shortening</li><li onclick="handleItemClick()">1 tsp. baking soda</li><li onclick="handleItemClick()">2 tsp. baking powder</li><li onclick="handleItemClick()">4 eggs, separated</li><li onclick="handleItemClick()">1 tsp. vanilla extract</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_BestButtermilkWaffles', '<ol><li onclick="handleItemClick()">Mix dry ingredients.</li><li onclick="handleItemClick()">Add egg yolks to milk and blend well.</li><li onclick="handleItemClick()">Add dry ingredients, mix together.</li><li onclick="handleItemClick()">Add melted butter and beat with a few quick strokes, fold in beaten egg whites.</li><li onclick="handleItemClick()">Bake in waffle iron until golden.</li><li onclick="handleItemClick()">Can add fruits such as blueberries, strawberries, chopped apple and   nuts for variety. </li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Breakfast_BestButtermilkWaffles', '' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_BestButtermilkWaffles', '<ul><li onclick="handleItemClick()"><a href="http://www.cooks.com/rec/doc/0,165,155184-228202,00.html" target="_blank">http://www.cooks.com/rec/doc/0,165,155184-228202,00.html</a></li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_BestBranMuffins', '<ul><li onclick="handleItemClick()">1 cup whole wheat flour</li><li onclick="handleItemClick()">1 tsp baking soda</li><li onclick="handleItemClick()">½ tsp salt</li><li onclick="handleItemClick()">1½ c. wheat bran</li><li onclick="handleItemClick()">3 Tbls	butter (or oil)</li><li onclick="handleItemClick()">2 Tbls	brown sugar</li><li onclick="handleItemClick()">2 Tbls	molasses</li><li onclick="handleItemClick()">1	egg</li><li onclick="handleItemClick()">1½ c.	buttermilk</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_BestBranMuffins', '<ol><li onclick="handleItemClick()">Preheat oven to 375 degrees. Grease pan.</li><li onclick="handleItemClick()">Sift flour, soda and salt together. Stir in the bran.</li><li onclick="handleItemClick()">Beat butter or oil and sugar and molasses together. Add egg and buttermilk. Mix dry ingredients into liquids. Place in the pan, about ¾ full. Bake muffins 15 to 20 minutes; or a loaf for about 30 minutes.</li><li onclick="handleItemClick()">Alternative: use a 3" x 7" loaf. Makes a nice tea bread.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_BestBranMuffins', '<ul><li onclick="handleItemClick()">from The Laurel\'s Kitchen Bread Book: A Guide to Whole-Grain Breadmaking, pg 333</li><li onclick="handleItemClick()">28 March 2009</li><li onclick="handleItemClick()">date created: [2009-03-28 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_BelgianWaffles', '' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_BelgianWaffles', '<ol><li onclick="handleItemClick()">Combine in large bowl:<ul><li onclick="handleItemClick()">2 c.	all purpose flour</li><li onclick="handleItemClick()">2 T.	sugar</li><li onclick="handleItemClick()">¾	t salt</li><li onclick="handleItemClick()">½	t active dry yeast</li></ul></li><li onclick="handleItemClick()">Whisk into dry ingredients:<ul><li onclick="handleItemClick()">½ c.	 unsalted butter, melted</li><li onclick="handleItemClick()">2 c.	 whole milk</li></ul></li><li onclick="handleItemClick()">Cover and let sit overnight, covered on counter. Next morning, add:<ul><li onclick="handleItemClick()">3	eggs, separated</li></ul></li><li onclick="handleItemClick()">Whisk yolks, whip whites to soft peaks and gently fold into batter.</li><li onclick="handleItemClick()">Cook for 3 minutes.</li><li onclick="handleItemClick()">Makes 10-12 waffles</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_BelgianWaffles', '<ul><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_BaronBagels', '<ul><li onclick="handleItemClick()">1 teaspoon active dry yeast</li><li onclick="handleItemClick()">1⅔ cups lukewarm water</li><li onclick="handleItemClick()">5 cups (600 grams) bread flour</li><li onclick="handleItemClick()">2 teaspoons salt, plus more for boiling</li><li onclick="handleItemClick()">1 tablespoon diastatic malt powder</li><li onclick="handleItemClick()">¼ cup poppy seeds, optional</li><li onclick="handleItemClick()">¼ cup sesame seeds, optional</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_BaronBagels', '<ol><li onclick="handleItemClick()">Put the yeast in the bowl of a standing mixer. Add 1⅔ cups lukewarm water and allow the yeast to activate, about 5 minutes. Add flour, salt and malt powder and mix at low speed for 5 minutes using the paddle attachment. Cover the dough and allow to rise at room temperature for about 2 hours.</li><li onclick="handleItemClick()">Punch the dough down and shape into a rough rectangle about 1 to 1½ inches thick, and about 2 times longer than it is wide. If you are having trouble forming the dough, stretch it, wait for the gluten to relax and reform.</li><li onclick="handleItemClick()">Cut the dough into 10 pieces of about 3 ounces each. Roll each into an 8-inch-long snakelike shape, tapering the dough at each end. Circle the dough around your hand, pinching the ends together and rolling under your palm once or twice to seal. Put the bagels on a Silpat or other nonstick baking sheet on top of a jellyroll pan. Cover well with plastic wrap and refrigerate for about 10 hours, or up to 24 hours.</li><li onclick="handleItemClick()">Heat the oven to 425 degrees. If you have a baking stone or brick you use for baking, put it on a rack near the bottom of the oven; it will retain heat and produce a crisper bagel. Bring a large pot of water to boil, throw a handful of salt into the boiling water and remove the bagels from the refrigerator.</li><li onclick="handleItemClick()">Using your hands, carefully place just enough bagels into the pot to cover the surface of the water, making sure that there are no bagels resting on top of one another. Let them float on one side for about 30 seconds before flipping them to the other side for another 30 seconds or so. Remove the bagels and drain well on a cooling rack.</li><li onclick="handleItemClick()">Pour poppy or sesame seeds into a bowl wider than the bagels. Working very quickly, remove the bagels one by one and dip them into the topping. Place them back on the Silpat-covered baking sheet, topping side down.</li><li onclick="handleItemClick()">Bake on the second to highest shelf of the oven for about 7 minutes. Then flip the bagels and continue baking for about 8 minutes, or until they are golden brown.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_BaronBagels', '<a href="http://cooking.nytimes.com/recipes/1014445-baron-bagels" target="_blank">http://cooking.nytimes.com/recipes/1014445-baron-bagels</a><ol><li onclick="handleItemClick()">Replaced about 40g of flour with high gluten flour.</li><li onclick="handleItemClick()">I diced a small jalapeño into two of the bagels and sprinkled locatelli on them too. They tasted good</li><li onclick="handleItemClick()">Baking: stone on the bottom shelf, cooked on the top. I baked for 7 minutes on one side and then about 10 on the other, the last 3 with speed bake (since they weren\'t browning). But they were underdone in the middle.</li><li onclick="handleItemClick()">Next time should be 7 minutes on one side, 7 minutes on the other, then speed bake for 2 minutes then flip for 2 minutes.</li><li onclick="handleItemClick()">These were not good bagels: tasted ok, but were quite gummy, even after toasting. I think I used <i class="conditional-space-after"></i>too much gluten; perhaps a tablespoon or two next time?</li></ol>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_BananaMuffins', '<ul><li onclick="handleItemClick()">½ c shortening, melted (I use butter)</li><li onclick="handleItemClick()">1 c less 1 Tablespoon sugar</li><li onclick="handleItemClick()">2 eggs</li><li onclick="handleItemClick()">1 c mashed ripe bananas</li><li onclick="handleItemClick()">2 c flour</li><li onclick="handleItemClick()">2 tsp baking powder</li><li onclick="handleItemClick()">1 tsp baking soda</li><li onclick="handleItemClick()">½ tsp. salt</li><li onclick="handleItemClick()">3 T (butter)milk</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_BananaMuffins', '<ol><li onclick="handleItemClick()">Preheat oven to 400 degrees (I use 375 degrees). Grease muffin cups.</li><li onclick="handleItemClick()">In mixing bowl, cream butter and sugar.</li><li onclick="handleItemClick()">Beat in eggs.</li><li onclick="handleItemClick()">Add bananas.</li><li onclick="handleItemClick()">Beat thoroughly.</li><li onclick="handleItemClick()">Combine dry ingredients.</li><li onclick="handleItemClick()">Stir into banana mixture alternately with milk.</li><li onclick="handleItemClick()">Spoon batter into muffin cups, filling them two-thirds full.</li><li onclick="handleItemClick()">Bake in preheated oven for 20 to 25 min.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Breakfast_BananaMuffins', 'Makes 12 muffins.' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_BananaMuffins', '<ul><li onclick="handleItemClick()">date created: [2009-06-23 Tue] </li><li onclick="handleItemClick()">from America Cooks via Mary Jane Legere 2009-06-23</li><li onclick="handleItemClick()">[2019-04-12 Fri] I made for Kate, et. al with buttermilk instead of milk, used 4 bananas and sprinkled a bit of coarse sugar on top. Very desserty, but a hit!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_BakedFrenchToast', '<ul><li onclick="handleItemClick()">1 large day old bread loaf like brioche, challah, crusty sourdough or French bread, see notes</li><li onclick="handleItemClick()">6 whole eggs</li><li onclick="handleItemClick()">1 cup whole milk</li><li onclick="handleItemClick()">½ cup heavy whipping cream</li><li onclick="handleItemClick()">2 tablespoons real maple syrup</li><li onclick="handleItemClick()">1 tablespoon vanilla extract</li><li onclick="handleItemClick()">¾ teaspoon ground cinnamon</li><li onclick="handleItemClick()">⅛ teaspoon ground cardamom</li><li onclick="handleItemClick()">⅛ teaspoon fresh grated nutmeg</li><li onclick="handleItemClick()">¼ teaspoon fine sea salt</li><li onclick="handleItemClick()">2 tablespoons butter plus more for greasing pan</li><li onclick="handleItemClick()">Optional toppings: Maple syrup, honey, powdered sugar and fresh berries</li></ul><ul><li onclick="handleItemClick()">1 tablespoon granulated sugar</li><li onclick="handleItemClick()">½ teaspoon ground cinnamon</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_BakedFrenchToast', '<ol><li onclick="handleItemClick()">Grease a 9-inch by 13-inch baking dish with butter and set aside.</li><li onclick="handleItemClick()">Slice the bread into thick slices (½-inch to 1-inch thick). Cut each bread slice in half, making two triangles.</li><li onclick="handleItemClick()">In a large bowl, whisk the eggs, milk, cream, maple syrup, vanilla, cinnamon, cardamom, nutmeg, and salt until combined.</li><li onclick="handleItemClick()">Quickly dip each slice of bread into the milk mixture and place into the baking dish, arranging each slice so that they are angled and overlap slightly (like roof shingles).</li><li onclick="handleItemClick()">When all the bread slices are arranged in the baking dish, pour the remaining milk mixture over the top of the bread. Cover the dish with aluminum foil and refrigerate at least 30 minutes and up to overnight.</li></ol><ol><li onclick="handleItemClick()">Heat the oven to 350° Fahrenheit (175°C).</li><li onclick="handleItemClick()">Bake the French toast, still covered, for 30 minutes.</li><li onclick="handleItemClick()">After 30 minutes, make the cinnamon/sugar topping by stirring 1 tablespoon of sugar and ½ teaspoon cinnamon together.</li><li onclick="handleItemClick()">Melt 2 tablespoons of butter, uncover the French toast and then slowly pour the melted butter over the top, trying to cover most of the bread slices.</li><li onclick="handleItemClick()">Scatter the cinnamon sugar over the bread, and then bake, uncovered, until the tips of the bread are golden brown and the bread looks puffed, about 10 minutes.</li><li onclick="handleItemClick()">Cool for 5 minutes</li><li onclick="handleItemClick()">Cut into 8 squares, and serve with your favorite toppings.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_BakedFrenchToast', '<ul><li onclick="handleItemClick()">From <a href="https://www.inspiredtaste.net/44190/baked-french-toast/#itr-recipe-44190" target="_blank">https://www.inspiredtaste.net/44190/baked-french-toast/#itr-recipe-44190</a></li><li onclick="handleItemClick()">date created: [2021-09-27 Mon] </li><li onclick="handleItemClick()">[2021-09-26 Sun] Made for the Heimburgs. It didn\'t even need maple syrup!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Breakfast_AppleFritters', '<ul><li onclick="handleItemClick()">1½ cups all purpose flour</li><li onclick="handleItemClick()">¼ cup sugar</li><li onclick="handleItemClick()">2 teaspoons baking powder</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">1½ teaspoons cinnamon</li><li onclick="handleItemClick()">⅔ cup milk</li><li onclick="handleItemClick()">2 eggs</li><li onclick="handleItemClick()">3 tablespoons applesauce</li><li onclick="handleItemClick()">2 large Granny Smith or Honey Crisp apples peeled, cored and diced</li><li onclick="handleItemClick()">canola oil for frying</li></ul><ul><li onclick="handleItemClick()">2 cups powdered sugar</li><li onclick="handleItemClick()">¼ cup milk</li><li onclick="handleItemClick()">½ teaspoon vanilla</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Breakfast_AppleFritters', '<ol><li onclick="handleItemClick()">Whisk together flour, sugar, baking powder, salt, and cinnamon in medium bowl.</li><li onclick="handleItemClick()">Make a well in the center and add ⅔ cup milk, eggs and applesauce. (Consider mixing liquids together first.)</li><li onclick="handleItemClick()">Stir just to combine.</li><li onclick="handleItemClick()">Fold in apples.  (Consider sauteing the apples in butter first. Add some sugar and cinnamon toward the end of the saute.)</li><li onclick="handleItemClick()">Heat 1½ inches of oil in heavy skillet, dutch oven or deep fryer to 375 degrees.</li><li onclick="handleItemClick()">Drop about ¼ cup of batter per fritter into hot oil; spreading it out as you drop.</li><li onclick="handleItemClick()">Cook each side until golden brown; approximately 2 minutes per side.</li><li onclick="handleItemClick()">Remove to paper towels to drain.</li><li onclick="handleItemClick()">Whisk together ¼ cup milk, powdered sugar and vanilla.</li><li onclick="handleItemClick()">Dunk each fritters in the glaze turning over to make sure both sides coated.</li><li onclick="handleItemClick()">Place on wire racks to air dry and drip.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Breakfast_AppleFritters', '<ul><li onclick="handleItemClick()">From <a href="https://www.smalltownwoman.com/apple-fritter/" target="_blank">https://www.smalltownwoman.com/apple-fritter/</a></li><li onclick="handleItemClick()">date created: [2020-04-26 Sun] </li><li onclick="handleItemClick()">[2020-04-26 Sun] I had a problem getting the oil to 375. I heated the Dutch oven, then poured in the oil with a candy thermometer in it. But, as it turns out, the thermometer was not deep in the oil, so when it read 375ish, the oil was probably 500+ so I incinerated the first two batches. When I plunged the thermometer into the oil (and used the "laser thermometer") I got better readings. The fritters were good, but could have been a bit crispier. The recipe probably feeds three for breakfast.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_ZaatarRubbedPitas', '<ul><li onclick="handleItemClick()">5 tablespoons extra-virgin olive oil</li><li onclick="handleItemClick()">4 teaspoons za’atar, divided</li><li onclick="handleItemClick()">1/8 ounce (1/2 envelope) instant yeast</li><li onclick="handleItemClick()">2/3 cup (180 milliliters) lukewarm water</li><li onclick="handleItemClick()">2 cups (250 grams) all purpose flour, plus more for dusting</li><li onclick="handleItemClick()">1 teaspoon fine sea salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_ZaatarRubbedPitas', '<ol><li onclick="handleItemClick()">In a small bowl, stir together 3 tablespoons olive oil and the za\'atar.</li><li onclick="handleItemClick()">In a small bowl, stir the yeast into the water and let stand for 5 minutes.</li><li onclick="handleItemClick()">In a large bowl, whisk together the flour, salt and the remaining 2 tablespoons olive oil; then add the yeast and using your hands, combine the mixture until a dough forms.</li><li onclick="handleItemClick()">Knead the dough in the bowl for a few minutes, then cover the bowl with plastic wrap and let stand somewhere warm, until doubled in size, about 1 hour.</li><li onclick="handleItemClick()">(<i class="conditional-space-after"></i>) Preheat the oven to 200°.</li><li onclick="handleItemClick()">Divide the dough into 6 equal balls.</li><li onclick="handleItemClick()">Lightly dust your work surface with flour and roll out each ball of dough into a disk about 1/4-inch thick.</li><li onclick="handleItemClick()">Let the disks rest for 10 minutes.</li><li onclick="handleItemClick()">When you’re ready to cook the pitas, place a large, heavy skillet over medium-high heat. Once hot, place a dough disk and cook on one side until the edges begin to come away from the pan, about 45 seconds.</li><li onclick="handleItemClick()">Flip the pita it over and cook until very lightly browned, 30 to 45 seconds.</li><li onclick="handleItemClick()">Keep the pita warm in the oven while you repeat with the remaining dough disks.</li><li onclick="handleItemClick()">Rub the za’atar oil over the surface of each pita. Serve right away or keep warm until ready to serve.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_ZaatarRubbedPitas', '<ul><li onclick="handleItemClick()">From <a href="https://www.washingtonpost.com/recipes/zaatar-rubbed-pitas/17240/" target="_blank">https://www.washingtonpost.com/recipes/zaatar-rubbed-pitas/17240/</a></li><li onclick="handleItemClick()">date created: [2023-02-20 Mon] </li><li onclick="handleItemClick()">[2023-02-19 Sun] Made for T. She liked them, but I would prefer naan.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_VeganBurgerBuns', '<ul><li onclick="handleItemClick()">4¾ cups (570g) all purpose flour + extra for kneading</li><li onclick="handleItemClick()">2 tablespoons (24g) granulated sugar or liquid such as maple syrup or agave</li><li onclick="handleItemClick()">2¼ teaspoons (7g) instant yeast (about 1 packet)</li><li onclick="handleItemClick()">2 teaspoons sea salt (12g)</li><li onclick="handleItemClick()">1½ cups (354mL) warm water (<i class="conditional-space-after"></i>)</li><li onclick="handleItemClick()">4 tablespoons (60mL) olive oil (or other oil)</li></ul><ul><li onclick="handleItemClick()">3 tablespoons (44mL) unsweetened vegan milk preferably one with a high protein content</li><li onclick="handleItemClick()">1 teaspoon (6.75g) maple syrup or agave syrup (use only ½ teaspoon if you don\'t want any hint of sweetness on your buns)</li><li onclick="handleItemClick()">1 teaspoon (5g) regular mustard or dijon mustard</li><li onclick="handleItemClick()">1 tablespoon mix of sesame seeds, for topping</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_VeganBurgerBuns', '<ol><li onclick="handleItemClick()">In a large bowl, add the flour, sugar, yeast, and salt. Whisk the ingredients together. </li><li onclick="handleItemClick()">Create a well in the center of the flour. Slowly add the warm water and olive oil to the dry ingredients, and then mix together with a spatula until just incorporated. The dough should look shaggy. </li><li onclick="handleItemClick()">Flour a clean surface, and then pour/add the dough onto the surface. Flour your hands and fold the dough together. Knead the dough for about 8-10 minutes with your hands and knuckles. The dough might be sticky at first, but you can add up to ¼ cup flour while flouring and kneading to make it easier to manage. You want the end dough ball to be smooth, with slight dimples with a bit of tension formed.</li><li onclick="handleItemClick()">Lightly grease the ball of dough with some additional oil and place back into the bowl in a ball. Cover the bowl with a plastic wrap or a kitchen towel and let it sit for at least 1 hour on the counter in a warm area. If your kitchen is too cold, you can place it in your OFF oven with the pilot light on which will provide enough residual heat for it to rise. The dough should rise and double in size.</li><li onclick="handleItemClick()">Punch down the dough and fold over.</li><li onclick="handleItemClick()">Divide the dough into 8 equal balls and roll each into a ball. Using your fingers, pinch and pull the undersides to shape each ball round. Now would be a great time to check out my highlight on Instagram where I video\'d this for clarification! But you essentially want to make them round.</li><li onclick="handleItemClick()">Line up the balls, about 4 inches apart if you don\'t want them to spread into one another/touch, on one or two baking sheets (depending on the size or your baking sheet - you want them decently spread out since they\'ll puff up, then spread again while baking).</li><li onclick="handleItemClick()">Cover with a light kitchen towel and allow the balls to proof/rise for another 45 minutes.</li><li onclick="handleItemClick()">You can also begin preheating your oven to 400°F/200°C within the last 20 minutes so it\'s ready when they\'re done rising.</li><li onclick="handleItemClick()">Using a silicone brush/pastry brush, brush the vegan egg wash over the buns and the sides. Sprinkle some sesame seeds over the top and any other seeds you might desire.</li><li onclick="handleItemClick()">Bake your buns for 15 minutes in the oven. Remove, and allow to cool on the baking sheet for about 5 minutes, then transfer to your cooling rack. Allow to cool fully. The buns also get much softer once they begin to cool.</li><li onclick="handleItemClick()">Slice, tear, slather in butter, and enjoy!</li></ol><ol><li onclick="handleItemClick()">Mix the vegan milk, maple syrup/agave and the mustard thoroughly together to combine.</li></ol><span class="tip">If you don\'t want any sweetness, you can lower this to ½ teaspoon maple syrup/agave. You don\'t have to use all of the vegan egg wash, just as much as you desire for a golden brown top.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_VeganBurgerBuns', 'IsVegan<ul><li onclick="handleItemClick()">From <a href="https://jessicainthekitchen.com/vegan-burger-buns-soft-and-fluffy/" target="_blank">https://jessicainthekitchen.com/vegan-burger-buns-soft-and-fluffy/</a></li><li onclick="handleItemClick()">date created: [2022-02-27 Sun] </li><li onclick="handleItemClick()">[2022-02-26 Sat] Made Tofu banh mi sliders for T, Greg and MaryAnn with these buns. These were very good buns, but I made eight buns out of them and they were of a good size for burgers (as advertised). They were too large for sliders (<i class="conditional-space-after"></i>). Next time I’d try making twelve (or sixteen?) buns for sliders.</li><li onclick="handleItemClick()">[2022-05-02 Mon] Made for Louise and Todd. I did form sixteen 63-gram buns and they were the perfect size. At bake time I also baked the tofu and roasted a pan of cauliflower so the bottom of the buns weren\'t as crisp as they ought to be.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_Tortillas', '<ul><li onclick="handleItemClick()">1 cup flour</li><li onclick="handleItemClick()">¼ tsp salt</li><li onclick="handleItemClick()">½ tsp baking powder</li><li onclick="handleItemClick()">4 Tbl crisco</li><li onclick="handleItemClick()">⅓ cup water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_Tortillas', '<ol><li onclick="handleItemClick()">Mix dry ingredients. Add crisco and water, mixing until combined. Knead until smooth and elastic. Divide into 4 pieces. Roll in to small smalls and roll out with hands.</li><li onclick="handleItemClick()">Cook until done on both sides, about 3-4 minutes.</li><li onclick="handleItemClick()">Eat \'em while they\'re hot!</li><li onclick="handleItemClick()">Makes 4 tortillas.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_Tortillas', '<ul><li onclick="handleItemClick()">(Recipe from Cave\'s Branch Kitchen, March 2003)</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_TexasStyleCornbread', 'This cornbread is made with cream style corn and chile peppers, along with shredded cheese.<ul><li onclick="handleItemClick()">1½ cups yellow cornmeal</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">1 teaspoon baking soda</li><li onclick="handleItemClick()">1½ cups buttermilk</li><li onclick="handleItemClick()">1 large egg, lightly beaten</li><li onclick="handleItemClick()">2 tablespoons melted butter or bacon drippings</li><li onclick="handleItemClick()">¼ cup chopped chile peppers, mild or hot, or use chopped and drained canned or pickled</li><li onclick="handleItemClick()">jalapeño chile peppers to taste</li><li onclick="handleItemClick()">1 cup cream-style corn</li><li onclick="handleItemClick()">1 cup shredded sharp Cheddar cheese</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_TexasStyleCornbread', '<ol><li onclick="handleItemClick()">Preparation:</li><li onclick="handleItemClick()">Preheat the oven to 425 degrees or 400 degrees for a glass baking dish.</li><li onclick="handleItemClick()">In mixing bowl, combine cornmeal, salt, and baking soda.</li><li onclick="handleItemClick()">Add buttermilk and egg; beat until batter is smooth.</li><li onclick="handleItemClick()">Place butter in 8-inch square pan or baking dish and heat in preheated oven.</li><li onclick="handleItemClick()">Pour half of the batter into the hot pan.</li><li onclick="handleItemClick()">Spoon cream-style corn evenly over batter, scatter chile peppers over corn layer, and sprinkle with the shredded cheese.</li><li onclick="handleItemClick()">Top with remaining batter.</li><li onclick="handleItemClick()">Bake cornbread until golden brown, about 20 to 25 minutes. Serve hot.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Bread_TexasStyleCornbread', 'Serves 6 to 8.' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_TexasStyleCornbread', '<ul><li onclick="handleItemClick()">By Diana Rattray, About.com</li><li onclick="handleItemClick()"><a href="http://southernfood.about.com/od/cornbread/r/bl01002b.htm" target="_blank">http://southernfood.about.com/od/cornbread/r/bl01002b.htm</a></li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_SourdoughSpeltRyeBreadRolls', '<ul><li onclick="handleItemClick()">200 grams 100% hydration active sourdough starter (i.e. 100 gram flour and 100 gram water)</li><li onclick="handleItemClick()">675 gram water, divided</li><li onclick="handleItemClick()">750 grams all-purpose spelt (or AP flour)</li><li onclick="handleItemClick()">250 grams whole grain rye</li><li onclick="handleItemClick()">20 grams salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_SourdoughSpeltRyeBreadRolls', '<ol><li onclick="handleItemClick()">Place sourdough starter in a large bowl. Pour in 60% (405 grams) of the water and mix with a wooden spoon or Danish dough whisk to break up the starter.</li><li onclick="handleItemClick()">Whisk the dry ingredients together in a separate bowl and add to the sourdough/water mixture.</li><li onclick="handleItemClick()">Mix using a wooden spoon or Danish dough whisk until the dough is too thick, then continue mixing with wet hands. Gradually add the rest of the water (270 grams) and mix thoroughly until the flour is completely incorporated and the dough is a shaggy mass.</li><li onclick="handleItemClick()">Form the dough into a rough ball, place in a lightly greased bowl. Cover and let it rest for 20 to 30 minutes.</li><li onclick="handleItemClick()">Stretch and fold the dough. Cover again and let the dough bulk ferment for two hours. Perform two stretch and folds during the first hour; once every 30 minutes. Let the dough rest for the 2nd hour.</li><li onclick="handleItemClick()">Cover the dough tightly and place in the refrigerator overnight.</li></ol><ol><li onclick="handleItemClick()">The next day, remove the dough from the refrigerator and allow it to warm up to room temperature for 1½ to 2 hours before shaping.</li><li onclick="handleItemClick()">Make twenty-four 75 gram balls (or larger if you prefer); let them rest for 15 minutes.</li><li onclick="handleItemClick()">Shape into small batards or tight boules and place them on cornmeal-dusted parchment paper (or a silpat).</li><li onclick="handleItemClick()">Let the rolls rise at room temperature for 45 minutes.</li><li onclick="handleItemClick()">While the dough is on its last rise preheat your oven to 475 degrees F. with a baking stone on the bottom rack and steam pan (or iron skillet) on the top shelf.</li><li onclick="handleItemClick()">Slide the rolls onto the preheated baking stone using the back of a baking sheet or a baker\'s peel. Immediately throw 3 or 4 ice cubes in the steam pan to generate steam. You can also spritz the rolls once or twice during the first couple of minutes of baking.</li><li onclick="handleItemClick()">Bake the rolls for about 20 minutes. After 5 minutes turn the heat down to 450 degrees F.</li><li onclick="handleItemClick()">Remove the rolls from the oven and place on a wire rack to cool.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_SourdoughSpeltRyeBreadRolls', '<ul><li onclick="handleItemClick()">From <a href="https://www.breadexperience.com/sourdough-spelt-rye-bread-rolls/" target="_blank">https://www.breadexperience.com/sourdough-spelt-rye-bread-rolls/</a></li><li onclick="handleItemClick()">date created: [2020-01-31 Fri] </li><li onclick="handleItemClick()">[2020-02-02 Sun] Made for Ken and Amy\'s pre-Superbowl party. The dough was kind of sticky at first, but not too bad to deal with. It produced pretty light and airy rolls with a crisp crust. Very flavorful. T wasn\'t thrilled with them.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_SourdoughRyeBreadwithBeer', 'Makes 1 large loaf<ul><li onclick="handleItemClick()">8 oz. liquid sourdough starter, bubbly and well fed</li><li onclick="handleItemClick()">12 oz. room temperature beer (such as Anchor Steam lager)</li><li onclick="handleItemClick()">¾ ounce honey, (1 tablespoon)</li><li onclick="handleItemClick()">5 oz. rye flour (I used light, but dark/pumpernickel would be good, too), (1 cup)</li><li onclick="handleItemClick()">12 oz. white bread flour (plus extra as needed), (2¼ cups)</li><li onclick="handleItemClick()">2½ teaspoons sea salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_SourdoughRyeBreadwithBeer', '<ol><li onclick="handleItemClick()">Combine all ingredients except salt in the bowl of a stand mixer in the order listed. Attach the dough hook, and knead on low speed (1 on a Kitchen Aid) until the dough is evenly moistened; it should be wet and sticky. Cover the bowl tightly with a lid or plastic wrap and let rest 20 minutes. (This is called autolyse and allows the flour to absorb some of the water, and the gluten strands to begin straightening out; it makes for less kneading in the end, and will prevent you from adding too much flour right off the bat.)</li><li onclick="handleItemClick()">After 20 minutes, add the salt and mix the dough on medium-low (2 on a Kitchen Aid) for 10 minutes, adding more bread flour 1 tablespoon at a time within the first 5 minutes until the dough comes away from the sides of the bowl. After 10 minutes, the dough should be smoother, but still tacky to the touch.</li><li onclick="handleItemClick()">Optionally, scrape the dough out onto a lightly floured surface and knead for a few minutes by hand, adding as little flour as necessary to keep it from sticking to your hands and the counter. It should still be a bit sticky, but should feel smooth and clay-like.</li><li onclick="handleItemClick()">Place the dough in a large plastic container and cover. Allow dough to double in volume, 3 - 4 hours. (The warmer the spot you choose, the faster it will rise; the ideal temperature being 75-85º.) Alternatively, let the dough rise in the fridge or a cool place overnight. If you do, let the dough come to room temperature before shaping it.</li><li onclick="handleItemClick()">Gently turn the dough out onto a lightly floured surface, pressing out the air bubbles. Shape into a boule by tucking the edges under itself, then gently rotating the dough on the surface to form a taught outer layer of dough.(Here\'s a quick video of how to shape a boule.) For an oval-shaped loaf, roll the boule seam-side-down, between the pads of your hands and the counter to elongate.</li><li onclick="handleItemClick()">If you have a rising basket, sift a light layer of flour onto the inside, and place the boule in it upside-down, pinching the seam shut. (If you don\'t have a rising basket, place the boule directly on a peel or board dusted with cornmeal or flour.) Place the whole deal in a large plastic bag, such as a trash can liner. Inflate the bag and close it with a twist tie or clip. Alternatively, just use a loaf pan.</li><li onclick="handleItemClick()">Let the bread rise a second time until doubled, about 1½ - 2 hours. When the bread is ready to bake, it will hold an indentation of your finger when you press it lightly, rather than springing back.</li><li onclick="handleItemClick()">Bake at 425 degrees until the bread\'s internal temperature rises to 200 degrees, about 35 minutes.</li></ol><ol><li onclick="handleItemClick()">While the bread is rising, about an hour before you\'re ready to bake, remove all but the lowest rack of your oven. Place a baking stone on the rack (or a heavy duty baking sheet), and place a metal, non-teflon pan of any size that you don\'t care about sacrificing (it will get rusty) on the floor of the oven.</li><li onclick="handleItemClick()">Crank the oven up to 500º.</li><li onclick="handleItemClick()">When the bread has doubled, gently turn it out onto a wooden peel dusted with flour or cornmeal. Holding alameor sharp knife at a 45º angle to the loaf, draw the blade, about 1" deep, across the top of the loaf, beginning and ending 2" from the bottoms of the boule. Make 2 or 3 diagonal slashes this way (see photo in post, above).</li><li onclick="handleItemClick()">Fill a 1 cup measure with ice cubes. Quickly slip the boule off the peel and onto the stone, and toss the cubes into the hot pan on the floor of the oven. This will steam the outside of the loaf, allowing it to expand as it bakes.</li><li onclick="handleItemClick()">Bake the loaf for 15 minutes without opening the oven, then turn the oven down to 450º and bake another 15 - 20 minutes or so, until the bread is a deep, burnished golden-brown and the loaf sounds hollow when thumped on the bottom. An instant read thermometer inserted into the middle should read around 200º, the temperature at which the starches in the dough are set.</li></ol><ol><li onclick="handleItemClick()">Let cool completely on a wire rack, 1 - 2 hours, before enjoying. When hot, the bread is still \'baking\' from the residual heat and steam inside the loaf, so step away from the bread until it is truly cool.</li><li onclick="handleItemClick()">This bread keeps well for more than a week. The best way to store this type of bread is in a paper bag at room temperature for a couple of days. After that, put the whole thing, paper bag and all, into a plastic bag and continue to store at room temp. After a couple of days like that, it there\'s any left over, cut leftovers into ½" chunks, fry in a heavy skillet in light olive oil, and toss into soups or salads for the best croutons ever.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_SourdoughRyeBreadwithBeer', '<ul><li onclick="handleItemClick()"><a href="https://bojongourmet.com/beer-rye-sourdough/" target="_blank">https://bojongourmet.com/beer-rye-sourdough/</a></li><li onclick="handleItemClick()">date created: [2020-01-05 Sun] </li><li onclick="handleItemClick()">[2020-01-05 Sun] I used the Kitchen Aid but did not knead the dough, with a ~4 hour first rise and 90 minute second. I used stone ground rye and All Purpose white, with a bit of vital wheat gluten added. I baked it in a loaf pan without the stone. It turned out well, although the crumb wasn\'t quite as open as in the photos. But then again, I took the starter out of the frig after it had been sitting for a week. I think it would have benefited from some invigoration.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_SourdoughPretzels', '<ul><li onclick="handleItemClick()">¾ cup (170g) water</li><li onclick="handleItemClick()">1 cup (227g) sourdough starter, unfed/discard</li><li onclick="handleItemClick()">3 cups (361g) High-Gluten Flour* or King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">¼ cup (35g) Baker\'s Special Dry Milk or nonfat dry milk</li><li onclick="handleItemClick()">2 tablespoons (14g) non-diastatic malt powder or 1 tablespoon (14g) sugar</li><li onclick="handleItemClick()">1 tablespoon butter or vegetable oil</li><li onclick="handleItemClick()">1½ teaspoons salt</li><li onclick="handleItemClick()">2 teaspoons instant yeast</li></ul>*Add an additional 2 tablespoons (28g) water if using high-gluten flour.<ul><li onclick="handleItemClick()">1 tablespoon non-diastatic malt powder or sugar</li><li onclick="handleItemClick()">2 tablespoons (28g) water</li><li onclick="handleItemClick()">pretzel salt</li><li onclick="handleItemClick()">2 tablespoons (28g) melted butter, optional</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_SourdoughPretzels', '<ol><li onclick="handleItemClick()">Prepare a baking sheet by spraying it with vegetable oil spray, or lining it with parchment paper. If you\'re not using King Arthur Flour\'s brand, grease the parchment with vegetable oil spray to make double-sure the pretzels won\'t stick.</li><li onclick="handleItemClick()">Mix and knead the dough ingredients — by hand, mixer, or bread machine — to make a cohesive, fairly smooth dough. It should be slightly sticky; if it seems dry, knead in an additional tablespoon or two of water.</li><li onclick="handleItemClick()">Cover the dough and let it rest for 45 minutes. It will rise minimally. Towards the end of the rising time, preheat the oven to 350°F.</li><li onclick="handleItemClick()">Turn the dough out onto a lightly greased work surface, fold it over a few times to gently deflate it, then divide it into 12 pieces, each weighing about 2¼ to 2½ ounces.</li><li onclick="handleItemClick()">Roll each piece of dough into an 18" rope. Shape each rope into a pretzel.</li><li onclick="handleItemClick()">Dissolve the malt in the water. Brush the pretzels with the solution, and sprinkle lightly with coarse pretzel salt.</li><li onclick="handleItemClick()">Bake the pretzels for 25 to 30 minutes, until they\'re a light golden brown. Note: This is correct; there\'s no need to let the shaped pretzels rise before baking.</li><li onclick="handleItemClick()">Remove the pretzels from the oven, and brush with melted butter, if desired.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_SourdoughPretzels', '<ul><li onclick="handleItemClick()">From <a href="https://www.kingarthurflour.com/recipes/sourdough-pretzels-recipe" target="_blank">https://www.kingarthurflour.com/recipes/sourdough-pretzels-recipe</a></li><li onclick="handleItemClick()">date created: [2020-03-15 Sun] </li><li onclick="handleItemClick()">[2020-03-15 Sun] Let the dough rise for several hours, but it came out fine. They were better reheated (made them a tad crispier).</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_SourdoughPopovers', '<ul><li onclick="handleItemClick()">1 cup (227g) milk (full-fat, reduced-fat, skim or almond)</li><li onclick="handleItemClick()">3 large eggs</li><li onclick="handleItemClick()">1/2 cup (113g) sourdough starter, ripe (fed) or discard</li><li onclick="handleItemClick()">3/4 teaspoon salt</li><li onclick="handleItemClick()">1 cup (120g) King Arthur Unbleached All-Purpose Flour</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_SourdoughPopovers', '<ol><li onclick="handleItemClick()">Heat a muffin or popover pan in the oven while it\'s preheating to 450°F.</li><li onclick="handleItemClick()">In the microwave or in a small saucepan, warm the milk until it feels just slightly warm to the touch.</li><li onclick="handleItemClick()">Combine the warm milk with the eggs, sourdough starter and salt, then mix in the flour. Don\'t over-mix; a few small lumps are OK. The batter should be thinner than a pancake batter, about the consistency of heavy cream.</li><li onclick="handleItemClick()">Carefully remove the hot pan from the oven, and spray it thoroughly with non-stick pan spray, or brush it generously with oil or melted butter.</li><li onclick="handleItemClick()">Quickly pour the batter into the cups, filling them almost to the top. If you\'re using a muffin tin, fill cups all the way to the top. Space the popovers around so there are empty cups among the full ones; this leaves more room for expansion.</li><li onclick="handleItemClick()">Bake the popovers for 15 minutes, then reduce the oven heat to 375°F and bake for an additional 15 to 20 minutes, until popovers are golden brown.</li><li onclick="handleItemClick()">Remove the popovers from the oven and serve immediately.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_SourdoughPopovers', '<ul><li onclick="handleItemClick()">From <a href="https://www.kingarthurbaking.com/recipes/sourdough-popovers-recipe" target="_blank">https://www.kingarthurbaking.com/recipes/sourdough-popovers-recipe</a></li><li onclick="handleItemClick()">date created: [2020-09-27 Sun] </li><li onclick="handleItemClick()">[2020-09-26 Sat] Made with almond milk. Not quite as crisp with the sourdough but good nonetheless.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_SourdoughEnglishMuffinsKingArthur', '<ul><li onclick="handleItemClick()">1 cup (227g) sourdough starter, ripe (fed) or discard; ripe will give you a more vigorous rise</li><li onclick="handleItemClick()">2 tablespoons (25g) sugar</li><li onclick="handleItemClick()">2 cups (454g) warm water (110°F-115°F)</li><li onclick="handleItemClick()">1 tablespoon active dry yeast or instant yeast</li><li onclick="handleItemClick()">7 cups (843g) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">½ cup (43g) Baker\'s Special Dry Milk or nonfat dry milk</li><li onclick="handleItemClick()">¼ cup (4 tablespoons, 57g) butter, at room temperature</li><li onclick="handleItemClick()">1 tablespoon salt</li><li onclick="handleItemClick()">¼ teaspoon sour salt (citric acid), optional; for enhanced sour flavor</li><li onclick="handleItemClick()">semolina or cornmeal, for coating</li></ul><ul><li onclick="handleItemClick()">½ cup (113.5g) sourdough starter, ripe (fed) or discard; ripe will give you a more vigorous rise</li><li onclick="handleItemClick()">1 tablespoon (12.5g) sugar</li><li onclick="handleItemClick()">1 cup (227) warm water (110°F-115°F)</li><li onclick="handleItemClick()">½ tablespoon active dry yeast or instant yeast</li><li onclick="handleItemClick()">3½ cups (421.5g) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">¼ cup (21.5g) Baker\'s Special Dry Milk or nonfat dry milk</li><li onclick="handleItemClick()">⅛ cup (2 tablespoons, 28.5g) butter, at room temperature</li><li onclick="handleItemClick()">½ tablespoon salt</li><li onclick="handleItemClick()">⅛ teaspoon sour salt (citric acid), optional; for enhanced sour flavor</li><li onclick="handleItemClick()">semolina or cornmeal, for coating</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_SourdoughEnglishMuffinsKingArthur', '<ol><li onclick="handleItemClick()">Combine all of the dough ingredients, except the cornmeal/semolina, in a large bowl.</li><li onclick="handleItemClick()">Mix and knead — by hand, electric mixer, or bread machine — to form a smooth dough. The dough should be soft and elastic, but not particularly sticky; add additional flour if necessary.</li><li onclick="handleItemClick()">Place the dough in a lightly greased bowl, cover, and set it aside to rise for about 1½ hours, or until it\'s noticeably puffy. For most pronounced sour flavor, cover the bowl, and immediately place it in the refrigerator (without rising first). Let the dough chill for 24 hours; this will develop its flavor.</li><li onclick="handleItemClick()">Gently deflate the dough, turn it out onto a lightly floured work surface, cover it, and let it sit for a few minutes, to relax the gluten. Divide the dough in half. Working with one piece at a time, roll ½" thick, and cut in 3" rounds. Re-roll and cut any remaining scraps. Repeat with the remaining half of dough.</li><li onclick="handleItemClick()">Alternatively, divide the dough into 24 pieces (total). Shape each piece into a round ball, then flatten each ball into a 3" round. For a somewhat more even rise as the muffins cook, flatten each ball slightly larger than 3", and trim edges with a 3" cutter (or trim all around the edge with a pair of scissors). Muffins with cut (rather than flattened) sides will rise more evenly.</li><li onclick="handleItemClick()">Place the rounds, evenly spaced, onto cornmeal- or semolina-sprinkled baking sheets (12 per sheet). Sprinkle them with additional cornmeal or semolina, cover with plastic wrap, and let them rise until light and puffy, about 45 to 60 minutes.<ul><li onclick="handleItemClick()">If the dough has been refrigerated overnight, the rise time will be about 2 hours.</li></ul></li><li onclick="handleItemClick()">Carefully transfer the rounds (as many as a time that will fit without crowding) right-side up to a large electric griddle preheated to 350°F, or to an ungreased frying pan that has been preheated over medium-low heat.</li><li onclick="handleItemClick()">Cook the muffins for about 5 minutes on each side, or until an instant-read thermometer inserted in the center of a muffin registers 190°F. The edges may feel a bit soft; that\'s OK.</li><li onclick="handleItemClick()">Remove the muffins from the griddle, and cool on a rack. Store tightly wrapped at room temperature for 4 or 5 days; freeze for longer storage.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_SourdoughEnglishMuffinsKingArthur', '<ul><li onclick="handleItemClick()">From <a href="https://www.kingarthurflour.com/recipes/sourdough-english-muffins-recipe" target="_blank">https://www.kingarthurflour.com/recipes/sourdough-english-muffins-recipe</a></li><li onclick="handleItemClick()">date created: [2020-04-03 Fri] </li><li onclick="handleItemClick()">[2020-04-26 Sun] Made again (a half recipe).</li><li onclick="handleItemClick()">[2021-09-19 Sun] Made them once again and griddled them for ~8 minutes on a side and they reach over 190°F. Need to reduce cook time.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_SourdoughCinnamonRollsRecipe', '<ul><li onclick="handleItemClick()">477g all-purpose or bread flour</li><li onclick="handleItemClick()">133g milk, whole</li><li onclick="handleItemClick()">191g butter, unsalted</li><li onclick="handleItemClick()">191g eggs</li><li onclick="handleItemClick()">48g sugar, caster</li><li onclick="handleItemClick()">11g salt</li><li onclick="handleItemClick()">200g sourdough starter</li></ul><ul><li onclick="handleItemClick()">215g light brown sugar</li><li onclick="handleItemClick()">40g all-purpose flour</li><li onclick="handleItemClick()">2 tablespoons butter, unsalted and melted</li><li onclick="handleItemClick()">2 teaspoons cinnamon, ground</li><li onclick="handleItemClick()">¼ teaspoon salt</li></ul><ul><li onclick="handleItemClick()">114g (4oz, half a block) cream cheese softened to room temperature</li><li onclick="handleItemClick()">62g powdered sugar</li><li onclick="handleItemClick()">37g milk, whole</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_SourdoughCinnamonRollsRecipe', '<ol><li onclick="handleItemClick()">Cut the butter into ¼” pats and let warm to room temperature while mixing the rest of the ingredients.</li><li onclick="handleItemClick()">In the bowl of a stand mixer fitted with the dough hook attachment, add the eggs, milk, sugar, and sourdough starter.</li><li onclick="handleItemClick()">Whisk together until incorporated.</li><li onclick="handleItemClick()">Add the flour and salt and mix on speed 1 for 3 minutes until incorporated.</li><li onclick="handleItemClick()">Let the dough rest for 10 minutes.</li><li onclick="handleItemClick()">After the 10-minute rest turn the mixer to speed 2 and mix for about 5-6 minutes until the dough starts to come together and all clumps have disappeared. The dough should start to pull from the sides of the bowl but it will not completely remove from the bottom. If the dough just doesn’t want to come together and it’s overly wet add a little flour, a tablespoon at a time until it comes together.</li><li onclick="handleItemClick()">With the mixer set to speed 1, add the butter one pat at a time, waiting to add each until the previous is absorbed.</li><li onclick="handleItemClick()">Continue until all the butter is added and the dough is shiny and smooth, this could take around 8-10 minutes.</li></ol><ol><li onclick="handleItemClick()">Transfer the mixed dough to a bulk container and let ferment for 2 hours at 75ºF (23°C).</li><li onclick="handleItemClick()">Perform 3 to 4 sets of stretch and folds at 30-minute intervals.</li></ol><ol><li onclick="handleItemClick()">Place the covered bulk fermentation container into the fridge for at least 2 hours to thoroughly chill.</li></ol><ol><li onclick="handleItemClick()">First, make the filling: In a bowl mix together the filling ingredients and set aside.</li><li onclick="handleItemClick()">Next, take out your dough from the fridge, lightly flour your work surface and the dough, and roll out to an 11×21″ rectangle with a long side closest to your body.</li><li onclick="handleItemClick()">Spread the filling evenly over the dough.</li><li onclick="handleItemClick()">Roll the dough up away from you into a tight log.</li><li onclick="handleItemClick()">Cut the log into pieces every 1¾”.</li><li onclick="handleItemClick()">Transfer the cut pieces to a baking pan with space around each one.</li></ol><ol><li onclick="handleItemClick()">Cover the pan and proof somewhere warm, around 77°F (25°C), for 2 to 3 hours.<ul><li onclick="handleItemClick()">The dough will relax and puff up during this time.</li><li onclick="handleItemClick()">They’re ready to bake when the dough feels very soft and light—give the dough additional time to proof if necessary.</li></ul></li></ol><ol><li onclick="handleItemClick()">Preheat your oven to 400°F (200°C).</li><li onclick="handleItemClick()">Slide the rolls into the oven once preheated and bake for 20-35 minutes.</li><li onclick="handleItemClick()">Spread the glaze over the rolls once cooled.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_SourdoughCinnamonRollsRecipe', '<ul><li onclick="handleItemClick()">From <a href="https://www.theperfectloaf.com/sourdough-cinnamon-rolls/#tasty-recipes-11562-jump-target" target="_blank">https://www.theperfectloaf.com/sourdough-cinnamon-rolls/#tasty-recipes-11562-jump-target</a></li><li onclick="handleItemClick()">date created: [2021-10-17 Sun] </li><li onclick="handleItemClick()">A hit each time I’ve made them. Some say they don’t even need the glaze.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_SourdoughBreadPerfectLoaf', '<ul><li onclick="handleItemClick()">3 tablespoons (60g) Trailblazer bread flour</li><li onclick="handleItemClick()">4 tablespoons (61g) [Water 1]</li><li onclick="handleItemClick()">1 tablespoon (30g) ripe sourdough starter</li></ul><ul><li onclick="handleItemClick()">6 cups (886g) Trailblazer bread flour</li><li onclick="handleItemClick()">2¾ cups (650g) [Water 1]</li></ul><ul><li onclick="handleItemClick()">All of the autolyse</li><li onclick="handleItemClick()">All of the levain</li><li onclick="handleItemClick()">½ cup (95g) [Water 2]</li><li onclick="handleItemClick()">3 teaspoons (17g) fine sea salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_SourdoughBreadPerfectLoaf', '<ol><li onclick="handleItemClick()">Make the Levain: In a medium jar mix Trailblazer flour, part of Water 1, and 1 tablespoon (30g) ripe sourdough starter until well incorporated (this liquid levain will feel quite loose) and loosely cover. Store in a warm place for 5 hours.</li><li onclick="handleItemClick()">Mix the Autolyse: About 1 hour 30 minutes before the levain is ready, place the flour and water in a large bowl and use wet hands to mix until no dry bits remain* (see Baker\'s Notes). Use a bowl scraper to scrape down the sides of the bowl to keep all the dough in one area at the bottom. Cover the bowl and place it near your levain for 1 hour 30 minutes. Since this is a longer autolyse, be sure to keep the dough warm, at 78°F (25°C).</li><li onclick="handleItemClick()">Check the Levain: It should show signs of readiness but not be overly ripe: moderate bubbles on the surface and a mild sour aroma. If the levain is not showing these signs, let it ferment 15 minutes more and check again.</li><li onclick="handleItemClick()">Adjust the water temperature for the main mix: Take the temperature of the dough and compare it to the desired dough temperature for this recipe, 78°F (25°C). If it’s higher, use cold water for the remaining water; if it’s lower, use warm water.</li><li onclick="handleItemClick()">Mix the dough: To the autolyse, add a splash of the water 2 (with this recipe, add water only a little at a time to avoid overhydration), the salt, and ripe levain. Using wet hands, mix the ingredients until well incorporated. If at any point the dough feels excessively wet, slack, and possibly falling apart, don’t add the remaining water. Otherwise, add the rest of the water, a little at a time, and continue to mix until the dough comes together, and all the water is absorbed.</li><li onclick="handleItemClick()">Strengthen the dough: Depending on how the dough feels, you can slap and fold it on the counter for about 5 minutes, or you can perform 5 minutes of repeated folding in the bowl. The slap and fold technique is effective for highly hydrated doughs, but it can be a bit of work and a bit messy. The dough should smooth out a little and gain some elasticity, but still be quite shaggy. Transfer back to the bowl or another container for bulk fermentation.</li><li onclick="handleItemClick()">Measure the temperature of the dough: For this recipe, it should be 78°F (25°C). Cover the dough and bulk-ferment for about 4 hours at warm room temperature: 74°-76°F (23°-24°C).</li><li onclick="handleItemClick()">During the bulk fermentation, complete 6 sets of stretches and folds, the first 3 at 15-minute intervals, and the remaining 3 at 30-minute intervals** (see Baker\'s Notes). After the last set, cover the bowl and let the dough rest for the remainder of bulk fermentation, about 1 hour 45 minutes.</li><li onclick="handleItemClick()">Check the dough: At the end of bulk fermentation, the dough will have risen some in the bulk container. Because of the high hydration, it might not be significantly risen, but it may have bubbles on top and at the sides, it should look smoother and less shaggy, and at the edge of the dough where it meets the container, it should dome downward. If you wet a hand and gently tug on the surface of the dough, it will feel elastic and cohesive, resisting your pull. If you don’t see dough that’s airy, strong, and “alive,” leave it for another 15 minutes in bulk fermentation and check again.</li><li onclick="handleItemClick()">Divide and preshape the dough: Using a bowl scraper, gently scrape the dough onto a clean work surface and use your bench knife to divide it directly in half. Using your bench knife in your dominant hand and with your other hand wet to reduce sticking, shape each piece of dough into a tight round. The dough will feel sticky and slack, so be sure to preshape it tightly to give it additional strength*** (see Baker\'s Notes).</li><li onclick="handleItemClick()">Let the rounds rest for 35 minutes, uncovered. Keep an eye on this dough during the rest; if it looks like it’s beginning to spread out into a thin pancake, skip the remaining bench rest time and proceed directly to shaping.</li><li onclick="handleItemClick()">Prepare the proofing baskets: Line two proofing baskets or bowls with clean kitchen towels. Dust lightly and evenly with white flour.</li><li onclick="handleItemClick()">Shape the dough: Shape each as a boule or a batard. Gently transfer each piece to a proofing basket, seam-side up. Place each basket inside an airtight reusable plastic bag and seal.</li><li onclick="handleItemClick()">Proof for about 18 hours (overnight) in a home refrigerator.</li><li onclick="handleItemClick()">When ready to bake, prepare the oven: Place an oven rack in the bottom third of the oven with no rack above it. Place a Dutch oven/combo cooker inside the oven and preheat to 450°F (230°C) for at least 30 minutes. (Alternatively, bake directly on a baking stone/steel.)</li><li onclick="handleItemClick()">Take one of the proofing baskets out of the fridge and uncover. Use your finger to gently poke around the dough to assess the strength. If it feels very fragile and weak, use a lighter hand when scoring to prevent the dough from collapsing when baking—don’t score in excessively deeply, only enough to cut through the outer skin of the dough. Put a piece of parchment paper over the basket. Place a pizza peel or inverted baking sheet on top of the parchment and, using both hands, flip everything over. Gently remove the basket and score the dough.</li><li onclick="handleItemClick()">Bake the dough: Slide the dough with the parchment into the preheated Dutch oven and cover with the lid. Bake for 20 minutes, then remove the lid. Continue to bake for 30 to 35 minutes, or until the internal temperature reaches 206°-210°F (96°-99°C) and the crust has a deep mahogany color and a crackle/ crunch when gently squeezed.</li><li onclick="handleItemClick()">Finish and cool: Let the loaf cool on a wire rack for 1 to 2 hours before slicing. For the second loaf, preheat the Dutch oven for 15 minutes and repeat.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_SourdoughBreadPerfectLoaf', '<ul><li onclick="handleItemClick()">From <a href="https://cairnspring.com/blogs/recipes/my-best-sourdough" target="_blank">https://cairnspring.com/blogs/recipes/my-best-sourdough</a></li><li onclick="handleItemClick()">date created: [2023-01-02 Mon] </li><li onclick="handleItemClick()">[2023-01-02 Mon] This dough is quite highly hydrated and as such, was quite slack and sticky. But that all changed during the final rising where it really firmed up. I was very happy with the loaf\'s airy structure and crispy crust.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_SourdoughBreadNewYorkTimes', '<ul><li onclick="handleItemClick()">20 grams mature starter, which you should keep refrigerated until you’re ready to use it</li><li onclick="handleItemClick()">700 grams high-quality white bread flour, plus more for feeding starter and dusting work surfaces</li><li onclick="handleItemClick()">300 grams high-quality whole-wheat flour, whole-grain rye flour, or spelt flour, or a combination</li><li onclick="handleItemClick()">20 grams kosher salt or fine sea salt</li><li onclick="handleItemClick()">Rice flour, for dusting (optional)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_SourdoughBreadNewYorkTimes', '<ol><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   In the morning, three days before you plan to serve your bread (Friday morning, for example, for loaves on Sunday), pull your starter from the refrigerator and decant 20 grams of it into a small, clean, clear container. Return any remaining starter to the refrigerator for future use. Stir in 100 grams of room-temperature tap water until the starter is evenly dispersed, then stir in 100 grams of white flour until you have a smooth paste.<span class="tip">   The yeast and bacteria in your starter become sluggish in the cool environment of your refrigerator. They must be energized through successive feedings, a process called refreshing, to be active enough to raise the dough.</span></li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   Cover the container, and let sit at room temperature until it has at least doubled in volume and its surface teems with sudsy bubbles, 10 to 12 hours, depending on your kitchen’s temperature.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   Once the starter has doubled in size (the evening of the first day), discard all but 20 grams of starter. To the 20 grams of starter, add 100 grams of water, then mix and incorporate another 100 grams of white flour. Cover and set aside at room temperature to be used in your dough the next day.</li></ol>The bulk of your work occurs on this day, so you’ll want to set aside some time to tend to your dough. Depending on environmental conditions, your dough may take anywhere from five to nine hours to finish its rises. It’s not active time, but you’ll want to stay close to keep an eye on it.<ol><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   Early on the second day, weigh 700 grams of white bread flour and 300 grams of whole-wheat or whole-grain rye or spelt flour (or a blend) in a large mixing bowl. Mix to combine. Weigh out 750 grams of lukewarm tap water (about 90 degrees) and add to the flours. Mix gently with a clean hand or a flexible bench scraper until all the flours are hydrated and no dry spots remain. Cover with a damp dish towel, and let sit at least 30 minutes while you wait until your starter is ready (see Step 2).<span class="note">   The  Tupperware "What-a-bowl" weighs 359 grams.</span><span class="tip">   If starter is the life force of bread, then the stretchy strands known as gluten are its backbone. When two proteins in flour come into contact with water, gluten forms a network inside the dough, trapping the gas produced by the yeast. To build lots of gluten from the get-go, bakers employ a technique known as autolyse, in which flour and water are mixed and left to rest, usually before adding the starter. During autolyse, gluten bonds form that create the basic structure of the dough. As little as 30 minutes of autolyse can be effective, but generally speaking a couple of hours is optimal. It will give your gluten a head start and decrease the amount of mixing down the line.</span></li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   When the sudsy bubbles on the surface of a starter form a dome and it appears on the verge of collapse, drop about a teaspoon of starter into a small bowl of room temperature water. If it floats, the starter is full of gas and ready to use (ripe). If it sinks, let it sit, checking every 30 minutes, until you see even more activity and then try the test again.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   Add 200 grams of ripe starter to the bowl with the flour-water mixture. Pinching with your thumb, forefinger and middle finger on one hand and rotating the bowl with the other, mix until the starter is completely incorporated.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   At this point, the dough should be wet but also extremely extensible (having the ability to stretch without snapping back). Sprinkle 20 grams salt and 20 grams of water across the dough, and pinch, as before, to incorporate. Cover with a damp towel and let sit for 10 minutes.<span class="tip">   Adding salt tightens the gluten network, so the dough will go from very extensible to more elastic (having the tendency to snap back after being stretched) and stringy.</span></li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   Uncover the dough. Slide a wet hand down along the inside of the bowl and underneath the dough. Grasp a handful and stretch it upward until you feel resistance, then fold it back onto the dough mass. Repeat this motion continuously for 10 minutes, rotating the bowl about 90 degrees each time. As you work the dough, it will progress from very slack and sticky to smoother and more elastic.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   After 10 minutes of mixing, pinch off a golf ball-size piece of dough and gently stretch it with your fingertips, working it both longer and wider until you have a thin, even membrane through which light can pass. If the dough tears before this point, continue to mix and check again every 10 minutes. (If you’re mixing for more than 20 minutes and the dough is not yet at this point, feel free to move on. Your bread will still turn out.) Use a flexible bench scraper to scrape dough out onto a clean surface. Rinse the bowl to remove any dried flour, then return the dough to the damp bowl.<span class="tip">   This will help determine if the dough has developed sufficient gluten to give it strength, which enables it to hold its shape.</span></li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   Mark where the dough hits the side of the bowl with a piece of tape. Note the time, and the temperature of the dough. It should be 76 degrees to 80 degrees. Cover the dough with a damp towel and let sit for 60 minutes.<span class="tip">   Bulk fermentation is the period after the starter has been added during which the dough undergoes its first rise. The yeast and bacteria produce gas and flavor, so a longer fermentation will result in a more flavorful bread. If your dough is above or below the optimal 76- to 80-degree range, that’s fine, just note that it will accelerate or slow the bulk fermentation accordingly. If fermentation seems to be moving slowly, you can move your dough to a warmer place, like the inside of the oven with the oven light on.</span></li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   Using a wet hand and the same mixing motion as Step 5, but with a gentler touch to avoid knocking out any gas, perform four folds, making a full rotation of the bowl. Cover the bowl, wait 1 hour, then perform the same series of four folds. Cover and repeat every 60 minutes, until the dough feels pillowy and filled with air, which can take at least 3 hours and as many as 7. Each time you fold the dough, it should feel lighter and sit higher in the bowl.<span class="tip">   Determining when bulk fermentation is complete can be difficult. The dough should more or less double in size — use the mark on the bowl as a reference — but that’s not a guarantee. You should see lots of bubbles on the surface and sides of the dough. </span>Unknown type: ’quote-block’Unknown type: ’quote-block’</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   Clear and lightly flour a work surface. Gently turn out the dough, letting its weight coax it out of the bowl and loosening the sides with the bench scraper. Divide the dough in half with the bench scraper. Using floured hands and working with one piece of dough at a time, gently pull all the edges of the dough toward the center to create a round, tidy packet. (The non-floured surface will readily stick to itself.) Use a bench scraper to turn the loose ball of dough over so it rests seam-side down. Cover with a clean towel and repeat with the second half of dough. Let both pieces of dough rest, covered, on the work surface for 20 minutes.<span class="tip">   Pre-shaping the dough guarantees uniform loaf size and helps to organize the gluten strands roughly into the final shape of the baked loaves. The following rest period relaxes the gluten and makes final shaping easier, leading to bread with a better overall rise.</span></li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>    As dough rests, line two baskets or mixing bowls with clean kitchen towels. Stir together a 50/50 mixture of white bread flour and rice flour. (Rice flour will prevent sticking.) Dust the interiors of the baskets generously with the 50/50 flour mixture. Set aside.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>    Uncover one piece of dough and lightly dust the top with the 50/50 flour mixture. In one decisive motion, use the bench scraper to lift and turn the dough over floured-side down. Slide your fingertips beneath the dough and stretch it gently into a square shape.    Fold the left side of the dough inward toward the center, then fold the right side inward and overtop of the left fold. Starting at the end closest to you, roll the dough away from you into a bulky spiral.    Let the dough sit for a minute or two on its seam to help it seal, then use a bench scraper to lift up the dough and place it seam-side up in one of the prepared baskets. Lightly dust the exposed part of the dough with more of the 50/50 flour mixture, and cover with a kitchen towel. Repeat with the second piece of dough.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>    Rest loaves at room temperature, checking on them periodically, until the surface of the dough has settled and the entire loaves have slightly increased in volume, 1 to 1½ hours.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>    Press a floured finger about ½ inch into the dough. If the dough springs back immediately, it needs more time — check again every 20 minutes. But, if it springs back slowly and a slight impression remains, the dough is proofed.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>    Once the dough passes the poke test, cover the baskets with plastic wrap and transfer to the refrigerator. Chill overnight and up to two days before baking. The longer the dough spends in the refrigerator, the tangier the final bread will taste.</li></ol><ol><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   About an hour before baking, arrange a rack in the lower third of your oven and place a large, uncovered Dutch oven inside. Heat the oven to 500 degrees.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   Remove one loaf from the refrigerator and uncover. Lightly dust the exposed dough with the 50/50 flour mixture, massaging it into the surface. Place a piece of parchment paper over the basket, making sure the parchment is longer and wider than the basket by several inches. Invert the loaf onto the parchment paper. Remove the basket, then slowly peel away the towel. Dust the rounded side of the dough with more of the 50/50 flour mixture, rubbing it into the surface to coat evenly.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   Use a <i class="conditional-space-after"></i>or a serrated knife to make a long, slightly off-center slash about ¼-inch deep, angling the blade toward the midline of the loaf.<span class="tip">   Slashing the bread will help the bread expand predictably in the oven.</span></li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   Very carefully place the heated Dutch oven on the stovetop. Taking care not to touch the sides, use the parchment paper to lower the loaf into the Dutch oven. Cover and return it to the oven. Bake for 20 minutes. Then, carefully remove the lid and reduce the oven temperature to 450 degrees. Continue to bake the loaf uncovered until the surface is deeply browned all over, another 30 to 40 minutes. Remove the Dutch oven from the oven, and use tongs to help you pull out the loaf. Transfer the Dutch oven back to the oven, and set the oven temperature back to 500 degrees. Repeat the process with the second loaf of bread.<span class="tip">   The bread is baked covered in the beginning to trap stream, which helps the loaf expand and rise as much as possible.</span></li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>   Allow the loaves to cool completely, for a few hours, before cutting into them. Whole loaves can be stored uncovered at room temperature for 1 day. Once cut, bread should be stored in paper bags at room temperature and will keep for 5 days or longer. After the second day, it benefits from light toasting.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_SourdoughBreadNewYorkTimes', '<ul><li onclick="handleItemClick()">date created: [2020-04-19 Sun] </li><li onclick="handleItemClick()">From <a href="https://cooking.nytimes.com/guides/59-how-to-make-sourdough-bread/" target="_blank">https://cooking.nytimes.com/guides/59-how-to-make-sourdough-bread/</a></li><li onclick="handleItemClick()">[2020-04-19 Sun] Made two beautiful loaves (gave one to Nancy). Since I didn\'t use rice flour, I had to scrape the dough off the towels before placing into Dutch oven. Also, I screwed up on the second loaf: I didn\'t cover the Dutch oven until the middle (instead of first) 20 minutes. It didn\'t rise as much as the first, but wasn\'t too bad.</li><li onclick="handleItemClick()">[2020-05-03 Sun] Made a half recipe (one loaf). I tried to optimize the stickiness by doing the final rise not over a towel but (lightly floured) parchment instead. The paper sort of worked, but was a bit of a hassle to pick out of the cooked bread, since the bread rose around it. The big problem I had is that I forgot to lower the temperature after I removed the Dutch oven top. The bread cooked quicker and was a quite a bit darker than it ought to have been.</li><li onclick="handleItemClick()">[2020-05-17 Sun] In a bit of a hurry, I realized that I skipped the final rise. I did pull the dough out of the refrigerator early (1 hour for one loaf and 2 hours for the other). They stuck pretty badly to the towels and didn\'t bake up quite as high, but seemed fine otherwise. I have one to Nancy and Pat who came for a social distancing event on the deck.</li><li onclick="handleItemClick()">[2020-09-20 Sun] I preformed the loaves and basically just popped them into floured towel-lined bowls. I used potato flour to keep the bread from sticking to the towel and parchment. It worked for keeping things from sticking although it burned in the oven. (Not terrible but, then again, not attractive.) The parchment got embedded in the second loaf and I had to pick out pieces of parchment.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_SourdoughBaguettesKingArthur', '<ul><li onclick="handleItemClick()">1¼  cups (283g) lukewarm water</li><li onclick="handleItemClick()">2 cups (482g) sourdough starter, ripe (fed) or discard</li><li onclick="handleItemClick()">4½ to 5 cups (539g to 602g) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">2½ teaspoons (15g) salt</li><li onclick="handleItemClick()">2 teaspoons sugar</li><li onclick="handleItemClick()">1 to 2 teaspoons instant yeast (depending on the vigor of your fed starter)</li><li onclick="handleItemClick()">4 teaspoons vital wheat gluten</li></ul><ul><li onclick="handleItemClick()">⅝ cups (142g) lukewarm water</li><li onclick="handleItemClick()">1 cup (241g) sourdough starter, ripe (fed) or discard</li><li onclick="handleItemClick()">2¼ to 2½  cups (270g to 301g) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">1¼ teaspoons (7.5g) salt</li><li onclick="handleItemClick()">1 teaspoon sugar</li><li onclick="handleItemClick()">1 teaspoons instant yeast (depending on the vigor of your fed starter)</li><li onclick="handleItemClick()">2 teaspoons vital wheat gluten</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_SourdoughBaguettesKingArthur', '<ol><li onclick="handleItemClick()">In a large bowl, combine the water, starter, and half the flour, mixing until smooth.</li><li onclick="handleItemClick()">Stir in the salt, sugar, yeast, and gluten, then most of the additional flour.</li><li onclick="handleItemClick()">Stir until the dough pulls away from the sides of the bowl, adding only enough additional flour as necessary; a slack (sticky) dough makes a light loaf.</li><li onclick="handleItemClick()">Knead the dough for about 7 minutes in a stand mixer; or 8 to 10 minutes by hand, on a lightly greased work surface. You may also knead this dough using the dough cycle on your bread machine; once it\'s finished kneading, transfer it to a bowl to rise, as directed below.</li><li onclick="handleItemClick()">Turn the dough into an oiled bowl, cover the bowl, and let the dough rise until doubled in bulk, about 90 minutes.</li><li onclick="handleItemClick()">Gently deflate the dough, and divide it into six pieces (for thin baguettes) or three pieces (for thicker Italian loaves).</li><li onclick="handleItemClick()">Shape each piece into a 16" long loaf, and place the loaves, at least 4" apart, on parchment-lined baking sheets, or in lightly greased baguette pans (French loaf pans). If you\'re using baguette pans, make the loaves 15" long.</li><li onclick="handleItemClick()">Cover the loaves with lightly greased plastic wrap, and let them rise for 1½  to 2 hours, or until they\'re nice and puffy. Towards the end of the rising time, preheat your oven to 450°F.</li><li onclick="handleItemClick()">For a classic look, make three diagonal slashes in each loaf, cutting about ¼" deep. For taller, rounder baguettes, don\'t slash.</li><li onclick="handleItemClick()">Bake the baguettes for about 25 minutes, or until they\'re a rich golden brown. If you baked in baguette pans, remove the loaves from the oven and unmold. Turn off the oven, return the loaves (without the pan) to the oven, and crack the oven door open a few inches. If you baked on a parchment-lined baking sheet, simply turn off the oven and crack the oven door open a few inches. Letting the loaves cool right in the turned-off oven helps preserve their crunchy crust.</li><li onclick="handleItemClick()">Remove the baguettes from the oven, and cool them completely on a rack. Store any leftovers in a paper bag for a day or so; paper will preserve their crunchy crust better than plastic. Freeze for longer storage.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_SourdoughBaguettesKingArthur', '<ul><li onclick="handleItemClick()">From <a href="https://www.kingarthurbaking.com/recipes/sourdough-baguettes-recipe" target="_blank">https://www.kingarthurbaking.com/recipes/sourdough-baguettes-recipe</a></li><li onclick="handleItemClick()">date created: [2021-06-05 Sat] </li><li onclick="handleItemClick()">[2021-06-06 Sun] Made for Heimburg dinner. Due to a pickleball-related incident, the bread rose way too long (instead of 2 hours it was more like 3½). The bread rose but after slashing fell and was quite flat. But good flavor.</li><li onclick="handleItemClick()">[2022-12-06 Tue] Made again. The bread is fine but without much flavor.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_SoccaFarinata', '<ul><li onclick="handleItemClick()">cup chickpea flour</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">1 teaspoon freshly ground black pepper</li><li onclick="handleItemClick()">4 to 6 tablespoons olive oil</li><li onclick="handleItemClick()">½ large onion, thinly sliced</li><li onclick="handleItemClick()">2 teaspoons chopped fresh rosemary</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_SoccaFarinata', '<ol><li onclick="handleItemClick()">Heat the oven to 450°.</li><li onclick="handleItemClick()">Put a well-seasoned or nonstick 12-inch pizza pan or cast-iron skillet in oven. (If you have a socca pan, obviously that will work well also.)</li><li onclick="handleItemClick()">Put the chickpea flour in a bowl; add the salt and pepper.</li><li onclick="handleItemClick()">Slowly add 1 cup lukewarm water, whisking to eliminate lumps.</li><li onclick="handleItemClick()">Stir in 2 tablespoons olive oil.</li><li onclick="handleItemClick()">Cover and let sit while the oven heats, or for as long as 12 hours. The batter should be about the consistency of heavy cream.</li><li onclick="handleItemClick()">Remove the pan, pour 2 tablespoons of the oil into it and swirl.</li><li onclick="handleItemClick()">Add the onions return the pan to the oven and cook, stirring once or twice, until they’re well browned, 6 to 8 minutes.</li><li onclick="handleItemClick()">Stir in the rosemary.</li><li onclick="handleItemClick()">Stir the onions and rosemary into the batter, then immediately pour the batter into the pan.</li><li onclick="handleItemClick()">Bake for 10 to 15 minutes, or until the pancake is firm and the edges set.</li><li onclick="handleItemClick()">Heat the broiler and brush the top of the pancake with 1 or 2 tablespoons of oil if it looks dry.</li><li onclick="handleItemClick()">Set the pancake a few inches away from the broiler, and cook just long enough to brown it in spots.</li><li onclick="handleItemClick()">Cut it into wedges, and serve hot or warm.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_SoccaFarinata', '<ul><li onclick="handleItemClick()">From <a href="https://cooking.nytimes.com/recipes/1014757-socca-farinata" target="_blank">https://cooking.nytimes.com/recipes/1014757-socca-farinata</a></li><li onclick="handleItemClick()">date created: [2022-09-01 Thu] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_SandwichBread', '<ul><li onclick="handleItemClick()">2 teaspoon active dry yeast</li><li onclick="handleItemClick()">1¼ cup warm water</li><li onclick="handleItemClick()">2 tablespoon sugar</li><li onclick="handleItemClick()">1 cup almond milk (or any nondairy milk)</li><li onclick="handleItemClick()">1 tablespoon salt (use less if on a low sodium diet)</li><li onclick="handleItemClick()">2 tablespoon avocado or olive oil</li><li onclick="handleItemClick()">~6 cups (720 g) bread flour (can substitute ⅓ with whole wheat flour)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_SandwichBread', '<ol><li onclick="handleItemClick()">Mix the yeast and sugar with ¼ cup of water and set aside for five minutes until it froths, indicating yeast is active.</li><li onclick="handleItemClick()">To the yeast and water mixture, add the remaining cup of water, milk, salt and oil. Then add 2½ cups of bread flour or 1 cup of bread flour and 1½ cups of whole wheat flour, if using that.</li><li onclick="handleItemClick()">Mix in a stand mixer on low speed or by hand until a dough forms. If it\'s sticky, continue adding more bread flour, a little at a time, until you have a soft and supple but not sticky or tacky dough.</li><li onclick="handleItemClick()">Continue kneading for another 10 minutes.</li><li onclick="handleItemClick()">Form a smooth ball with the dough and place in an oiled bowl, turning over once to cover the top with oil. Cover and let it rise in a warm place for 1 to 1 ½ hours, until doubled in volume.</li><li onclick="handleItemClick()">Punch down the dough, form into a ball, and return it to the bowl to rise for another hour.</li><li onclick="handleItemClick()">Grease two standard (6-cup) loaf pans. Now punch the dough down again and divide it into two. Using a rolling pin, roll out each loaf into a rectangle, about 6 X 8 inches. Roll it up into a cylinder and tuck the seams underneath. Place each loaf into a loaf pan.</li><li onclick="handleItemClick()">Cover the dough loosely with oiled cling wrap or with a shower cap, and set it aside to rise for about 1 hour until the dough rises above the pan, forming a nice dome.</li><li onclick="handleItemClick()">Preheat the oven to 400 degrees. Bake the loaves for 35 minutes.</li><li onclick="handleItemClick()">Cool on a rack for about 10 minutes, then remove the loaves from the pan and continue cooling before you slice.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_SandwichBread', '<ul><li onclick="handleItemClick()">From <a href="https://holycowvegan.net/perfect-sandwich-bread/#recipe" target="_blank">https://holycowvegan.net/perfect-sandwich-bread/#recipe</a></li><li onclick="handleItemClick()">date created: [2023-02-28 Tue] </li><li onclick="handleItemClick()">The original recipe called for 3-4 cups bread flour. Not nearly enough!</li><li onclick="handleItemClick()">[2023-02-26 Sun] Made and used for cucumber finger sandwiches for a Vegan High Tea. Was well-received.</li><li onclick="handleItemClick()">[2023-03-14 Tue] Made with about ⅓ Spelt and Emmer flour. Really tasty and good structure. After cooling, I sliced and froze it. It held up well. I decide this could be our daily bread (it\'s the best thing since sliced bread?).</li><li onclick="handleItemClick()">[2023-08-13 Sun] The original recipe called for 4 teaspoon of yeast; 2 is plenty.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_RusticSourdoughTwoWays', '<ul><li onclick="handleItemClick()">1 cup (227g) ripe Sourdough Starter</li><li onclick="handleItemClick()">1½ (340g) lukewarm water</li><li onclick="handleItemClick()">1 teaspoon yeast</li><li onclick="handleItemClick()">2½ teaspoons salt</li><li onclick="handleItemClick()">5 cups (602g) all-purpose flour</li><li onclick="handleItemClick()">¾ cup (96g) fruit blend (e.g., a mixture of Thompson raisins, golden raisins, dried cranberries, etc.)</li><li onclick="handleItemClick()">½ cup (57g) toasted nuts (perhaps mixed variety)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_RusticSourdoughTwoWays', '<ol><li onclick="handleItemClick()">Combine all ingredients except for the fruit and nuts, kneading to form a smooth dough.</li><li onclick="handleItemClick()">Allow the dough to rise in a covered bowl until doubled in size, about 90 minutes.</li><li onclick="handleItemClick()">Gently divide the dough in half; it\'ll deflate somewhat.</li><li onclick="handleItemClick()">Knead the fruit and nuts into half the dough.</li><li onclick="handleItemClick()">Shape the dough into two rounds or oval loaves, as desired.</li><li onclick="handleItemClick()">Place in flour brotforms or couche or towel-lined bowls.</li><li onclick="handleItemClick()">Cover and let rise until very puffy, about 1 hour.</li><li onclick="handleItemClick()">Toward the end of the rising time place a baking stone or steel in the oven and preheat to 425°.</li><li onclick="handleItemClick()">Turn the risen loaves over onto a piece of parchment.</li><li onclick="handleItemClick()">Spray the loaves with lukewarm water and dust generously with flour.</li><li onclick="handleItemClick()">Make two fairly deep diagonal slices in each. Use firm, quick motions; a sharp knife or lame works well here.</li><li onclick="handleItemClick()">Slide loaves onto the stone.</li><li onclick="handleItemClick()">Bake the breads for 25 to 30 minutes, until they are a very deep golden brown.</li><li onclick="handleItemClick()">Remove from the oven and cool on a rack.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_RusticSourdoughTwoWays', '<ul><li onclick="handleItemClick()">From King Arthur Baking Company catalog, Holiday Inspiration 2021, page 38.</li><li onclick="handleItemClick()">date created: [2021-11-02 Tue] </li><li onclick="handleItemClick()">[2021-10-06 Wed] I made both loaves. The plain one was fairly insipid. But the fruited one was quite pleasant and made lovely toast for several days.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_RusticBread', 'Makes 2 large loaves<ul><li onclick="handleItemClick()">½ cup wheat berries or cracked wheat (optional)</li></ul><ul><li onclick="handleItemClick()">>12.5 oz. water (1½ cups)</li><li onclick="handleItemClick()">⅛ teaspoon instant yeast</li><li onclick="handleItemClick()">1 lb. bread flour (3½ cups; 420 grams)</li><li onclick="handleItemClick()">½ tablespoon (5 grams) salt</li></ul><ul><li onclick="handleItemClick()">12.5 oz. water (1½ cups)</li><li onclick="handleItemClick()">½ teaspoon instant yeast</li><li onclick="handleItemClick()">8 oz. bread flour (2  cups; 240 grams)</li><li onclick="handleItemClick()">8 oz. whole wheat or rye flour or a mixture of them (around 2 cups; 240 grams)</li><li onclick="handleItemClick()">¼ cup or so flax meal (optional) </li><li onclick="handleItemClick()">½ tablespoon (5 grams) salt</li><li onclick="handleItemClick()">all of the preferment </li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_RusticBread', '<ol><li onclick="handleItemClick()">If using grains, soak in water, enough to cover, over night.</li><li onclick="handleItemClick()">Put the yeast in the water and stir. Mix the flour and salt together in a bowl and pour in the yeasted water. Mix until the flour is hydrated, adding more water if necessary. Cover the bowl with plastic wrap and leave the pre-ferment out at room temperature overnight (up to 16 hours... if you need more time before baking put it in the refrigerator).</li><li onclick="handleItemClick()">To make the final dough, combine all of the ingredients except the pre-ferment in a mixing bowl. Chop the pre-ferment up into small pieces and mix or knead it into the final dough until they are thoroughly combined. This is quite difficult to do by hand: Hamelman assumes the baker has a mixer and can mix it for 5 minutes by machine. I mix and knead my dough by hand for about 10 minutes.</li><li onclick="handleItemClick()">Place the dough back in a greased bowl and ferment for 2½ hours, punching down or folding the dough twice during that time.</li><li onclick="handleItemClick()">(Folding the dough consists of taking the dough out of the bowl, spreading it out a little on a clean surface, folding it in thirds like a letter, rotating it 90 degrees and folding it up again, and then returning the dough to the bowl and covering it again. Like punching down, folding degases the dough some, but it also encourages gluten development. More on this topic in a future post.)</li><li onclick="handleItemClick()">At the end of the fermentation, divide the dough into two pieces and preshape each into a ball. Cover with a clean towel and let each rest for 5 to 10 minutes before shaping into the final shape. Once shaped, cover the loaves with a clean towel and set aside for a final rise, approximately 1¼ to 1½ hours.</li><li onclick="handleItemClick()">Halfway though the final rise, begin preheating the oven to 450 degrees. If you are using a baking stone, preheat it as well.</li><li onclick="handleItemClick()">Right before placing it in the oven, score the loaves. Place them in the oven and use whatever technique you use to create stream in the oven (squirt bottle, skillet full of hot water, etc) to encourage proper crust development.</li><li onclick="handleItemClick()">After 20 minutes of baking, rotate the loaves 180 degrees so that they\'ll bake evenly. Bake until an instant read thermometer reads around 200 degrees, which took approximately 35 minutes for my batard ("football") shaped loaves.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_RusticBread', '<ul><li onclick="handleItemClick()">date created: [2011-03-04 Fri] </li><li onclick="handleItemClick()">From <a href="http://www.thefreshloaf.com/recipes/rusticbread" target="_blank">http://www.thefreshloaf.com/recipes/rusticbread</a>February 2011</li><li onclick="handleItemClick()">(I\'ve tried preheating to 500 degrees, then lowering to 450 degrees and baking for 20 minutes on speed bake. Crispy crust, moist and tender, but a bit gummy inside.)</li><li onclick="handleItemClick()">[2020-03-23 Mon] Added ~2 cups cheddar cheese and a diced jalapeño. The dough may have risen too long in the second rise and when in the oven, the cheese exploded out of the loaf. Tasty, nevertheless. Gave one loaf for Nancy.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_PumpkinBread', 'Prep Time: 20 minutes<br>Cook Time: 60-70 minutes<ul><li onclick="handleItemClick()">3 cups (594 grams) sugar </li><li onclick="handleItemClick()">1 cup vegetable oil</li><li onclick="handleItemClick()">4 eggs, lightly bean</li><li onclick="handleItemClick()">16 ounces canned unsweetened pumpkin</li><li onclick="handleItemClick()">1 cup raisins (optional)</li><li onclick="handleItemClick()">3½ cups (420 grams) flour</li><li onclick="handleItemClick()">2 teaspoons salt</li><li onclick="handleItemClick()">2 teaspoons baking soda</li><li onclick="handleItemClick()">1 teaspoon baking powder</li><li onclick="handleItemClick()">1 teaspoon nutmeg</li><li onclick="handleItemClick()">1 teaspoon allspice</li><li onclick="handleItemClick()">1 teaspoon cinnamon</li><li onclick="handleItemClick()">½ teaspoon cloves</li><li onclick="handleItemClick()">⅔ cup water</li></ul><ul><li onclick="handleItemClick()">1½ cups (297 grams) sugar </li><li onclick="handleItemClick()">½ cup vegetable oil</li><li onclick="handleItemClick()">2 eggs, lightly bean</li><li onclick="handleItemClick()">8 ounces canned unsweetened pumpkin</li><li onclick="handleItemClick()">½ cup raisins (optional)</li><li onclick="handleItemClick()">1¾ cups (240 grams) flour</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">1 teaspoon baking soda</li><li onclick="handleItemClick()">½ teaspoon baking powder</li><li onclick="handleItemClick()">½ teaspoon nutmeg</li><li onclick="handleItemClick()">½ teaspoon allspice</li><li onclick="handleItemClick()">½ teaspoon cinnamon</li><li onclick="handleItemClick()">¼ teaspoon cloves</li><li onclick="handleItemClick()">⅓ cup water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_PumpkinBread', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees.</li><li onclick="handleItemClick()">Butter and flour two 9x5 loaf pans.</li><li onclick="handleItemClick()">Stir together sugar and oil. Stir in eggs, pumpkin and, optionally, the raisins.</li><li onclick="handleItemClick()">Combine dry ingredients in separate bowl.</li><li onclick="handleItemClick()">Blend dry ingredients and water into wet mixture, alternating.</li><li onclick="handleItemClick()">Divide batter between two loaf pans.</li><li onclick="handleItemClick()">Bake for 60 to 70 minutes or until cake tester comes out clean. Let stand 10 minutes. Remove from pans and cool.</li></ol><span class="tip">Two Loaves will also make one loaf plus three mini-loaves.   </span>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_PumpkinBread', '<ul><li onclick="handleItemClick()"><a href="http://www.foodnetwork.com/food/cda/recipe_print/0,1946,FOOD_9936_4067_RECIPE-PRINT-FULL-PAGE-FORMATTER,00.html" target="_blank">http://www.foodnetwork.com/food/cda/recipe_print/0,1946,FOOD_9936_4067_RECIPE-PRINT-FULL-PAGE-FORMATTER,00.html</a></li><li onclick="handleItemClick()">Recipe Courtesy of Cathy Lowe</li><li onclick="handleItemClick()">[2018-02-21 Wed] made for Women@DJ: yum</li><li onclick="handleItemClick()">[2016-11-27 Sun] made for Sprint Reviews + TLC; good (although I used duck eggs and got some shell in them!)</li><li onclick="handleItemClick()">[2016-06-26 Sun] made for TC, Doris and Joanne; still a hit!</li><li onclick="handleItemClick()">[2009-12-13 Sun] Again on (for HLTA and DJ work colleagues). Another hit.</li><li onclick="handleItemClick()">[2006-12-11 Mon] A hit! Made for Kate, Jan, Ian, Dan, TLC</li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_Potica', '<ul><li onclick="handleItemClick()">4 tablespoons (57g) unsalted butter, softened</li><li onclick="handleItemClick()">¼ cup (50g) sugar</li><li onclick="handleItemClick()">1 teaspoon (6g) salt</li><li onclick="handleItemClick()">¾ cup (170g) milk</li><li onclick="handleItemClick()">2 large eggs</li><li onclick="handleItemClick()">2½  teaspoons instant yeast or active dry yeast</li><li onclick="handleItemClick()">2 teaspoons vanilla extract</li><li onclick="handleItemClick()">3 cups (361g) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">¼ cup (46g) potato flour or ½ cup (46g) dried potato flakes</li></ul><ul><li onclick="handleItemClick()">4½  cups (510g) chopped walnuts or pecans</li><li onclick="handleItemClick()">¾ cup (149g) sugar</li><li onclick="handleItemClick()">2 tablespoons (15g) King Arthur Unbleached All-Purpose Flour or 1 tablespoon Instant ClearJel</li><li onclick="handleItemClick()">¼ teaspoon salt</li><li onclick="handleItemClick()">2 teaspoons cinnamon</li><li onclick="handleItemClick()">3 large eggs</li><li onclick="handleItemClick()">¼ cup (57g) milk</li><li onclick="handleItemClick()">¼ cup (78g) maple syrup</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li><li onclick="handleItemClick()">2 teaspoons grated orange rind (zest), optional</li></ul><ul><li onclick="handleItemClick()">1 large egg, beaten with 2 tablespoons water</li><li onclick="handleItemClick()">¼  cup (28g) finely chopped walnuts or pecans</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_Potica', '<ol><li onclick="handleItemClick()">To make the dough: Place the butter, sugar, and salt in a large mixing bowl. Bring the milk to a simmer on the stove or in the microwave and pour over the ingredients. Stir briefly, then let the mixture cool to lukewarm.</li><li onclick="handleItemClick()">While the mixture is cooling, weigh your flour; or measure it by gently spooning it into a cup, then sweeping off any excess.</li><li onclick="handleItemClick()">When cooled, whisk in the eggs, yeast, and vanilla. Whisk about 1 cup of the all-purpose flour with the potato flour (or potato flakes) and stir into the wet ingredients. Add the remaining flour, mixing to form a soft dough.</li><li onclick="handleItemClick()">Knead the dough for 8 to 10 minutes, until shiny and smooth. Cover the dough and let it rise for 1 hour, then refrigerate it for at least 1 hour, and as long as overnight.</li><li onclick="handleItemClick()">To make the filling: Put the nuts, sugar, flour or Instant ClearJel, salt, and cinnamon in the bowl of a food processor or blender. Process in short bursts to grind the nuts.</li><li onclick="handleItemClick()">With the food processor running, add the eggs, milk, maple syrup, and vanilla. Add the orange zest and pulse to incorporate.</li><li onclick="handleItemClick()">To assemble: On a greased work surface, roll the dough into a 26" x 18" rectangle, with a long side facing you. Spread the filling evenly over the surface, leaving 1" of one long edge uncovered.</li><li onclick="handleItemClick()">Roll the dough toward the uncovered edge, pinching to seal the seam and the ends to enclose the filling.</li><li onclick="handleItemClick()">Grease two 8 1/2" x 4 1/2" loaf pans and line with parchment. Cut the rolled-up dough in half, so that you end up with two logs about 13" to 14" long.</li><li onclick="handleItemClick()">Working with one piece at a time, bring the ends of the log together to make a ring shape, pinching and sealing the spot where they meet to enclose the filling. Flatten the ring gently (it\'ll shape itself into a 6 1/2" to 7" oblong). Settle the ring into the bottom of the pan with its two sides next to one another (not on top of each other), and the original long seam facing down. Press the ring gently to spread it over the bottom and into the corners of the pan.  </li><li onclick="handleItemClick()">Repeat with the second piece of dough and the second pan.</li><li onclick="handleItemClick()">Cover the loaves and let them rise until puffy, up to 1 1/2 hours. Toward the end of the rise time, preheat the oven to 350°F.</li><li onclick="handleItemClick()">When the loaves have risen, brush the tops with the beaten egg and sprinkle with the finely chopped nuts.</li><li onclick="handleItemClick()">Bake the loaves for 50 to 55 minutes. Check the tops after 20 minutes, tenting with foil if necessary to keep them from over-browning. The breads are done when the centers read 190°F when measured with a digital thermometer.</li><li onclick="handleItemClick()">Remove from the oven and let cool in the pans on a rack for 20 minutes before tipping out of the pans and returning to the rack to finish cooling completely.</li><li onclick="handleItemClick()">Store bread, well wrapped, on the counter for up to three days; freeze for longer storage.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_Potica', '<ul><li onclick="handleItemClick()">From <a href="https://www.kingarthurbaking.com/recipes/potica-recipe" target="_blank">https://www.kingarthurbaking.com/recipes/potica-recipe</a></li><li onclick="handleItemClick()">date created: [2021-03-14 Sun] </li><li onclick="handleItemClick()">[2021-03-14 Sun] It\'s a rich Slovenian bread, not far off from babka. This one is packed with pecans and cinnamony goodness, slightly sweet and citrusy.  Both Tracey and found it not too terrible.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_PitaBread', 'About 2 hours<ul><li onclick="handleItemClick()">2  teaspoons active dry yeast</li><li onclick="handleItemClick()">½  teaspoon sugar</li><li onclick="handleItemClick()">35  grams whole-wheat flour (¼ cup), preferably freshly milled</li><li onclick="handleItemClick()">310  grams unbleached all-purposed flour (2½ cups)</li><li onclick="handleItemClick()">1  teaspoon kosher salt</li><li onclick="handleItemClick()">2  tablespoons olive oil</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_PitaBread', '<ol><li onclick="handleItemClick()">Make sponge: Put 1 cup lukewarm water in a large mixing bowl. Add yeast and sugar. Stir to dissolve. Add the whole-wheat flour and ¼ cup all-purpose flour and whisk together. Put bowl in a warm (not hot) place, uncovered, until mixture is frothy and bubbling, about 15 minutes.</li><li onclick="handleItemClick()">Add salt, olive oil and nearly all remaining all-purpose flour (reserve ½ cup). With a wooden spoon or a pair of chopsticks, stir until mixture forms a shaggy mass. Dust with a little reserved flour, then knead in bowl for 1 minute, incorporating any stray bits of dry dough.</li><li onclick="handleItemClick()">Turn dough onto work surface. Knead lightly for 2 minutes, until smooth. Cover and let rest 10 minutes, then knead again for 2 minutes. Try not to add too much reserved flour; the dough should be soft and a bit moist. (At this point, dough may refrigerated in a large zippered plastic bag for several hours or overnight. Bring dough back to room temperature, knead into a ball and proceed with recipe.)</li><li onclick="handleItemClick()">Clean the mixing bowl and put dough back in it. Cover bowl tightly with plastic wrap, then cover with a towel. Put bowl in a warm (not hot) place. Leave until dough has doubled in size, about 1 hour.</li><li onclick="handleItemClick()">Heat oven to 475 degrees. On bottom shelf of oven, place a heavy-duty baking sheet, large cast-iron pan or ceramic baking tile. Punch down dough and divide into 8 pieces of equal size. Form each piece into a little ball. Place dough balls on work surface, cover with a damp towel and leave for 10 minutes.</li><li onclick="handleItemClick()">Remove 1 ball (keeping others covered) and press into a flat diskc with rolling pin. Roll to a 6-inch circle, then to an 8-inch diameter, about ⅛ inch thick, dusting with flour if necessary. (The dough will shrink a bit while baking.)</li><li onclick="handleItemClick()">Carefully lift the dough circle and place quickly on hot baking sheet. After 2 minutes the dough should be nicely puffed. Turn over with tongs or spatula and bake 1 minute more. The pita should be pale, with only a few brown speckles. Transfer warm pita to a napkin-lined basket and cover so bread stays soft. Repeat with the rest of the dough balls.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Bread_PitaBread', '<ul><li onclick="handleItemClick()">8 six-inch diameter breads</li></ul>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_PitaBread', '<a href="https://cooking.nytimes.com/recipes/1016071-homemade-pita-bread" target="_blank">https://cooking.nytimes.com/recipes/1016071-homemade-pita-bread</a>[2018-02-03 Sat] Made for TC and Freedman; good. TC said, like most pitas, they were bland.' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_PioneerBread', '<ul><li onclick="handleItemClick()">1 pkg. active dry yeast</li><li onclick="handleItemClick()">¾ cup warm water (105 to 115 degrees)</li><li onclick="handleItemClick()">3 tablespoons sugar</li><li onclick="handleItemClick()">2 teaspoons salt</li><li onclick="handleItemClick()">1 egg</li><li onclick="handleItemClick()">3 tablespoons butter</li><li onclick="handleItemClick()">⅓ cup yellow cornmeal</li><li onclick="handleItemClick()">2 to 2-½ cups unbleached flour</li><li onclick="handleItemClick()">softened butter and extra cornmeal</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_PioneerBread', '<ol><li onclick="handleItemClick()">Dissolve yeast in warm water in large mixer bowl.</li><li onclick="handleItemClick()">Add sugar, salt, egg, butter, ⅓ cup cornmeal and 1 cup of the flour.</li><li onclick="handleItemClick()">Blend ½ minute on low speed, scraping bowl constantly.</li><li onclick="handleItemClick()">Beat 2 minutes on medium speed, scraping bowl occasionally.</li><li onclick="handleItemClick()">Stir in enough remaining flour to make dough easy to handle.</li><li onclick="handleItemClick()">Turn dough onto lightly floured surface; knead until smooth and elastic, about 5 minutes.</li><li onclick="handleItemClick()">Place in greased bowl; turn greased side up; cover.</li><li onclick="handleItemClick()">let rise in warm place until double, 1 to 1-½ hours. (Dough is ready if an indentation remains when touched.)</li><li onclick="handleItemClick()">Punch down dough. Flatten dough with hands or rolling pin into rectangle, 18x9 inches. Fold crosswise into thirds, overlapping the 2 sides. Roll dough tightly toward you, beginning at one of the open ends. Press with thumbs to seal after each turn. Pinch edge firmly to seal. With side of hand, press each end to seal: fold ends under.</li><li onclick="handleItemClick()">Place loaf seam side down in greased loaf pan, 9x5x3 or 8½x4½x2½ inches.</li><li onclick="handleItemClick()">Brush lightly with butter; sprinkle with cornmeal.</li><li onclick="handleItemClick()">Let rise until double, 50 to 60 minutes.</li><li onclick="handleItemClick()">Heat oven to 400 degrees.</li><li onclick="handleItemClick()">Bake until loaf sounds hollow when tapped, 25 to 30 minutes.</li><li onclick="handleItemClick()">Remove from pan; cool on wire rake with side down (long side).</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_PioneerBread', '<ul><li onclick="handleItemClick()">From Betty Crocker\'s Bread Book <a href="http://aveshandmade.blogspot.com/2010/02/pioneer-bread.html" target="_blank">http://aveshandmade.blogspot.com/2010/02/pioneer-bread.html</a></li><li onclick="handleItemClick()">date created: [2021-04-04 Sun] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_PanePugliese', 'Makes 2 loaves<ul><li onclick="handleItemClick()">0.5 cup (113g) cool water</li><li onclick="handleItemClick()">1.25 cup (149g) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">⅛ teaspoon instant yeast</li></ul><ul><li onclick="handleItemClick()">all of the biga (above)</li><li onclick="handleItemClick()">1.5 cup (340g) lukewarm water</li><li onclick="handleItemClick()">4 cups (482g) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">2 teaspoons salt</li><li onclick="handleItemClick()">1 teaspoon instant yeast</li></ul>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_PanePugliese', '<ol><li onclick="handleItemClick()">In a small mixing bowl, combine the water, flour, and yeast to form a soft dough. Don\'t knead it; just make sure all of the ingredients are well-incorporated. Set this mixture aside in a warm place, covered, for 12 to 16 hours; overnight is fine.</li><li onclick="handleItemClick()">Knead all of the dough ingredients together, using a mixer or bread machine, until the dough is cohesive and elastic (though not necessarily smooth), about 10 minutes.</li><li onclick="handleItemClick()">Cover the dough and let it rise in a warm place for 2 to 3 hours, gently stirring it down each hour. Letting it rise the full 3 hours will enhance the bread\'s flavor.</li><li onclick="handleItemClick()">Lightly grease a half-sheet pan or other flat pan; or line with parchment. Scoop the very wet dough, in two separate pieces, onto the pan lengthwise, shaping each piece into a rough oval as best you can.</li><li onclick="handleItemClick()">Cover the dough with heavily greased plastic wrap, and allow it to rise for about 90 minutes. It\'ll spread quite a bit; don\'t worry, it\'s supposed to. Towards the end of the rising time, preheat the oven to 450 degreesF.</li><li onclick="handleItemClick()">Spray the loaves heavily with warm water, and bake them for 25 to 30 minutes, or until they\'re a deep golden brown.</li><li onclick="handleItemClick()">Turn the oven off, prop the door open, transfer the loaves from the pan to the oven rack, and allow them to cool in the turned-off oven.</li></ol><ul><li onclick="handleItemClick()"><a href="https://www.kingarthurflour.com/recipes/pane-pugliese-recipe" target="_blank">https://www.kingarthurflour.com/recipes/pane-pugliese-recipe</a></li><li onclick="handleItemClick()">[2018-01-08 Mon] Made two loaves while I worked from home. T & I were both pleased with it overall: light and crusty. Somewhat reminiscent of <a href="https://www.kingarthurflour.com/recipes/no-knead-crusty-white-bread-recipe" target="_blank">https://www.kingarthurflour.com/recipes/no-knead-crusty-white-bread-recipe</a>, but with a bit more character.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_PandeCristal', '<ul><li onclick="handleItemClick()">15g olive oil</li><li onclick="handleItemClick()">500g water</li><li onclick="handleItemClick()">500g King Arthur Unbleached Bread Flour</li><li onclick="handleItemClick()">2.5g (¾ teaspoon) instant yeast</li><li onclick="handleItemClick()">10g salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_PandeCristal', '<ol><li onclick="handleItemClick()">Oil a two-quart rectangular baking dish (10” x 7”) with the olive oil. If you don’t have a 2-quart dish, an 8” or 9” square pan will work. Don’t worry about any pan you use being oven-safe; you won’t be baking the bread in it.</li><li onclick="handleItemClick()">To make the dough: Weigh your flour; or measure it by gently spooning it into a cup, then sweeping off any excess.</li><li onclick="handleItemClick()">In a medium bowl, mix the water, flour, yeast, and salt until thoroughly combined and homogeneous. Note: The dough starts off very slack and wet. That’s OK; it will transform itself through time and folds.</li><li onclick="handleItemClick()">Pour the dough into the pan. Check the dough’s temperature by inserting a digital thermometer into the center. If it\'s less than 72°F, move the pan to a warmer spot, e.g., your oven with the light turned on.</li><li onclick="handleItemClick()">Cover the pan and allow the dough to rest for 20 minutes.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>: Use your wet hands to grab a section of dough from one side, lift it up, then press it down into the middle. Repeat this 8 to 12 times, rotating the starting point of the grab around the dough.</li><li onclick="handleItemClick()">Cover the dish and allow the dough to rest for 20 minutes.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>: With wet hands, reach under the dough and stretch the middle upward until the dough releases from the dish. Roll it forward off your hands, allowing it to fold over (or “coil”) on itself. This is called a coil fold. Rotate the dish 90 degrees (a quarter turn) and repeat. Continue performing this folding action until the dough feels like it won’t stretch and elongate easily, usually four to five times initially. Note: You’ll be doing this three more times, each time building strength and developing the dough. See “tips,” below, for more details,</li><li onclick="handleItemClick()">Cover the pan and allow the dough to rest for 20 minutes.</li><li onclick="handleItemClick()">Repeat the coil fold. Cover the bowl and allow the dough to rest for 20 minutes.</li><li onclick="handleItemClick()">At this point, the dough should be easier to handle and feel tighter. Repeat the coil fold using only two or three folds this time. Cover the bowl and allow the dough to rest for 20 minutes.</li><li onclick="handleItemClick()">Repeat the coil fold one last time, using only one or two folds if the dough is relatively strong. Cover the bowl and allow the dough to rest for about 80 minutes.</li><li onclick="handleItemClick()">To divide the dough: As gently as possible, turn the dough out onto a heavily floured surface, maintaining the rectangle or square shape – be careful not to deflate the delicate dough. Sprinkle a generous amount of flour on top of the dough, leaving no exposed sticky spots. Then, working as gently as possible, use a bench knife or other sharp knife to divide it into four pieces. Gently place two pieces on a piece of parchment, leaving space between them. Repeat with the remaining two pieces of dough, placing them on another piece of parchment.</li><li onclick="handleItemClick()">Allow the loaves to rest at room temperature for 2 hours, uncovered. While the loaves are resting, preheat the oven to 475°F with a baking stone or steel on a lower rack. Allow the oven to preheat for 1 hour to ensure it’s thoroughly heated. The loaves are ready for the oven when there are a few large bubbles on the surface of each loaf and they feel light and airy.</li><li onclick="handleItemClick()">To bake the bread: Carefully slide the two loaves (still resting on the parchment) into the oven onto the preheated stone or steel. If space is tight and the full sheet of parchment won’t fit on the stone or steel, cut the parchment between the two loaves and arrange them as best you can. Allow the other two loaves to continue to rest.</li><li onclick="handleItemClick()">Bake the loaves for 15 minutes, then transfer them, from the stone or steel, directly onto a rack in the upper third of the oven for an additional 13 to 15 minutes. Moving them allows the baking stone or steel to become hot again in preparation for the next two loaves. After a total of 30 minutes of baking, remove the loaves from the oven and allow them to cool on a rack.</li><li onclick="handleItemClick()">Repeat the process with the two remaining loaves. Cool the bread fully before slicing.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>: Wrap the bread loosely and store it at room temperature for up to several days; freeze for longer storage.</li></ol><span class="tip">Sample timelines:  </span><span class="tip">Unknown type: ’table’</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_PandeCristal', '<ul><li onclick="handleItemClick()">From <a href="https://www.kingarthurbaking.com/recipes/pan-de-cristal-recipe" target="_blank">https://www.kingarthurbaking.com/recipes/pan-de-cristal-recipe</a></li><li onclick="handleItemClick()">date created: [2022-02-01 Tue] </li><li onclick="handleItemClick()">[2022-02-01 Tue] This recipe has crazy high hydration. But it gives good directions, including videos of how to do the folds, which really do strengthen the dough. The one issue is that the bake time is way too long: 15 minutes on a hot stone and then perhaps 5 more on a rack is all that is required. More than that and you get some pretty dark crust. The bread was light and crispy, with about as much flavor as you can expect from a same-day bread.</li><li onclick="handleItemClick()">[2022-03-26 Sat] They really only need that first 15 minutes... </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_PaindeCampagne', '<ul><li onclick="handleItemClick()">50g mature whole wheat starter</li><li onclick="handleItemClick()">100g water</li><li onclick="handleItemClick()">100g whole wheat flour</li></ul><ul><li onclick="handleItemClick()">200g of the levain</li><li onclick="handleItemClick()">350g water</li><li onclick="handleItemClick()">50g rye</li><li onclick="handleItemClick()">½ tsp diastatic malt</li><li onclick="handleItemClick()">450g bread flour</li><li onclick="handleItemClick()">10g salt (about 0.56 Tablespoons)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_PaindeCampagne', '<ol><li onclick="handleItemClick()">Mix levain ingredients. Allow to peak, between four and five hours in a 28 degrees C kitchen. It ought to have a nice fruity aroma that wasn\'t at all sour.</li><li onclick="handleItemClick()">Disperse the levain in the water with a wire whisk until it has a good foam on top. Next, whisk in rye and malt powder. Then add bread flour with spatula and mix until all the flour has been moistened.</li><li onclick="handleItemClick()">Autolyse for 50 minutes.</li><li onclick="handleItemClick()">Add salt.</li><li onclick="handleItemClick()">Knead to medium gluten development.</li><li onclick="handleItemClick()">Bulk ferment for 1 hour with a turn at 30 minutes.</li><li onclick="handleItemClick()">Pre-shape dough and allow to rest for 10 minutes.</li><li onclick="handleItemClick()">Shape final dough and put into well-floured banneton.</li><li onclick="handleItemClick()">Let rise for about half an hour, covered.</li><li onclick="handleItemClick()">Retard dough for 12 hours in the refrigerator.</li><li onclick="handleItemClick()">Insert baking stone and preheat oven to 230 degrees C (= 446 degrees F) for 30 minutes.</li><li onclick="handleItemClick()">Bake with steam for 15 minutes.</li><li onclick="handleItemClick()">Reduce heat to 200 C (= 392 degrees F) and bake for a further 30 - 35 minutes until golden brown.</li><li onclick="handleItemClick()">Cool completely on a wire rack.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_PaindeCampagne', '<a href="http://www.thefreshloaf.com/node/38229/pain-de-campagne" target="_blank">http://www.thefreshloaf.com/node/38229/pain-de-campagne</a><ul><li onclick="handleItemClick()">My starter was comprised of white flour and I used KA AP flour instead of bread flour and all of the levain.</li><li onclick="handleItemClick()">I skipped the 12 hour dough retard.</li><li onclick="handleItemClick()">I made a double batch.</li><li onclick="handleItemClick()"><b class="conditional-space-after">Issue</b>: the two loaves ran together on the peel and stone. I had to saw them apart while they were in the oven.</li><li onclick="handleItemClick()">Good oven spring. Moist, with a nice crumb and not too sour (although T disagreed on the latter point).</li><li onclick="handleItemClick()">Made French toast the next morning, but, frankly, the bread was better as plain ol\' toast.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_PainauLevain', 'Makes 2 loavesTakes a minimum of ~6 hours: 30 mixing + 4.5 rising + 1 baking<ul><li onclick="handleItemClick()">454 grams ripe starter (2½ cups; 1 pound)</li><li onclick="handleItemClick()">600 grams unbleached, all-purpose flour (5 cups; 1 pound, 5 oz.)</li><li onclick="handleItemClick()">85 grams whole wheat flour (⅔ cups; 3 oz.)</li><li onclick="handleItemClick()">397 grams water (1¾ cups; 14 oz.)</li><li onclick="handleItemClick()">12.5 grams (2½ teaspoons) salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_PainauLevain', '<ol><li onclick="handleItemClick()">Combine the flours, water and starter and mix using bread attachment of a mixer.</li><li onclick="handleItemClick()">Cover the bowl loosely with plastic and let the dough rest for 20 to 30 minutes.</li><li onclick="handleItemClick()">Add the salt and knead the dough until it becomes smooth, supple and slightly tacky. (Avoid adding flour!)</li><li onclick="handleItemClick()">Cover and let rise for 1 hour.</li><li onclick="handleItemClick()">Fold dough.</li><li onclick="handleItemClick()">Cover and let rise for 1 hour.</li><li onclick="handleItemClick()">Divide the dough into two pieces and preshape each piece into a loose ball. Place the dough smooth side up on a lightly floured surface. Cover and let rest for about 20 minutes.</li><li onclick="handleItemClick()">Shape the loaves into loaves and place in loaf pan.</li><li onclick="handleItemClick()">Cover and let rise for 2 hours.</li><li onclick="handleItemClick()">An hour before baking, preheat oven to 450 degrees.</li><li onclick="handleItemClick()">Spritz loaves with water and place in oven.</li><li onclick="handleItemClick()">Bake for 40 minutes, until the crust is richly colored and the internal temperature of the loaf is about 200 degrees.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_PainauLevain', '<ul><li onclick="handleItemClick()">The King Arthur Flour Baker\'s Companion, page 279-280</li><li onclick="handleItemClick()">date created: [2019-08-02 Fri] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_PainAuxRaisinsPaulHollywood', '<ul><li onclick="handleItemClick()">For the dough:<ul><li onclick="handleItemClick()">350g strong white bread flour</li><li onclick="handleItemClick()">250g unsalted butter, chilled</li><li onclick="handleItemClick()">30g golden caster sugar</li><li onclick="handleItemClick()">7g fast-action dried yeast</li><li onclick="handleItemClick()">1 tsp salt</li><li onclick="handleItemClick()">125ml whole milk</li><li onclick="handleItemClick()">50ml warm water</li><li onclick="handleItemClick()">1 large egg, plus 1 beaten egg to glaze</li></ul></li><li onclick="handleItemClick()">For the crème pâtissière:<ul><li onclick="handleItemClick()">50g caster sugar</li><li onclick="handleItemClick()">2 large egg yolks</li><li onclick="handleItemClick()">20g cornflour</li><li onclick="handleItemClick()">250ml whole milk</li><li onclick="handleItemClick()">½ vanilla pod, split and seeds scraped out</li></ul></li><li onclick="handleItemClick()">For the filling:<ul><li onclick="handleItemClick()">100g raisins</li><li onclick="handleItemClick()">¼ tsp ground cinnamon</li><li onclick="handleItemClick()">finely grated zest of 1 unwaxed orange</li></ul></li><li onclick="handleItemClick()">For the icing:<ul><li onclick="handleItemClick()">200g icing sugar, sifted</li><li onclick="handleItemClick()">juice of 1 orange</li></ul></li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_PainAuxRaisinsPaulHollywood', 'Step 1:<ul><li onclick="handleItemClick()">Make the dough.</li><li onclick="handleItemClick()">Put the flour in a mixing bowl.</li><li onclick="handleItemClick()">Cut 25g of the butter into cubes, add these to the bowl and rub in the butter with your fingertips until the mixture resembles breadcrumbs.</li><li onclick="handleItemClick()">Add the caster sugar, yeast and salt and stir to combine.</li></ul>Step 2:<ul><li onclick="handleItemClick()">Beat the milk, warm water and egg together in a separate bowl and pour the wet mixture into the flour mixture.</li><li onclick="handleItemClick()">Mix with a wooden spoon to bring the ingredients together, then turn out the mixture onto the work surface and knead it with a dough scraper for 5 minutes, until you have a slightly sticky dough.</li><li onclick="handleItemClick()">Wrap the dough and chill it for 1 hour.</li></ul>Step 3:<ul><li onclick="handleItemClick()">Place the remaining block of chilled butter between 2 sheets of baking paper and flatten it out with a rolling pin to a rectangle measuring about 33 x 19cm (13 x 7.5").</li></ul>Step 4:<ul><li onclick="handleItemClick()">Lightly flour the work surface and roll out the chilled dough to a rectangle about 1cm (.39") thick and measuring 50 x 20cm (19½ x 7.9").</li><li onclick="handleItemClick()">With a short end of the dough closest to you, lay the butter on top of the dough, so that it covers the bottom two thirds.</li><li onclick="handleItemClick()">Make sure that it is positioned neatly and almost reaches the sides.</li></ul>Step 5:<ul><li onclick="handleItemClick()">Fold the exposed dough at the top (without the butter) down to cover half of the butter.</li><li onclick="handleItemClick()">Fold the bottom third of the dough (with butter) up over the dough – you will now have a sandwich of 2 layers of butter and 3 layers of dough.</li><li onclick="handleItemClick()">Pinch together the edges of the dough lightly to seal in the butter and turn the dough/butter parcel 90 degrees, so the long seam is on the left-hand side.</li><li onclick="handleItemClick()">Wrap the dough and chill it for 20 minutes to harden the butter.</li></ul>Step 6:<ul><li onclick="handleItemClick()">With the seam still on the left, roll out the dough on a lightly floured work surface to a rectangle, about 1cm (.39") thick and 50 x 20cm (19½ x 7.9"), as before.</li><li onclick="handleItemClick()">With a short end of the dough closest to you, fold the bottom one third of the dough up and then fold the top third down on top.</li><li onclick="handleItemClick()">Put the dough back in the fridge for 20 minutes.</li></ul>Step 7:<ul><li onclick="handleItemClick()">Make the crème pâtissière.</li><li onclick="handleItemClick()">While the dough is in the fridge, in a medium bowl and using a balloon whisk, whisk the caster sugar with the egg yolks, cornflour and 1 tablespoon of the milk until pale and combined.</li></ul>Step 8:<ul><li onclick="handleItemClick()">Gently heat the remaining milk with the vanilla seeds in a small saucepan until it just comes to the boil.</li><li onclick="handleItemClick()">Pour the hot milk into the egg mixture and whisk until well combined.</li><li onclick="handleItemClick()">Return the mixture to the pan and heat it gently, whisking continuously, until the mixture thickens to a custard consistency.</li><li onclick="handleItemClick()">Pour the crème pâtissière into a bowl, cover the surface and leave it to cool.</li><li onclick="handleItemClick()">Then, chill it until set.</li></ul>Step 9:<ul><li onclick="handleItemClick()">Finish the pain aux raisins.</li><li onclick="handleItemClick()">Remove the dough from the freezer, unwrap it and roll it out on a lightly floured work surface to a rectangle about 1cm (.39") thick and 50 x 20cm (19½ x 7.9"), as before.</li><li onclick="handleItemClick()">With one of the short edges closest to you, fold the bottom one third of the dough up and then fold the top third down on top.</li><li onclick="handleItemClick()">Roll out the dough to a 30cm (11.8") square.</li></ul>Step 10:<ul><li onclick="handleItemClick()">Spread the crème pâtissière over the dough, leaving a 2cm (.79") border on the side furthest from you.</li></ul>Step 11:<ul><li onclick="handleItemClick()">Sprinkle the raisins, cinnamon and orange zest over the crème pâtissière, then starting from the edge furthest from you, roll the dough towards you into a spiralled sausage shape, keeping it as tight as possible – give the dough a gentle tug each time you roll to tighten it up and give it a little tension.</li><li onclick="handleItemClick()">When you reach the end, roll the sausage back and forth a few times to seal the join.</li></ul>Step 12:<ul><li onclick="handleItemClick()">Cut the roll into 12 equal slices, each about 2.5–3cm (1") wide.</li><li onclick="handleItemClick()">Lay the slices, cut-side up and spaced apart to allow for rising, on the lined baking trays.</li><li onclick="handleItemClick()">Put each tray inside a proving bag and leave the dough to prove for 1 hour, until it has at least doubled in size.</li></ul>Step 13:<ul><li onclick="handleItemClick()">Heat the oven to 220°C/ 200°C fan/425°F/Gas 7.</li><li onclick="handleItemClick()">Brush the risen dough with beaten egg and bake the pains for 15–20 minutes, until golden brown and risen.</li><li onclick="handleItemClick()">If they look like they are over-browning, cover them with foil for the last 5 minutes of baking. Remove the pains from the oven and leave them to cool.</li></ul>Step 14:<ul><li onclick="handleItemClick()">Make the icing.</li><li onclick="handleItemClick()">Mix the icing sugar and 2 tablespoons of the orange juice to make a stiff but pourable icing.</li><li onclick="handleItemClick()">Drizzle the orange icing over the cooled pain aux raisins, then leave them for a few minutes for the icing to set before serving.</li></ul>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_PainAuxRaisinsPaulHollywood', '<ul><li onclick="handleItemClick()">From <a href="https://thegreatbritishbakeoff.co.uk/recipes/all/paul-hollywood-pain-aux-raisins/" target="_blank">https://thegreatbritishbakeoff.co.uk/recipes/all/paul-hollywood-pain-aux-raisins/</a></li><li onclick="handleItemClick()">date created: [2023-05-16 Tue] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_NoKneadHarvestBread', '<ul><li onclick="handleItemClick()">3 1/4 cups (390g) King Arthur Unbleached Bread Flour</li><li onclick="handleItemClick()">1 cup (113g) King Arthur Whole Wheat Flour</li><li onclick="handleItemClick()">2 teaspoons (12g) salt</li><li onclick="handleItemClick()">1/2 teaspoon instant yeast</li><li onclick="handleItemClick()">1 3/4 cups (397g) cool water</li><li onclick="handleItemClick()">3/4 cup (85g) dried cranberries</li><li onclick="handleItemClick()">1/2 cup (85g) golden raisins</li><li onclick="handleItemClick()">1 cup (113g) coarsely chopped pecans or walnuts</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_NoKneadHarvestBread', '<ol><li onclick="handleItemClick()">Weigh your flour; or measure it by gently spooning it into a cup, then sweeping off any excess. Mix the flours, salt, yeast, and water in a large bowl. Stir, then use your hands to bring the sticky dough together, making sure to incorporate all of the flour.  </li><li onclick="handleItemClick()">Work in the fruits and nuts.</li><li onclick="handleItemClick()">Cover the bowl with plastic wrap and let the dough rest at room temperature overnight, or for at least 8 hours; it\'ll become bubbly and rise quite a bit, so use a large bowl.</li><li onclick="handleItemClick()">Turn the dough out onto a lightly floured surface, and form it into a log or round loaf to fit your 14" to 15" long lidded stoneware baker; 9" x 12" oval deep casserole dish with cover; or 9" to 10" round lidded baking crock.</li><li onclick="handleItemClick()">Place the dough in the lightly greased pan, smooth side up.</li><li onclick="handleItemClick()">Cover and let rise at room temperature for about 2 hours, until it\'s become puffy. It should rise noticeably, but it\'s not a real high-riser.</li><li onclick="handleItemClick()">Using a sharp knife or lame, slash the bread in a crosshatch pattern. Place the lid on the pan, and put the bread in the cold oven. Set the oven temperature to 450°F, and put the bread into the oven.</li><li onclick="handleItemClick()">Bake the bread for 45 to 50 minutes (start the timer when you place the bread into the cold oven). Remove the lid and continue to bake for another 5 to 15 minutes, until it\'s deep brown in color, and a digital thermometer inserted into the center registers about 205°F.  </li><li onclick="handleItemClick()">Remove the bread from the oven, turn it out onto a rack, and cool completely before slicing.</li><li onclick="handleItemClick()">Store the bread, well wrapped, at room temperature for several days; freeze for longer storage.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_NoKneadHarvestBread', '<ul><li onclick="handleItemClick()">date created: [2022-12-17 Sat] </li><li onclick="handleItemClick()">From <a href="https://www.kingarthurbaking.com/recipes/no-knead-harvest-bread-recipe" target="_blank">https://www.kingarthurbaking.com/recipes/no-knead-harvest-bread-recipe</a></li><li onclick="handleItemClick()"><2022-12-17 Sat> Made for Squirrels party. Wanting to get an extra crispy crust, I baked it in a cast iron pot. In order to get to 205°F it took the full 15 minutes at the end, but by then, the bottom crust was charred. Not terrible, but not great.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_NoKneadCrustyBread', '<ul><li onclick="handleItemClick()">3  cups (360 grams) unbleached all-purpose flour</li><li onclick="handleItemClick()">1¾ teaspoons salt</li><li onclick="handleItemClick()">½ teaspoon yeast</li><li onclick="handleItemClick()">1½ cups (355 grams) water</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_NoKneadCrustyBread', '<ol><li onclick="handleItemClick()">In a large mixing bowl, whisk together flour, salt and yeast.</li><li onclick="handleItemClick()">Add water and mix until a shaggy mixture forms.</li><li onclick="handleItemClick()">Cover bowl with plastic wrap and set aside for 12 - 18 hours.   Overnight works great.</li><li onclick="handleItemClick()">Heat oven to 450 degrees.</li><li onclick="handleItemClick()">When the oven has reached 450 degrees place a cast iron pot with a lid in the oven and heat the pot for 30 minutes.</li><li onclick="handleItemClick()">[optional] Meanwhile, pour dough onto a floured parchment paper and shape into a ball. Cover with plastic wrap and let set while the pot is heating.</li><li onclick="handleItemClick()">Remove hot pot from the oven and use parchment paper to drop in the dough.</li><li onclick="handleItemClick()">Cover and return to oven for 30 minutes.</li><li onclick="handleItemClick()">After 30 minutes remove the lid and bake an additional 15 minutes.</li><li onclick="handleItemClick()">Remove bread from oven and cool on a rack.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_NoKneadCrustyBread', '<a href="http://www.simplysogood.com/2013/03/artisan-no-knead-bread.html" target="_blank">http://www.simplysogood.com/2013/03/artisan-no-knead-bread.html</a>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_Naan', '<ul><li onclick="handleItemClick()">⅜ cup (3 ounces) lukewarm water to dissolve yeast (even though the recipe calls for ¾ cup)</li><li onclick="handleItemClick()">1 tsp active dry yeast</li><li onclick="handleItemClick()">2 cups all-purpose flour plain flour</li><li onclick="handleItemClick()">1 tsp salt</li><li onclick="handleItemClick()">1 tsp sugar</li><li onclick="handleItemClick()">⅛ tsp baking soda</li><li onclick="handleItemClick()">2 Tbsp oil canola</li><li onclick="handleItemClick()">2½ Tbsp plain yogurt</li><li onclick="handleItemClick()">1 tsp clarified butter (ghee), to butter the Naan</li><li onclick="handleItemClick()">¼ cup All Purpose flour for rolling</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_Naan', '<ol><li onclick="handleItemClick()">Dissolve yeast in lukewarm water and let it sit for 10 minutes or until the mixture becomes frothy.</li><li onclick="handleItemClick()">Add sugar, salt and baking soda to the flour and mix well.</li><li onclick="handleItemClick()">Add the oil and yogurt to make crumbly dough.</li><li onclick="handleItemClick()">Add the water/yeast mixture and additional water as needed to make into firm dough. Note: The dough will soften as it rises.</li><li onclick="handleItemClick()">Knead the dough until smooth.</li><li onclick="handleItemClick()">Cover the dough and keep in a warm place three to four hours, until nearly double in volume.</li><li onclick="handleItemClick()">Heat the oven to 500°F with pizza stone approximately thirty minutes, until stone is hot. (Using a baking/pizza stone will help to give the Naan close to same kind of heat as a clay tandoor.)</li><li onclick="handleItemClick()">Knead the dough for about one minute.</li><li onclick="handleItemClick()">Divide dough into six equal parts and roll each piece into an oval, dusting the surface lightly with dry flour to help with the rolling.</li><li onclick="handleItemClick()">Lightly wet your hands and flip the rolled Naan between your palms. Place two Naan on your baking/pizza stone and put it into the oven.</li><li onclick="handleItemClick()">Bake the Naan two at a time. The Naan will take two to three minutes to cook, depending upon your oven. The baked Naan should be golden brown on top.</li><li onclick="handleItemClick()">Take Naan out of the oven and brush lightly with clear butter or ghee.</li><li onclick="handleItemClick()">Wait two to three minutes before baking the next Naan to give oven a chance to regain lost heat.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_Naan', 'Favorite<ul><li onclick="handleItemClick()">From <a href="https://www.manjulaskitchen.com/Naan-bread/" target="_blank">https://www.manjulaskitchen.com/Naan-bread/</a></li><li onclick="handleItemClick()">date created: [2021-12-18 Sat] </li><li onclick="handleItemClick()">[2021-12-17 Fri] I made a double batch for MaryAnn\'s birthday dinner (and we wound up eating less than half of them). The recipe called for <b class="conditional-space-after">way</b>too much water; I added nearly a full cup additional flour (to a doubled recipe). But the end-product was great. I received comments that this was “probably the best Naan I’ve ever had.” They were light and fluffy on the inside and a bit crispy on the exterior. And tasty. So instead of using ¾ cup of water, consider using only ⅜ cup to dissolve yeast.</li><li onclick="handleItemClick()">[2023-01-26 Thu] Made for Squirrels\' party. They were a hit although I may have rolled the bread a bit too thinly. They got a bit more crispy than I\'d prefer.</li><li onclick="handleItemClick()">[2023-03-12 Sun] Made for G, MA and the Grosecloses, to popular acclaim.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_MapleCinnamonRolls', '<ul><li onclick="handleItemClick()">1 cup (240ml) whole milk*</li><li onclick="handleItemClick()">⅔ cup (135g) granulated sugar</li><li onclick="handleItemClick()">1 and ½ tablespoons (14g) Red Star Platinum yeast (2 standard size packets)*</li><li onclick="handleItemClick()">½ cup (115g) unsalted butter, softened to room temperature and cut into 4 pieces</li><li onclick="handleItemClick()">2 large eggs, at room temperature</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">4 and ½ cups (563g) all-purpose flour (spoon & leveled), plus more for dusting/rolling</li></ul><ul><li onclick="handleItemClick()">½ cup (115g) unsalted butter, softened to room temperature</li><li onclick="handleItemClick()">¼ cup (60ml) pure maple syrup</li><li onclick="handleItemClick()">¼ cup (50g) granulated sugar</li><li onclick="handleItemClick()">1 Tablespoon ground cinnamon</li></ul><ul><li onclick="handleItemClick()">1 and ½ cups (180g) confectioners’ sugar</li><li onclick="handleItemClick()">2 Tablespoons (30ml) pure maple syrup</li><li onclick="handleItemClick()">2 Tablespoons (30ml) whole milk</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_MapleCinnamonRolls', '<ol><li onclick="handleItemClick()">Heat milk to about 95°F (35°C) – use microwave or stove top.</li><li onclick="handleItemClick()">Pour the warm milk into the bowl of a stand electric mixer fitted with the dough hook attachment (OR you can use a handheld mixer OR no mixer, but a stand mixer is ideal).</li><li onclick="handleItemClick()">With a whisk, manually whisk in the sugar and yeast.</li><li onclick="handleItemClick()">Cover with a towel and let sit until the yeast is foamy, about 5-10 minutes.<span class="tip">   If the yeast does not dissolve and foam, start over with fresh active yeast.</span></li><li onclick="handleItemClick()">On low speed, beat in the softened butter until it is slightly broken up.</li><li onclick="handleItemClick()">Next add the eggs, one at a time, and then the salt.<span class="tip">   The butter won’t really be mixing into the mixture, so don’t be alarmed if it stays in pieces.</span></li><li onclick="handleItemClick()">On low speed, gradually add the flour.</li><li onclick="handleItemClick()">Once it is all added, beat on medium speed until a soft dough forms.</li><li onclick="handleItemClick()">Increase speed to medium-high and beat until the dough is soft and supple, about 6 minutes longer.<span class="tip">   If you do not have a stand-mixer with a hook attachment, knead the dough by hand in this step.</span></li><li onclick="handleItemClick()">Transfer the dough to a lightly floured surface and knead it with your hands for 1 minute.</li><li onclick="handleItemClick()">Form the dough into a ball and transfer it to a lightly greased bowl.</li><li onclick="handleItemClick()">Cover the dough loosely with plastic wrap, a paper towel, or aluminum foil and let sit in a warm place until doubled in size, about 1 to 2 hours.</li><li onclick="handleItemClick()">Grease the bottom and sides of a 9×13 inch baking dish.</li><li onclick="handleItemClick()">Turn the risen dough out onto a lightly floured work surface, punch it down and, using a rolling pin, roll into a 12×18 inch rectangle.</li><li onclick="handleItemClick()">Make sure the dough is smooth and evenly thick.</li></ol><ol><li onclick="handleItemClick()">Using a handheld or stand mixer fitted with a paddle or whisk attachment, beat the butter and maple syrup together on medium-high speed until combined and creamy.</li><li onclick="handleItemClick()">Add the sugar and cinnamon, beating until combined.</li><li onclick="handleItemClick()">Spread the maple mixture all over the dough.</li><li onclick="handleItemClick()">Tightly roll up the dough to form an 18-inch-long log.</li><li onclick="handleItemClick()">Cut into 12 even rolls.</li><li onclick="handleItemClick()">Arrange them in the prepared baking pan, cut sides up.</li><li onclick="handleItemClick()">Cover the rolls very tightly with aluminum foil (no rolls exposed – this dries out your dough!) and stick in the refrigerator for 8-12 hours.</li><li onclick="handleItemClick()">Remove rolls from the refrigerator and let rise in a warm place just as you did earlier until they are puffy, about 1-2 hours. Mine usually take 1 and ½ hours.</li><li onclick="handleItemClick()">After the rolls have risen, preheat the oven to 375°F (191°C).</li><li onclick="handleItemClick()">Bake for about 25 minutes, until they are golden brown.<span class="tip">    About halfway through the bake time, I like to cover the rolls loosely with aluminum foil so the tops don’t brown too much.</span></li><li onclick="handleItemClick()">Remove pan from the oven and allow to cool on a wire rack for about 10 minutes as you make the icing.</li></ol><ol><li onclick="handleItemClick()">Whisk all of the icing ingredients together.<span class="tip">    If it’s too thin, add a little more confectioners’ sugar.</span></li><li onclick="handleItemClick()">Drizzle icing over warm rolls.</li><li onclick="handleItemClick()">Cover leftover frosted or unfrosted rolls tightly and store at room temperature for up to 3 days.<span class="tip">   I prefer this over storing in the refrigerator. I find that dries them out, but do what you like best.</span></li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_MapleCinnamonRolls', '<ol><li onclick="handleItemClick()"><i class="conditional-space-after"></i>: Baked rolls can be frozen up to 2-3 months. Thaw overnight in the refrigerator and warm up before enjoying. You can also freeze the unbaked rolls and here’s how: bake the rolls in for only about 10 minutes at 375°F (191°C). Cool completely, then cover tightly and freeze. To serve, take the rolls out of the freezer and put into the refrigerator a few hours before serving. Then, finish baking them.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>: Whole milk preferred for richest tasting dough. 2% or 1% would be fine, but not ideal. Nonfat is not recommended.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>: If not using an instant yeast, rise time may be up to 40% longer. Reference my Baking with Yeast Guide for answers to common yeast FAQs.</li><li onclick="handleItemClick()"><i class="conditional-space-after"></i>: If planning to bake the rolls right away, instead of sticking the rolls in the refrigerator, loosely cover them and let rise in a warm place just as you did earlier until they are puffy, about 2 hours. Then continue with the bake.</li></ol><ul><li onclick="handleItemClick()">From <a href="https://sallysbakingaddiction.com/melt-in-your-mouth-maple-cinnamon-rolls/" target="_blank">https://sallysbakingaddiction.com/melt-in-your-mouth-maple-cinnamon-rolls/</a>via Sarah Colwill</li><li onclick="handleItemClick()">date created: [2022-04-20 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_LemonPoppySeedMuffinsorQuickBread', 'By Carroll Pellegrinelli, About.com<ul><li onclick="handleItemClick()">"Using a cake mix make making these muffins so much easier."</li><li onclick="handleItemClick()">Serve these muffins warm with real butter.</li><li onclick="handleItemClick()">Prep Time: 25 minutes</li><li onclick="handleItemClick()">Cook Time: 25 minutes</li></ul><ul><li onclick="handleItemClick()">2 large eggs</li><li onclick="handleItemClick()">1 cup milk</li><li onclick="handleItemClick()">½ cup oil or ½ cup butter, softened</li><li onclick="handleItemClick()">juice and zest of 1 lemon</li><li onclick="handleItemClick()">1 18.25 ounce lemon cake mix</li><li onclick="handleItemClick()">4 tablespoons poppy seeds</li><li onclick="handleItemClick()">Optional Lemon Glaze:<ul><li onclick="handleItemClick()">4 teaspoons lemon juice</li><li onclick="handleItemClick()">¼ cup powdered sugar</li><li onclick="handleItemClick()">zest of 1 lemon</li></ul></li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_LemonPoppySeedMuffinsorQuickBread', '<ol><li onclick="handleItemClick()">Preheat oven to 350 degrees F.</li><li onclick="handleItemClick()">Grease 18 muffin cups or grease and flour 2-9" x 5" loaf pans.</li><li onclick="handleItemClick()">In a large bowl, with a hand mixer combine eggs, milk and oil.</li><li onclick="handleItemClick()">Add lemon juice and zest. Blend.</li><li onclick="handleItemClick()">Hand stir in cake mix and poppy seeds, only stirring until ingredients are moistened. There will be some lumps.</li><li onclick="handleItemClick()">Bake for 25 minutes or until tester comes out clean.</li><li onclick="handleItemClick()">Remove from muffin pan and cool on wire rack.</li><li onclick="handleItemClick()">If using glaze: Stir together juice, sugar and zest. Drizzle over warm muffins. </li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_LemonPoppySeedMuffinsorQuickBread', '<ul><li onclick="handleItemClick()"><a href="http://baking.about.com/od/quickandsweetbreads/r/lemonpoppyseed.htm" target="_blank">http://baking.about.com/od/quickandsweetbreads/r/lemonpoppyseed.htm</a></li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_JapaneseMilkBreadRolls', '<ul><li onclick="handleItemClick()">43g (3T) water</li><li onclick="handleItemClick()">43g (3T) whole milk</li><li onclick="handleItemClick()">14g (2T) King Arthur Unbleached Bread Flour or Organic Bread Flour</li></ul><ul><li onclick="handleItemClick()">298g (2.5 cups) King Arthur Unbleached Bread Flour or Organic Bread Flour</li><li onclick="handleItemClick()">18g (2T) Baker\'s Special Dry Milk or 11g (2T) nonfat dry milk</li><li onclick="handleItemClick()">50g (¼ cup) sugar</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">1 tablespoon instant yeast</li><li onclick="handleItemClick()">113g (½ cup) whole milk</li><li onclick="handleItemClick()">1 large egg</li><li onclick="handleItemClick()">57g (¼ cup; 4T) melted unsalted butter</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_JapaneseMilkBreadRolls', '<ol><li onclick="handleItemClick()">To make the tangzhong: Combine all of the ingredients in a small saucepan, and whisk until no lumps remain.</li><li onclick="handleItemClick()">Place the saucepan over low heat, and cook the mixture, whisking constantly, until thick and the whisk leaves lines on the bottom of the pan, about 3 to 5 minutes.</li><li onclick="handleItemClick()">Transfer the tangzhong to a small mixing bowl or measuring cup and let it cool to room temperature.</li><li onclick="handleItemClick()">To make the dough: Combine the tangzhong with the remaining dough ingredients, then mix and knead -- by hand, mixer, or bread machine -- until a smooth, elastic dough forms.</li><li onclick="handleItemClick()">Shape the dough into a ball, and let it rest in a lightly greased covered bowl for 60 to 90 minutes, until puffy but not necessarily doubled in bulk.</li><li onclick="handleItemClick()">Gently deflate the dough, divide it into 8 equal pieces, and shape each piece into a ball.</li><li onclick="handleItemClick()">Place the rolls into a lightly greased round bun pan. Cover the pan, and let the rolls rest for 40 to 50 minutes, until puffy. To use another pan, see "tips," below.</li><li onclick="handleItemClick()">Preheat the oven to 350F. Brush the rolls with milk or egg wash (1 large egg beaten with 1 tablespoon cold water), and bake for 28 to 32 minutes, until golden brown on top; a digital thermometer inserted into the center of the middle roll should read at least 190F.</li><li onclick="handleItemClick()">Remove the rolls from the oven. Allow them to cool in the pan for 10 minutes, then transfer them to a rack to cool completely.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Bread_JapaneseMilkBreadRolls', '' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_JapaneseMilkBreadRolls', '<ul><li onclick="handleItemClick()"><a href="https://www.kingarthurflour.com/recipes/japanese-milk-bread-rolls-recipe" target="_blank">https://www.kingarthurflour.com/recipes/japanese-milk-bread-rolls-recipe</a></li><li onclick="handleItemClick()">[2018-08-19 Sun] I make them in an 8" cake tin for T and me. Taste, light. They were a bit large; consider using a muffin pan to make 10 or 12 rolls?</li><li onclick="handleItemClick()">[2022-11-24 Thu] I make them for Thanksgiving at the McCaggs. Light, fluffy and tasty.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_IrishSodaBread', 'Printed from COOKS.COM<ul><li onclick="handleItemClick()">2 c. unsifted all-purpose flour</li><li onclick="handleItemClick()">2 tbsp. sugar</li><li onclick="handleItemClick()">1 tsp. baking powder</li><li onclick="handleItemClick()">1 tsp. baking soda</li><li onclick="handleItemClick()">½ tsp. salt</li><li onclick="handleItemClick()">3 tbsp. butter, softened</li><li onclick="handleItemClick()">½ c. dark seedless raisins</li><li onclick="handleItemClick()">1 c. buttermilk</li><li onclick="handleItemClick()">1 tbsp. butter, melted</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_IrishSodaBread', '<ol><li onclick="handleItemClick()">Preheat oven to 375 degrees. Using solid vegetable shortening, lightly grease the surface of a small baking sheet. Set aside until bread is shaped.</li><li onclick="handleItemClick()">Assemble all ingredients for Irish soda bread. (Make bread the same day you plan to serve it.)</li><li onclick="handleItemClick()">Put flour, sugar, baking powder, baking soda and salt in a sifter; sift over a large bowl.</li><li onclick="handleItemClick()">Add softened butter and cut into flour mixture, using a pastry blender or fork until mixture looks like fine crumbs.</li><li onclick="handleItemClick()">Add raisins and toss thoroughly.</li><li onclick="handleItemClick()">Pour buttermilk into flour mixture all at once.</li><li onclick="handleItemClick()">Gently toss mixture together with a fork until all dry ingredients are just moistened. Do not overmix.</li><li onclick="handleItemClick()">Using hands, gently gather flour mixture together and press firmly into a ball.</li><li onclick="handleItemClick()">Put dough on a lightly floured pastry cloth or board. Knead gently with the palms of your hands until dough is smooth (about 1 minute). Shape into a smooth round ball and place on the prepared baking sheet.</li><li onclick="handleItemClick()">Using hands, flatten dough into a circle that is about seven inches in diameter. (Dough will be about 1½" thick.) Press a large floured knife into center of loaf, halfway through dough. Repeat, at right angle, to divide loaf into quarters.</li><li onclick="handleItemClick()">Bake bread for 30 to 40 minutes, or until top is golden brown and loaf sounds hollow when tapped on the bottom and sides with a wooden spoon.</li><li onclick="handleItemClick()">Remove to a wire rack to cool. Brush top with melted butter and later, dust with flour. Makes one loaf.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_IrishSodaBread', '<ul><li onclick="handleItemClick()"><a href="http://www.cooks.com/rec/doc/0,194,157171-238200,00.html" target="_blank">http://www.cooks.com/rec/doc/0,194,157171-238200,00.html</a></li><li onclick="handleItemClick()">date created: [2009-05-02 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_HotCrossBuns', '<ul><li onclick="handleItemClick()">PREP:  25 mins. to 35 mins.</li><li onclick="handleItemClick()">BAKE:  20 mins. to 20 mins.</li><li onclick="handleItemClick()">TOTAL:  2 hrs 45 mins. to 3 hrs 15 mins.</li><li onclick="handleItemClick()">YIELD: 12 to 14 buns</li></ul>This soft dough is easily shaped, and makes tender, aromatic buns, ready for an icing cross on top.<ul><li onclick="handleItemClick()">¼ cup (57g) apple juice or rum</li><li onclick="handleItemClick()">½ cup (78g) mixed dried fruit</li><li onclick="handleItemClick()">½ cup (78g) raisins or dried currants</li><li onclick="handleItemClick()">1.25 cup (283g) milk, room temperature</li><li onclick="handleItemClick()">2 large eggs, plus 1 egg yolk (save the white for the topping)</li><li onclick="handleItemClick()">6 tablespoons (85g) butter, room temperature</li><li onclick="handleItemClick()">2 teaspoons instant yeast</li><li onclick="handleItemClick()">¼ cup (53g) light brown sugar, firmly packed</li><li onclick="handleItemClick()">1 teaspoon ground cinnamon</li><li onclick="handleItemClick()">¼ teaspoon ground cloves or allspice</li><li onclick="handleItemClick()">¼ teaspoon ground nutmeg</li><li onclick="handleItemClick()">1¾ teaspoons salt</li><li onclick="handleItemClick()">1 tablespoon baking powder</li><li onclick="handleItemClick()">4.5 cups (539g) King Arthur Unbleached All-Purpose Flour</li></ul><ul><li onclick="handleItemClick()">1 large egg white, reserved from above</li><li onclick="handleItemClick()">t Tablespoon (14g) milk</li></ul><ul><li onclick="handleItemClick()">1 cup + 2 tablespoons (128g) confectioners\' sugar</li><li onclick="handleItemClick()">½ teaspoon vanilla extract</li><li onclick="handleItemClick()">pinch of salt</li><li onclick="handleItemClick()">4 teaspoons milk, or enough to make a thick, pipeable icing</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_HotCrossBuns', '<ol><li onclick="handleItemClick()">Lightly grease a 10" square pan or 9" x 13" pan.</li><li onclick="handleItemClick()">Mix the rum or apple juice with the dried fruit and raisins, cover with plastic wrap, and microwave briefly, just till the fruit and liquid are very warm, and the plastic starts to "shrink wrap" itself over the top of the bowl. Set aside to cool to room temperature. Note: If you worry about using plastic wrap in your microwave, simply cover the bowl with a glass lid.</li><li onclick="handleItemClick()">When the fruit is cool, mix together all of the dough ingredients (including the eggs and the egg yolk from the separated egg); hold out the fruit for the time being. Knead the mixture, using an electric mixer or bread machine, until the dough is soft and elastic. Mix in the fruit and any liquid not absorbed.</li><li onclick="handleItemClick()">Let the dough rise for 1 hour, covered. It should become puffy, though may not double in bulk.</li><li onclick="handleItemClick()">Divide the dough into billiard ball-sized pieces, about 3¾ ounces each. A heaped muffin scoop (about ⅓ cup) makes about the right portion. You\'ll make 12 to 14 buns. Use your greased hands to round them into balls. Arrange them in the prepared pan.</li><li onclick="handleItemClick()">Cover the pan, and let the buns rise for 1 hour, or until they\'ve puffed up and are touching one another. While the dough is rising, preheat the oven to 375 degreesF.</li><li onclick="handleItemClick()">Whisk together the reserved egg white and milk, and brush it over the buns.</li><li onclick="handleItemClick()">Bake the buns for 20 minutes, until they\'re golden brown. Remove from the oven, carefully turn the buns out of the pan (they should come out in one large piece), and transfer them to a rack to cool.</li><li onclick="handleItemClick()">Mix together the icing ingredients, and when the buns are completely cool, pipe it in a cross shape atop each bun.</li></ol>Want to make these buns a day or so ahead of time? Try the <b class="conditional-space-after">tangzhong technique</b>, a Japanese method for increasing the softness and shelf life of yeast rolls. <ul><li onclick="handleItemClick()">Begin by measuring out the flour and milk you\'ll be using in the recipe. </li><li onclick="handleItemClick()">Now take 3 tablespoons of the measured flour and ½ cup of the measured milk; put them in a saucepan set over medium-high heat.</li><li onclick="handleItemClick()">Cook the mixture, whisking constantly, until it thickens and forms a thick slurry; this will take about 1½ to 2½ minutes. </li><li onclick="handleItemClick()">Transfer the cooked mixture to a bowl, let it cool to lukewarm, then combine it with the remaining flour, milk, and other dough ingredients. </li><li onclick="handleItemClick()">Proceed with the recipe as directed. </li><li onclick="handleItemClick()">Well-wrapped and stored at room temperature, your finished hot cross buns should stay soft and fresh for several days.</li></ul>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_HotCrossBuns', '<a href="https://www.kingarthurflour.com/recipes/PrintRecipe?RID=352&radio=1" target="_blank">https://www.kingarthurflour.com/recipes/PrintRecipe?RID=352&radio=1</a>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_Focaccia', '<ul><li onclick="handleItemClick()">4 cups (512 g) all-purpose flour or bread flour, see notes above</li><li onclick="handleItemClick()">2 teaspoons (10 g) kosher salt</li><li onclick="handleItemClick()">2 teaspoons (8 g) instant yeast, see notes above if using active dry</li><li onclick="handleItemClick()">2 cups (455 g) lukewarm water, made by combining 1/2 cup boiling water with 1 1/2 cups cold water</li><li onclick="handleItemClick()">butter for greasing</li><li onclick="handleItemClick()">4 tablespoons olive oil, divided</li><li onclick="handleItemClick()">flaky sea salt, such as Maldon</li><li onclick="handleItemClick()">1 to 2 teaspoons whole rosemary leaves, optional </li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_Focaccia', '<ol><li onclick="handleItemClick()"><b class="conditional-space-after">Make the dough:</b>In a large bowl, whisk together the flour, salt, and instant yeast. Add the water. Using a rubber spatula, mix until the liquid is absorbed and the ingredients form a sticky dough ball. Rub the surface of the dough lightly with olive oil. Cover the bowl with a damp tea towel, cloth bowl cover, or plastic wrap and place in the refrigerator immediately for at least 12 hours or for as long as three days. (See notes above if you need to skip the overnight rise for time purposes.)<span class="note">   For an "express method" allow for a 1.5-2 hour first rise and a 30 minute second rise.</span><span class="note">   It is important the dough really be slicked with olive oil especially if you are using a cloth bowl cover or tea towel as opposed to plastic wrap or a hard lid. If you are using a tea towel, consider securing it with a rubber band to make a more airtight cover. If you do not slick the dough with enough oil, you risk the dough drying out and forming a crust over the top layer. </span></li><li onclick="handleItemClick()">Line two 8- or 9-inch pie plates or a 9×13-inch pan (see notes above) with parchment paper or grease with butter or coat with nonstick cooking spray. (Note: This greasing step may seem excessive, but with some pans, it is imperative to do so to prevent sticking. With my USA pans, I can get away with olive oil alone; with my glass baking dishes, butter is a must.)</li><li onclick="handleItemClick()">Pour a tablespoon of oil into the center of each pan or 2 tablespoons of oil if using the 9×13-inch pan. Using two forks, deflate the dough by releasing it from the sides of the bowl and pulling it toward the center. Rotate the bowl in quarter turns as you deflate, turning the mass into a rough ball. Use the forks to split the dough into two equal pieces (or do not split if using the 9×13-inch pan). Place one piece into one of the prepared pans. Roll the dough ball in the oil to coat it all over, forming a rough ball. Repeat with the remaining piece. Let the dough balls rest for 3 to 4 hours depending on the temperature of your kitchen.</li><li onclick="handleItemClick()">Set a rack in the middle of the oven and preheat it to 425°F. If using the rosemary, sprinkle it over the dough. Pour a tablespoon of oil over each round of dough (or two tablespoons if using a 9×13-inch pan).  Rub your hands lightly in the oil to coat, then, using all of your fingers, press straight down to create deep dimples. If necessary, gently stretch the dough as you dimple to allow the dough to fill the pan. Sprinkle with flaky sea salt all over.</li><li onclick="handleItemClick()">Transfer the pans or pan to the oven and bake for 25 to 30 minutes, until the underside is golden and crisp. Remove the pans or pan from the oven and transfer the focaccia to a cooling rack. Let it cool for 10 minutes before cutting and serving; let it cool completely if you are halving it with the intention of making a sandwich.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_Focaccia', '<ul><li onclick="handleItemClick()">[2022-12-15 Thu] Made for 2022 Holiday party... the express method.  I skipped the butter and all was fine.  Fluffy, light and good taste.</li><li onclick="handleItemClick()">[2023-02-05 Sun] Made for Greg and Mary Ann... the overnight method. It was good once again. In fact, we didn\'t notice much of a difference between this and the express method.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_CzechoslovakianCarawaySeedRyeBread', '<ul><li onclick="handleItemClick()">2 packages (¼ ounce each) active dry yeast</li><li onclick="handleItemClick()">2 cups warm water (110° to 115°), divided</li><li onclick="handleItemClick()">¼ cup packed brown sugar</li><li onclick="handleItemClick()">1 tablespoon caraway seeds</li><li onclick="handleItemClick()">1 tablespoon canola oil</li><li onclick="handleItemClick()">2 teaspoons salt</li><li onclick="handleItemClick()">2½ cups rye flour</li><li onclick="handleItemClick()">2¾ to 3¼ cups all-purpose flour, divided</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_CzechoslovakianCarawaySeedRyeBread', '<ol><li onclick="handleItemClick()">In a large bowl, dissolve yeast in ½ cup warm water.</li><li onclick="handleItemClick()">Add brown sugar, caraway, oil, salt and remaining water; mix well.</li><li onclick="handleItemClick()">Stir in rye flour and 1 cup all-purpose flour; beat until smooth.</li><li onclick="handleItemClick()">Add enough remaining all-purpose flour to form a soft dough.</li><li onclick="handleItemClick()">Turn onto a floured surface; knead until smooth and elastic, 6-8 minutes.</li><li onclick="handleItemClick()">Place in a greased bowl, turning once to grease top.</li><li onclick="handleItemClick()">Cover and let rise in a warm place until doubled, about 1 hour.</li><li onclick="handleItemClick()">Punch dough down; divide in half.</li><li onclick="handleItemClick()">Shape each half into a ball; place in 2 greased 8-inch round baking pans or ovenproof skillets.</li><li onclick="handleItemClick()">Flatten balls to a 6-inch diameter.</li><li onclick="handleItemClick()">Cover and let rise until nearly doubled, about 30 minutes.</li><li onclick="handleItemClick()">Bake at 375° for 25-30 minutes or until golden brown.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_CzechoslovakianCarawaySeedRyeBread', '<ul><li onclick="handleItemClick()">From <a href="https://www.tasteofhome.com/recipes/caraway-seed-rye-bread/" target="_blank">https://www.tasteofhome.com/recipes/caraway-seed-rye-bread/</a></li><li onclick="handleItemClick()">date created: [2021-11-02 Tue] </li><li onclick="handleItemClick()">[2021-10-18 Mon] A light, soft crumb; very tasty. I used two 9-inch round baking pans, so I didn\'t get much rise out of the loaves. I might try a loaf pan next time.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_CustardyPopovers', '<ul><li onclick="handleItemClick()">4 eggs</li><li onclick="handleItemClick()">1 cup milk</li><li onclick="handleItemClick()">1 cup unbleached white flour</li><li onclick="handleItemClick()">½ tsp. salt</li><li onclick="handleItemClick()">4 Tbs. melted butter</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_CustardyPopovers', '<ol><li onclick="handleItemClick()">Turn on the oven (to 375F) and put the muffin tin in while preheating.</li><li onclick="handleItemClick()">Beat together the eggs and milk. Add flour and salt. Beat with a whisk until uniform. Don\'t over beat or whip.</li><li onclick="handleItemClick()">When ready and the oven is preheated, take out the muffin tin, use a brush to coat all sides and bottom of the muffin wells with the melted butter. Work quickly before the muffin tin cools down.</li><li onclick="handleItemClick()">Fill each muffin hole about ⅔ full with batter. Put tin back in the oven as quickly as you can.</li><li onclick="handleItemClick()">Bake for 15 minutes in a convection oven or 35 minutes in a conventional oven without opening the oven door.</li><li onclick="handleItemClick()">Take the muffins out, prick with a fork to let steam escape and help them hold their shape. Serve immediately with butter, jam and/or berries.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_CustardyPopovers', '<a href="http://galsonfamilycookbook.blogspot.com/2010/11/custardy-popovers-from-moosewood.html" target="_blank">http://galsonfamilycookbook.blogspot.com/2010/11/custardy-popovers-from-moosewood.html</a>, taken from the first Moosewood bookI\'ve made these a few times; always a hit!But you\'ve got to eat them quick; they have a short shelf life.' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_CrustyHomemadeBread', '<ul><li onclick="handleItemClick()">1.5 teaspoons active dry yeast</li><li onclick="handleItemClick()">1.75 cups warm water (110° to 115°)</li><li onclick="handleItemClick()">3.5 cups (420 grams) plus 1 tablespoon all-purpose flour, divided</li><li onclick="handleItemClick()">2 teaspoons (6 grams) salt</li><li onclick="handleItemClick()">1 tablespoon cornmeal or additional flour</li><li onclick="handleItemClick()">1 tablespoon sesame seeds (optional and optimal)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_CrustyHomemadeBread', '<ol><li onclick="handleItemClick()">In a large bowl, dissolve yeast in warm water. Using a rubber spatula, stir in 3.5 cups flour and salt to form a soft, sticky dough. Do not knead. Cover and let rise at room temperature 1 hour.</li><li onclick="handleItemClick()">Stir down dough (dough will be sticky). Turn onto a floured surface; with floured hands pat into a 9-in. square. Fold square into thirds, forming a 9x3-in. rectangle. Fold rectangle into thirds, forming a 3-in. square. Place in a large greased bowl, turning once to grease the top. Cover and let rise at room temperature until almost doubled, about 1 hour.</li><li onclick="handleItemClick()">Punch down dough and repeat folding process. Return dough to bowl; refrigerate, covered, overnight.</li><li onclick="handleItemClick()">Grease the bottom of a disposable foil roasting pan with at least 4-in.-high sides; dust pan with cornmeal. Turn dough onto a floured surface. Knead gently 6-8 times; shape into a 6-in. round loaf. Place into prepared pan; dust top with remaining 1 tablespoon flour or sesame seeds (not both). Cover pan and let rise at room temperature until dough expands to a 7-½-in. loaf, about 1-¼ hours.</li><li onclick="handleItemClick()">Preheat oven to 500°. Using a sharp knife, make a slash (¼ in. deep) across top of loaf. Cover pan tightly with foil. Bake on lowest oven rack 25 minutes.</li><li onclick="handleItemClick()">Reduce oven setting to 450°. Remove foil; bake bread until deep golden brown, 25-30 minutes. Remove loaf to a wire rack to cool.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_CrustyHomemadeBread', '[2020-02-19 Wed] created<ul><li onclick="handleItemClick()">from TasteofHome via Flipboard <a href="https://www.tasteofhome.com/recipes/crusty-homemade-bread/" target="_blank">https://www.tasteofhome.com/recipes/crusty-homemade-bread/</a></li><li onclick="handleItemClick()">[2020-02-23 Sun] Made for TC. Fine crumb, tasty and crusty as advertised.</li><li onclick="handleItemClick()">[2020-03-13 Fri] Made for us, with sesame seeds. Bake at 450 for a bit shorter time and not quite as crusty (although TC liked that).</li><li onclick="handleItemClick()">[2020-03-16 Mon] Made for Nancy B’s birthday, with sesame seeds.</li><li onclick="handleItemClick()">[2020-04-05 Sun] Made during quarantine.</li><li onclick="handleItemClick()">[2020-04-11 Sat] Made during quarantine... for Easter dinner!</li><li onclick="handleItemClick()">[2020-05-02 Sat] Made for Seth Ransom. :-(</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_CracklingCornbread', '<ul><li onclick="handleItemClick()">1 cup stone-ground cornmeal</li><li onclick="handleItemClick()">1 cup unbleached all-purpose flour</li><li onclick="handleItemClick()">⅓ cup granulated sugar</li><li onclick="handleItemClick()">2½ teaspoons baking powder</li><li onclick="handleItemClick()">¼ teaspoon salt</li><li onclick="handleItemClick()">1 cup buttermilk</li><li onclick="handleItemClick()"><s class="conditional-space-after">1 cup diced, crisp-cooked bacon</s></li><li onclick="handleItemClick()">6 tablespoons (¾ stick) sweet butter, melted</li><li onclick="handleItemClick()">1 egg, slightly beaten</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_CracklingCornbread', '<ol><li onclick="handleItemClick()">Preheat oven to 400 degrees F.</li><li onclick="handleItemClick()">Grease a 9-inch-square baking pan.</li><li onclick="handleItemClick()">Stir dry ingredients together in a bowl.</li><li onclick="handleItemClick()">Then stir in buttermilk, <s class="conditional-space-after">bacon,</s>butter and egg and mix gently.</li><li onclick="handleItemClick()">Pour batter into a the prepared pan, set on the middle rack of the oven and bake for 25 minutes.</li><li onclick="handleItemClick()">Cornbread is done when edges are lightly browned and a knife inserted in the center comes out clean.</li><li onclick="handleItemClick()">Cut into 3-inch squares to serve.</li></ol><span class="note">Variation: Spoon the batter into 10 greased muffin cups and bake for about 20 minutes.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_CracklingCornbread', '<ul><li onclick="handleItemClick()">From <i class="conditional-space-after"></i>by Julee Rosso and Sheila Lukins (with Michael McLaughlin), page 247.</li><li onclick="handleItemClick()"><a href="http://www.cookstr.com/recipes/crackling-corn-bread#UIc5zjOZugckUws9.99" target="_blank">http://www.cookstr.com/recipes/crackling-corn-bread#UIc5zjOZugckUws9.99</a></li><li onclick="handleItemClick()">date created: [2020-07-26 Sun] </li><li onclick="handleItemClick()">I usually use a cast iron pan, and melt some of the butter in the pan to grease it.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_CinnamonRaisinSourdoughBread', '<ul><li onclick="handleItemClick()">½ cup (113g) sourdough starter, ripe (fed) or discard</li><li onclick="handleItemClick()">3 cups (360g) King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">2½  teaspoons instant yeast</li><li onclick="handleItemClick()">1 tablespoon sugar</li><li onclick="handleItemClick()">1¼  teaspoons (8g) salt</li><li onclick="handleItemClick()">1 large egg</li><li onclick="handleItemClick()">5 tablespoons (71g) butter, softened</li><li onclick="handleItemClick()">⅔ cup (152g) lukewarm water</li></ul><ul><li onclick="handleItemClick()">¼ cup (50g) sugar</li><li onclick="handleItemClick()">1½ teaspoons cinnamon</li><li onclick="handleItemClick()">2 teaspoons King Arthur Unbleached All-Purpose Flour</li><li onclick="handleItemClick()">1 large egg, beaten with 1 tablespoon water</li><li onclick="handleItemClick()">½ cup (74g) raisins</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_CinnamonRaisinSourdoughBread', '<ol><li onclick="handleItemClick()">Weigh your flour; or measure it by gently spooning it into a cup, then sweeping off any excess. Combine all of the dough ingredients, and mix and knead — using your hands, a stand mixer, or a bread machine set on the dough cycle — to make a soft, smooth dough.</li><li onclick="handleItemClick()">Place the dough in a lightly greased container, and allow it to rise for 1 1/2 to 2 hours, until it\'s just about doubled in bulk.</li></ol><ol><li onclick="handleItemClick()">While the dough is rising, make the filling by stirring together the sugar, cinnamon, and flour.</li></ol><ol><li onclick="handleItemClick()">Gently deflate the dough, and transfer it to a lightly greased work surface.</li><li onclick="handleItemClick()">Roll and pat the dough into a rough rectangle approximately 6" x 20".</li><li onclick="handleItemClick()">Brush the dough with the egg/water mixture and sprinkle it evenly with the filling and raisins, leaving a bare strip about 1" wide along one short edge; this will make the log you\'re about to roll easier to seal.</li><li onclick="handleItemClick()">Starting with the short end that\'s covered with filling, roll the dough into a log. Pinch the ends to seal, and pinch the long seam closed.</li><li onclick="handleItemClick()">Transfer the log, seam-side down, to a lightly greased 9" x 5" loaf pan. Cover and allow the bread to rise until it\'s crested about 1" over the rim of the pan, about 1 hour.</li><li onclick="handleItemClick()">While the dough is rising, preheat the oven to 350°F.</li><li onclick="handleItemClick()">Bake the bread for 40 to 45 minutes, tenting it lightly with aluminum foil after the first 15 to 20 minutes. The bread\'s crust will be golden brown, and the interior of the finished loaf should measure 190°F on a digital thermometer.</li><li onclick="handleItemClick()">Remove the bread from the oven, and gently loosen the edges. Turn it out of the pan, and brush the top surface with butter, if desired; this will give it a soft, satiny crust. Allow the bread to cool completely before slicing.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_CinnamonRaisinSourdoughBread', '<ul><li onclick="handleItemClick()">From <a href="https://www.kingarthurbaking.com/recipes/cinnamon-raisin-sourdough-bread-recipe" target="_blank">https://www.kingarthurbaking.com/recipes/cinnamon-raisin-sourdough-bread-recipe</a></li><li onclick="handleItemClick()">date created: [2021-08-09 Mon] </li><li onclick="handleItemClick()">[2021-08-09 Mon] Having had a timing issue, after the initial rise, I popped it in the refrigerator overnight; I let it warm up for an hour in the morning and all was good. A tender and tasty loaf. <span class="note">  I increased raisins to 100g which was a fine amount, but the ends were not very filled.</span></li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_CinnabonsusingBreadMachine', '<ul><li onclick="handleItemClick()">¼ cup butter, melted</li><li onclick="handleItemClick()">¼ cup water</li><li onclick="handleItemClick()">½ pkg. instant vanilla pudding (½ of a 3.4 oz. box)</li><li onclick="handleItemClick()">1 cup milk</li><li onclick="handleItemClick()">1 egg, beaten</li><li onclick="handleItemClick()">1 tbsp. sugar</li><li onclick="handleItemClick()">½ tsp. salt</li><li onclick="handleItemClick()">4 cup bread flour</li><li onclick="handleItemClick()">2½ tsp. yeast</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_CinnabonsusingBreadMachine', '<ol><li onclick="handleItemClick()">½ cup butter, softened</li><li onclick="handleItemClick()">1 cup brown sugar</li><li onclick="handleItemClick()">2 tsp. cinnamon</li><li onclick="handleItemClick()">4 oz. cream cheese, softened</li><li onclick="handleItemClick()">¼ cup butter, softened</li><li onclick="handleItemClick()">1½ cup confectioners sugar</li><li onclick="handleItemClick()">½ tsp. vanilla</li><li onclick="handleItemClick()">1½ tsp. milk</li><li onclick="handleItemClick()">Place ingredients in machine following the specifications of that</li><li onclick="handleItemClick()">particular machine. Set for dough cycle. After complete on dough</li><li onclick="handleItemClick()">cycle, remove from machine and roll out to 17x10" (approx.) rectangle.</li><li onclick="handleItemClick()">Mix together brown sugar and cinnamon. Spread softened butter over</li><li onclick="handleItemClick()">dough. Sprinkle brown sugar and cinnamon mixture over top. Roll</li><li onclick="handleItemClick()">tightly from long end, pinching edges closed when completely rolled.</li><li onclick="handleItemClick()">Slice rolled dough into ½" slices (or large if a larger bun is</li><li onclick="handleItemClick()">preferred).  Place into greased cake pans or a cookie sheet.  If</li><li onclick="handleItemClick()">using cake pans, use 3 9" pans. Let rise until doubled. Bake at</li><li onclick="handleItemClick()">350 for 15-20 minutes, until golden. Do not overbake.</li><li onclick="handleItemClick()">Spread on very warm rolls. They are best when eaten fresh, but we</li><li onclick="handleItemClick()">have found that 10-15 seconds in the microwave rejuvenates them.</li><li onclick="handleItemClick()">Note:  You may add chopped nuts with the filling, and use twice</li><li onclick="handleItemClick()">the amount of cinnamon.</li><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_CinnabonsusingBreadMachine', '' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_ChewySourdoughItalianBread', '<ul><li onclick="handleItemClick()">1 cup (~225 grams) active sourdough starter, at its peak</li><li onclick="handleItemClick()">4½ cup (540 grams) bread flour, plus more for kneading</li><li onclick="handleItemClick()">1½ (355 ml) cup water</li><li onclick="handleItemClick()">1 Tbsp. (21 grams) honey</li><li onclick="handleItemClick()">1 Tbsp. (14 grams) olive oil</li><li onclick="handleItemClick()">2½ tsp. salt</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_ChewySourdoughItalianBread', '<ol><li onclick="handleItemClick()">Mix all ingredients except salt in a large bowl, being sure that all of the ingredients are hydrated. The dough should be shaggy and wet. Cover and allow to sit, or autolyse, for 30 minutes.</li><li onclick="handleItemClick()">Sprinkle the salt over the dough and mix it in, stretching and folding the dough over itself as you go. The dough will be sticky but less so as the salt mixes in. Flour a clean work surface and turn the dough out onto it. Sprinkle the dough lightly with flour and knead gently for 5-8 minutes, adding more flour as needed. The dough should be tacky but not so sticky that it isn’t workable.</li><li onclick="handleItemClick()">Once the dough is soft and pliable, form it into a ball. Oil the mixing bowl you started with and place dough in, rough side up. Move the ball of dough around in the bowl so that the smooth portion is coated in oil. Flip it over and cover tightly with a lid or plastic wrap. Set aside to ferment for 8-12 hours, or overnight.</li><li onclick="handleItemClick()">In the morning, slice the dough in half while still in the bowl, being careful not to deflate it too much. Oil a baking sheet generously or line it with parchment paper. Sprinkle the oiled pan or parchment paper generously with flour or a coarse semolina or cornmeal. Flour your hands and scoop out one of the portions of dough. It will be fairly wet and sticky. Shape it roughly into a torpedo loaf, approximately 12″ long, pushing the dough together to make it as high and thin as you can. Place it on one side of the sheet pan. Repeat with the other dough.</li><li onclick="handleItemClick()">Cover with a damp towel or plastic wrap and allow to proof for 1.5 – 2 hours or until it is puffy. It won’t double in size but should spring up nicely in the oven.</li><li onclick="handleItemClick()">Preheat the oven to 450 degrees for 30 minutes. Remove the plastic wrap from the loaves, slash as desired with a very sharp knife, and place in hot oven. Bake for 15 minutes, rotate sheet pan, and bake an additional 10-15 minutes or until it makes a hollow sound when the bottom is thumped or it reaches an internal temperature of 190 degrees.</li><li onclick="handleItemClick()">Move to a cooling rack. Serve warm, torn and dipped in olive oil or spread with butter. Or, cool completely and use for garlic bread or sub sandwiches.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_ChewySourdoughItalianBread', '<a href="https://www.culturesforhealth.com/learn/recipe/sourdough-recipes/chewy-sourdough-italian-bread/" target="_blank">https://www.culturesforhealth.com/learn/recipe/sourdough-recipes/chewy-sourdough-italian-bread/</a>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_CheesyHerbRolls', '<ul><li onclick="handleItemClick()">3¾ cups (450g) unbleached all-purpose flour, plus more for dusting the work surface.</li><li onclick="handleItemClick()">2 teaspoons salt</li><li onclick="handleItemClick()">½ cup warm low fat milk (about 110 degrees)</li><li onclick="handleItemClick()">½ cup heavy cream</li><li onclick="handleItemClick()">⅓ cup warm water</li><li onclick="handleItemClick()">2¼ teaspoons rapid rise yeast</li><li onclick="handleItemClick()">2 teaspoons sugar</li><li onclick="handleItemClick()">2½ tablespoons unsalted butter, melted</li><li onclick="handleItemClick()">¼ cup sugar</li><li onclick="handleItemClick()">1½ large eggs, beaten (crack one egg into a bowl, whisk, and then use half that amount with 1 whole egg.)</li></ul><ul><li onclick="handleItemClick()">7½ cups (900g) unbleached all-purpose flour, plus more for dusting the work surface.</li><li onclick="handleItemClick()">4 teaspoons salt</li><li onclick="handleItemClick()">1 cup warm low fat milk (about 110 degrees)</li><li onclick="handleItemClick()">1 cup heavy cream</li><li onclick="handleItemClick()">⅔ cup warm water</li><li onclick="handleItemClick()">2 scant tablespoons rapid rise yeast</li><li onclick="handleItemClick()">4 teaspoons sugar</li><li onclick="handleItemClick()">5 tablespoons unsalted butter, melted</li><li onclick="handleItemClick()">½ cup sugar</li><li onclick="handleItemClick()">3 large eggs, beaten</li></ul><ul><li onclick="handleItemClick()">¼ teaspoon parsley</li><li onclick="handleItemClick()">¼ teaspoon dill</li><li onclick="handleItemClick()">¼ teaspoon thyme</li><li onclick="handleItemClick()">¼ teaspoon basil</li><li onclick="handleItemClick()">¼ teaspoon rosemary</li><li onclick="handleItemClick()">½ cup parmesan cheese, (kraft powdered kind)</li><li onclick="handleItemClick()">½ cup butter, melted</li><li onclick="handleItemClick()">2 teaspoons garlic</li></ul><ul><li onclick="handleItemClick()">½ teaspoon parsley</li><li onclick="handleItemClick()">½ teaspoon dill</li><li onclick="handleItemClick()">½ teaspoon thyme</li><li onclick="handleItemClick()">½ teaspoon basil</li><li onclick="handleItemClick()">½ teaspoon rosemary</li><li onclick="handleItemClick()">1 cup parmesan cheese, (kraft powdered kind)</li><li onclick="handleItemClick()">1 cup butter, melted</li><li onclick="handleItemClick()">4 teaspoons garlic</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_CheesyHerbRolls', '<ol><li onclick="handleItemClick()">(<i class="conditional-space-after"></i>???Adjust oven rack to the lowest position and heat to 200 degrees. Once the oven temp reaches 200, maintain the heat for 10 minutes and turn off the oven.??? <i class="conditional-space-after"></i>)</li><li onclick="handleItemClick()">Mix { 1¾ cups (210g) , 3½ cups (420g) } of the flour and the salt in a bowl.</li><li onclick="handleItemClick()">Mix the milk, cream, butter, and {¼, ½} cup sugar in a saucepan and heat over medium heat until foam forms around the edges. Remove from the burner and place on a hot pad in the fridge to cool only to luke warm. You do not want cold milk, but it cannot be hot either.</li><li onclick="handleItemClick()">In a glass measuring cup, add the warm water and yeast with the 2 teaspoons of sugar. Allow to foam for 5-10 minutes.</li><li onclick="handleItemClick()">In a bowl of a standing mixer, add the milk mixture and about 1 cup (120g) of the flour. Using the dough hook, mix for about 30 seconds. scrape down the sides of the bowl and add the yeast mixture. beat again for 3 minutes. Add the eggs and beat for 30 seconds. Add the remaining flour and beat on medium then medium high for 1-2 minutes or until the dough is pulling away from the mixer but still slightly sticky to the touch.</li><li onclick="handleItemClick()">Place in a clean, lightly oiled bowl and cover with a towel to rise for 1-2 hours, sometimes I let mine go for 3 hours.</li><li onclick="handleItemClick()">Punch down the dough and place on a lightly floured surface.</li><li onclick="handleItemClick()">Form into balls and then roll only the tops in butter, then herb mixture and then place in greased pie dishes (about 2 dishes), covered lightly with a towel to rise for 1 hour or until doubled in size.</li><li onclick="handleItemClick()">Bake at 375 degrees for 15-20 minutes or until lightly golden on top. Serve immediately.</li></ol><ol><li onclick="handleItemClick()">Mix butter and garlic in one bowl, seasoning and cheese in another.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_CheesyHerbRolls', '<a href="http://www.ohsweetbasil.com/herby-garlicky-cheesy-bread.html" target="_blank">http://www.ohsweetbasil.com/herby-garlicky-cheesy-bread.html</a><ul><li onclick="handleItemClick()">[2016-07-03 Sun] Made for 4th of July party. They were a big hit with the crowd, but I thought they were a lot like the stuff you get at Olive Garden.</li><li onclick="handleItemClick()">[2020-12-25 Fri] Made for Ho-Ho-Heimburg Christmas. They went over well. <b class="conditional-space-after">Note:</b>The amount of butter (½ cup) for the herb dip in the single recipe seemed to be enough for the double batch.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_ArtisanBreadsticks', '<ul><li onclick="handleItemClick()">1½ cups (340g) water, lukewarm</li><li onclick="handleItemClick()">3 tablespoons (25g) olive oil, divided</li><li onclick="handleItemClick()">2 tablespoons (12g) King Arthur Pizza Dough Flavor, optional</li><li onclick="handleItemClick()">1 teaspoon granulated sugar</li><li onclick="handleItemClick()">2 teaspoons (12g) salt</li><li onclick="handleItemClick()">2 tablespoons (7g) herbes de Provence, or other dried herbs</li><li onclick="handleItemClick()">2¼ teaspoons instant yeast</li><li onclick="handleItemClick()">4¼ cups (510g) King Arthur Unbleached Bread Flour</li></ul><ul><li onclick="handleItemClick()">3 tablespoons unsweetened vegan milk (44mL) preferably one with a high protein content</li><li onclick="handleItemClick()">1 teaspoon maple syrup or agave syrup (6.75g) use only ½ teaspoon if you don\'t want any hint of sweetness on your buns</li><li onclick="handleItemClick()">1 teaspoon regular mustard  (5g) or dijon mustard</li><li onclick="handleItemClick()">1 tablespoon mix of sesame seeds, for topping</li></ul><ul><li onclick="handleItemClick()">1 large egg beaten with 1 tablespoon water </li></ul><ul><li onclick="handleItemClick()">egg wash (<i class="conditional-space-after"></i>Vegan <i class="conditional-space-after"></i>Chicken-based)</li><li onclick="handleItemClick()">¼ cup (43g) King Arthur Artisan Bread Topping or other seed mixture</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_ArtisanBreadsticks', '<ol><li onclick="handleItemClick()">Mix and knead the dough ingredients — by hand, mixer, or bread machine set on the dough cycle — to form a slightly soft dough.</li><li onclick="handleItemClick()">Cover and let rise for 1 hour, until puffy.</li><li onclick="handleItemClick()">Drizzle with 1 tablespoon olive oil over a half-sheet pan (13" x 18") or other large, rimmed baking sheet.</li><li onclick="handleItemClick()">Spread the dough into the pan, stretching it to the edges. If it shrinks back, let it rest for 10 minutes, and stretch again, repeating if necessary.</li><li onclick="handleItemClick()">Use a lightly greased bench knife or pizza wheel to cut the dough into 12 or 13 crosswise strips, 1" wide. Then cut the dough in half lengthwise — you\'ll have 24 to 26 strips, each about 6 ½" long.</li><li onclick="handleItemClick()">Leave them right as they are, in the pan.</li><li onclick="handleItemClick()">Cover and let the strips rise at room temperature for 45 to 60 minutes, until puffy.</li><li onclick="handleItemClick()">Towards the end of the rising time, preheat the oven to 350°F.</li><li onclick="handleItemClick()">Brush the strips with egg wash, and sprinkle on the topping.</li><li onclick="handleItemClick()">Bake the breadsticks for 30 to 35 minutes, until they\'re light gold.</li><li onclick="handleItemClick()">Remove the pan from the oven.</li><li onclick="handleItemClick()">Once the breadsticks are cool enough to handle, cut along their score lines.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_ArtisanBreadsticks', 'IsVegan (or could be)<ul><li onclick="handleItemClick()">From <a href="https://www.kingarthurbaking.com/recipes/artisan-breadsticks-recipe" target="_blank">https://www.kingarthurbaking.com/recipes/artisan-breadsticks-recipe</a></li><li onclick="handleItemClick()">date created: [2022-09-05 Mon] </li><li onclick="handleItemClick()">[2022-09-05 Mon] Made for the Westfalls, using Penzy’s <a href="https://www.penzeys.com/online-catalog/tuscan-sunset/c-24/p-319/pd-s" target="_blank">https://www.penzeys.com/online-catalog/tuscan-sunset/c-24/p-319/pd-s</a>, topping half with sesame seeds and the other half with everything bagel topping. Light, airy and tasty.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Bread_AmazingRosemaryBread', '<ul><li onclick="handleItemClick()">1 tablespoon yeast</li><li onclick="handleItemClick()">1 tablespoon sugar</li><li onclick="handleItemClick()">1 cup warm water</li><li onclick="handleItemClick()">2½ cups (300g) flour, divided</li><li onclick="handleItemClick()">1 teaspoon salt</li><li onclick="handleItemClick()">2 tablespoons fresh rosemary</li><li onclick="handleItemClick()">2 tablespoons vegan margarine</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Bread_AmazingRosemaryBread', '<ol><li onclick="handleItemClick()">Place yeast, sugar and water in large bowl or food processor and allow mixture to become bubbly.</li><li onclick="handleItemClick()">Mix in 1 tablespoon margarine, salt, and 2 cups (240g) of flour.</li><li onclick="handleItemClick()">Add one tablespoon of the fresh chopped rosemary.</li><li onclick="handleItemClick()">Knead for about 10 minutes by hand or in food processor about 5 minutes until smooth and elastic.</li><li onclick="handleItemClick()">Add more flour if necessary.</li><li onclick="handleItemClick()">Oil a bowl, put dough in it and cover with a towel.</li><li onclick="handleItemClick()">Let dough rise in a warm place for one hour until doubled.</li><li onclick="handleItemClick()">Punch down dough and divide in half. Let dough rest about 5 minutes.</li><li onclick="handleItemClick()">Spray baking pan or cookie sheet with cooking spray.</li><li onclick="handleItemClick()">Shape the dough into 2 small rounded oval loaves. Sprinkle remaining 1 Tablespoon of rosemary over the loaves and press lightly into the surface.</li><li onclick="handleItemClick()">Let loaves rise again until doubled, about 45 minutes.</li><li onclick="handleItemClick()">Preheat oven to 375 degrees Fahrenheit.</li><li onclick="handleItemClick()">Bake for 15 to 20 minutes, until lightly browned.</li><li onclick="handleItemClick()">Carefully remove from oven, brush with remaining vegan margarine (and salt if desired).</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Bread_AmazingRosemaryBread', '<ul><li onclick="handleItemClick()">Makes 2 loaves</li><li onclick="handleItemClick()">Preparation time: 2 hours, Baking time: 20 minutes</li></ul>' ] );
credits_array.push( [ 'CostanzoRecipes_Bread_AmazingRosemaryBread', '<ul><li onclick="handleItemClick()"><a href="http://vegweb.com/index.php?PHPSESSID=7404f53c6ca2ebfde2c6d58855366e29&action=printpage;topic=21486.0" target="_blank">http://vegweb.com/index.php?PHPSESSID=7404f53c6ca2ebfde2c6d58855366e29&action=printpage;topic=21486.0</a></li><li onclick="handleItemClick()">date created: [2009-06-30 Tue] </li><li onclick="handleItemClick()">[2023-02-01 Wed] Made for Mary Scott and us. A bread with a light crumb; the rosemary really helped add some flavor to an otherwise plain bread.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Beverages_Sangria', 'Depending on the type of red wine you use, whether it is light bodied like a Beaujolais or deep and rich like a Cabernet, add the sparkling water to taste. Sangria is best enjoyed the day it is made, otherwise the oils from the citrus rind begin to impart flavor.Prep Time: 15 minutesTotal Time: 2 hoursYield: About 1½ quarts<ul><li onclick="handleItemClick()">1 (750-ml) bottle red wine</li><li onclick="handleItemClick()">¼ cup brandy</li><li onclick="handleItemClick()">¼ cup orange flavored liqueur (recommended: triple sec or Grand Marnier)</li><li onclick="handleItemClick()">2 tablespoons fresh lime juice</li><li onclick="handleItemClick()">2 tablespoons fresh orange juice</li><li onclick="handleItemClick()">¼ cup sugar</li><li onclick="handleItemClick()">½ orange, thinly sliced</li><li onclick="handleItemClick()">½ lemon, thinly sliced</li><li onclick="handleItemClick()">1 unwaxed apple, cored, and cut into thin wedges</li><li onclick="handleItemClick()">1 (750-ml) bottle sparkling water, or to taste, chilled</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Beverages_Sangria', '<ol><li onclick="handleItemClick()">Combine everything but the sparkling water in a large plastic container or glass pitchers.</li><li onclick="handleItemClick()">Cover and chill completely, 1 to 2 hours. When ready to serve, add 2 cups of the sparkling water, adding more to taste, if desired.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Beverages_Sangria', '<ul><li onclick="handleItemClick()"><a href="http://emerils.com/print/124088" target="_blank">http://emerils.com/print/124088</a></li><li onclick="handleItemClick()">Made for Jan\'s Ice Cream Social [2017-06-13 Tue] <ul><li onclick="handleItemClick()">swapped strawberries for apples and cranberry juice or orange</li></ul></li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Beverages_OatMilk', '<ul><li onclick="handleItemClick()">6 cups water</li><li onclick="handleItemClick()">1 cup whole rolled oats</li><li onclick="handleItemClick()">4 teaspoons maple syrup</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li><li onclick="handleItemClick()">½ teaspoon sea salt</li><li onclick="handleItemClick()">½ cup flaked coconut (<i class="conditional-space-after"></i>)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Beverages_OatMilk', '<ol><li onclick="handleItemClick()">Combine the oats, water, maple syrup, vanilla, and salt in a high-powered blender and blend for 20 seconds.</li><li onclick="handleItemClick()">Place a fine mesh strainer over a large bowl and strain the milk without pushing any excess pulp through the strainer. This will create a creamier texture that’s not gritty or gummy.</li><li onclick="handleItemClick()">Add more maple syrup, to taste, if desired. Chill overnight.<span class="note">   If you want to drink your oat milk right away, I recommend adding ice - it\'s flavor is best when well chilled.</span></li></ol><span class="note">As the oat milk sits in the fridge, natural separation will occur. You can shake it, if you like, but I like it\'s texture best when I leave pulp at the bottom and pour off the top.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Beverages_OatMilk', '<ul><li onclick="handleItemClick()">From <a href="https://www.loveandlemons.com/oat-milk/#wprm-recipe-container-42113" target="_blank">https://www.loveandlemons.com/oat-milk/#wprm-recipe-container-42113</a></li><li onclick="handleItemClick()">date created: [2023-02-10 Fri] </li><li onclick="handleItemClick()">[2023-03-01 Wed] I like to shake the milk each time before I use it because otherwise it is quite thin. But shaking it can make it a tiny bit slimy.</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Beverages_Mojitos', '<ul><li onclick="handleItemClick()">1 large sprig spearmint</li><li onclick="handleItemClick()">.75 oz simple syrup (1:1 sugar to water; <i class="conditional-space-after"></i>)</li></ul><ul><li onclick="handleItemClick()">Half a spent lime hull, and</li><li onclick="handleItemClick()">1 oz of lime juice (no less, no more)</li><li onclick="handleItemClick()">2 oz white rum</li><li onclick="handleItemClick()">3 oz sparkling mineral water </li><li onclick="handleItemClick()">Top with crushed ice and mix with a straw until drink is combined and glass is frosty.</li></ul>' ] );
